(2, 'Фильмы', 'смотреть филмы онлайн бесплатно без регистрации', 'смотреть, филмы, онлайн, бесплатно, без, регистрации,', '');
INSERT INTO `data` (`id`, `cat`, `shot_text`, `all_text`, `view`, `name_ru`, `tname`, `name_en`, `date`, `fyear`, `lyear`, `strana`, `budget`, `genre1`, `genre2`, `genre3`, `time`, `director`, `in_role`) VALUES
(1, 1, 'Приключения героя русских сказок продолжаются. На этот раз история будет рассказывать нам о приключениях Ивана Царевича и Серого Волка…', 'Приключения героя русских сказок продолжаются. На этот раз история будет рассказывать нам о приключениях Ивана Царевича и Серого Волкf', 121, 'Иван Царевич и Серый Волк', '', '', '2012-07-02', 2011, 0, 'Россия', '', 0, 0, 0, '1:22:33', '', ' Никита Ефремов, Иван Охлобыстин, Артур Смольянинов, Лия Ахеджакова, Кристина Асмус, Виктор Сухоруков'),
(2, 1, 'Отважные звери из Нью-Йоркского зоопарка сделали все возможное, чтобы выбраться на свободу. Но теперь они захотели вернуться домой. Для этого лучшие друзья отважный лев Алекс и озорная зебра Марти, женственный бегемот Глория и мнительный жираф Мелман примкнули к бродячему цирку, который должен привести их прямо в Нью-Йорк.', 'Отважные звери из Нью-Йоркского зоопарка сделали все возможное, чтобы выбраться на свободу. Но теперь они захотели вернуться домой. Для этого лучшие друзья отважный лев Алекс и озорная зебра Марти, женственный бегемот Глория и мнительный жираф Мелман примкнули к бродячему цирку, который должен привести их прямо в Нью-Йорк.', 24, 'Мадагасхар 3', '', '', '2012-07-04', 2012, 0, 'США', '', 0, 0, 0, '01:21:10', '', ' Константин Хабенский - Лев Алекс, Оскар Кучера - Зебра Марти, Александр Цекало - Жираф Мелман, Маша Малиновская - Бегемотиха Глория'),
(3, 2, 'Когда то давно, этот народ преступил закон, теперь каждый год несколько молодых юношей и девушек из них по жребию, или собственному желанию выбираются для участия в ''''Голодных играх''''. Эти игры демонстрируют умение людей выживать и сражаться, вот только оружие здесь боевое, и побеждает только один, выживший.\r\n', 'Когда то давно, этот народ преступил закон, теперь каждый год несколько молодых юношей и девушек из них по жребию, или собственному желанию выбираются для участия в ''''Голодных играх''''. Эти игры демонстрируют умение людей выживать и сражаться, вот только оружие здесь боевое, и побеждает только один, выживший.\r\nКитнисс и Пит мечтают о совместной счастливой жизни, а вместо этого оказываются друг против друга с оружием в руках; теперь, пока их много, они могут биться спина к спине, но когда останутся вдвоем, им придется развернуться друг к другу лицом. Сможет ли кто-то из молодых пожертвовать собой ради любви, или они найдут другой выход.', 126, 'Голодные игры', '', '', '2012-07-06', 2012, 0, 'США', '', 0, 0, 0, '02:13:18', '', 'Элизабет Бэнкс, Стенли Туччи, Дональд Сазерленд, Джош Хатчерсон, Вуди Харрельсон,Дженнифер Лоуренс'),
(4, 2, 'Могущественные супергерои решили объединиться. Теперь на улицы выходит новая команда, которая решила бороться со злыми силами, чтобы защитить простых граждан от смерти, грабежей и т.д. Среди ее членов можно встретить уже полюбившихся нам персонажей. Так, например, Капитан Америка будет сражаться бок о бок с Тором, а Железный человек не бросит своего напарника Халка в беде.', 'Могущественные супергерои решили объединиться. Теперь на улицы выходит новая команда, которая решила бороться со злыми силами, чтобы защитить простых граждан от смерти, грабежей и т.д. Среди ее членов можно встретить уже полюбившихся нам персонажей. Так, например, Капитан Америка будет сражаться бок о бок с Тором, а Железный человек не бросит своего напарника Халка в беде.', 47, 'Мстители', '', '', '2012-07-06', 2012, 0, 'США', '', 0, 0, 0, '02:10:45', '', ' Крис Хемсворт, Скарлетт Йоханссон, Крис Эванс, Джереми Реннер, Роберт Дауни мл., Марк Руффало, Коби Смолдерс, Том Хиддлстон, Сэмюэл Л. Джексон, Стеллан Скарсгард'),
(5, 2, 'Представляем вашему вниманию новый триллер. Действия разворачивается вокруг исчезновения сестры нашей главной героини, которую зовут Джилл Пэрриш. Однажды придя домой, она обнаруживает, что ее сестра бесследно исчезла. У Джилл появляется уверенность в том, что исчезновение сестры связано с давнишней страшной историей, которую ей пришлось пережить...', ' Представляем вашему вниманию новый триллер. Действия разворачивается вокруг исчезновения сестры нашей главной героини, которую зовут Джилл Пэрриш. Однажды придя домой, она обнаруживает, что ее сестра бесследно исчезла. У Джилл появляется уверенность в том, что исчезновение сестры связано с давнишней страшной историей, которую ей пришлось пережить. Тогда ей пришлось подвергнуться похищению серийным убийцы, но только чудом она смогла вырваться из ловушки и благополучно вернуться домой. Прошло уже несколько лет с тех пор, но девушку не покидает уверенность, что это дело рук того самого маньяка. Джилл обращается в полицию, но там ее словам никто не верит, говоря о том, что ее сестра взрослый человек и сама вернется, когда захочет. Но Джилл не тот человек, который будет сидеть и молча ждать развития событий, она сама берется за поиски своей сестры. Она решает найти убийцу, вывести его на чистую воду и спасти свою сестру, действуя решительно и не боясь всех опасностей, которые могут встретиться на ее пути. Большинство считают ее сумасшедшей и никто ей не верит, но она не обращает внимание, находит пистолет и продолжает заниматься поисками убийцы. Сможет ли она найти его, спасет ли она свою сестру, получится ли у нее доказать окружающим, что она в своем уме и убийца действительно существует. Заранее предупредите кого-то, чтобы в конце фильма оторвал вас от экрана монитора, самостоятельно у вас это вряд ли получится.', 46, 'Игра на выживание', '', '', '2012-07-07', 0, 0, 'США', '', 0, 0, 0, '1:30:56', '', ' Аманда Сайфред, Дэниэл Санжата, Дженнифер Карпентер, Себастиан Стэн, Уэс Бентли, Кэтрин Монниг, Джоэль Мур, Майкл Паре, Эмили Уикершем, Джордан Фрай'),
(7, 1, ' Погони за жёлудем и борьба за выживание, чувство одиночества и радость от встречи со старыми друзьями, льды, океаны и континенты – всё по старому и вместе с тем всё так необычно в новой части культового мультфильма Ледниковый период. Теперь случается дрейф континентов, и наши старые знакомые оказываются отрезанными от стада...', ' Погони за жёлудем и борьба за выживание, чувство одиночества и радость от встречи со старыми друзьями, льды, океаны и континенты – всё по старому и вместе с тем всё так необычно в новой части культового мультфильма Ледниковый период. Теперь случается дрейф континентов, и наши старые знакомые оказываются отрезанными от стада. Теперь им придётся пережить долгое плавание на айсберге, знакомство с невиданными животными и растениями, узнать новые земли и погостить у пиратов. Скрэт наконец то поймает своё сокровище, но вместо сказочного обеда попадёт в совершенно неизвестные для него места, где ему придётся пережить не одно приключение. Ледниковый период продолжается!', 28, 'Ледниковый период 4', '', '', '2012-07-08', 2012, 0, 'США', '', 0, 0, 0, '01:19:39', '', ''),
(8, 2, ' Новая версия сериала по роману Р.Стивенсона, насыщенная свежими идеями и новыми вариантами видения событий книги. Двухсерийная драма повествует о Джиме Хокинсе, который неожиданно вливается в мир пиратства, когда обнаруживает карту сокровищ капитана Флинта. Но Долговязый Джон Сильвер не остановится ни перед чем, чтобы прибрать всё золото к своим рукам...', ' Новая версия сериала по роману Р.Стивенсона, насыщенная свежими идеями и новыми вариантами видения событий книги. Двухсерийная драма повествует о Джиме Хокинсе, который неожиданно вливается в мир пиратства, когда обнаруживает карту сокровищ капитана Флинта. Но Долговязый Джон Сильвер не остановится ни перед чем, чтобы прибрать всё золото к своим рукам...', 3, 'Остров сокровищ', '', '', '2012-07-08', 2011, 0, 'США', '', 0, 0, 0, '3:00:00', '', 'Эдди Иззард, Тоби Регбо, Руперт Пенри-Джонс, Дэниэл Мейс, Филип Гленистер, Дональд Сазерленд, Элайджа Вуд, Ширли Хендерсон, Нина Сосанья, Джофф Белл'),
(9, 2, ' Человеку, некогда работавшему на криминального авторитета, трудно бороться с призраками прошлого. Но он смог, он ушел. Однако жизнь наказала его за прежние грехи и когда его сыну стали срочно нужны деньги на дорогие медикаменты Скотту ничего не оставалось, как вновь обратиться за помощью к прежнему боссу. Только вот жизнь от этого проще не становится…', ' Человеку, некогда работавшему на криминального авторитета, трудно бороться с призраками прошлого. Но он смог, он ушел. Однако жизнь наказала его за прежние грехи и когда его сыну стали срочно нужны деньги на дорогие медикаменты Скотту ничего не оставалось, как вновь обратиться за помощью к прежнему боссу. Только вот жизнь от этого проще не становится…', 2, 'Записки Кейна: Жизнь узника', '', '', '2012-07-08', 2010, 0, 'США / Revel Entertainment', '', 0, 0, 0, '01:31:06', '', ' Дрю Фуллер, Итэн Эмбри, Уильям Дивэйн, Уильям Этертон, Уитни Эйбл, Ив Мауро, Пол Рэй, Триша Адамс, Скотт Кларк Беринжер, Берни Даймонд'),
(10, 2, 'На дворе — конец девятнадцатого века, но, хотя люди пользуются автомобилями, железными дорогами и телеграфом, человек по-прежнему бессилен перед проявлениями сверхъестественного. Молодой лондонский юрист Артур Киппс вынужден оставить своего 4-летнего сына и отправиться в командировку в уединенную северную деревушку, чтобы составить реестр документов, оставшихся от скончавшегося хозяина поместья Ил Марш. Добравшись до места и пообщавшись с негостеприимными местными жителями, он начинает понимать, что над деревушкой нависла тень мрачной тайны...', 'На дворе — конец девятнадцатого века, но, хотя люди пользуются автомобилями, железными дорогами и телеграфом, человек по-прежнему бессилен перед проявлениями сверхъестественного. Молодой лондонский юрист Артур Киппс вынужден оставить своего 4-летнего сына и отправиться в командировку в уединенную северную деревушку, чтобы составить реестр документов, оставшихся от скончавшегося хозяина поместья Ил Марш. Добравшись до места и пообщавшись с негостеприимными местными жителями, он начинает понимать, что над деревушкой нависла тень мрачной тайны. Когда же рядом со старым кладбищем ему на глаза попадается загадочная женщина, одетая в черное, это малозначительное происшествие знаменует начало череды леденящих кровь смертей в семьях обитателей деревни.', 1, 'Женщина в черном', '', '', '2012-07-09', 2012, 0, 'Швеция, Канада, Великобритания', '', 0, 0, 0, '95 мин. / 01:35', '', 'Дэниэл Рэдклифф, Кирен Хайдз, Джанет МакТир ,Дэвид Бурк, Шон Дули, Эмма Шори\r\nМолли Хэрмон, Ellisa Walker-Reid,Софи Стаки, Миша Хэндл'),
(11, 3, 'Сериал «Интерны» уже давно стал культовым. История про четырех  молодых и совсем еще «зеленых» интернов,  под управлением циничного руководителя Быкова заняла место в сердцах многих телезрителей.  А как же их не полюбить! Ведь медицинский юмор как у самих интернов так и у стоящих выше по должности на высшем уровне. Любовные перипетии,  предательство и преданность, и конечно же превосходный юмор – все это сериал «Интерны» Смотреть онлайн интерны все серии в хорошем качестве', 'Сериал «Интерны» уже давно стал культовым. История про четырех  молодых и совсем еще «зеленых» интернов,  под управлением циничного руководителя Быкова заняла место в сердцах многих телезрителей.  А как же их не полюбить! Ведь медицинский юмор как у самих интернов так и у стоящих выше по должности на высшем уровне...', 30, 'Интерны', 'interny', '', '2012-07-20', 2012, 0, 'Россия', '', 12, 0, 0, '24 мин', '', ': Кристина Асмус, Александр Ильин мл., Иван Охлобыстин, Илья Глинников, Вадим Демчог, Светлана Камынина, Байрон Один Ланд, Светлана Пермякова, Дмитрий Шаракоис'),
(15, 3, 'Действие происходит после событий сериала «Универ». Общежитие, в котором жили герои идёт под снос и ребят (пятикурсников Антона и Кузю, оставленных на второй год) переселяют в новую, недавно построенную общагу. В новом корпусе их селят в один блок с тремя девушками — Кристиной, Машей и Яной. Также, в роли аспиранта (чтобы избежать призыва в армию) в универ возвращается Майкл.', 'Действие происходит после событий сериала «Универ». Общежитие, в котором жили герои идёт под снос и ребят (пятикурсников Антона и Кузю, оставленных на второй год) переселяют в новую, недавно построенную общагу. В новом корпусе их селят в один блок с тремя девушками — Кристиной, Машей и Яной. Также, в роли аспиранта (чтобы избежать призыва в армию) в универ возвращается Майкл.', 17, 'Универ. Новая общага', '', '', '2012-07-22', 2012, 0, 'Россия', '', 12, 0, 0, '24', '', 'Виталий Гогунский,\r\nАрарат Кещян,\r\nСтанислав Ярушин,\r\nАнна Кузина,\r\nНастасья Самбурская,\r\nАнна Хилькевич,\r\nВладимир Фекленко,\r\nЕлена Валюшкина,\r\nАндрей Лебедев'),
(12, 2, 'Сюжет фильма раскрывает тайную жизнь Величайшего Президента Америки Авраама Линкольна — любящего мужа и отца днем и беспощадного убийцу вампиров ночью. Армия кровопийц, которым он бросил вызов, растет с каждым днем. Сможет ли президент великой страны противостоять полчищам вампиров и спасти свою семью и народ от неминуемой гибели?..', 'Сюжет фильма раскрывает тайную жизнь Величайшего Президента Америки Авраама Линкольна — любящего мужа и отца днем и беспощадного убийцу вампиров ночью. Армия кровопийц, которым он бросил вызов, растет с каждым днем. Сможет ли президент великой страны противостоять полчищам вампиров и спасти свою семью и народ от неминуемой гибели?..', 3, 'Президент Линкольн: Охотник на вампиров', '', '', '2012-07-20', 2012, 0, 'США', '', 0, 0, 0, '01:45', '', 'Бенджамин Уокер\r\nДоминик Купер\r\nЭнтони Маки\r\nМэри Элизабет Уинстэд\r\nРуфус Сьюэлл\r\nМартон Чокаш\r\nДжимми Симпсон\r\nДжозеф Моул\r\nРобин МакЛиви\r\nЭрин Уоссон'),
(14, 3, 'Обычный, рядовой российский парень Коля не может определиться между жизнью «на районе» и миром пермской элиты общества. На протяжении всего сериала его ждут увлекательные и смешные истории.', 'Обычный, рядовой российский парень Коля не может определиться между жизнью «на районе» и миром пермской элиты общества. На протяжении всего сериала его ждут увлекательные и смешные истории.', 84, 'Реальные пацаны', '', '', '2012-07-22', 2011, 0, 'Россия', '', 12, 0, 0, '24 мин', '', 'Николай Наумов\r\nАнтон Богданов\r\nВладимир Селиванов\r\nСтанислав Тляшев\r\nЗоя Бербер\r\nМарина Федункив\r\nМария Скорницкая\r\nВалентина Мазунина\r\nАрмен Бежанян\r\nИгорь Ознобихин'),
(16, 3, ' «Счастливы вместе» — это история о средней провинциальной российской семье, живущей в Екатеринбурге. Они прожили двадцать лет вместе, знают все слабые и сильные стороны друг друга, и умело используют эти знания в семейных конфликтах. Гена и Даша Букины постоянно держат друг друга в тонусе и подкалывают, однако, им удается преодолевать все бытовые проблемы с юмором. За ссорами, руганью, обидами друг на друга скрывается настоящая теплота, привязанность и любовь. ', ': «Счастливы вместе» — это история о средней провинциальной российской семье, живущей в Екатеринбурге. Они прожили двадцать лет вместе, знают все слабые и сильные стороны друг друга, и умело используют эти знания в семейных конфликтах. Гена и Даша Букины постоянно держат друг друга в тонусе и подкалывают, однако, им удается преодолевать все бытовые проблемы с юмором. За ссорами, руганью, обидами друг на друга скрывается настоящая теплота, привязанность и любовь. \r\n У Букиных есть двое детей — туповатая красавица Света, в голове которой одни мальчики, и отличник Рома, которому вечно не везет с девчонками. Также в семье Букиных живет мальчик Сема — подкидыш, которого оставили непутевые родственники Даши.\r\n Еще один член семьи Букиных — добрейший и обаятельнейший пес Барон.\r\n Немаловажные персонажи сериала и соседи Букиных — Лена и Толик Полено. Лена — начальник в банке, и дома тоже командует. Толик — альфонс и бездельник, живущей с Леной ради ее денег и квартиры. Толик дружит с Геной и постоянно «учится у него плохому», что регулярно становится причиной семейных скандалов.', 1, 'Счасливы вместе', '', '', '2012-07-22', 2012, 0, 'Россия', '', 12, 0, 0, '24', '', 'Виктор Логинов, Наталья Бочкарёва, Дарья Сагалова, Александр Якин, Юлия Захарова, Павел Савинков'),
(38, 2, 'Шумная компания из пяти друзей сбегает на уик-энд подебоширить в изолированную от всего мира деревенскую хижину. Звучит знакомо? Ну так вы и не представляете, что вас ждёт на самом деле.', 'Шумная компания из пяти друзей сбегает на уик-энд подебоширить в изолированную от всего мира деревенскую хижину. Звучит знакомо? Ну так вы и не представляете, что вас ждёт на самом деле.', 0, 'Хижина в лесу', 'Hijina_v_lesu', 'The Cabin in the Woods', '0000-00-00', 2011, 2011, '$30 000 000', 'США', 27, 28, 26, '95 мин', 'Дрю Годдард', 'Кристен Коннолли, Крис Хемсворт, Анна Хатчисон, Фрэн Кранц, Джесси Уильямс, Брэдли Уитфорд'),
(39, 2, 'Коммивояжер Грег Ньюман садится в такси. Все идет нормально, пока водитель не сбивает женщину. Таксист предлагает довезти до больницы потерпевшую, Билли, и ее парня Каспера, которые, сев в такси, берут Грега в заложники. Так начинается «турне миллионера» — коварный бандитский замысел.', 'Коммивояжер Грег Ньюман садится в такси. Все идет нормально, пока водитель не сбивает женщину. Таксист предлагает довезти до больницы потерпевшую, Билли, и ее парня Каспера, которые, сев в такси, берут Грега в заложники. Так начинается «турне миллионера» — коварный бандитский замысел. Билли с Каспером, угрожая Грегу пистолетом, заставляют его снимать деньги со всех своих банковских карт, останавливаясь у многочисленных банкоматов. Но оказывается, им нужны не только деньги Грега. Каспер с Билли работают на могущественного преступника по кличке Римлянин, который приказал им поймать Грега. Римлянин уверен, что Грег на самом деле преступник по имени Джулиус Джекс, укравший у него миллионы долларов. И теперь Римлянин во что бы то ни стало хочет отомстить Грегу. Грег уверяет похитителей, что он невиновен…', 0, 'Турне миллионера', 'Turne_millionera', 'The Millionaire Tour', '0000-00-00', 2012, 2012, 'неизвестно', 'США', 3, 26, 0, '81 мин', 'Inon Shampanier', 'Доминик Монахэн, Джордан Бэлфи, Рик Гомез, Агнес Брукнер, Брюс Дэвисон, Мариса Петроро, Дэйв Вескио, Лаура С. Спенсер, Рон Рогге'),
(18, 3, 'Повседневная жизнь современного Крестного отца: его мысли — стремительны, действия — решительны, а юмор — черен. Мафиозный босс Северного Джерси Тони Сопрано успешно справляется с проблемами «Семьи».\r\n\r\nНо вот собственная семья немного подкачала: дети от рук отбились, брак — под угрозой, мамаша — пилит. Он надеется на помощь психиатра, но как тому рассказать обо всех своих проблемах, если связан «Омертой» — обетом молчания, нарушать который нельзя под страхом смерти?', 'Повседневная жизнь современного Крестного отца: его мысли — стремительны, действия — решительны, а юмор — черен. Мафиозный босс Северного Джерси Тони Сопрано успешно справляется с проблемами «Семьи».\r\n\r\nНо вот собственная семья немного подкачала: дети от рук отбились, брак — под угрозой, мамаша — пилит. Он надеется на помощь психиатра, но как тому рассказать обо всех своих проблемах, если связан «Омертой» — обетом молчания, нарушать который нельзя под страхом смерти?', 1, 'Клан Сопрано', 'Klan Soprano', 'The Sopranos', '2012-07-28', 1999, 0, 'США ', '', 15, 0, 0, '50 мин', 'Тимоти Ван Паттен, Джон Паттерсон, Аллен Култер', 'Джеймс Гандольфини, Эди Фэлко, Джэми-Линн Сиглер, Майкл Империоли, Лоррейн Бракко, Тони Сирико, Роберт Айлер, Стив Ван Зандт, Доминик Кьянезе, Аида Туртурро'),
(37, 2, 'В детстве Питер Паркер был оставлен своими родителями, и поэтому воспитывался дядей и тётей. Шли годы, Питер был обычным примерным школьником, подвергался нападкам хулиганов и был влюблён в свою одноклассницу Гвен Стэйси, которая сама втайне отвечала ему взаимностью. Но после укуса генетически изменённого паука, Питер получает невероятные сверхспособности и его жизнь меняется навсегда.', 'В детстве Питер Паркер был оставлен своими родителями, и поэтому воспитывался дядей и тётей. Шли годы, Питер был обычным примерным школьником, подвергался нападкам хулиганов и был влюблён в свою одноклассницу Гвен Стэйси, которая сама втайне отвечала ему взаимностью. Но после укуса генетически изменённого паука, Питер получает невероятные сверхспособности и его жизнь меняется навсегда.\r\n\r\nОднако его не перестаёт мучить вопрос о том, что случилось с его родителями. Он знакомится с давним другом и партнёром своего отца — генетиком Куртом Коннорсом, который вместе с отцом Питера разрабатывал формулу регенерации. Питер помогает её закончить, а Коннорс, всю жизнь мечтавший восстановить свою правую руку, вводит формулу себе и становится Ящером. Осознавая свою вину, Питер начинает новую жизнь в образе таинственного супергероя Человека-паука и становится грозой преступников, одновременно пытаясь найти способ остановить Коннорса.', 0, 'Новый Человек-паук', 'Novyi_Chelovek-pauk', 'The Amazing Spider-Man', '0000-00-00', 2012, 2012, '$230 000 000', 'США', 28, 3, 21, '136 мин', 'Марк Уэбб', 'Эндрю Гарфилд, Эмма Стоун, Рис Иванс, Дэнис Лири, Мартин Шин, Салли Филд, Эмбет Дэвидц, Кэмпбелл Скотт, Ирфан Кхан, Крис Зилка'),
(24, 2, 'Бэтмен поднимает ставки в войне с криминалом. С помощью лейтенанта Джима Гордона и прокурора Харви Дента он намерен очистить улицы от преступности, отравляющей город. Сотрудничество оказывается эффективным, но скоро они обнаружат себя посреди хаоса, развязанного восходящим криминальным гением, известным испуганным горожанам под именем Джокер.', 'Бэтмен поднимает ставки в войне с криминалом. С помощью лейтенанта Джима Гордона и прокурора Харви Дента он намерен очистить улицы от преступности, отравляющей город. Сотрудничество оказывается эффективным, но скоро они обнаружат себя посреди хаоса, развязанного восходящим криминальным гением, известным испу', 0, 'Темный рыцарь', 'Temnyi_rycar', 'The Dark Knight', '0000-00-00', 0, 0, 'США', 'неизвестно', 28, 3, 26, '152 мин', 'Кристофер Нолан', 'Кристиан Бэйл, Хит Леджер, Аарон Экхарт, Майкл Кейн, Гэри Олдмен, Мэгги Джилленхол, Морган Фримен'),
(21, 2, 'Роберт и Альфред — фокусники-иллюзионисты, которые на рубеже XIX и XX веков соперничали друг с другом в Лондоне. С годами их дружеская конкуренция на профессиональной почве перерастает в настоящую войну.\r\n\r\nОни готовы на все, чтобы выведать друг у друга секреты фантастических трюков и сорвать их исполнение. Непримиримая вражда, вспыхнувшая между ними, начинает угрожать жизни окружающих их людей…', 'Роберт и Альфред — фокусники-иллюзионисты, которые на рубеже XIX и XX веков соперничали друг с другом в Лондоне. С годами их дружеская конкуренция на профессиональной почве перерастает в настоящую войну.\r\n\r\nОни готовы на все, чтобы выведать друг у друга секреты фантастических трюков и сорвать их исполнение. Непримиримая вражда, вспыхнувшая между ними, начинает угрожать жизни окружающих их людей…', 0, 'Престиж', 'Prestij', 'The Prestige', '0000-00-00', 2008, 0, 'США', 'неизвестно', 26, 9, 6, '125 мин', 'Кристофер Нолан', 'Хью Джекман, Кристиан Бэйл, Скарлетт Йоханссон, Майкл Кейн, Дэвид Боуи'),
(25, 2, 'Джон влюблен в красавицу Лори, у него отличная работа и большие планы на будущее. Но в их отношения вмешивается третий, давний друг Джона — Тед. Он отрывается сутки напролет, предпочитает случайные связи и не желает терять друга. Но никто на самом деле не знает на что он способен, ведь Тед — большой плюшевый медведь.', 'Джон влюблен в красавицу Лори, у него отличная работа и большие планы на будущее. Но в их отношения вмешивается третий, давний друг Джона — Тед. Он отрывается сутки напролет, предпочитает случайные связи и не желает терять друга. Но никто на самом деле не знает на что он способен, ведь Тед — большой плюшевый медведь.', 0, 'Третий лишний', 'Tretii_lishnii', 'Ted', '0000-00-00', 2012, 0, 'США', 'неизвестно', 12, 30, 0, '106 мин', 'Сет МакФарлейн', 'Марк Уолберг\r\nМила Кунис\r\nСет МакФарлейн\r\nДжоэль МакХэйл, Джованни Рибизи, Патрик Варбертон, Мэтт Уолш, Джессика Барт, Аэдин Минкс, Билл Смитрович'),
(26, 2, 'Профессиональный убийца Леон, не знающий пощады и жалости, знакомится со своей очаровательной соседкой Матильдой, семью которой расстреливают полицейские, замешанные в торговле наркотиками. Благодаря этому знакомству он впервые испытывает чувство любви, но…', 'Профессиональный убийца Леон, не знающий пощады и жалости, знакомится со своей очаровательной соседкой Матильдой, семью которой расстреливают полицейские, замешанные в торговле наркотиками. Благодаря этому знакомству он впервые испытывает чувство любви, но…', 0, 'Леон', 'Leon', 'Léon', '0000-00-00', 0, 0, 'США', '', 26, 9, 15, '110 мин', 'Люк Бессон', 'Жан Рено, Натали Портман, Дэнни Айелло, Гэри Олдмен'),
(28, 3, 'В маленьком приморском городке расположена уникальная клиника «Надежда». Супруги Ольга и Сергей помогают женщинам забеременеть — лечат недуги, связанные с нарушениями репродуктивной системой, а так же младенческие патологии. Они делают чудеса, помогая женщинам стать матерями, но по иронии судьбы сами не могут испытать счастье рождения родного ребенка — кровинушки.', 'В маленьком приморском городке расположена уникальная клиника «Надежда». Супруги Ольга и Сергей помогают женщинам забеременеть — лечат недуги, связанные с нарушениями репродуктивной системой, а так же младенческие патологии. Они делают чудеса, помогая женщинам стать матерями, но по иронии судьбы сами не могут испытать счастье рождения родного ребенка — кровинушки.', 0, 'Кровинушка', 'Krovinushka', 'неизвестно', '0000-00-00', 2012, 2012, 'Россия', 'неизвестно', 16, 0, 0, '43мин', 'Иван Агапов, Ольга Грекова', 'Марина Маняхина, Станислав Николаев\r\nЕлена Лагута, Диана Максимова, Дмитрий Варшавский, Аристарх Ливанов, Анатолий Завьялов, Татьяна Борисова, Юрий Сазонов, Иван Непомнящий'),
(31, 3, 'В глухой тайге, спрятавшись от мира, живет семья: Полина, Прохор и их двадцатидвухлетняя внучка Ефросинья. Когда-то давно влюбленный конвоир Прохор помог бежать политзаключенной Полине. Они укрылись в тайге в заброшенном домике охотников, и с тех пор держат связь с внешним миром только через местного егеря. Тем временем, в тайгу по поручению бизнесмена Мартынова приезжает группа геологов - они должны найти секретное месторождение золота, на которое, как верят местные жители, наложено страшное проклятие. Среди геологов – Максим и влюбленная в него Татьяна. Но однажды ночью Максим видит купающуюся в водопаде Ефросинью...', 'В глухой тайге, спрятавшись от мира, живет семья: Полина, Прохор и их двадцатидвухлетняя внучка Ефросинья. Когда-то давно влюбленный конвоир Прохор помог бежать политзаключенной Полине. Они укрылись в тайге в заброшенном домике охотников, и с тех пор держат связь с внешним миром только через местного егеря. Тем временем, в тайгу по поручению бизнесмена Мартынова приезжает группа геологов - они должны найти секретное месторождение золота, на которое, как верят местные жители, наложено страшное проклятие. Среди геологов – Максим и влюбленная в него Татьяна. Но однажды ночью Максим видит купающуюся в водопаде Ефросинью...', 0, 'Ефросинья. Таёжная любовь', 'Efrosinya', 'неизвестно', '0000-00-00', 2012, 2012, 'Россия', 'неизвестно', 9, 16, 0, '44 мин', 'Максим Мокрушев', 'Анастасия Макарова, Валерий Золотухин, Александр Клюквин, Ксения Энтелис');
