(32, 3, 'Убийство — дело непростое даже для хорошо подготовленного человека. Главную библейскую заповедь нам вбивают с детства. А даже если у кого-то и проскальзывают мысли «как сладко было бы воткнуть ножик в приятеля и придушить бы подружку, которая с пресловутым приятелем переспала» или что-нибудь попроще «подсыпать бы яду профессору, что никак зачет не ставит» или совсем невинное «вот бы конкурент в окошко выпал». Но обычно дальше фантазий, этакой невинной интеллектуальной мастурбации эти мысли не доходят. Даже те из нас, для кого убийство морально приемлемо боятся — боятся наказания.', 'Убийство — дело непростое даже для хорошо подготовленного человека. Главную библейскую заповедь нам вбивают с детства. А даже если у кого-то и проскальзывают мысли «как сладко было бы воткнуть ножик в приятеля и придушить бы подружку, которая с пресловутым приятелем переспала» или что-нибудь попроще «подсыпать бы яду профессору, что никак зачет не ставит» или совсем невинное «вот бы конкурент в окошко выпал». Но обычно дальше фантазий, этакой невинной интеллектуальной мастурбации эти мысли не доходят. Даже те из нас, для кого убийство морально приемлемо боятся — боятся наказания. \r\n\r\nА теперь представьте, что у вас есть способность убить всех, кто вам не нравится, причем убить, просто написав их имя в потертой черной тетрадке с надписью Death Note. Эта тетрадь — идеальное оружие. Не нужно покупать пистолеты и точить ножи, искать веревки и выпаривать из бытовой химии яды. Достаточно знать имя и внешность того, кого хотите убить, росчерк карандаша и через 40 секунд недоброжелатель умирает от сердечного приступа, а если вы не лишены фантазии, смерть можно обставить более интересно, болезнь, несчастный случай, самоубийство, наконец. Ни отпечатков пальцев, ни орудия убийства. \r\n\r\nА что если у кого-то возникнет идея сделать с помощью тетрадки нечто большее, чем просто смерть обидчиков? Что если этот кто-то окажется идеалистом, готовым принять решение за целый мир?', 0, 'Тетрадь смерти', 'Tetrad_smerti', 'Death note', '0000-00-00', 2006, 2007, 'Япония', 'неизвестно', 18, 6, 1, '23 мин', 'Тетсуро Араки', 'Брайан Драммонд, Эндрю Френсис, Винсент Тонг, Мамору Мияно\r\nКаппэй Ямагути, Шидо Накамура, Наойя Учида, Киёси Кобаяши, Ая Хирано.\r\nАи Сату\r\n'),
(33, 3, 'Роман Широков — врач-ординатор родильного дома областной клинической больницы. Роман — талантливый врач, прошедший за границей спецкурс по репродуктологии. Он не боится браться за самые серьезные, опасные и редкие клинические случаи. Но из-за своего пристрастия к рискованным решениям часто конфликтует с начальством.', 'Роман Широков — врач-ординатор родильного дома областной клинической больницы. Роман — талантливый врач, прошедший за границей спецкурс по репродуктологии. Он не боится браться за самые серьезные, опасные и редкие клинические случаи. Но из-за своего пристрастия к рискованным решениям часто конфликтует с начальством.', 0, 'Женский доктор', 'Jenskii_doktor', 'неизвестно', '0000-00-00', 2012, 2012, 'Украина', 'неизвестно', 16, 0, 0, '44 мин', 'Александр Пархоменко, Антон Гойда', 'Илья Носков, Алёна Яковлева, Андрей Финягин, Сергей Калантай, Олеся Власова, Олег Иваница, Виталина Библив, Андрей Павленко, Иван Марченко, Константин Косинский'),
(34, 2, 'Прошло десять лет после героического поражения Персеем морского чудовища Кракена, теперь он живет спокойной жизнью деревенского рыбака и воспитывает своего 10-летнего сына.', 'Прошло десять лет после героического поражения Персеем морского чудовища Кракена, теперь он живет спокойной жизнью деревенского рыбака и воспитывает своего 10-летнего сына.\r\n\r\nТем временем, бушует борьба за превосходство между Богами и Титанами. Опасно ослабленные нехваткой человеческой любви и преданности, Боги теряют контроль над заключенными в тюрьму Титанами и их свирепым лидером, Кроносом, отцом правящих братьев Зевса, Аида и Посейдона. Давным-давно триумвират сверг своего сильного отца, отправив его гнить в мрачную пропасть Тартар, темницу, находящуюся в глубоких пределах подземного мира.\r\n\r\nПерсей не может остаться в стороне, когда Аид вместе с сыном Зевса, Аресом, заключают сделку с Кроносом, чтобы вместе уничтожить Зевса. Сила Титанов становится ещё больше, в то время как Зевс теряет свою мощь и власть, а по Земле раскидывается ад подземного мира.\r\n\r\nВместе с Андромедой, полубогом Агенором, сыном Посейдона и низвергнутым богом Гефестом,- Персей отправляется в опасное и отважное путешествие в подземный мир, чтобы спасти Зевса, свергнуть Титанов и сохранить людской род.', 0, 'Гнев Титанов', 'Gnev_titanov', 'Wrath of the Titans', '0000-00-00', 2012, 2012, 'США', '$150 000 000', 30, 21, 3, '99 мин', 'Джонатан Либесман', 'Сэм Уортингтон, Лиам Нисон, Рэйф Файнс, Эдгар Рамирез, Тоби Кеббелл, Розамунд Пайк, Билл Найи, Дэнни Хьюстон, Джон Белл, Лили Джеймс.'),
(35, 2, 'Героическая история диктатора, который рискует своей жизнью, чтобы ни в коем случае не допустить демократию в свою столь любовно угнетаемую страну.', 'Героическая история диктатора, который рискует своей жизнью, чтобы ни в коем случае не допустить демократию в свою столь любовно угнетаемую страну.', 0, 'Диктатор', 'Diktator', 'The Dictator', '0000-00-00', 2012, 2012, 'США', '$65 000 000', 12, 0, 0, '83 мин', 'Ларри Чарльз', '\r\nСаша Барон Коэн, Анна Фэрис, Бен Кингсли, Саид Бадрия, Мишель Берг, Роки Ситрон, Liam Campora, Аасиф Мандви, Ризван Манжи, Рик Чэмберс'),
(36, 2, 'Миллионеры-адреналиноманы, которые уже взяли от жизни все, но хотят еще большего. Все они: банкир с Уолл-Стрит, гений видео игр, русский алюминиевый магнат, международный торговец оружием и один из основателей мобильной связи. За собственные деньги они отправляются на войну, чтобы почувствовать ее настоящий вкус и получить новую дозу адреналина. Но с самого начала все идет не так. Иллюзия игры рушится, как только миллионеры попадают на остров. При высадке их лодки тонут, а охрана — убита.', 'Миллионеры-адреналиноманы, которые уже взяли от жизни все, но хотят еще большего. Все они: банкир с Уолл-Стрит, гений видео игр, русский алюминиевый магнат, международный торговец оружием и один из основателей мобильной связи. За собственные деньги они отправляются на войну, чтобы почувствовать ее настоящий вкус и получить новую дозу адреналина. Но с самого начала все идет не так. Иллюзия игры рушится, как только миллионеры попадают на остров. При высадке их лодки тонут, а охрана — убита. \r\n\r\nМиллионеры оказываются на вражеской территории, не имея возможности выбраться с острова. Они паникуют и ругаются между собой, в то время как по острову их преследуют солдаты военного командира. Крейг пытается их обучить основам самообороны, но они ведут себя эгоистично, претенциозно и безответственно. Смогут ли избалованные и привыкшие к комфорту миллионеры выбраться живыми из ловушки, которую приготовил им остров?', 0, 'Солдаты удачи ', 'Soldaty_udachi', 'Soldiers of Fortune', '0000-00-00', 2012, 2012, '$8 000 000', 'США', 3, 0, 0, '94 мин', 'Максим Коростышевский', 'Шон Бин, Кристиан Слэйтер, Доминик Монахэн, Винг Реймз, Джеймс Кромуэлл, Фредди Родригес, Колм Мини, Райан Доноху, Чарли Бьюли, Сара Анн Шультс'),
(40, 2, 'Мы посылаем сигналы в космос и ждем ответа. Но уверены ли мы, что хотим его получить? Что если пришельцы потенциально опасны? В 2009 году на конференции в Вашингтоне астронавт Эдгар Митчелл, побывавший на Луне, сделал сенсационное заявление о существовании внеземной жизни. Теперь мы знаем, контакт не просто возможен, он неизбежен!', 'Мы посылаем сигналы в космос и ждем ответа. Но уверены ли мы, что хотим его получить? Что если пришельцы потенциально опасны? В 2009 году на конференции в Вашингтоне астронавт Эдгар Митчелл, побывавший на Луне, сделал сенсационное заявление о существовании внеземной жизни. Теперь мы знаем, контакт не просто возможен, он неизбежен!', 0, 'Морской бой', 'Morskoi_boi', 'Battleship', '0000-00-00', 2012, 2012, '$209 000 000', 'США', 28, 3, 26, '131 мин', 'Питер Берг', 'Тейлор Китч, Александр Скарсгард, Рианна, Бруклин Декер, Таданобу Асано, Лиам Нисон, Джон Туи, Грегори Д. Гэдсон, Джесси Племонс, Хамиш Линклэйтер'),
(41, 2, 'н — обычный рабочий-строитель, живущий в маленькой квартирке в захудалом районе города будущего где-то в Новой Азии. Хотя собственная жизнь его в целом устраивает, он не может избавиться от чувства, что ему хочется чего-то большего. Потребность в новых будоражащих впечатлениях приводит его в офис компании «Вспомнить всё», имплантирующей в память своих клиентов воспоминания-фантазии, которые они могут получить не рискуя при этом пережить сами события в реальности. Пока герой выбирает, какие именно воспоминания ему приобрести, отряд спецназа штурмует комнату, где он находится, и уже было берет его под арест...', 'н — обычный рабочий-строитель, живущий в маленькой квартирке в захудалом районе города будущего где-то в Новой Азии. Хотя собственная жизнь его в целом устраивает, он не может избавиться от чувства, что ему хочется чего-то большего. Потребность в новых будоражащих впечатлениях приводит его в офис компании «Вспомнить всё», имплантирующей в память своих клиентов воспоминания-фантазии, которые они могут получить не рискуя при этом пережить сами события в реальности. Пока герой выбирает, какие именно воспоминания ему приобрести, отряд спецназа штурмует комнату, где он находится, и уже было берет его под арест. К своему собственному удивлению, он молниеносно уничтожает весь отряд при помощи невероятных бойцовских навыков, о владении которыми он и не подозревал…', 0, 'Вспомнить всё', 'неизвестно', 'Total Recall', '0000-00-00', 2012, 2012, '$125 000 000', 'США', 28, 3, 26, '118 мин', 'Лен Уайзман', 'Колин Фаррелл, Кейт Бекинсейл, Джессика Бил, Брайан Крэнстон, Джон Чо, Билл Найи, Букем Вудбайн, Уилл Юн Ли, Милтон Барнс, Джеймс Макгоун'),
(42, 2, 'Через 12 лет в состоянии, близком к коматозному, Селин узнает о существовании родной дочери Евы — гибрида вампира и ликана. И Селин необходимо помешать БиоКом создать суперликанов, которые убьют их всех.', 'Через 12 лет в состоянии, близком к коматозному, Селин узнает о существовании родной дочери Евы — гибрида вампира и ликана. И Селин необходимо помешать БиоКом создать суперликанов, которые убьют их всех.', 0, 'Другой мир: Пробуждение', 'Drugoi_mir:_Probujdenie', 'Underworld: Awakening', '0000-00-00', 2012, 2012, '$70 000 000', 'США', 27, 3, 30, '85 мин', 'Монс Морлинд, Бьёрн Стейн', 'Кейт Бекинсейл, Стивен Ри, Майкл Или, Тео Джеймс, Индия Айли, Чарльз Дэнс, Сандрин Холт, Кристен Холден-Рид, Джейкоб Блэр, Адам Рейд.'),
(43, 2, 'Испокон веков мифы и легенды окутывают загадочной пеленой живописные отроги Шотландских гор. Искусной лучнице Мериде приходится выбирать свой путь в жизни самостоятельно, и однажды она отказывается следовать древним традициям королевства, бросая вызов могущественным шотландским кланам и их предводителям: нескладному лорду МакГаффину, угрюмому лорду Макинтошу и сварливому лорду Дингволлу...', 'Испокон веков мифы и легенды окутывают загадочной пеленой живописные отроги Шотландских гор. Искусной лучнице Мериде приходится выбирать свой путь в жизни самостоятельно, и однажды она отказывается следовать древним традициям королевства, бросая вызов могущественным шотландским кланам и их предводителям: нескладному лорду МакГаффину, угрюмому лорду Макинтошу и сварливому лорду Дингволлу. Неосторожные поступки Мериды грозят повергнуть королевство в хаос, и тогда она отправляется за советом к эксцентричной отшельнице, которая вместо помощи накладывает на Мериду опасное заклятье. Юной принцессе предстоит полагаться только на собственную храбрость, чтобы преодолеть могущественное волшебство и победить самого страшного зверя из тех, что водятся в горных долинах.', 0, 'Храбрая сердцем', 'Hrabraya_serdcem', 'Brave', '0000-00-00', 2012, 2012, '$185 000 000', 'США', 18, 12, 30, '93 мин', 'Марк Эндрюс, Бренда Чэпман, Стив Пурселл', 'Келли Макдоналд, Эмма Томпсон, Билли Коннолли, Джули Уолтерс, Робби Колтрейн, Кевин МакКидд, Крэйг Фергюсон, Сэлли Кингхорн, Эйлид Фрайзер, Пейджи Баркер.'),
(44, 2, 'Он — обычный рабочий-строитель, живущий в маленькой квартирке в захудалом районе города будущего где-то в Новой Азии. Хотя собственная жизнь его в целом устраивает, он не может избавиться от чувства, что ему хочется чего-то большего. Потребность в новых будоражащих впечатлениях приводит его в офис компании «Вспомнить всё», имплантирующей в память своих клиентов воспоминания-фантазии, которые они могут получить не рискуя при этом пережить сами события в реальности. Пока герой выбирает, какие именно воспоминания ему приобрести, отряд спецназа штурмует комнату, где он находится, и уже было берет его под арест.', 'Он — обычный рабочий-строитель, живущий в маленькой квартирке в захудалом районе города будущего где-то в Новой Азии. Хотя собственная жизнь его в целом устраивает, он не может избавиться от чувства, что ему хочется чего-то большего. Потребность в новых будоражащих впечатлениях приводит его в офис компании «Вспомнить всё», имплантирующей в память своих клиентов воспоминания-фантазии, которые они могут получить не рискуя при этом пережить сами события в реальности. Пока герой выбирает, какие именно воспоминания ему приобрести, отряд спецназа штурмует комнату, где он находится, и уже было берет его под арест. К своему собственному удивлению, он молниеносно уничтожает весь отряд при помощи невероятных бойцовских навыков, о владении которыми он и не подозревал…', 0, 'Вспомнить всё', 'Vspomnit_vse', 'Total Recall', '0000-00-00', 2012, 2012, '$125 000 000', 'США, Канада', 28, 26, 3, '118 мин', 'Лен Уайзман', 'Колин Фаррелл, Кейт Бекинсейл, Джессика Бил, Брайан Крэнстон, Джон Чо, Билл Найи, Букем Вудбайн, Уилл Юн Ли, Милтон Барнс, Джеймс Макгоун.'),
