(48, 3, 'Действие сериала разворачивается примерно через 70 лет после победы аватара Аанга над Лордом Огня в последней серии мультсериала «Аватар: Легенда об Аанге». Корра, уже овладевшая магией воды, земли и огня должна обучиться последнему элементу — магии воздуха. В этом ей может помочь только сын Аанга и Катары — Тензин. Корра живёт в «Республиканском городе». Республиканский город — это место, где вместе живут люди всех наций. Героям мультсериала предстоит борьба с преступностью и с готовящимся восстанием против магов.', 'Действие сериала разворачивается примерно через 70 лет после победы аватара Аанга над Лордом Огня в последней серии мультсериала «Аватар: Легенда об Аанге». Корра, уже овладевшая магией воды, земли и огня должна обучиться последнему элементу — магии воздуха. В этом ей может помочь только сын Аанга и Катары — Тензин. Корра живёт в «Республиканском городе». Республиканский город — это место, где вместе живут люди всех наций. Героям мультсериала предстоит борьба с преступностью и с готовящимся восстанием против магов.', 0, 'Аватар: Легенда о Корре', 'Аvаtаr:_Lеgеndа_о_Коrrе', 'The Legend of Korra', '0000-00-00', 2012, 2012, '-', 'США', 1, 30, 18, '24 мин', 'Хоаким Дос Сантос, Ки Хьюн Рю', 'Джанет Вэрни, Ди Брэдли Бейкер, Дэвид Фаустино, П.Дж. Бирн, Дж.К. Симмонс, Джефф Беннетт, Сейшелл Гэбриел, Стивен Блум, Дарси Роуз Бернс, Минди Стерлинг.'),
