(55, 2, 'Норман, Паранорман. Единственная надежда полусонного городка в борьбе с полчищами нечисти. Его оружие — супер-мега-дар: умение общаться с призраками. Впрочем, мертвецы — не главная опасность, куда хуже — глупые взрослые с дробовиками наперевес.', 'Норман, Паранорман. Единственная надежда полусонного городка в борьбе с полчищами нечисти. Его оружие — супер-мега-дар: умение общаться с призраками. Впрочем, мертвецы — не главная опасность, куда хуже — глупые взрослые с дробовиками наперевес.', 0, 'Паранорман, или Как приручить зомби', 'ParaNorman', 'ParaNorman', '0000-00-00', 2012, 2012, 'США ', 'неизвестно', 18, 12, 21, '93 мин', 'Крис Батлер, Сэм Фелл', 'Коди Смит-МакФи, Таккер Албрицци, Анна Кендрик, Кейси Аффлек, Кристофер Минц-Плассе, Лесли Манн, Джефф Гарлин, Илэйн Стритч, Бернард Хилл, Джоделль Ферланд'),
(56, 2, 'Он — предложил, она — согласилась! Казалось бы, дело в шляпе — почти женаты. Но свадьба становится невыполнимой миссией, когда в дело вступает отряд бывших подружек жениха, босс невесты, трещащий по швам список гостей и престарелые родственники, имеющие тенденцию умирать в самый неподходящий момент. И вроде бы немножко женаты, но все как-то не до конца…', 'Он — предложил, она — согласилась! Казалось бы, дело в шляпе — почти женаты. Но свадьба становится невыполнимой миссией, когда в дело вступает отряд бывших подружек жениха, босс невесты, трещащий по швам список гостей и престарелые родственники, имеющие тенденцию умирать в самый неподходящий момент. И вроде бы немножко женаты, но все как-то не до конца…', 0, 'Немножко женаты', 'Nemnojko_jenaty', 'The Five-Year Engagement', '0000-00-00', 2012, 2012, 'США ', '$30 000 000', 16, 12, 0, '124 мин', 'Николас Столлер', 'Джейсон Сигел, Эмили Блант, Крис Прэтт, Элисон Бри, Лоурен Уидман, Мими Кеннеди, Дэвид Пэймер, Джеки Уивер, Джим Пиддок, Эрик Купер'),
(57, 2, 'Главная героиня фильма — большая почитательница творчества Вуди Аллена — к своей радости однажды случайно встречает своего кумира перед знаменитой гостиницей Plaza Athenee в Париже.', 'Главная героиня фильма — большая почитательница творчества Вуди Аллена — к своей радости однажды случайно встречает своего кумира перед знаменитой гостиницей Plaza Athenee в Париже.', 0, 'Париж-Манхэттен', 'Parij-Manhetten', 'Paris-Manhattan', '0000-00-00', 2012, 2012, 'неизвестно', 'Франция', 16, 12, 0, 'Элис Тальони, Патрик Брюэль, М', 'Софи Лелуш', 'Элис Тальони, Патрик Брюэль, Марина Дельтерм, Луи-До де Ланкесэ, Мишель Омон, Мари-Кристин Адам, Янник Соулер, Марго Чатели, Арсен Моска, Глэдис Коэн'),
(58, 3, 'До своей карьеры терапевта, Чарли был в тупике из-за отсутствия перспектив в низшей бейсбольной лиге. Проблема неумения контролировать свой гнев сбила его с пути в высшую лигу. После прохождения курса терапии по борьбе с гневом, он вывел свою команду в высшую лигу и провел один потрясающий сезон, прежде чем старые проблемы вновь не напомнили о себе. В своем финальном матче он пытался ударить себя битой по ноге, в результате чего получил травму, которая положила конец его карьере. ', '\r\n\r\nНо в итоге эта же травма привела его к нынешней профессии. В то время как Чарли борется со своим гневом, в его жизни процветает хаос. Всё осложняется его отношениями с собственным терапевтом и лучшим другом, бывшей женой, чьи позитивные взгляды на будущее, но при этом плохой выбор мужчин, расстраивают Чарли и их 13-летнюю дочь, имеющую психические расстройства.', 0, 'Управление гневом', 'Upravlenie_gnevom', 'Anger Management', '0000-00-00', 2012, 2012, 'неизвестно', 'США', 12, 0, 0, '22 мин', 'Боб Коэрр, Энди Кэдифф, Джерри Коэн', ' Чарли Шин, Майкл Арден, Сэльма Блэр, Даниела Бобадилла, Бэрри Корбин, Норин ДеВулф, Стивен Тейлор, Бретт Батлер, Альдо Гонзалез, Дерек Ричардсон'),
(59, 3, 'Действие происходит в современном Портленде, где детектив из отдела убийств узнаёт, что он является потомком группы охотников, известных как «Гриммы», которые сражаются, чтобы сохранить человечество в безопасности от сверхъестественных существ. Узнав о своей судьбе, и том, что он является последним из своего рода, он должен защитить каждую живую душу от зловещих персонажей сборника сказок, которые проникли в реальный мир.', 'Действие происходит в современном Портленде, где детектив из отдела убийств узнаёт, что он является потомком группы охотников, известных как «Гриммы», которые сражаются, чтобы сохранить человечество в безопасности от сверхъестественных существ. Узнав о своей судьбе, и том, что он является последним из своего рода, он должен защитить каждую живую душу от зловещих персонажей сборника сказок, которые проникли в реальный мир.', 0, 'Гримм', 'Grimm', 'Grimm', '0000-00-00', 2011, 2011, 'США', 'неизвестно', 27, 30, 9, '42 мин', 'Норберто Барба, Терренс О’Хара, Холли Дэйл', 'Дэвид Гвинтоли, Битси Таллоч, Сайлас Уэйр, Митчелл Расселл Хорнсби, Саша Ройз');
INSERT INTO `data` (`id`, `cat`, `shot_text`, `all_text`, `view`, `name_ru`, `tname`, `name_en`, `date`, `fyear`, `lyear`, `strana`, `budget`, `genre1`, `genre2`, `genre3`, `time`, `director`, `in_role`) VALUES
(60, 2, 'Однажды, несколько тысяч лет тому назад, две планеты притянулись друг к другу. Там правили мир и гармония. Но стоило верхнему миру обрести уверенность и власть, как между планетами началось противостояние. Казалось, ничто не может примирить параллельные миры.', 'Она — дочь президента верхнего мира. Эта хрупкая девушка с сильным характером и не подозревала, что душа ее способна любить. Он — ее половина. Их встреча была предопределена свыше, их судьбы переплелись воедино. Сможет ли Он, вопреки законам физики своего мира, быть вместе со своей любимой?', 0, 'Параллельные миры', 'miry', 'Upside Down', '0000-00-00', 2012, 2012, 'Канада, Франция', '$72 000 000', 30, 16, 0, '113 мин', 'Хуан Диего Соланас', 'Кирстен Данст, Джим Стёрджесс, Нил Напье, Стелла Маив, Джэйн Хейтмейер, Ларри Дэй, Джон МакЛарен, Дон Джордан, Холли О’Брайэн, Агнешка Вроновска'),
(61, 2, 'Мечи пересекутся и сердца будут разбиты в приключениях с одним из самых любимых персонажей из Шрэка — котом в сапогах. Это удалая поездка ранних лет кота в сапогах, когда он объединяется с умным Шалтай-Болтаем и сообразительной Кисой, чтобы украсть знаменитую Гусыню, несущую золотые яйца.', 'Мечи пересекутся и сердца будут разбиты в приключениях с одним из самых любимых персонажей из Шрэка — котом в сапогах. Это удалая поездка ранних лет кота в сапогах, когда он объединяется с умным Шалтай-Болтаем и сообразительной Кисой, чтобы украсть знаменитую Гусыню, несущую золотые яйца.', 0, 'Кот в сапогах', 'Kot_v_sapogah', 'Puss in Boots', '0000-00-00', 2011, 2011, 'США ', '$130 000 000', 18, 23, 21, '90 мин', 'Крис Миллер', 'Антонио Бандерас, Сальма Хайек, Билли Боб Торнтон, Констанс Мари, Уолт Дорн, Эми Седарис, Алекс Мендоза и другие.'),
(62, 2, 'В провинциальном городке на местном ТВ прозябают два друга — Ширяев и Молоток, и их коллега — красавица Надя. Все трое мечтают разбогатеть и стать столичными звездами. Неожиданно им в голову приходит идея: устроить реалити-шоу, участники которого должны отыскать золото Колчака. Одержимые жадностью герои шоу пускаются в гонку за кладом на самолетах, поездах и автомобилях. В пути их ждут сумасшедшие приключения, и все они еще не знают главного секрета…', 'В провинциальном городке на местном ТВ прозябают два друга — Ширяев и Молоток, и их коллега — красавица Надя. Все трое мечтают разбогатеть и стать столичными звездами. Неожиданно им в голову приходит идея: устроить реалити-шоу, участники которого должны отыскать золото Колчака. Одержимые жадностью герои шоу пускаются в гонку за кладом на самолетах, поездах и автомобилях. В пути их ждут сумасшедшие приключения, и все они еще не знают главного секрета…', 0, 'Большая ржака!', 'Bolshaya_rjaka!', '-', '0000-00-00', 2012, 2012, 'Россия', '$593 814', 12, 0, 0, '80 мин', 'Виталий Москаленко', 'Сергей Писаренко, Евгений Никишин, Анна Семенович, Александр Семчев, Сергей Дорогов, Александр Робак, Владимир Зайцев, Александра Флоринская, Михаил Владимиров, Ирина Медведева'),
(63, 2, 'Уличный танцор Эш жаждет реванша за проигрыш на конкурсе Streetdance, и хочет собрать команду, которой не будет равных. В поисках, которые забрасывают его в самые разные уголки мира, Эш встречает девушку Еву, танцующую сальсу, и влюбляется в нее. В Еве он видит свое счастье, свой собственный танец, свою победу… Но завоевать сердце этой девушки не так просто.', 'Уличный танцор Эш жаждет реванша за проигрыш на конкурсе Streetdance, и хочет собрать команду, которой не будет равных. В поисках, которые забрасывают его в самые разные уголки мира, Эш встречает девушку Еву, танцующую сальсу, и влюбляется в нее. В Еве он видит свое счастье, свой собственный танец, свою победу… Но завоевать сердце этой девушки не так просто.\r\n\r\nСвобода самовыражения и мастерство импровизации, страсть сальсы и дерзость ринга — все это танцы, танцы, танцы — в школах, в клубах, на улицах Рима, Парижа, Лондона, Нью-Йорка.', 0, 'Уличные танцы 2', 'Ulichnye_tancy_2', 'dance', '0000-00-00', 2012, 2012, 'Германия / Великобритания', '£7 000 000', 16, 0, 0, '85 мин', 'Макс Джива, Дания Пасквини', 'София Бутелла, Джордж Сэмпсон, Том Конти, Фальк Хеншел, Стефани Нгуйен, Элла Рэгг, Джоанна Джеффрис, Джеймс Майкл Ранкин, Ли Крэвен, Элизабетта Ди Карло'),
(64, 2, 'Переспав с «очень плохой училкой» прямо в школе, тинейджер становится отцом «по залету», а его зрелая пассия попадает в тюрьму за совращение малолетнего. Теперь юный папа-одиночка вынужден заботиться о сыне до его совершеннолетия, а затем благополучно исчезает в неизвестном направлении. И вот, много лет спустя, оказавшись на мели, эксцентричный папаша-инфантил словно ураган врывается в жизнь сына накануне его свадьбы и своими безумными выходками переворачивает всё вверх дном.', 'Переспав с «очень плохой училкой» прямо в школе, тинейджер становится отцом «по залету», а его зрелая пассия попадает в тюрьму за совращение малолетнего. Теперь юный папа-одиночка вынужден заботиться о сыне до его совершеннолетия, а затем благополучно исчезает в неизвестном направлении. И вот, много лет спустя, оказавшись на мели, эксцентричный папаша-инфантил словно ураган врывается в жизнь сына накануне его свадьбы и своими безумными выходками переворачивает всё вверх дном.', 0, 'Папа-досвидос', 'Papa-dosvidos', 'Thats My Boy', '0000-00-00', 2012, 2012, 'США', '$70 000 000', 12, 0, 0, '116 мин', 'Шон Андерс', 'Адам Сэндлер, Энди Сэмберг, Лейтон Мистер, Майло Вентимилья, Ванилла Айс, Пегги Стюарт, Блейк Кларк, Меган Фэй, Тони Орландо, Джеймс Каан'),
(65, 3, 'Героини «Деффчонок» — четыре подруги: мечтательная неудачница Маша, ее 16-летняя сестра Василиса, очкастый офисный планктон Катя и профессиональная блондинка Леля. Каждая хочет от жизни своего: успешной карьеры, правильного замужества, вселенской популярности…', 'Героини «Деффчонок» — четыре подруги: мечтательная неудачница Маша, ее 16-летняя сестра Василиса, очкастый офисный планктон Катя и профессиональная блондинка Леля. Каждая хочет от жизни своего: успешной карьеры, правильного замужества, вселенской популярности…\r\n\r\nСпособов стать счастливой миллион! Одна беда — в жизни все гораздо сложнее, чем в мечтах. Если ты попала на прослушивание к крутому продюсеру, это еще не значит, что тебя сделают звездой. Если заклеила депутата с Рублевки — далеко не факт, что он не слиняет от тебя в Лондон. Бурные ночи с поп-идолом еще не дают гарантии, что он захочет на тебе жениться. А когда ты влюбляешься в начальника, будь готова к тому, что он начнет играть твоими чувствами ради бизнеса.\r\n\r\nСложность еще и в том, что подруги снимают одну на всех квартиру. Ведь все они приехали из Саратова, и родственников в столице у них нет. Жить вчетвером в одном шалаше — вот настоящая беда, в которой познаются друзья. Или это счастье, а не беда вовсе? Ответ на этот и еще 999 вопросов предстоит найти нашим героиням.', 0, 'Деффчонки', 'Deffchonki', 'Deffchonki', '0000-00-00', 2012, 2012, 'Россия', 'неизвестно', 12, 0, 0, '24 мин', 'Сергей Корягин, Ольга Френкель, Нигина Сайфуллаева', 'Галина Боб, Анастасия Денисова, Полина Максимова, Таисия Вилкова, Родион Юрин, Алексей Воробьев, Александр Серов, Наталья Унгард, Тимур Боканча, Софья Урицкая'),
(66, 2, 'Агент Джей узнает, что никакого защитного галактического щита, способного отразить иноземный удар, не существует. Агент Кей не построил его, потому что был убит в 1969 году. Агент Джей должен совершить путешествие во времени, чтобы спасти Землю и жизнь напарника.', 'Агент Джей узнает, что никакого защитного галактического щита, способного отразить иноземный удар, не существует. Агент Кей не построил его, потому что был убит в 1969 году. Агент Джей должен совершить путешествие во времени, чтобы спасти Землю и жизнь напарника.', 0, 'Люди в черном 3', 'Lyudi_v_chernom_3', 'Men in Black 3', '0000-00-00', 2012, 2012, 'США', '$225 000 000', 28, 12, 3, '106 мин', 'Барри Зонненфельд', 'Уилл Смит, Джош Бролин, Томми Ли Джонс, Джемейн Клемент, Эмма Томпсон, Майкл Стулбарг, Майк Колтер, Николь Шерзингер, Майкл Чернус, Элис Ив'),
(67, 2, 'Испания, море, яхта — отпуск с поднадоевшей молодому Уиллу Шоу компанией родственников… Никто не мог предположить, что уже через несколько часов палуба яхты обагрится кровью, а члены семьи Шоу станут заложниками в руках неизвестных. В поисках родных Уилл невольно узнает о государственном заговоре и раскрывает тайны своего отца. У парня всего несколько часов, чтобы спасти семью и страну от гибели.', 'Испания, море, яхта — отпуск с поднадоевшей молодому Уиллу Шоу компанией родственников… Никто не мог предположить, что уже через несколько часов палуба яхты обагрится кровью, а члены семьи Шоу станут заложниками в руках неизвестных. В поисках родных Уилл невольно узнает о государственном заговоре и раскрывает тайны своего отца. У парня всего несколько часов, чтобы спасти семью и страну от гибели.', 0, 'Средь бела дня', 'Sred_bela_dnya', 'The Cold Light of Day', '0000-00-00', 2011, 2011, 'США, Испания', '$10 968 746', 3, 0, 26, '93 мин', 'Мабрук Эль Мекри', 'Генри Кавилл, Сигурни Уивер, Брюс Уиллис, Вероника Эчеги, Джозеф Моул, Кэролайн Гудолл, Рафи Гаврон, Эмма Хэмилтон, Майкл Бадд, Рошди Зем'),
(68, 2, 'Лента расскажет о пойманном мексиканскими властями преступнике, заключенном в полную наркотиков и насилия тюрьму…', 'Лента расскажет о пойманном мексиканскими властями преступнике, заключенном в полную наркотиков и насилия тюрьму…', 0, '«Весёлые» каникулы', 'Veselye_kanikuly', 'Get the Gringo', '0000-00-00', 2012, 2012, 'США', '$20 000 000', 3, 9, 26, '96 мин', 'Адриан Грюнберг', 'Мэл Гибсон, Кевин Эрнандез, Долорес Эредия, Хесус Очоа, Петер Стормаре, Дин Норрис, Боб Гантон, Скотт Коэн, Патрик Бошо, Стефани Николь Лемелин'),
