(72, 2, 'Сюжет фильма разворачивается вокруг дружной компании соседей, организовавших дружину ради патрулирования окрестностей и поддержания порядка. В действительности благие намерения были лишь поводом хотя бы изредка сбегать от семьи, дабы покутить вечерком в сугубо мужской компании. Безоблачная жизнь заканчивается в тот момент, когда соседский дозор случайно узнаёт о заговоре с целью уничтожить мир.', 'Сюжет фильма разворачивается вокруг дружной компании соседей, организовавших дружину ради патрулирования окрестностей и поддержания порядка. В действительности благие намерения были лишь поводом хотя бы изредка сбегать от семьи, дабы покутить вечерком в сугубо мужской компании. Безоблачная жизнь заканчивается в тот момент, когда соседский дозор случайно узнаёт о заговоре с целью уничтожить мир.', 0, 'Дружинники ', 'Drujinniki ', 'The Watch', '0000-00-00', 2012, 2012, 'США', '$68 000 000', 28, 0, 12, '102 мин', 'Акива Шаффер', ' Джона Хилл, Бен Стиллер, Винс Вон, Розмари ДеУитт, Билли Крудап, Ричард Айоаде, Р. Ли Эрми, Уилл Форте, Даг Джонс, Йорма Такконе...'),
