(76, 2, 'В этой мрачной и романтичной мистической истории женщина едет в уединённое место, где она обнаруживает, что её преследует некто, появившийся, чтобы пребывать в этом месте как в его собственном. С неожиданным прибытием друга женщины, темный дух становится более агрессивным. Вскоре женщина начинает проявлять удачливость и неразумность, находясь на тонкой линии между здравомыслием и самообладанием, но постепенно распутывает клубок сложившейся интриги.', 'В этой мрачной и романтичной мистической истории женщина едет в уединённое место, где она обнаруживает, что её преследует некто, появившийся, чтобы пребывать в этом месте как в его собственном. С неожиданным прибытием друга женщины, темный дух становится более агрессивным. Вскоре женщина начинает проявлять удачливость и неразумность, находясь на тонкой линии между здравомыслием и самообладанием, но постепенно распутывает клубок сложившейся интриги.', 0, 'Присутствие', 'Prisutstvie', 'The Presence', '0000-00-00', 2010, 2010, 'США', '-', 26, 0, 9, '83 мин', 'Том Провост', 'Мира Сорвино, Шейн Вест, Джастин Кирк, Тони Курран, Мьюз Уотсон, Деобиа Опареи и др.'),
(77, 2, 'Cпасти карьеру некогда знаменитого телеведущего Дэна Джеральдо может лишь одно — сенсация. В поисках жареных фактов журналист отправляется в таинственную страну Паломбию. С помощью неутомимого местного авантюриста Паблито он выходит на след самого загадочного существа на Земле — рыжего и пушистого, сумчатого и хвостатого зверя Марсупилами. Обаятельнейшее животное каким-то непостижимым образом связано с тайной вечной молодости, и на него объявлена настоящая охота. Путешественникам придется спасти Марсупилами от безумных ученых, грозных военных, алчных браконьеров и прочих напастей, которые таят джунгли.', 'Cпасти карьеру некогда знаменитого телеведущего Дэна Джеральдо может лишь одно — сенсация. В поисках жареных фактов журналист отправляется в таинственную страну Паломбию. С помощью неутомимого местного авантюриста Паблито он выходит на след самого загадочного существа на Земле — рыжего и пушистого, сумчатого и хвостатого зверя Марсупилами. Обаятельнейшее животное каким-то непостижимым образом связано с тайной вечной молодости, и на него объявлена настоящая охота. Путешественникам придется спасти Марсупилами от безумных ученых, грозных военных, алчных браконьеров и прочих напастей, которые таят джунгли.', 0, 'Джунгли зовут! В поисках Марсупилами', 'Djungli_zovut!_V_poiskah_Marsupilami', 'Sur la piste du Marsupilami', '0000-00-00', 2012, 2012, 'Франция, Бельгия', '€40 000 000', 12, 23, 21, '105 мин', 'Ален Шаба', 'Жамель Деббуз, Ален Шаба, Фред Тесто, Ламбер Вильсон, Жеральдин Накаш, Лия Кебеде, Патрик Тимсит, Жак Вебер, Айсса Майга, Далип Синх'),
(78, 2, 'Это подробная и глубокая картина о жизни украинских боксеров, материалы для которой собирались в течение двух лет. По словам самих спортсменов, это «материалы из разных уголков планеты, тех мест, которые очень важны для нас». География съемок, которые начались еще в 2008 году, большая — от Украины и Казахстана в США. В фильм вошли интервью с братьями, их родными и друзьями, коллегами и единомышленниками, уникальные кадры из домашнего архива.', 'Это подробная и глубокая картина о жизни украинских боксеров, материалы для которой собирались в течение двух лет. По словам самих спортсменов, это «материалы из разных уголков планеты, тех мест, которые очень важны для нас». География съемок, которые начались еще в 2008 году, большая — от Украины и Казахстана в США. В фильм вошли интервью с братьями, их родными и друзьями, коллегами и единомышленниками, уникальные кадры из домашнего архива.', 0, 'Кличко', 'Klichko', 'Klitschko', '0000-00-00', 2011, 2011, 'Германия', 'неизвестно', 31, 2, 24, '118 мин', 'Себастьян Денхардт', 'Виталий Кличко, Владимир Кличко, Фриц Здунек, Эмануэл Стюарт, Леймон Брюстер, Крис Бёрд, Bernd Bönte, Др. Перлман Хикс, Дон Кинг, Надежда Кличко'),
(79, 2, 'На острове Мён недалеко от скал Монс Клинт молодая пара купила дом. В тот же день со скалы падает какой то человек. Через пару дней оказывается, что их с виду хороший дом на самом деле почти разваливается и требует срочного капитального ремонта. Вечером к ним заявляется местный мастер на все руки и предлагает все починить быстро и почти даром.', 'На острове Мён недалеко от скал Монс Клинт молодая пара купила дом. В тот же день со скалы падает какой то человек. Через пару дней оказывается, что их с виду хороший дом на самом деле почти разваливается и требует срочного капитального ремонта. Вечером к ним заявляется местный мастер на все руки и предлагает все починить быстро и почти даром.', 0, 'За гранью', 'Over kanten', 'Za_granyu', '0000-00-00', 2012, 2012, 'Дания', 'неизвестно', 26, 0, 0, '99 мин', 'Laurits Munch-Petersen, Jacob Ditlev', 'Джонатан Спанг, Кристиан Шамбург-Мюллер, Андерс Хове, Троэльс Любю, Анне Луизе Хассинг, Эльсебет Стеэнтофт...'),
(80, 3, 'Фильм о сложных, драматичных, подчас героических буднях врачей главного института скорой помощи — знаменитого «Склифа». Их работа — испытание на прочность, каждый день они дают кому-то вторую жизнь…', 'Фильм о сложных, драматичных, подчас героических буднях врачей главного института скорой помощи — знаменитого «Склифа». Их работа — испытание на прочность, каждый день они дают кому-то вторую жизнь…\r\n\r\nВ центре истории — непростые отношения хирурга Олега Брагина, блестящего врача, умного, жесткого и харизматичного, но давно отчаявшегося найти в жизни что-то настоящее, кроме работы, и начальницы Ларисы — сумевшей сквозь цинизм Брагина разглядеть потерянного в жизни и одинокого человека…', 0, 'Склифосовский', 'Sklifosovskii', 'net', '0000-00-00', 2012, 2012, 'Россия', 'неизвестно', 9, 16, 0, '43 мин', 'Андрей Селиванов', 'Максим Аверин, Дмитрий Миллер, Евгений Галушко, Ольга Красько, Мария Кожевникова, Ольга Павловец, Екатерина Травова, Антон Эльдаров'),
(81, 2, 'Добро пожаловать в мир, где время стало единственной и самой твердой валютой, где люди генетически запрограммированы так, что в 25 лет перестают стареть. Правда, последующие годы стоят денег. И вот богатые становятся практически бессмертными, а бедные, как всегда, обречены сражаться за жизнь.', 'Добро пожаловать в мир, где время стало единственной и самой твердой валютой, где люди генетически запрограммированы так, что в 25 лет перестают стареть. Правда, последующие годы стоят денег. И вот богатые становятся практически бессмертными, а бедные, как всегда, обречены сражаться за жизнь.', 0, 'Время', 'Vremya', 'In Time', '0000-00-00', 2011, 2011, 'США', '$40 000 000', 28, 9, 26, '109 мин', 'Эндрю Никкол', 'Джастин Тимберлэйк, Аманда Сайфред, Киллиан Мёрфи, Алекс Петтифер, Винсент Картайзер, Джонни Галэки, Коллинс Пенни, Тоби Хемингуэй, Оливия Уайлд, Шайло Уствальд.'),
(82, 2, 'Волею случая конгрессмен Дэвид Норрис узнает, что мир движется по заранее написанному плану, за исполнением которого следят работающие в неком Бюро Корректировки люди в шляпах, обладающие сверхъестественными способностями. Как назло, план не предусматривает дальнейших пересечений с балериной Элизой, в которую политик влюблен. Дэвид заручается поддержкой одного из агентов Бюро и начинает неравную борьбу с остальными, отстаивая свободу выбора и личное счастье…', 'Волею случая конгрессмен Дэвид Норрис узнает, что мир движется по заранее написанному плану, за исполнением которого следят работающие в неком Бюро Корректировки люди в шляпах, обладающие сверхъестественными способностями. Как назло, план не предусматривает дальнейших пересечений с балериной Элизой, в которую политик влюблен. Дэвид заручается поддержкой одного из агентов Бюро и начинает неравную борьбу с остальными, отстаивая свободу выбора и личное счастье…', 0, 'Меняющие реальность', 'Menyayuschie_realnost', 'The Adjustment Bureau', '0000-00-00', 2011, 2011, 'США', '$51 000 000', 28, 16, 26, '105 мин', 'Джордж Нолфи', 'Мэтт Дэймон, Эмили Блант, Энтони Маки, Джон Слэттери, Теренс Стэмп, Майкл Келли, Лиза Торсон, Флоренс Кастринер, Филис Макбрид, Натали Картер.'),
(83, 2, 'Это история четырех отцов, четырех дочерей и четырех претендентов стать зятьями и, как предполагает вторая половина названия, они все и являются грязной дюжиной. Каждый из этих отцов хочет, чтобы его дочь вышла замуж за самого богатого наследника. Каждая дочь думает, что она выходит замуж за сына самого богатого человека. Каждый сын притворяется самым богатым наследником. Тем не менее, все эти люди терпеть не могут друг друга, но все они находятся под одной крышей, в одном доме.', 'Это история четырех отцов, четырех дочерей и четырех претендентов стать зятьями и, как предполагает вторая половина названия, они все и являются грязной дюжиной. Каждый из этих отцов хочет, чтобы его дочь вышла замуж за самого богатого наследника. Каждая дочь думает, что она выходит замуж за сына самого богатого человека. Каждый сын притворяется самым богатым наследником. Тем не менее, все эти люди терпеть не могут друг друга, но все они находятся под одной крышей, в одном доме.', 0, 'Полный дом 2', 'Polnyi_dom_2', 'Housefull 2', '0000-00-00', 2012, 2012, 'Индия', 'INR 450 000 000', 12, 0, 0, '145 мин', 'Саджид Кхан', 'Акшай Кумар, Асин, Джон Абрахам, Жаклин Фернандес, Шреяс Талпаде, Шазан Падамси, Ритеш Дешмукх'),
(84, 3, 'Старшеклассницу Котоко Айхару угораздило навсегда отдать девичье сердечко Наоки Ириэ, суперзвезде школы. Два года влюбленная девушка изо всех сил пыталась пробиться наверх, в вожделенный класс «А», где учится любимый, но в итоге так и осталась в школьном «болоте». Мягко говоря, человек она хороший, только не дано… Наступил последний, выпускной год.', 'Старшеклассницу Котоко Айхару угораздило навсегда отдать девичье сердечко Наоки Ириэ, суперзвезде школы. Два года влюбленная девушка изо всех сил пыталась пробиться наверх, в вожделенный класс «А», где учится любимый, но в итоге так и осталась в школьном «болоте». Мягко говоря, человек она хороший, только не дано… Наступил последний, выпускной год.', 0, 'Озорной поцелуй', 'Ozornoi_pocelui', 'Itazura na kisu', '0000-00-00', 2008, 2008, 'Япония', '-', 1, 9, 18, '25 мин', 'Осаму Ямазаки', 'Дайсукэ Хиракава, Наоко Матсуи, Томоми Мияучи, Нана Мидзуки, Такаси Нагасако.'),
(85, 3, 'Альтернативная Англия XIX-го века, роскошное поместье графа Фантомхайва, дружная компания нерасторопных слуг, над которыми возвышается безупречный Себастьян. Юный граф Сиэль любит разные игры, и многочисленные способности дворецкого то и дело находят себе применение. Ведь эти двое заключили важный контракт, который касается не только кулинарных талантов Себастьяна.', 'Альтернативная Англия XIX-го века, роскошное поместье графа Фантомхайва, дружная компания нерасторопных слуг, над которыми возвышается безупречный Себастьян. Юный граф Сиэль любит разные игры, и многочисленные способности дворецкого то и дело находят себе применение. Ведь эти двое заключили важный контракт, который касается не только кулинарных талантов Себастьяна.', 0, 'Темный дворецкий', 'Temnyi_dvoreckii', 'Kuroshitsuji', '0000-00-00', 2008, 2010, 'Япония', '-', 1, 9, 18, '25 мин', 'Тошия Синохара', 'Брина Паленсиа, Дж. Майкл Татум, Дайсукэ Оно, Маая Сакамото, Дзюн Фукуяма, Пак Роми, Сюндзи Фуджимура, Юкари Тамура, Хироки Тоти, Эмири Като.'),
(88, 2, 'Действие фильма происходит в 19-м веке, во время гражданской войны в США. Данбар оказывается в заброшенном форте в штате Дакота, где сначала заводит дружбу с волками, а затем и с индейцами, изучает их культуру и обычаи. Он влюбляется в девушку, правда, белую. Но вот приближается регулярная армия, и Данбару приходится делать решающий выбор.', 'Действие фильма происходит в 19-м веке, во время гражданской войны в США. Данбар оказывается в заброшенном форте в штате Дакота, где сначала заводит дружбу с волками, а затем и с индейцами, изучает их культуру и обычаи. Он влюбляется в девушку, правда, белую. Но вот приближается регулярная армия, и Данбару приходится делать решающий выбор.', 0, 'Танцующий с волками', 'Tancuyuschii_s_volkami', 'Dances with Wolves', '0000-00-00', 1990, 1990, 'США, Великобритания', '$22 000 000', 21, 9, 4, '236 мин', 'Кевин Костнер', 'Кевин Костнер, Мэри МакДоннелл, Грэм Грин, Родни Грант, Флойд Вестерман, Уэс Стьюди');
INSERT INTO `data` (`id`, `cat`, `shot_text`, `all_text`, `view`, `name_ru`, `tname`, `name_en`, `date`, `fyear`, `lyear`, `strana`, `budget`, `genre1`, `genre2`, `genre3`, `time`, `director`, `in_role`) VALUES
(89, 2, 'Фильм рассказывает о героической обороне Брестской крепости, которая приняла на себя первый удар немецко-фашистских захватчиков 22 июня 1941 года. С документальной точностью описываются события, происходившие в первые дни обороны. Фильм рассказывает о главных трёх очагах сопротивления, возглавляемых командиром полка Петром Гавриловым, комиссаром Ефимом Фоминым и начальником 9-й погранзаставы Андреем Кижеватовым.', 'Фильм рассказывает о героической обороне Брестской крепости, которая приняла на себя первый удар немецко-фашистских захватчиков 22 июня 1941 года. С документальной точностью описываются события, происходившие в первые дни обороны. Фильм рассказывает о главных трёх очагах сопротивления, возглавляемых командиром полка Петром Гавриловым, комиссаром Ефимом Фоминым и начальником 9-й погранзаставы Андреем Кижеватовым.', 0, 'Брестская крепость', 'Brestskaya_krepost', 'неизвестно', '0000-00-00', 2010, 2010, 'Россия, Беларусь', '225 000 000 руб.', 5, 9, 0, '131 мин', 'Александр Котт', 'Алексей Копашов, Андрей Мерзликин, Павел Деревянко, Александр Коршунов, Евгений Цыганов, Максим Костромыкин, Анатолий Кот, Яна Есипович, Сергей Цепов, Анна Цуканова'),
(90, 2, 'История о нелегких буднях элитной группы «морские котики», которым поручено вытащить из плена агентов ЦРУ. Выполняя задание, бойцы попутно уничтожают террористическую группу, в планы которой входила масштабная атака на США.', 'История о нелегких буднях элитной группы «морские котики», которым поручено вытащить из плена агентов ЦРУ. Выполняя задание, бойцы попутно уничтожают террористическую группу, в планы которой входила масштабная атака на США.', 0, 'Закон доблести', 'Zakon_doblesti', 'неизвестно', '0000-00-00', 2012, 2012, 'США', '$12 000 000', 5, 21, 3, '110 мин', 'Майк МакКой, Скотт Во', 'Джейсон Коттл, Нестор Серрано, Айлса Маршалл, Гонсало Менендес, Эмилио Ривера, Димитар Маринов'),
(91, 3, 'Это яркая история жизни и любви девушки Кати. Предательство отца в юности сломало ей жизнь. Очутившись в западне, без сил и возможности что-либо изменить, Катя научилась сопротивляться. Она всем и себе доказала, что смелость города берет, а вера и верность — самое надежное оружие...', 'Это яркая история жизни и любви девушки Кати. Предательство отца в юности сломало ей жизнь. Очутившись в западне, без сил и возможности что-либо изменить, Катя научилась сопротивляться. Она всем и себе доказала, что смелость города берет, а вера и верность — самое надежное оружие. Пройдя через ряд невероятных испытаний, она победила коварных врагов и отвоевала свое право быть счастливой в окружении самых родных и близких людей: любимого мужчины и дочери.', 0, 'Катина любовь 2', 'Katina_lyubov_2', 'неизвестно', '0000-00-00', 2012, 2012, 'Россия', 'неизвестно', 16, 0, 0, '43 мин', 'Дмитрий Гольдман', 'Ольга Павловец, Дмитрий Пчела, Юрий Цурило, Ольга Дроздова'),
(92, 2, 'Фильм об экстремальном спорте и сноубординге. Группа сноубордистов во главе с Трэвисом Райсом воплощает свои самые смелые мечты в реальность, отправляется в глобальные приключения и поднимает сноубординг на новые, невообразимые уровни.', 'Фильм об экстремальном спорте и сноубординге. Группа сноубордистов во главе с Трэвисом Райсом воплощает свои самые смелые мечты в реальность, отправляется в глобальные приключения и поднимает сноубординг на новые, невообразимые уровни.', 0, 'Искусство полета', 'Iskusstvo_poleta', 'The Art of Flight', '0000-00-00', 2011, 2011, 'США', '$2 000 000', 31, 24, 21, '80 мин', 'Курт Морган', 'Джейк Бловелт, Джон Джексон, Джереми Джонс, Скотти Лаго, Mark Landvik, Пэт Мур, Николас Мюллер, Eero Niemela, David Carrier Porcheron, Трэвис Райс.'),
(93, 2, 'Кобб — талантливый вор, лучший из лучших в опасном искусстве извлечения: он крадет ценные секреты из глубин подсознания во время сна, когда человеческий разум наиболее уязвим. Редкие способности Кобба сделали его ценным игроком в привычном к предательству мире промышленного шпионажа, но они же превратили его в извечного беглеца и лишили всего, что он когда-либо любил.', 'Кобб — талантливый вор, лучший из лучших в опасном искусстве извлечения: он крадет ценные секреты из глубин подсознания во время сна, когда человеческий разум наиболее уязвим. Редкие способности Кобба сделали его ценным игроком в привычном к предательству мире промышленного шпионажа, но они же превратили его в извечного беглеца и лишили всего, что он когда-либо любил.', 0, 'Начало', 'Nachalo', 'Inception', '0000-00-00', 2010, 2010, 'США, Великобритания', '$160 000 000', 28, 26, 3, '148 мин', 'Кристофер Нолан', 'Леонардо ДиКаприо, Джозеф Гордон-Левитт, Эллен Пейдж, Том Харди, Кен Ватанабе, Дилип Рао, Киллиан Мёрфи, Том Беренджер, Марион Котийяр, Пит Постлетуэйт.'),
(94, 2, 'Американский Юг, на дворе 1960-е годы. Скитер только-только закончила университет и возвращается домой, в сонный городок Джексон, где никогда ничего не происходит. Она мечтает стать писательницей, вырваться в большой мир. Но для приличной девушки с Юга не пристало тешиться столь глупыми иллюзиями, приличной девушке следует выйти замуж и хлопотать по дому.', 'Американский Юг, на дворе 1960-е годы. Скитер только-только закончила университет и возвращается домой, в сонный городок Джексон, где никогда ничего не происходит. Она мечтает стать писательницей, вырваться в большой мир. Но для приличной девушки с Юга не пристало тешиться столь глупыми иллюзиями, приличной девушке следует выйти замуж и хлопотать по дому.\r\n\r\nМудрая Эйбилин на тридцать лет старше Скитер, она прислуживает в домах белых всю свою жизнь, вынянчила семнадцать детей и давно уже ничего не ждет от жизни, ибо сердце ее разбито после смерти единственного сына.\r\n\r\nМинни — самая лучшая стряпуха во всем Джексоне, а еще она самая дерзкая служанка в городе. И острый язык не раз уже сослужил ей плохую службу. На одном месте Минни никогда подолгу не задерживается. Но с Минни лучше не связываться даже самым высокомерным белым дамочкам. Двух черных служанок и белую неопытную девушку объединяет одно — обостренное чувство справедливости и желание хоть как-то изменить порядок вещей. Смогут ли эти трое противостоять целому миру? Сумеют ли они выжить в этой борьбе?\r\nРейтинг фильма', 0, 'Прислуга', 'Prisluga', 'The Help', '0000-00-00', 2011, 2011, 'США, Индия, ОАЭ', '$25 000 000', 9, 0, 0, '146 мин', 'Тейт Тейлор', 'Эмма Стоун, Брайс Даллас Ховард, Виола Дэвис, Октавия Спенсер, Джессика Честейн, Ана О’Райли, Эллисон Джэнни, Анна Кэмп, Элинор Генри, Эмма Генри.'),
(95, 2, 'Актеры Серега, Женечка и Эндрю, устав ждать, когда удача отыщет на карте их уездный город, приезжают покорять Москву. Выступление на корпоративе у Мафии производит такой фурор, что Босс Мафии умирает от смеха. Спасаясь от Мафии, Киллеров и Спецслужб, друзьям приходится угнать старый автомобиль. Их ждут неожиданные встречи и опасные приключения. Ведь теперь они — не просто ЛОпуХИ, а настоящая Банда Бандитов…', 'Актеры Серега, Женечка и Эндрю, устав ждать, когда удача отыщет на карте их уездный город, приезжают покорять Москву. Выступление на корпоративе у Мафии производит такой фурор, что Босс Мафии умирает от смеха. Спасаясь от Мафии, Киллеров и Спецслужб, друзьям приходится угнать старый автомобиль. Их ждут неожиданные встречи и опасные приключения. Ведь теперь они — не просто ЛОпуХИ, а настоящая Банда Бандитов…', 0, 'ЛОпуХИ', 'LOpuHI', 'нет', '0000-00-00', 2009, 2009, 'Россия', '$1 500 000', 12, 0, 0, '85 мин', 'Сарик Андреасян', 'Сергей Писаренко, Евгений Никишин, Эндрю Нджогу, Дмитрий Нагиев, Михаил Горевой, Александр Баширов, Сергей Бурунов, Надежда Ручка, Михаил Полицеймако, Николай Наумов'),
(96, 2, 'Адвокаты Андрей и Вениамин — друзья, которых объединяет многое, но работа то и дело ставит их на разные стороны баррикад. Особенность их положения в том, что судебные процессы, в которых они участвуют, происходят не в земной жизни, а в загробной. Они — участники Небесного Суда, решающего, куда направить душу человека после смерти, в Рай или в Ад. В одно из дел неожиданно вмешиваются личные интересы Андрея: на скамью подсудимых попадает человек, сделавший предложение его вдове.\r\n', 'Адвокаты Андрей и Вениамин — друзья, которых объединяет многое, но работа то и дело ставит их на разные стороны баррикад. Особенность их положения в том, что судебные процессы, в которых они участвуют, происходят не в земной жизни, а в загробной. Они — участники Небесного Суда, решающего, куда направить душу человека после смерти, в Рай или в Ад. В одно из дел неожиданно вмешиваются личные интересы Андрея: на скамью подсудимых попадает человек, сделавший предложение его вдове.\r\n', 0, 'Небесный суд', 'Nebesnyi_sud', '-', '0000-00-00', 2012, 2012, 'Россия', '30 000 000 руб.', 9, 0, 0, '-', 'Алена Званцова', 'Константин Хабенский, Михаил Пореченков, Дмитрий Марьянов, Ингеборга Дапкунайте, Анна Михалкова, Никита Зверев, Олег Мазуров, Яна Сексте, Марина Дуксова, Даниэла Стоянович'),
(97, 2, '41-летняя Мари просыпается на свой день рождения, ничего не помня о своих последних пятнадцати годах жизни. Она обнаруживает себя матерью сына подростка, а ее брак находится на грани распада. Теперь в ограниченное время ей предстоит понять происходящее и попытаться исправить ситуацию.', '41-летняя Мари просыпается на свой день рождения, ничего не помня о своих последних пятнадцати годах жизни. Она обнаруживает себя матерью сына подростка, а ее брак находится на грани распада. Теперь в ограниченное время ей предстоит понять происходящее и попытаться исправить ситуацию.', 0, 'Жизнь другой', 'Jizn_drugoi', 'La vie dune autre', '0000-00-00', 2012, 2012, 'Франция, Люксембург, Бельгия', '$6 500 000', 9, 12, 16, '97 мин', 'Сильви Тестю', 'Жюльет Бинош, Матьё Кассовиц, Ор Атика, Даниель Лебрюн, Вернон Добчефф, Ив Дашари-Ле Беон, Франсуа Берлеан, Мари-Кристин Адам, Николас Карпентье, Альберт Спайнер и др.'),
(98, 2, 'Обладающий паранормальными способностями заурядный учитель Модесто может видеть мертвых людей. Это не принесло ему никаких успехов в жизни, скорее наоборот, из-за этого его каждый раз увольняют с работы.', 'Обладающий паранормальными способностями заурядный учитель Модесто может видеть мертвых людей. Это не принесло ему никаких успехов в жизни, скорее наоборот, из-за этого его каждый раз увольняют с работы. \r\n\r\nОднажды ему таки улыбается удача, и он устраивается работать в очень престижную элитную школу. Там его задачей становится обеспечить успешное окончание школы пяти трудным ученикам. Проблема лишь в том, что все они уже двадцать лет как мертвы, погибнув при охватившем школу пожаре. Для измученной пятеркой призраков директрисы школы единственной надеждой на долгожданное избавление от них становится неудачник Модесто.', 0, 'Призрачный выпускной', 'Призрачный_выпускной', 'Promoción fantasma', '0000-00-00', 2012, 2012, 'Испания', '-', 30, 21, 12, '88 мин', 'Хавьер Руис', 'Рауль Аревало, Александра Хименес, Хавьер Гонзалез, Анна Кастилло, Андреа Дуро, Аура Гарридо, Алекс Маруни, Хайме Олиас, Карлос Аресес, Сильвия АбрилСпайнер и др.'),
