(100, 2, 'Владелец поместья Коллинвуд, Барнабас Коллинз, богат, властен и слывет неисправимым Казановой, пока не совершает роковую ошибку, разбив сердце Анжелики Бошар. Будучи ведьмой в буквальном смысле этого слова, она обрекает его на судьбу, худшую, чем сама смерть — обращает его в вампира и хоронит заживо. Два века спустя Барнабаса случайно освобождают из склепа, и тот оказывается в очень изменившемся мире 1972 года. Он возвращается в Коллинвуд и находит в руинах это некогда величественное здание. Жалкие потомки его семьи сохранились лишь немногим лучше родового гнезда, и у каждого из них есть свои «скелеты в шкафу».', 'Владелец поместья Коллинвуд, Барнабас Коллинз, богат, властен и слывет неисправимым Казановой, пока не совершает роковую ошибку, разбив сердце Анжелики Бошар. Будучи ведьмой в буквальном смысле этого слова, она обрекает его на судьбу, худшую, чем сама смерть — обращает его в вампира и хоронит заживо. Два века спустя Барнабаса случайно освобождают из склепа, и тот оказывается в очень изменившемся мире 1972 года. Он возвращается в Коллинвуд и находит в руинах это некогда величественное здание. Жалкие потомки его семьи сохранились лишь немногим лучше родового гнезда, и у каждого из них есть свои «скелеты в шкафу».', 0, 'Мрачные тени', 'Mrachnye_teni', 'Dark Shadows', '0000-00-00', 2012, 2012, 'США', '$150 000 000', 30, 12, 16, '113 мин', 'Тим Бёртон', 'Джонни Депп, Мишель Пфайффер, Хелена Бонем Картер, Ева Грин, Джеки Эрл Хейли, Джонни Ли Миллер, Белла Хиткот, Хлоя Грейс Морец, Гулливер МакГрат'),
(101, 2, 'Бао и ее друг Нань репетируют новую пьесу. Но Бао так нервничает перед премьерой, что заболевает и не может выйти на сцену. Тогда ее заменяет в спектакле сестра-близняшка, про которую никто не знает в театре и блестяще выступает на сцене. Успех сестры заставляет страдать Бао от ревности и подозрений. Бао видит в ней угрозу своей карьере и даже своей любви к Наню. После ссоры между ними в грозовую ночь на море Бао становится другим человеком, а её сестра исчезает…', 'Бао и ее друг Нань репетируют новую пьесу. Но Бао так нервничает перед премьерой, что заболевает и не может выйти на сцену. Тогда ее заменяет в спектакле сестра-близняшка, про которую никто не знает в театре и блестяще выступает на сцене. Успех сестры заставляет страдать Бао от ревности и подозрений. Бао видит в ней угрозу своей карьере и даже своей любви к Наню. После ссоры между ними в грозовую ночь на море Бао становится другим человеком, а её сестра исчезает…', 0, 'Вторая женщина', 'Vtoraya_jenschina', 'Qing mi', '0000-00-00', 2012, 2012, 'Китай, Гонконг', '-', 26, 16, 9, '102 мин', 'Miu-suet Lai', 'Шу Чен, Ки Шу, Мей Хуан Кси, Шон Юе.'),
