(103, 2, 'Есть четыре персонажа — два копа и два преступника. Первый коп — молодой и борзый, он любит гонять по автостраде за нарушителями, поэтому на собственные деньги прокачивает свою патрульную машину. Второй — бывалый ветеран, три дня до пенсии. Он способен делать на дороге крутые штуки; знает, что молодой напарник еще не созрел для настоящего драйва, но предпочитает не лезть в бутылку без лишнего повода. Первый преступник — налетчик и стрелок, безжалостный убийца, профессиональный «гастролер». Он случайно попадает в гонконгский КПЗ, поэтому срочно вызывает с материка своего напарника. Напарник — опытный водила для гоп-стопов с 20-летним стажем — организует побег своего партнера. После кровавой бани, учиненной в стенах КПЗ, преступникам надо сделать последний большой гоп-стоп и сбежать из города, все выезды из которого перекрыты полицейскими патрулями.', 'Есть четыре персонажа — два копа и два преступника. Первый коп — молодой и борзый, он любит гонять по автостраде за нарушителями, поэтому на собственные деньги прокачивает свою патрульную машину. Второй — бывалый ветеран, три дня до пенсии. Он способен делать на дороге крутые штуки; знает, что молодой напарник еще не созрел для настоящего драйва, но предпочитает не лезть в бутылку без лишнего повода. Первый преступник — налетчик и стрелок, безжалостный убийца, профессиональный «гастролер». Он случайно попадает в гонконгский КПЗ, поэтому срочно вызывает с материка своего напарника. Напарник — опытный водила для гоп-стопов с 20-летним стажем — организует побег своего партнера. После кровавой бани, учиненной в стенах КПЗ, преступникам надо сделать последний большой гоп-стоп и сбежать из города, все выезды из которого перекрыты полицейскими патрулями.', 0, 'Автострада', 'Avtostrada', 'Che sau', '0000-00-00', 2012, 2012, 'Гонконг', '-', 3, 15, 9, '90 мин', 'Поу-Сои Чинг', 'Энтони Вонг, Шон Юе, Го Сяодун, Барби Хсю, Джози Хо, Ка Танг Лам, Мишель Йе'),
(104, 2, 'О фильме: На самолете творится сверхъестественное - пассажиры на самолете начинают умирать один за другим.', 'О фильме: На самолете творится сверхъестественное - пассажиры на самолете начинают умирать один за другим.', 0, '407: Призрачный рейс', '407:_Prizrachnyi_reis', '407 Dark Flight ', '0000-00-00', 2012, 2012, 'Таиланд', '-', 27, 0, 26, '90 мин', 'Исара Нади', 'Марша Ватанапанич, Питер Найт, Парамей Ноиам, Намо Тонкумнерд.'),
(105, 3, 'Что надо сделать для развития удачной идеи? Повторить и удвоить! Именно так поступили авторы продолжения, введя в сюжет вторую пару хозяин-слуга: слегка сумасшедшего, но обаятельного юного герцога Алоиса Транси и мрачноватого, но компетентного дворецкого Клода Фаустуса. По сути, новые герои являются зеркальным отражением полюбившихся зрителям Сиэля и Себастиана, которые решили пока не покидать сериал.', 'Что надо сделать для развития удачной идеи? Повторить и удвоить! Именно так поступили авторы продолжения, введя в сюжет вторую пару хозяин-слуга: слегка сумасшедшего, но обаятельного юного герцога Алоиса Транси и мрачноватого, но компетентного дворецкого Клода Фаустуса. По сути, новые герои являются зеркальным отражением полюбившихся зрителям Сиэля и Себастиана, которые решили пока не покидать сериал.\r\n\r\nВо втором сезоне «Дворецкого» мы сможем снова побывать в старой доброй псевдовикторианской Англии и встретить прежних знакомых, а также решить новые сюжетные загадки, щедро разбросанные авторами. Каково истинное прошлое Алоиса, и в чем суть его договора с Клодом? Что связывает обе пары главных героев? И где, наконец, душа Сиэля? Неужели их с Себастианом договор не прошел небесный арбитраж?', 0, 'Темный дворецкий 2 сезон', 'Temnyi_dvoreckii ', 'Kuroshitsuji II', '0000-00-00', 2010, 2010, 'Япония', '-', 1, 0, 18, '25 мин', 'Хирофуми Огура', 'Дайсукэ Оно, Маая Сакамото, Ая Хирано\r\nНана Мидзуки, Сакурай Такахиро.'),
(106, 2, 'Журналист Эрик только что расстался с подругой, но чувствует себя весьма неплохо. У него есть его старый и верный друг — пес Гейб, а босс Эрика, миссис Эндрюс собирается отправить его в Лондон, чтобы он возглавил новый открывающийся офис. Но Гейб, неожиданно, становится препятствием для поездки...', 'Журналист Эрик только что расстался с подругой, но чувствует себя весьма неплохо. У него есть его старый и верный друг — пес Гейб, а босс Эрика, миссис Эндрюс собирается отправить его в Лондон, чтобы он возглавил новый открывающийся офис. Но Гейб, неожиданно, становится препятствием для поездки. Длительный карантин в компании пит-буллей и мастиффов совсем не привлекает его и он начинает действовать, как Купидон, чтобы привлечь внимание Эрика к их соседке Саре. Эрик, тем временем, занимаясь поисками таинственного писателя P. Л. Даттона, начинает подозревать, что Сара и есть тот самый писатель…', 0, 'Пес-купидон', 'Pes-kupidon', 'Gabe the Cupid Dog', '0000-00-00', 2012, 2012, 'США', '$2 500 000', 23, 0, 0, '90 мин', 'Майкл Фейфер', 'Боти Блисс, Гэбриэлль Конфорти, Линден Эшби, Pete Sepenuk, Майкл Вудс, Ральф Уэйт, Джон Дил, Кирстин Дорн, Кайл Силверштейн, Майк Корич'),
(107, 2, 'Обвиненный в страшном преступлении, Джон Коффи оказывается в блоке смертников тюрьмы «Холодная гора». Вновь прибывший обладал поразительным ростом и был пугающе спокоен, что, впрочем, никак не влияло на отношение к нему начальника блока Пола Эджкомба, привыкшего исполнять приговор.', 'Обвиненный в страшном преступлении, Джон Коффи оказывается в блоке смертников тюрьмы «Холодная гора». Вновь прибывший обладал поразительным ростом и был пугающе спокоен, что, впрочем, никак не влияло на отношение к нему начальника блока Пола Эджкомба, привыкшего исполнять приговор.\r\n\r\nГигант удивил всех позже, когда выяснилось, что он обладает невероятной магической силой…', 0, 'Зеленая миля', 'Zelenaya_milya', 'The Green Mile', '0000-00-00', 1999, 1999, 'США', '$60 000 000', 30, 6, 15, '189 мин', 'Фрэнк Дарабонт', 'Том Хэнкс, Майкл Кларк Дункан, Дэвид Морс, Бонни Хант, Джеймс Кромуэлл, Майкл Джитер, Грэм Грин\r\nДаг Хатчисон, Сэм Рокуэлл\r\nБэрри Пеппер.'),
(108, 2, 'В этом фильме рассказывается о мужчине, который после пробуждения от комы обнаруживает, что его личность присвоена другим, и понимает, что никто, даже собственная жена, не верит ему. И тогда при помощи незнакомой молодой женщины-таксистки герой стремится доказать, кто он такой.', 'В этом фильме рассказывается о мужчине, который после пробуждения от комы обнаруживает, что его личность присвоена другим, и понимает, что никто, даже собственная жена, не верит ему. И тогда при помощи незнакомой молодой женщины-таксистки герой стремится доказать, кто он такой.', 0, 'Неизвестный', 'Nеizvеstnuy', 'Unknown', '0000-00-00', 2011, 2011, 'Великобритания, Германия, Франция, Канада, Япония,', '$30 000 000', 26, 6, 9, '113 мин', 'Жауме Серра', 'Лиам Нисон, Дайан Крюгер, Дженьюэри Джонс, Эйдан Куинн, Бруно Ганц, Фрэнк Ланджелла, Себастьян Кох, Оливье Шнайдер, Стипе Эрчег, Райнер Бок.'),
(109, 2, 'У величественного Короля-Льва Муфасы рождается наследник по имени Симба. Уже в детстве любознательный малыш становится жертвой интриг своего завистливого дяди Шрама, мечтающего о власти.', 'У величественного Короля-Льва Муфасы рождается наследник по имени Симба. Уже в детстве любознательный малыш становится жертвой интриг своего завистливого дяди Шрама, мечтающего о власти.\r\n\r\nСимба познаёт горе утраты, предательство и изгнание, но в конце концов обретает верных друзей и находит любимую. Закалённый испытаниями, он в нелёгкой борьбе отвоёвывает своё законное место в «Круге жизни», осознав, что значит быть настоящим Королём.', 0, 'Король Лев', 'Korol_lev', 'The Lion King', '0000-00-00', 1994, 1994, 'США', '$45 000 000', 18, 23, 19, '89 мин', 'Роджер Аллерс, Роб Минкофф', 'Джереми Айронс, Мэттью Бродерик, Натан Лейн, Эрни Сабелла, Джеймс Эрл Джонс, Мойра Келли, Роуэн Эткинсон, Вупи Голдберг, Чич Марин, Джонатан Тейлор Томас.'),
(110, 2, 'Много времени утекло с тех пор, как лев Симба сверг своего злого дядю Шрама и вернул трон короля саванны. У него и королевы Налы уже подрастает дочь — принцесса Киара.\r\n', 'Много времени утекло с тех пор, как лев Симба сверг своего злого дядю Шрама и вернул трон короля саванны. У него и королевы Налы уже подрастает дочь — принцесса Киара.\r\n\r\nОднако порученная легкомысленным заботам наших старых знакомых Тимона и Пумбы, проказливая и непослушная Киара пока никак не похожа на будущую королеву. Однажды сбежав в Запретную Землю, она встречает там львенка Кову, который становится ее лучшим другом.\r\n\r\nДа только принцесса не знает, что эта дружба может стоить ей короны! Кову — наследник Шрама, и пусть он не пошел в старого интригана, его мать Зира спит и видит, как бы усадить сына на трон.\r\n\r\nИ чем прочнее дружба между Киарой и Кову, тем гуще тучи над племенем Симбы…', 0, 'Король Лев 2: Гордость Симбы  ', 'Korol_lev_2', 'The Lion King II: Simbas Pride', '0000-00-00', 1998, 1998, 'США', '$45 000 000', 18, 23, 19, '81 мин ', 'Даррел Руни, Роб ЛаДука', 'Джереми Айронс, Мэттью Бродерик, Натан Лейн, Эрни Сабелла, Джеймс Эрл Джонс, Мойра Келли, Роуэн Эткинсон, Вупи Голдберг, Чич Марин, Джонатан Тейлор Томас.'),
(111, 2, 'Группа студентов колледжа отправляется за город, чтобы вовсю оторваться на выходных: попить пивка, поплавать в озере и подышать чистым лесным воздухом. Но уже в первый день они сталкиваются с неотесанными фермерами Такером и Дэйлом, также решившими как следует оттянуться на природе. Приняв этих диковатых, но, в сущности, симпатичных ребят за «злобных местных», горожане решают дать деревенщине жесткий отпор. Но с каждым их шагом становится только хуже…', 'Группа студентов колледжа отправляется за город, чтобы вовсю оторваться на выходных: попить пивка, поплавать в озере и подышать чистым лесным воздухом. Но уже в первый день они сталкиваются с неотесанными фермерами Такером и Дэйлом, также решившими как следует оттянуться на природе. Приняв этих диковатых, но, в сущности, симпатичных ребят за «злобных местных», горожане решают дать деревенщине жесткий отпор. Но с каждым их шагом становится только хуже…', 0, 'Убойные каникулы', '-', 'Tucker and Dale vs Evil', '0000-00-00', 2010, 2010, 'Канада, США', '$4 749 516', 27, 0, 12, '85 мин', 'Эли Крэйг', 'Тайлер Лэбин, Алан Тьюдик, Катрина Боуден, Джесси Мосс, Филип Грэйнджер, Брэндон Джей МакЛарен, Кристи Лэйн, Челан Симмонс, Трэвис Нельсон, Алекс Арсено.'),
(112, 2, 'Главная задача фильма — рассказать о вратарском искусстве на примере спортивных карьер великих вратарей прошлого и современности, о том, чего стоит успех и как нужно добиваться побед.', 'Главная задача фильма — рассказать о вратарском искусстве на примере спортивных карьер великих вратарей прошлого и современности, о том, чего стоит успех и как нужно добиваться побед.', 0, 'Вся жизнь в перчатках', '-', '-', '0000-00-00', 2012, 2012, 'Россия', '-', 31, 0, 24, '31 мин', 'Марина Кангур', 'Вячеслав Малафеев, Икер Касильяс, Джанлуиджи Буффон, Эдвин ван дер Сар, Йенс Леманн, Игорь Акинфеев\r\nАлександр Шовковский, Михаил Бирюков, Ринат Дасаев.'),
(113, 2, 'Действие кинокартины происходит в первой половине XVIII века — в переломную эпоху казахской истории, когда в кровопролитной войне с джунгарами единство казахского народа и героизм становятся решающей силой на пути к обретению свободы.', 'Действие кинокартины происходит в первой половине XVIII века — в переломную эпоху казахской истории, когда в кровопролитной войне с джунгарами единство казахского народа и героизм становятся решающей силой на пути к обретению свободы.', 0, 'Войско Мын Бала', '-', 'Myn Bala', '0000-00-00', 2012, 2012, 'Казахстан', '$10 000 000', 21, 11, 5, '133 мин', 'Акан Сатаев', 'Асылхан Толепов, Алия Ануарбек, Аян Утепберген, Куралай Анарбекова, Тлектес Мейрамов, Толеубек Аралбай, Нурлан Алимжанов, Берик Айтжанов, Куралай Анарбекова. '),
(114, 2, 'В новой истории о поисках истины, предательстве, вечной молодости и смертельной опасности капитану Джеку Воробью предстоит столкнуться с женщиной из своего прошлого Анжеликой. До самого конца не будет понятно, связывает ли их настоящая любовь, или же Анжелика искусно притворяется, чтобы вместе с Джеком добраться до таинственного источника вечной молодости.', 'В новой истории о поисках истины, предательстве, вечной молодости и смертельной опасности капитану Джеку Воробью предстоит столкнуться с женщиной из своего прошлого Анжеликой. До самого конца не будет понятно, связывает ли их настоящая любовь, или же Анжелика искусно притворяется, чтобы вместе с Джеком добраться до таинственного источника вечной молодости. \r\n\r\nОна силой принуждает капитана Джека Воробья взойти на корабль «Месть Королевы Анны», которым управляет коварный злодей Черная Борода. Наш герой оказывается в ситуации, когда он не знает, чего ему бояться больше — ужасного злодея или же свою давнюю подругу.', 0, 'Пираты Карибского моря: На странных берегах', '-', 'Pirates of the Caribbean: On Stranger Tides', '0000-00-00', 2011, 2011, 'США', '$250 000 000', 30, 12, 3, '136 мин', 'Роб Маршалл', 'Джонни Депп, Пенелопа Крус, Джеффри Раш, Иэн МакШейн, Кевин МакНэлли, Стивен Грэм, Сэм Клафлин, Астрид Берже-Фрисби, Джемма Уорд, Кит Ричардс.');
INSERT INTO `data` (`id`, `cat`, `shot_text`, `all_text`, `view`, `name_ru`, `tname`, `name_en`, `date`, `fyear`, `lyear`, `strana`, `budget`, `genre1`, `genre2`, `genre3`, `time`, `director`, `in_role`) VALUES
(115, 2, 'Герои «Американского пирога» встречаются вновь спустя несколько лет. Они докажут, что даже время и расстояние не в силах разрушить их дружбу. Летом 1999-го четверо мичиганских парней решили расстаться с невинностью. Прошли годы, и теперь друзья вернулись домой уже повзрослевшими, чтобы вспомнить прошлое и оторваться на полную катушку.', 'Герои «Американского пирога» встречаются вновь спустя несколько лет. Они докажут, что даже время и расстояние не в силах разрушить их дружбу. Летом 1999-го четверо мичиганских парней решили расстаться с невинностью. Прошли годы, и теперь друзья вернулись домой уже повзрослевшими, чтобы вспомнить прошлое и оторваться на полную катушку.', 0, 'Американский пирог: Все в сборе', '-', 'American Reunion', '0000-00-00', 2012, 2012, 'США', '$50 000 000', 12, 0, 0, '113 мин', 'Джон Харвитц, Хейден Шлоссберг', 'Джейсон Биггз, Элисон Хэннигэн, Шонн Уильям Скотт, Крис Клейн, Томас Иэн Николас, Эдди Кэй Томас, Тара Рид, Мена Сувари, Юджин Леви, Дженнифер Кулидж.'),
(116, 2, 'С утра — работа в музее этнографии, вечером — новости по Рен-ТВ, по выходным — митинги и секс с бывшим мужем, научным работником среднего звена. Лиза — типичный представитель питерской интеллигенции. Вика — обычная провинциалка. Отпуск в Петербурге для нее — это водка, вечеринки и авантюры. Казалось, между ними нет ничего общего. Однако, по воле случая они встретились — и сошлись: вода и пламень, синий чулок и тусовщица, интеллигенция и народ. Лиза и Вика — две стороны одной медали по имени Россия.\r\n\r\n«Кококо» — вечная комедия русской жизни!', 'С утра — работа в музее этнографии, вечером — новости по Рен-ТВ, по выходным — митинги и секс с бывшим мужем, научным работником среднего звена. Лиза — типичный представитель питерской интеллигенции. Вика — обычная провинциалка. Отпуск в Петербурге для нее — это водка, вечеринки и авантюры. Казалось, между ними нет ничего общего. Однако, по воле случая они встретились — и сошлись: вода и пламень, синий чулок и тусовщица, интеллигенция и народ. Лиза и Вика — две стороны одной медали по имени Россия.\r\n\r\n«Кококо» — вечная комедия русской жизни!', 0, 'Кококо', 'Кококо', 'Кококо', '0000-00-00', 2012, 2012, 'Россия', '$470 198', 9, 0, 0, '90 мин', 'Авдотья Смирнова', 'Анна Михалкова, Яна Троянова, Евгений Муравич, Геннадий Смирнов, Юлия Снигирь, Анна Пармас, Константин Шелестун, Любовь Аркус, Татьяна Рябоконь, Сергей Борисов.'),
(117, 2, '24 часа из жизни 28-летнего миллиардера-финансиста Эрика Пэкера, который изменяет своей молодой жене, подвергается нападению и разом теряет все свое состояние. Действие ленты будет разворачиваться на Манхэттене в течение одних суток.', '24 часа из жизни 28-летнего миллиардера-финансиста Эрика Пэкера, который изменяет своей молодой жене, подвергается нападению и разом теряет все свое состояние. Действие ленты будет разворачиваться на Манхэттене в течение одних суток.', 0, 'Космополис ', '-', 'Cosmopolis', '0000-00-00', 2012, 2012, '2012', '$20 500 000', 9, 0, 26, '105 мин', 'Дэвид Кроненберг', 'Роберт Паттинсон, Жюльет Бинош, Сара Гадон, Матье Амальрик, Джей Барушель, Кевин Дюран, К’Наан, Эмили Хэмпшир, Саманта Мортон, Пол Джаматти'),
(118, 2, 'За несколько недель до грандиозного авиашоу юный истребитель СУ-27 по имени Витязь поступает в ученики к самолетам-корифеям, которые берутся подготовить его к соревнованию. Но Витязь забывает о занятиях, когда по уши влюбляется в очаровательный легкий самолет Молнию, не подозревая, что она — помощница жестокого и злого истребителя Грома, который мечтает расправиться с Витязем. Сможет ли Витязь завоевать любовь Молнии? Успеет ли разрушить коварные планы Грома? И главное — станет ли Витязь победителем авиашоу?', 'За несколько недель до грандиозного авиашоу юный истребитель СУ-27 по имени Витязь поступает в ученики к самолетам-корифеям, которые берутся подготовить его к соревнованию. Но Витязь забывает о занятиях, когда по уши влюбляется в очаровательный легкий самолет Молнию, не подозревая, что она — помощница жестокого и злого истребителя Грома, который мечтает расправиться с Витязем. Сможет ли Витязь завоевать любовь Молнии? Успеет ли разрушить коварные планы Грома? И главное — станет ли Витязь победителем авиашоу?', 0, 'От винта', '-', 'От винта', '0000-00-00', 2012, 2012, 'Россия', '$3 500 000', 18, 21, 12, '-', 'Ольга Лопато', 'Антонина Березка, Алексей Франдетти, Валентин Гафт, Андрей Мерзликин, Анфиса Чехова, Александр Головин, Александр Ильин, Александр Семчев, Александр Леньков, Виктор Власов'),
(119, 2, 'Фильм рассказывает историю о двадцатилетнем парне, работающем в различных приютах для бездомных в Бостоне, где он часто пересекается со своим хоть и великолепным, но отчужденным и проблемным отцом.', 'Фильм рассказывает историю о двадцатилетнем парне, работающем в различных приютах для бездомных в Бостоне, где он часто пересекается со своим хоть и великолепным, но отчужденным и проблемным отцом.', 0, 'Быть Флинном', 'Byt_Flinnom', 'Being Flynn', '0000-00-00', 2012, 2012, 'США', 'неизвестно', 9, 0, 0, '86 мин', 'Пол Вайц', 'Роберт Де Ниро, Пол Дано, Оливия Тирлби, Лили Тейлор, Джулианна Мур, Эдди Роус, Стив Кирбус, Виктор Расук, Лайам Брогги, Крис Чок'),
(120, 2, 'В 108-ом районе тайваньской столицы случается утечка некоего токсичного вещества и начинается вирусная зомби-эпидемия. Власти направляют туда спецназ для спасения остатков населения, но эвакуация осложняется сопротивлением со стороны местных бандитов. Впрочем ситуация складывается настолько критическая, что волей-неволей приходится забыть о взаимной неприязни и объединиться перед общей угрозой.', 'В 108-ом районе тайваньской столицы случается утечка некоего токсичного вещества и начинается вирусная зомби-эпидемия. Власти направляют туда спецназ для спасения остатков населения, но эвакуация осложняется сопротивлением со стороны местных бандитов. Впрочем ситуация складывается настолько критическая, что волей-неволей приходится забыть о взаимной неприязни и объединиться перед общей угрозой.', 0, 'Зомби 108', 'Zombi_108', 'Zombie 108', '0000-00-00', 2012, 2012, 'Тайвань', 'TWD 3 000 000', 27, 0, 0, '88 мин', 'Joe Chein', 'Моррис Ронг, Ивонн Йао, Джош-Хиякава Уилсон, Тиа Бо, Джек Као, Kevin Lee, По Тай'),
(121, 2, 'В фокусе сюжетной линии двое подростков Эмма и Дин, которые оказались на необитаемом острове в Карибском море. Во время морской прогулки Эмма упала за борт корабля, и только Дин увидел это и прыгнул за ней в море. Проходят недели и молодые люди влюбляются, узнают многое о друг друге, а также познают себя.', 'В фокусе сюжетной линии двое подростков Эмма и Дин, которые оказались на необитаемом острове в Карибском море. Во время морской прогулки Эмма упала за борт корабля, и только Дин увидел это и прыгнул за ней в море. Проходят недели и молодые люди влюбляются, узнают многое о друг друге, а также познают себя.', 0, 'Голубая лагуна', 'Golubaya_laguna', 'Blue Lagoon: The Awakening', '0000-00-00', 2012, 2012, 'США', 'неизвестно', 16, 0, 0, '96 мин', 'Мэтт Хеллер, Хезер Рутман', 'Индиана Эванс, Брентон Туэйтес, Дениз Ричардс, Фрэнк Джон Хьюз, Патрик Ст. Эсприт, Аликс Гиттер, Хейли Кийоко, Айми Кареро, Джейкоб Артист'),
(122, 2, 'Триллер о том, что поиски родственников могут привести к неожиданным результатам. Джесси увлечена своим молодым человеком. Он журналист, с ним никогда не бывает скучно. На этот раз они отправляются на поиски его пропавшего отца. Последним его местонахождением, известным сыну, был необитаемый остров на Филиппинах. "Почему бы не отправиться в райский уголок в компании с несколькими друзьями?" – решает влюбленная пара. Правда, своим товарищам о том, зачем на самом деле они едут на Филиппины, молодые люди не сообщают. А надо бы. Потому что их времяпрепровождение на тропическом острове оказывается не таким уж приятным. Пропавший папаша, действительно, обитает там, где предполагает сын, но скрывается он не просто так. Отец оказывается частью засекреченного правительственного проекта, изучающего не что-нибудь, а человеческий страх. Впереди друзей ждут опасные приключения, которые смогут открыть им, что такое настоящий абсолютный страх.', 'Триллер о том, что поиски родственников могут привести к неожиданным результатам. Джесси увлечена своим молодым человеком. Он журналист, с ним никогда не бывает скучно. На этот раз они отправляются на поиски его пропавшего отца. Последним его местонахождением, известным сыну, был необитаемый остров на Филиппинах. "Почему бы не отправиться в райский уголок в компании с несколькими друзьями?" – решает влюбленная пара. Правда, своим товарищам о том, зачем на самом деле они едут на Филиппины, молодые люди не сообщают. А надо бы. Потому что их времяпрепровождение на тропическом острове оказывается не таким уж приятным. Пропавший папаша, действительно, обитает там, где предполагает сын, но скрывается он не просто так. Отец оказывается частью засекреченного правительственного проекта, изучающего не что-нибудь, а человеческий страх. Впереди друзей ждут опасные приключения, которые смогут открыть им, что такое настоящий абсолютный страх.', 0, 'Абсолютный страх', '-', 'Absolute Fear', '0000-00-00', 2012, 2012, 'США', '-', 1, 0, 26, '-', '