(123, 2, 'О фильме: Семейный кинофильм, повествующий невероятную историю о почти десятилетнем Тони, чей папа делает головокружительную карьеру от крановщика до министра транспорта. Из-за этого между его, как казалось мальчику, созданными друг для друга родителями регулярно начинают возникать разногласия, семья оказывается на грани развода, и Тони готов устроить все, чтоб его папа и мама вновь были вместе. Даже призвать на помощь Королеву.', 'О фильме: Семейный кинофильм, повествующий невероятную историю о почти десятилетнем Тони, чей папа делает головокружительную карьеру от крановщика до министра транспорта. Из-за этого между его, как казалось мальчику, созданными друг для друга родителями регулярно начинают возникать разногласия, семья оказывается на грани развода, и Тони готов устроить все, чтоб его папа и мама вновь были вместе. Даже призвать на помощь Королеву.', 0, 'Тони 10', 'Toni_10', 'Tony 10', '0000-00-00', 2012, 2012, 'Нидерланды', '€4 000 000', 23, 0, 0, '90 мин', 'Миша Кэмп', 'Фаас Вийн, Jeroen Spitzenberger, Рифка Лодейзен, Аннет Мальэрб, Carlo Boszhard, Люк Питерс, Анна Дрейвер'),
(124, 2, 'Фильм расскажет историю пяти пар, которым предстоят все радости процесса ожидания и рождения ребенка. Главная героиня 42-летняя адептка системы похудания по Джиллиан Майклз, которая ведет собственное шоу по сбросу веса и фитнесу. По сюжету героиня выясняет, что, несмотря на возраст, она ждет ребенка.', 'Фильм расскажет историю пяти пар, которым предстоят все радости процесса ожидания и рождения ребенка. Главная героиня 42-летняя адептка системы похудания по Джиллиан Майклз, которая ведет собственное шоу по сбросу веса и фитнесу. По сюжету героиня выясняет, что, несмотря на возраст, она ждет ребенка.', 0, 'Чего ждать, когда ждешь ребенка', '_', 'What to Expect When Youre Expecting', '0000-00-00', 2012, 2012, 'США', '$40 000 000', 9, 12, 16, '111 мин', 'Кирк Джонс', 'Кэмерон Диаз, Дженнифер Лопез, Элизабет Бэнкс, Чейс Кроуфорд, Бруклин Декер, Анна Кендрик, Мэттью Моррисон, Деннис Куэйд, Венди МакЛендон-Кови, Родриго Санторо'),
(125, 2, 'Три уникальные истории о человеческом самоуничтожении в современную эру высоких технологий. В надежде восстановить гуманное сострадание в наше бесчувственное время, фильм демонстрирует альтернативную сторону подлинного человечества. Вы станете свидетелем мира будущего, где вас ожидает серия неожиданных историй. Все эти истории происходят на Земле.', 'Три уникальные истории о человеческом самоуничтожении в современную эру высоких технологий. В надежде восстановить гуманное сострадание в наше бесчувственное время, фильм демонстрирует альтернативную сторону подлинного человечества. Вы станете свидетелем мира будущего, где вас ожидает серия неожиданных историй. Все эти истории происходят на Земле.', 0, 'Книга судного дня', '-', 'Doomsday Book', '0000-00-00', 2012, 2012, 'Корея Южная', '$5 000 000', 28, 0, 9, '113 мин', 'Ким Чжи Ун, Пиль-Сунг Йим', 'Лю Сынпом, Ко Чунхи, Пак Хэиль, Ким Кану, Сон Ёнчан, Ким Гёли.'),
(126, 2, 'Действие фильма разворачивается в Вуосаари, пригороде Хельсинки, и повествует о социальном государстве в эпоху индивидуальности и реалити-шоу. Две недели жизни современного пригорода демонстрируют жажду людей к жизни и любви. Судьбы людей в фильме порой абсурдны, но они трогательны, полны тепла и юмора, а иногда и непроглядной темноты.', 'Действие фильма разворачивается в Вуосаари, пригороде Хельсинки, и повествует о социальном государстве в эпоху индивидуальности и реалити-шоу. Две недели жизни современного пригорода демонстрируют жажду людей к жизни и любви. Судьбы людей в фильме порой абсурдны, но они трогательны, полны тепла и юмора, а иногда и непроглядной темноты.', 0, 'Голая бухта ', '-', 'Vuosaari', '0000-00-00', 2012, 2012, 'Финляндия', '€1 460 000', 9, 0, 0, '-', 'Аку Лоухимиес', ' Альма Пёвсти, Айно Лоухимиес, Шон Пертуи, Deogracias Masomi, Лаура Бирн, Конста Мякеля, Аманда Пилке, Танели Мякеля, Яспер Пяякконен, Эмели Лоухимиес, Екатерина Новосёлова, Топи Тарвайнен, Мери Ненонен и др.'),
(127, 2, 'Можно ли попробовать изменить расстановку сил в мире? Да, если вы круты как Ван Дамм, у вас есть пять тонн плутония и первоклассные наемники. Стоит ли шутить с Уиллисом, когда вы ему серьезно задолжали? Нет, даже если вы опасны как Сталлоне и у вас за спиной Неудержимые.', 'Можно ли попробовать изменить расстановку сил в мире? Да, если вы круты как Ван Дамм, у вас есть пять тонн плутония и первоклассные наемники. Стоит ли шутить с Уиллисом, когда вы ему серьезно задолжали? Нет, даже если вы опасны как Сталлоне и у вас за спиной Неудержимые. \r\n\r\nКого позвать на такое плевое дельце, как спасение мира? Пара проверенных ребят, Стэйтем и Норрис, явно не помешают. Пригодятся и малыш Хемсворт, и опасная красотка. Но команда будет неполной без Шварценеггера. Он реально вернулся! Все в сборе. Понеслась…', 0, 'Неудержимые 2', '-', 'The Expendables 2', '0000-00-00', 2012, 2012, 'США', '$100 000 000', 3, 0, 21, '103 мин', 'Саймон Уэст', 'Сильвестр Сталлоне, Джейсон Стэйтем, Дольф Лундгрен, Жан-Клод Ван Дамм, Терри Крюс, Арнольд Шварценеггер, Брюс Уиллис, Лиам Хемсворт, Нань Юй, Брюс Уиллис, Чак норрис'),
(128, 2, 'Чарли — самый обыкновенный подросток. Он мечтает о том, чтобы стать рок-звездой, но его очень строгий, категоричный отчим не одобряет музыкальных амбиций Чарли. Кэди Уорт — юная певица, чьи песни сразу становятся хитами и занимают первые строчки в чартах. Но и Кэди есть свои проблемы: авторитарный отец — владелец студии звукозаписи, который контролирует музыкальную карьеру дочери и давно перестал понимать, чего Кэди хочет на самом деле. Чарли устраивается уборщиком на студию отца Кэди, и у них с Кэди завязываются теплые дружеские отношения...', 'Чарли — самый обыкновенный подросток. Он мечтает о том, чтобы стать рок-звездой, но его очень строгий, категоричный отчим не одобряет музыкальных амбиций Чарли. Кэди Уорт — юная певица, чьи песни сразу становятся хитами и занимают первые строчки в чартах. Но и Кэди есть свои проблемы: авторитарный отец — владелец студии звукозаписи, который контролирует музыкальную карьеру дочери и давно перестал понимать, чего Кэди хочет на самом деле. Чарли устраивается уборщиком на студию отца Кэди, и у них с Кэди завязываются теплые дружеские отношения. Один из продюсеров студии обращает внимание на Чарли и дает ему шанс записать демо-диск и выступить на бале-маскараде, где будет выступать и сама Кэди. Чарли очень рад, но боится, что об этом узнает его отчим, и поэтому выступает в маске, под псевдонимом «Рэгс». Кэди очень понравилось, как поет этот таинственный исполнитель, но она не успевает выяснить, кто он такой. Кэди хочет во что бы то ни стало разыскать загадочного певца и просит Чарли помочь ей в поисках…', 0, 'Лохмотья', '-', 'Rags', '0000-00-00', 2012, 2012, 'США, Канада', '-', 19, 12, 9, '-', 'Билле Вудрафф', 'Дрейк Белл Эван Джогиа Кеке Палмер Макс Шнайдер Баркели Даффилд Дейвон Вейгель Айзиа Мустафа Луиза Д’Оливера Трэвис Тернер Кинэн Трэйси'),
(129, 2, 'Комиссар полиции Мумбаи Аджай Бхарадвадж на пресс-конференции рапортует, что с организованной преступностью в городе покончено. Но в тот же день на мумбайском вокзале с поезда сходит Виджай Сурья. Он один, он безоружен, он чужак, и у него нет ни рупии в кармане. Но его цель — стать новым криминальным авторитетом и более того — легализовать мафию. А для этого нужно обойти единственное серьёзное препятствие — комиссара Бхарадваджа, и самый короткий путь здесь — завоевать сердце его дочери. Насколько далеко можно зайти, обладая изощрённым умом и знанием человеческой психологии при полном отсутствии моральных принципов? И что движет человеком, стремящимся к абсолютной власти?', 'Комиссар полиции Мумбаи Аджай Бхарадвадж на пресс-конференции рапортует, что с организованной преступностью в городе покончено. Но в тот же день на мумбайском вокзале с поезда сходит Виджай Сурья. Он один, он безоружен, он чужак, и у него нет ни рупии в кармане. Но его цель — стать новым криминальным авторитетом и более того — легализовать мафию. А для этого нужно обойти единственное серьёзное препятствие — комиссара Бхарадваджа, и самый короткий путь здесь — завоевать сердце его дочери. Насколько далеко можно зайти, обладая изощрённым умом и знанием человеческой психологии при полном отсутствии моральных принципов? И что движет человеком, стремящимся к абсолютной власти?', 0, 'Бизнесмен', '-', 'Business Man', '0000-00-00', 2012, 2012, 'Индия', '-', 3, 12, 26, '126 мин', 'Пури Джаганнатх, Vijaya Ram Prasad', ' Махеш Бабу, Каджал, Пракаш Радж, Аеша Шива, Саяджи Шинде, Раза Мурад, Джахангир Кхан, Др. Бхарат Редди'),
(130, 2, 'Четверо героев страдают от проблем во взаимоотношениях со спутницами жизни, которые вовсю черпают советы из книги Стива Харви «Поступай как женщина, думай как мужчина». Узнав об этом, парни решают отомстить слабому полу тем, что попытаются опровергнуть данные в тексте рекомендации, ведя себя в точности наоборот.', 'Четверо героев страдают от проблем во взаимоотношениях со спутницами жизни, которые вовсю черпают советы из книги Стива Харви «Поступай как женщина, думай как мужчина». Узнав об этом, парни решают отомстить слабому полу тем, что попытаются опровергнуть данные в тексте рекомендации, ведя себя в точности наоборот.', 0, 'Думай, как мужчина', '-', 'Think Like a Man', '0000-00-00', 2012, 2012, 'США', '$12 000 000', 16, 0, 12, '122 мин', 'Тим Стори', 'Ариэль Кеббел, Джерри Феррара, Тараджи П. Хенсон, Миган Гуд, Гэбриэл Юнион, Моррис Честнат, Кевин Харт, Майкл Или, Крис Браун, Реджина Холл'),
(131, 2, 'Главный герой — трепло, каких свет не видывал. И вот однажды этот говорливый персонаж узнаёт, что ему осталось произнести вслух ровно тысячу слов, после чего он обязательно умрёт…', 'Главный герой — трепло, каких свет не видывал. И вот однажды этот говорливый персонаж узнаёт, что ему осталось произнести вслух ровно тысячу слов, после чего он обязательно умрёт…', 0, 'Тысяча слов ', '-', 'A Thousand Words', '0000-00-00', 2009, 2009, 'США', '$40 000 000', 30, 12, 9, '91 мин', 'Брайан Роббинс', ' Эдди Мёрфи, Керри Вашингтон, Эмануэл Рэгсдэйл, Джилл Бейси, Грег Коллинз, Роберт Лекванг, Майкл Дж. Уилкинсон, Линдси Нельсон, Майкл Коуди Гилберт, Лу Салиба'),
(132, 2, 'Кейт Мэтьюсон, специализирующаяся на акулах биолог и документалист, всячески избегала глубоководных погружений после трагической гибели ее наставника. Когда-то она была известна тем, что свободно плавала в океане с белыми акулами, теперь же Кейт зарабатывает на жизнь проведением обычных морских экскурсий...', 'Кейт Мэтьюсон, специализирующаяся на акулах биолог и документалист, всячески избегала глубоководных погружений после трагической гибели ее наставника. Когда-то она была известна тем, что свободно плавала в океане с белыми акулами, теперь же Кейт зарабатывает на жизнь проведением обычных морских экскурсий. Однако неожиданный приезд ее давнего партнера и бывшего мужа убеждает ее бросить вызов собственным демонам и вернуться в глубокие воды, где обитают эти страшные хищники.', 0, 'Заклинательница акул', '-', 'Dark Tide', '0000-00-00', 2011, 2011, 'ЮАР, Великобритания', '$25 000 000', 26, 21, 9, '114 мин', 'Джон Стокуэлл', 'Холли Берри, Оливье Мартинес, Ральф Браун, Люк Тайлер, Mark Elderkin, Thoko Ntshinga, Sizwe Msutu'),
(133, 2, 'Действие фильма разворачивается в американском городе Колд Рок, в котором на протяжении многих лет пропадают без вести дети. Местные легенды гласят, что их забирает к себе таинственный высокий человек.', 'Действие фильма разворачивается в американском городе Колд Рок, в котором на протяжении многих лет пропадают без вести дети. Местные легенды гласят, что их забирает к себе таинственный высокий человек.\r\n\r\nЖительница Колд Рок, медсестра Джулия, не верит в эти легенды до тех пор, пока однажды ночью не обнаруживает, что кровать её сына пуста. Спустившись на первый этаж, она в ужасе видит, как некая тёмная фигура вместе с её сыном покидает дом. Руководствуясь инстинктом, Джулия бросается вслед за ними, пытаясь сделать всё возможное, чтобы вернуть сына, а заодно и получить ответы на вопросы: кто такой этот высокий человек? И что происходит с детьми?', 0, 'Верзила ', '-', 'The Tall Man', '0000-00-00', 2012, 2012, 'США, Канада, Франция', '$18 200 000', 26, 15, 9, '105 мин', 'Паскаль Ложье', 'Джессика Бил, Джоделль Ферланд, Уильям Б. Дэвис, Саманта Феррис, Коллин Вилер, Гарвин Санфорд, Джанет Райт, Ив Харлоу, Джон Манн, Тич Грант'),
(134, 2, 'Профессиональный наёмный убийца во время смертельной схватки с мафией оказывается целью преследования неизвестного опасного врага.', 'Профессиональный наёмный убийца во время смертельной схватки с мафией оказывается целью преследования неизвестного опасного врага.', 0, 'Узник', '-', 'One in the Chamber', '0000-00-00', 2012, 2012, 'США', '$6 000 000', 3, 15, 26, '91 мин', 'Уильям Кауфман', ' Дольф Лундгрен, Кьюба Гудинг мл., Лео Грегори, Билли Мюррэй, Клаудия Бассолс, Луис Мэндилор, Эндрю Бикнелл, Аарон МакФерсон, Элин Пэнк'),
(135, 2, 'Он — предложил, она — согласилась! Казалось бы, дело в шляпе — почти женаты. Но свадьба становится невыполнимой миссией, когда в дело вступает отряд бывших подружек жениха, босс невесты, трещащий по швам список гостей и престарелые родственники, имеющие тенденцию умирать в самый неподходящий момент. И вроде бы немножко женаты, но все как-то не до конца…', 'Он — предложил, она — согласилась! Казалось бы, дело в шляпе — почти женаты. Но свадьба становится невыполнимой миссией, когда в дело вступает отряд бывших подружек жениха, босс невесты, трещащий по швам список гостей и престарелые родственники, имеющие тенденцию умирать в самый неподходящий момент. И вроде бы немножко женаты, но все как-то не до конца…', 0, 'Немножко женаты', '-', 'The Five-Year Engagement', '0000-00-00', 2012, 2012, 'США', '$30 000 000', 16, 0, 12, '124 мин', 'Николас Столлер', 'Джейсон Сигел, Эмили Блант, Крис Прэтт, Элисон Бри, Лоурен Уидман, Мими Кеннеди, Дэвид Пэймер, Джеки Уивер, Джим Пиддок, Эрик Купер'),
(136, 2, 'В поисках редкой видеозаписи трое взломщиков пробираются в таинственный особняк. Хозяин ждет их у включенного телевизора и, похоже, не слишком радуется визиту. Он мертв уже несколько дней, а его странное наследие — коллекция старых видеозаписей, покоится неподалеку.', 'В поисках редкой видеозаписи трое взломщиков пробираются в таинственный особняк. Хозяин ждет их у включенного телевизора и, похоже, не слишком радуется визиту. Он мертв уже несколько дней, а его странное наследие — коллекция старых видеозаписей, покоится неподалеку.\r\n\r\nЖелая отыскать нужную пленку, друзья просматривают весь архив. Каждая запись погружает их в новый кошмар, настолько реальный, будто он происходит у них на глазах. И с каждой минутой где-то совсем рядом пробуждается оно, неведомое и беспощадное ЗЛО.', 0, 'Зло', 'Zlo', 'V/H/S', '0000-00-00', 2012, 2012, 'США', '-', 27, 0, 26, '116 мин', 'Мэттью Беттинелли, Адам Вингард, Дэвид Брукнер', 'Кэлвин Ридер, Лэйн Хьюз, Адам Вингард, Ханна Файрман, Майк Донлан, Джо Сайкес, Дрю Сойер, Джессика Сэмс, Джо Сванберг, Софи Такал'),
(137, 2, 'Бывший мафиозо, отошедший от дел, теперь — просто пожилой больной человек. Но его прошлое никуда не уходит. Девушка, которая виделась с ним всего пару раз, становится мишенью, ее преследуют вооруженные люди.', 'Бывший мафиозо, отошедший от дел, теперь — просто пожилой больной человек. Но его прошлое никуда не уходит. Девушка, которая виделась с ним всего пару раз, становится мишенью, ее преследуют вооруженные люди.', 0, 'Подозрение', '-', 'Suspicion', '0000-00-00', 2012, 2012, 'США', '$100 000', 26, 0, 9, '84 мин', 'Дэвид Дилли', 'Сюзанн Мэй, Брэд Блэйсделл, Эйдан Бристоу, Шон Карлос Ларкин, Кэтлин Беннер, Дэвид Новак, Марио Гузман, Кристофер Брэдли, Русс Перри, Бретт Эшли, Кевин Л. Джейкобс, Дэвид Болл, Бобби Бёрки...'),
(138, 2, 'Уэсли Дидс, успешный, богатый бизнесмен. Он всегда делал в своей жизни то, что от него обычно ожидали, будь то принятие руководства компанией его отца, или же планирование свадьбы с красавицей Натали. Однако, неожиданно для окружающих и себя самого, Уэсли встряхивается от рутины и повседневности после того, как встречает Линдси, мать-одиночку, работающую уборщицей в его офисном здании.', 'Уэсли Дидс, успешный, богатый бизнесмен. Он всегда делал в своей жизни то, что от него обычно ожидали, будь то принятие руководства компанией его отца, или же планирование свадьбы с красавицей Натали. Однако, неожиданно для окружающих и себя самого, Уэсли встряхивается от рутины и повседневности после того, как встречает Линдси, мать-одиночку, работающую уборщицей в его офисном здании. \r\n\r\n Решив помочь женщине вновь встать на ноги после ряда жизненных неудач, герой вдруг начинает осознавать, что что-то изменилось внутри него самого. Что-то, что наконец-то даст мужчине сил обменять свою привычную жизнь на ту, что на самом деле всегда была ему нужна.', 0, 'Хорошие поступки', '-', 'Good Deeds', '0000-00-00', 2012, 2012, 'США', '$35 025 791', 9, 12, 16, '110 мин', 'Тайлер Перри', 'Тайлер Перри, Тэнди Ньютон, Гэбриэл Юнион, Эдди Сибриан, Брайан Дж. Уайт, Филисия Рашад, Беверли Джонсон, Ребекка Ромин, Джейми Кеннеди.'),
(139, 2, '70 лет назад недобитые нацисты улетели на Луну. Теперь, когда их гигантский флот возмездия почти достроен, они решили устроить Земле новый блицкриг. Тем временем президент США готова на всё, чтобы пойти на второй срок — ...', '70 лет назад недобитые нацисты улетели на Луну. Теперь, когда их гигантский флот возмездия почти достроен, они решили устроить Земле новый блицкриг. Тем временем президент США готова на всё, чтобы пойти на второй срок — даже развязать в космосе войну за природные ресурсы; а тщеславный офицер Четвертого Рейха Клаус задумал предать фюрера и получить власть над Землёй в свои руки. Боевые цеппелины уже вышли на орбиту, земные города под прицелом. Похоже, мира хотят только двое: наивная учительница с Луны Ренате и бывший астронавт Джеймс Вашингтон.', 0, 'Железное небо', '_', 'Iron Sky', '0000-00-00', 2012, 2012, 'Финляндия, Германия, Австралия', '€7 500 000', 28, 12, 3, '93 мин', 'Тимо Вуоренсола', 'Юлия Дитце, Удо Кир, Пета Сержант, Ким Джексон, Гёц Отто, Стефани Пол, Кристофер Кирби, Моника Госсманн, Джим Нобелок, Юки Ивамото'),
(140, 2, 'В центре повествования семья Магуров, состоящая из матери алкоголички Жанет и ее трех дочерей, которые следуют в аэропорт за отцом семейства, прибывшем из-за границы. Ухудшившаяся погода и грозящий торнадо заставляют их укрыться в подземном убежище. Вскоре они обнаруживают, что там еще кто-то есть…', 'В центре повествования семья Магуров, состоящая из матери алкоголички Жанет и ее трех дочерей, которые следуют в аэропорт за отцом семейства, прибывшем из-за границы. Ухудшившаяся погода и грозящий торнадо заставляют их укрыться в подземном убежище. Вскоре они обнаруживают, что там еще кто-то есть…', 0, 'Грызущий ногти', '-', 'Nailbiter', '0000-00-00', 2012, 2012, 'США', '-', 27, 0, 0, '81 мин', 'Патрик Ри', 'Joicie Appell, Emily Boresow, Джейсон Коффман, Том Сонрой, Мишель Дэвидсон, Йен Демпси, Бен Джеффри, Aaron Laue, Allen Lowman, Зейн Мартин');
INSERT INTO `data` (`id`, `cat`, `shot_text`, `all_text`, `view`, `name_ru`, `tname`, `name_en`, `date`, `fyear`, `lyear`, `strana`, `budget`, `genre1`, `genre2`, `genre3`, `time`, `director`, `in_role`) VALUES
(141, 2, 'Бэк Хён Чоль — бывший исследователь лаборатории биотехнологии, который борется против группы гангстеров, пытающейся украсть основную технологию важного полупроводникового кристалла. Вместе с Хён Чолем борется с гангстерами и слепо верящая ему Хан Дон Хва, дочь его старшего коллеги...', 'Бэк Хён Чоль — бывший исследователь лаборатории биотехнологии, который борется против группы гангстеров, пытающейся украсть основную технологию важного полупроводникового кристалла. Вместе с Хён Чолем борется с гангстерами и слепо верящая ему Хан Дон Хва, дочь его старшего коллеги. Бандиты в своих экспериментах используют трупы людей. Ан Чин О — человек, который фальсифицировал свою собственную смерть из-за страховых денег. Хён Чоль похищает «тело» Чин О, чтобы опередить бандитов. Но это не устраивает Чин О, мечтающего получить деньги по страховке. Вот с этого и начались их отношения и приключения…', 0, 'Только через мой труп', '-', 'Si-che-ga Dol-a-wass-da', '0000-00-00', 2012, 2012, 'Корея Южная', '$2 600 000', 9, 0, 15, '110 мин', 'Seon-ho Wu', 'Ли Пом Со, Лю Сын Пом, Ким Ок-бин, Ко Чан-сок, Чон Ман-сик, Ю Да-ин'),
(142, 2, 'Проведя два года в Лондоне, Аче возвращается домой, чтобы начать новую жизнь: устроиться на работу, завести новых друзей. Однако многое изменилось и встреча с Джин заставляет Аче почувствовать то, что он чувствовал только к Баби — своей первой большой и настоящей любви…', 'Проведя два года в Лондоне, Аче возвращается домой, чтобы начать новую жизнь: устроиться на работу, завести новых друзей. Однако многое изменилось и встреча с Джин заставляет Аче почувствовать то, что он чувствовал только к Баби — своей первой большой и настоящей любви…', 0, 'Три метра над уровнем неба: Я тебя хочу', '_', 'Три метра над уровнем неба', '0000-00-00', 2012, 2012, 'Испания', '$17 020 666', 9, 0, 16, '119 мин', '119 мин', 'Марио Касас, Мария Вальверде, Клара Лаго, Альваро Сервантес, Андреа Дуро, Луис Фернандез, Марина Салас, Диего Мартин, Нереа Камачо, Ману Фульола'),
(143, 2, '1193 год до нашей эры. Парис украл прекрасную Елену, жену царя Спарты Менелая. За честь Менелая вступается его брат — царь Агамемнон. Его армия под предводительством Ахиллеса подошла к Трое и взяла город в кровавую осаду, длившуюся долгих десять лет… Два мира будут воевать за честь и власть. Тысячи умрут за славу. И за любовь нация сгорит дотла.', '1193 год до нашей эры. Парис украл прекрасную Елену, жену царя Спарты Менелая. За честь Менелая вступается его брат — царь Агамемнон. Его армия под предводительством Ахиллеса подошла к Трое и взяла город в кровавую осаду, длившуюся долгих десять лет… Два мира будут воевать за честь и власть. Тысячи умрут за славу. И за любовь нация сгорит дотла.', 0, 'Троя', '_', 'Troy', '0000-00-00', 2004, 2004, 'США, Мальта, Великобритания', '$175 000 000', 3, 16, 9, '163 мин', 'Вольфганг Петерсен', 'Брэд Питт, Эрик Бана, Орландо Блум, Шон Бин, Дайан Крюгер, Брайан Кокс, Брендон Глисон, Питер ОТул, Джон Шрапнель, Сири Свеглер, Гарретт Хедлунд, Тайлер Мэйн'),
(144, 2, 'Преподобный Маркус Коттон много лет занимается изгнанием дьявола из бесноватых. Секрет его успеха не столько в проникновенной молитве, сколько в многочисленных трюках и спецэффектах, которые оказывают чудесный психологический эффект на впечатлительную паству. Собираясь на очередной экзорцизм, он приглашает с собой съемочную группу, которая снимает о нем документальный фильм. Его вере придется пройти суровое испытание, когда он столкнется лицом к лицу с самим дьяволом.', 'Преподобный Маркус Коттон много лет занимается изгнанием дьявола из бесноватых. Секрет его успеха не столько в проникновенной молитве, сколько в многочисленных трюках и спецэффектах, которые оказывают чудесный психологический эффект на впечатлительную паству. Собираясь на очередной экзорцизм, он приглашает с собой съемочную группу, которая снимает о нем документальный фильм. Его вере придется пройти суровое испытание, когда он столкнется лицом к лицу с самим дьяволом.', 0, 'Последнее изгнание дьявола', '-', 'The Last Exorcism', '0000-00-00', 2010, 2010, 'США, Франция', '$3 000 000', 27, 9, 26, '87 мин', 'Даниэль Штамм', ' Патрик Фабиан, Эшли Белл, Ирис Бар, Луис Хертэм, Калеб Лэндри Джонс, Тони Бентли, Джон Райт мл., Шанна Форресталль, Джастин Шафер, Кэрол Саттон'),
(145, 2, 'На дворе — конец девятнадцатого века, но, хотя люди пользуются автомобилями, железными дорогами и телеграфом, человек по-прежнему бессилен перед проявлениями сверхъестественного. Молодой лондонский юрист Артур Киппс вынужден оставить своего 4-летнего сына и отправиться в командировку в уединенную северную деревушку, чтобы составить реестр документов, оставшихся от скончавшегося хозяина поместья Ил Марш...', 'На дворе — конец девятнадцатого века, но, хотя люди пользуются автомобилями, железными дорогами и телеграфом, человек по-прежнему бессилен перед проявлениями сверхъестественного. Молодой лондонский юрист Артур Киппс вынужден оставить своего 4-летнего сына и отправиться в командировку в уединенную северную деревушку, чтобы составить реестр документов, оставшихся от скончавшегося хозяина поместья Ил Марш. Добравшись до места и пообщавшись с негостеприимными местными жителями, он начинает понимать, что над деревушкой нависла тень мрачной тайны. Когда же рядом со старым кладбищем ему на глаза попадается загадочная женщина, одетая в черное, это малозначительное происшествие знаменует начало череды леденящих кровь смертей в семьях обитателей деревни.', 0, 'Женщина в черном', '-', 'The Woman in Black', '0000-00-00', 2012, 2012, 'Великобритания, Канада, Швеция', '$17 000 000', 27, 9, 26, '95 мин', 'Джеймс Уоткинс', 'Дэниэл Рэдклифф, Кьяран Хайндс, Джанет МакТир, Дэвид Бурк, Шон Дули, Эмма Шори, Хэрмон Молли, Софи Стаки, Миша Хэндли, Джессика Рэйне'),
(146, 2, 'Кот в сапогах отправляется на поиск рубина, украденного из короны принцессы пресловутым Французским вором Виспере. Его сопровождают три маленьких котенка, три Дьяволенка. Кот должен приручить их, прежде чем поставить под угрозу миссию.', 'Кот в сапогах отправляется на поиск рубина, украденного из короны принцессы пресловутым Французским вором Виспере. Его сопровождают три маленьких котенка, три Дьяволенка. Кот должен приручить их, прежде чем поставить под угрозу миссию.', 0, 'Кот в сапогах: Три Чертенка', '-', 'Puss in Boots: The Three Diablos', '0000-00-00', 2011, 2011, 'США', '-', 18, 0, 14, '13 мин', 'Раман Хюи', 'Антонио Бандерас, Жилль Марини, Шарлотта Ньюхаус, Крис Миллер, Уолт Дорн, Брэт Марнелл, Майлз Кристофер Бакши, Нина Зои Бакши,\r\nГийом Арето.'),
(147, 2, 'В поисках редкой видеозаписи трое взломщиков пробираются в таинственный особняк. Хозяин ждет их у включенного телевизора и, похоже, не слишком радуется визиту. Он мертв уже несколько дней, а его странное наследие — коллекция старых видеозаписей, покоится неподалеку.', 'В поисках редкой видеозаписи трое взломщиков пробираются в таинственный особняк. Хозяин ждет их у включенного телевизора и, похоже, не слишком радуется визиту. Он мертв уже несколько дней, а его странное наследие — коллекция старых видеозаписей, покоится неподалеку.\r\n\r\nЖелая отыскать нужную пленку, друзья просматривают весь архив. Каждая запись погружает их в новый кошмар, настолько реальный, будто он происходит у них на глазах. И с каждой минутой где-то совсем рядом пробуждается оно, неведомое и беспощадное ЗЛО.', 0, 'Зло', 'zlo', 'V/H/S', '0000-00-00', 2012, 2012, 'США', 'неизвестно', 27, 26, 0, '116 мин', '	Мэттью Беттинелли, Адам Вингард, Дэвид Брукнер', 'Кэлвин Ридер, Лэйн Хьюз, Адам Вингард, Ханна Файрман, Майк Донлан, Джо Сайкес'),
(148, 3, 'Убита девушка. На месте преступления следователь встречает человека, который видел убийцу и даже снял его на видеокамеру. К несчастью для сыщика свидетель оказывается болтливым и ужасно рассеянным. Ситуация накаляется, когда мужчины понимают, что пожар, начавшийся внизу, грозит перекинуться выше, а это значит, что в огне могут пропасть улики. Времени, чтобы добраться до истины, остается все меньше.', 'Убита девушка. На месте преступления следователь встречает человека, который видел убийцу и даже снял его на видеокамеру. К несчастью для сыщика свидетель оказывается болтливым и ужасно рассеянным. Ситуация накаляется, когда мужчины понимают, что пожар, начавшийся внизу, грозит перекинуться выше, а это значит, что в огне могут пропасть улики. Времени, чтобы добраться до истины, остается все меньше.', 0, 'Откровения', 'Otkroveniya', 'Otkroveniya', '0000-00-00', 2012, 2012, 'Россия', 'неизвестно', 6, 0, 0, '23 мин', 'Алексей Красовский', 'Кирилл Пирогов, Дмитрий Назаров, Мария Аронова, Андрей Ильин, Роман Мадянов'),
(149, 2, 'Мастера мирового авторского кино сняли 7 маленьких увлекательных историй, действие которых происходит в Гаване.', 'Мастера мирового авторского кино сняли 7 маленьких увлекательных историй, действие которых происходит в Гаване.', 0, 'Гавана, я люблю тебя', '-', '7 días en La Habana', '0000-00-00', 2012, 2012, 'Испания, Франция', '€3 000 000', 9, 0, 0, '123 мин', 'Бенисио Дель Торо, Пабло Траперо, Элиа Сулейман', 'Бенисио Дель Торо, Пабло Траперо, Элиа Сулейман, Хулио Медем, Гаспар Ноэ, Хуан Карлос Табио, Лоран Канте'),
(150, 2, 'Семеро друзей отправляются вместе в Лас-Вегас. Весь путь в Город Азарта они снимают на видео. Пробитое колесо приводит их в хороший придорожный мотель. Здесь их встречает приветливый персонал и теплый прием. ', 'Семеро друзей отправляются вместе в Лас-Вегас. Весь путь в Город Азарта они снимают на видео. Пробитое колесо приводит их в хороший придорожный мотель. Здесь их встречает приветливый персонал и теплый прием. Друзьям обещают помочь во всем. А утром они понимают, что оказались в ловушке, каждое их действие тоже снимают на видео. И все такие же вежливые и внимательные люди собираются помочь в первую очередь умереть. Они шутят, вежливо отвечают на вопросы — и убивают. В чем философия смертельного испытания? Об этом сможет рассказать только тот, кому удастся вырваться из ловушки живым. Удастся ли?', 0, 'Помощники ', '-', 'The Helpers', '0000-00-00', 2012, 2012, 'США', '$4 000 000', 27, 0, 26, '83 мин', 'Крис Стоукс', ' Кристен Куинтрелл, Денис Лоутон, Кристофер Джонс, Джо Райт, Рэйчел Стерлинг, Блэк Томас, Дастин Хэрниш, Камерон Дискин, Брэкстон Дэвис, Даллас Ловато'),
(151, 2, 'Тайлер — беспечный студент, который никак не может найти общий язык с окружающим миром. Он подавлен смертью старшего брата. Отцу, как впрочем, и матери с отчимом, нет до него никакого дела. К счастью, у него есть друг Айдан. Однажды парни случайно ввязываются в уличную драку…', 'Тайлер — беспечный студент, который никак не может найти общий язык с окружающим миром. Он подавлен смертью старшего брата. Отцу, как впрочем, и матери с отчимом, нет до него никакого дела. К счастью, у него есть друг Айдан. Однажды парни случайно ввязываются в уличную драку…', 0, 'Помни меня', '-', 'Remember Me', '0000-00-00', 2010, 2010, 'США', '$16 000 000', 9, 0, 16, '112 мин', 'Аллен Култер', ' Роберт Паттинсон, Пирс Броснан, Эмили де Рэйвин, Кейтлин Ранд, Мосес Ацеведо, Ноэль Родригез, Кевин П. МакКарти, Крис Купер, Атена Кёрри, Лена Улин, Грегори Джбара, Руби Джерринс'),
(152, 2, 'Пес по кличке «Вольт» всю жизнь снимается в телевизионном сериале, где его герой — суперпес — спасает человечество, используя свои необычайные способности. Сам Вольт свято верит в собственную неуязвимость, невероятную силу, и умение летать.', 'Пес по кличке «Вольт» всю жизнь снимается в телевизионном сериале, где его герой — суперпес — спасает человечество, используя свои необычайные способности. Сам Вольт свято верит в собственную неуязвимость, невероятную силу, и умение летать. Когда же судьба забрасывает его в полный опасностей Большой Город, он все еще думает, что это — лишь очередной эпизод телесериала…', 0, 'Вольт', '-', 'Bolt', '0000-00-00', 2008, 2008, 'США', '$150 000 000', 18, 21, 12, '96 мин', 'Байрон Ховард, Крис Уильямс', 'Джон Траволта, Майли Сайрус, Сьюзи Эссман, Марк Уолтон, Малкольм МакДауэлл, Джеймс Липтон, Грег Джерманн, Дидрих Бадер, Ник Свардсон, Жан-Поль Ману.'),
(153, 2, 'Фильм приглашает в зачарованный замок, скрытый в чаще темного волшебного леса. Его хозяин ужасное Чудовище, которого все боятся и ненавидят...', 'Его хозяин ужасное Чудовище, которого все боятся и ненавидят. Лишь самая прекрасная и смелая девушка в мире по имени Белль способна разгадать тайну страшного, а на самом деле, очень несчастного хозяина замка и разрушить чары, обрекшие его на вечное пребывание в шкуре жуткого зверя.\r\n\r\nТолько тот, кто растопит лед в сердце чудовища и сможет полюбить его таким, какой он есть, сможет вернуть ему человеческий облик, но, чтобы спасти хозяина зачарованного замка, Белль придется выступить против всех: ведь жители ее деревни, подстрекаемые злобным охотником Гастоном, хотят погубить гордое и доброе Чудовище…', 0, 'Красавица и чудовище', '-', 'Beauty and the Beast', '0000-00-00', 1991, 1991, 'США', '$25 000 000', 18, 30, 19, '84 мин', 'Гари Труздейл, Кирк Уайз', 'Пейдж О’Хара, Робби Бенсон, Ричард Уайт, Джерри Орбак,\r\nДэвид Огден Стайерз, Анджела Лэнсбери, Брэдли Пирс, Рекс Эверхарт, Джесси Корти, Хэл Смит.'),
(154, 2, 'Обаятельный разбойник Флинн путешествует по жизни с легкостью, лишь потому, что он красив, болтлив и удачлив. И, казалось, фортуна всегда на его стороне, пока однажды он не выбирает высокую башню в густой чаще леса в качестве «спокойного» убежища. Флинн оказывается связанным по рукам и ногам юной красавицей по имени Рапунцель.', 'красив, болтлив и удачлив. И, казалось, фортуна всегда на его стороне, пока однажды он не выбирает высокую башню в густой чаще леса в качестве «спокойного» убежища. Флинн оказывается связанным по рукам и ногам юной красавицей по имени Рапунцель. \r\n\r\nЕсли вы думаете, что самое интересное в ней — это 21 метр волшебных золотистых волос, то вы заблуждаетесь! Запертая в башне и отчаянно ищущая приключений, Рапунцель решает использовать Флинна в качестве билета в большой мир. Сначала комичное похищение, затем невинный шантаж — и вот наши герои на воле. Вместе с главными героями в авантюрное путешествие отправятся бравый конь-ищейка Максимус, ручной хамелеон и шайка сумасбродных разбойников.', 0, 'Рапунцель: Запутанная история', '-', 'Tangled', '0000-00-00', 2010, 2010, 'США', '$260 000 000', 18, 30, 19, '100 мин', 'Нэйтан Грено, Байрон Ховард', 'Мэнди Мур, Закари Левай, Донна Мерфи, Рон Перлман, М. К. Гейни, Джефри Тэмбор, Брэд Гэррет, Пол Ф. Томпкинс, Ричард Кил, Делани Роуз Стейн.'),
(155, 3, 'Саша Зайцев — московский студент. Он похож на миллионы своих сверстников, но при этом очень отличается от окружающих. С одной стороны, у Саши есть очки. А еще у Саши есть вид затюканного «ботаника» и неразделенная любовь. С другой стороны, у Саши — раздвоение личности. Нет, он не разговаривает сам с собой в шапочке из фольги. Просто если Сашу бьют по голове, он «превращается» в Федора, подозрительно похожего на актера Михаила Галустяна.', 'очень отличается от окружающих. С одной стороны, у Саши есть очки. А еще у Саши есть вид затюканного «ботаника» и неразделенная любовь. С другой стороны, у Саши — раздвоение личности. Нет, он не разговаривает сам с собой в шапочке из фольги. Просто если Сашу бьют по голове, он «превращается» в Федора, подозрительно похожего на актера Михаила Галустяна. \r\n\r\nФедор, в отличие от Саши, знает, что делать со своими желаниями — немедленно исполнять! Хочется нахамить соседу? Зажать на вечеринке однокурсницу? Угнать джип? Мало, кто решится на такое, но Федор может все.', 0, 'Зайцев + 1', 'Zaicev+1', 'нет', '0000-00-00', 2011, 2012, 'Россия', 'нет', 12, 0, 0, '23 мин', 'Максим Пежемский', 'Михаил Галустян, Филипп Котов, Иван Громов, Наталья Костенева, Александр Солдаткин, Надежда Иванова'),
(156, 2, 'Действие происходит в недалеком будущем. Главный герой, Михаил Галкин, замечает, как вокруг накапливаются перемены… Происходят события, казалось бы, не связанные между собой… Он обнаруживает глобальный заговор и понимает, что за этим заговором стоят скрытые ...', 'Действие происходит в недалеком будущем. Главный герой, Михаил Галкин, замечает, как вокруг накапливаются перемены… Происходят события, казалось бы, не связанные между собой… Он обнаруживает глобальный заговор и понимает, что за этим заговором стоят скрытые силы, контролирующие наш мир. И эти силы не принадлежат человеческой цивилизации. Герой начинает против них войну. Войну, которую нельзя проиграть.', 0, 'Москва 2017', '-', 'Branded', '0000-00-00', 2012, 2012, 'США', '-', 28, 0, 26, '106 мин', 'Джейми Брэдшоу, Александр Дулерайн', 'Эд Стоппард, Джефри Тэмбор, Лили Собески, Джон Ласковски, Макс фон Сюдов, Ингеборга Дапкунайте, Андрей Кайков, Атанас Сребрев, Эмма Стикгольд, Любомир Йончев'),
(157, 2, 'За внимание манерной девушки Беллы соревнуются гламурный вампир Эдвард, его уменьшенная копия — карлик Маленький Эдвард, и толстый оборотень Джейкоб. Дополнительную суматоху вносит банда «Сосунков» — молодых вампиров...', 'За внимание манерной девушки Беллы соревнуются гламурный вампир Эдвард, его уменьшенная копия — карлик Маленький Эдвард, и толстый оборотень Джейкоб. Дополнительную суматоху вносит банда «Сосунков» — молодых вампиров, выследивших Беллу по запаху уникального экземпляра порно-журнала «Чёрные стволы», и прибывающих из Сиеттла с целью её убить. Семье вампиров Калленов и стае оборотней предстоит вместе защищать Беллу в смертельной битве с силами зла, чтобы Эдвард и Белла смогли, наконец, пожениться.', 0, 'Вампиранутые', '-', 'Breaking Wind', '0000-00-00', 2011, 2011, 'США', '-', 12, 0, 0, '79 мин', 'Крэйг Мосс', 'За внимание манерной девушки Беллы соревнуются гламурный вампир Эдвард, его уменьшенная копия — карлик Маленький Эдвард, и толстый оборотень Джейкоб. Дополнительную суматоху вносит банда «Сосунков» — молодых вампиров, выследивших Беллу по запаху уникального экземпляра порно-журнала «Чёрные стволы», и прибывающих из Сиеттла с целью её убить. Семье вампиров Калленов и стае оборотней предстоит вместе защищать Беллу в смертельной битве с силами зла, чтобы Эдвард и Белла смогли, наконец, пожениться.'),
(158, 2, 'Молодые миллионеры Бен и Чон ведут дела на побережье Калифорнии. Бен — выдающийся ботаник и талантливый бизнесмен, Чон — мастер возвращения долгов и борьбы с конкурентами. В их работе много сложных моментов, ведь они выращивают лучшую в мире траву. Особо серьезные проблемы решает знакомый агент ФБР.', 'Молодые миллионеры Бен и Чон ведут дела на побережье Калифорнии. Бен — выдающийся ботаник и талантливый бизнесмен, Чон — мастер возвращения долгов и борьбы с конкурентами. В их работе много сложных моментов, ведь они выращивают лучшую в мире траву. Особо серьезные проблемы решает знакомый агент ФБР.\r\n\r\nНо с одной не сможет помочь даже он. Сверхприбыльным бизнесом заинтересовался мексиканский картель. Его возглавляет прекрасная Елена, и она нашла главную слабость друзей — и Бен, и Чон принадлежат одной девушке. Ради прелестной О. они готовы на все. Любовь делает нас особо опасными.', 0, 'Особо опасны', '-', 'Savages', '0000-00-00', 2012, 2012, 'США', '$45 000 000', 26, 15, 9, '130 мин', 'Оливер Стоун', 'Тейлор Китч, Блейк Лайвли, Аарон Джонсон, Джон Траволта, Бенисио Дель Торо, Сальма Хайек, Яна Бенкер, Candra Docherty, Патрик Фоурми, Гари Стретч'),
(159, 2, 'Представьте себе, что всем известная история Золушки, превращается в анимационную комедию, да еще и снятую в 3D! Вам интересно? А если представить, что Золушка живет в волшебной стране, по которой путешествует русский принц со своей тётей?', 'Представьте себе, что всем известная история Золушки, превращается в анимационную комедию, да еще и снятую в 3D! Вам интересно? А если представить, что Золушка живет в волшебной стране, по которой путешествует русский принц со своей тётей? Еще интереснее? Вас ждут невероятные приключения, похищения и погони, большая дружба, настоящая любовь и… выбитый зуб! И никто, ни злая мачеха со своими дочками, ни разбойники-пираты не смогут помешать Золушке и Принцу обрести свое счастье!', 0, 'Золушка: Полный вперед!', '-', 'Cendrillon au Far West', '0000-00-00', 2012, 2012, 'Франция', '$412 683', 18, 0, 0, '85 мин', 'Паскаль Эрольд', 'Александра Лами, Иоланда Моро, Изабель Нанти, Антуан де Кон, Мишель Бужена Роли дублировали: Валерия Кудрявцева, Тимур Родригез, Мария Аронова'),
(160, 2, 'Орбитальная станция MS1 — крупнейшая космическая тюрьма, где в анабиозе содержатся тысячи опасных преступников. Ходят слухи, что над погруженными в искусственный сон узниками проводятся противозаконные эксперименты. С расследованием на станцию отправлена комиссия во главе с Эмили Уорнок, дочерью президента США.', 'Орбитальная станция MS1 — крупнейшая космическая тюрьма, где в анабиозе содержатся тысячи опасных преступников. Ходят слухи, что над погруженными в искусственный сон узниками проводятся противозаконные эксперименты. С расследованием на станцию отправлена комиссия во главе с Эмили Уорнок, дочерью президента США.\r\n\r\nНеожиданно ситуация выходит из-под контроля, и вся станция оказывается захвачена уголовниками. Спецагент Сноу, несправедливо обвиненный в государственной измене, получает задание проникнуть в самую неприступную тюрьму во Вселенной и спасти Эмили. Это его единственный шанс вернуть себе доброе имя и получить свободу.', 0, 'Напролом', '-', 'Lockout', '0000-00-00', 2011, 2011, 'Франция', '$20 000 000', 28, 26, 3, '95 мин', 'Джеймс Мэтер, Стивен Ст. Леджер', 'Гай Пирс, Мэгги Грэйс, Винсент Риган, Джозеф Гилган, Ленни Джеймс, Петер Стормаре, Джеки Идо, Тим Плестер, Энн-Соленн Хатте'),
(161, 2, 'Депрессивный главный герой всегда и всем говорил «нет» — например, друзьям, если они зовут куда-то. Но в один прекрасный день он заключает соглашение, по которому всегда должен отвечать «Да» на любое предложение…', 'Депрессивный главный герой всегда и всем говорил «нет» — например, друзьям, если они зовут куда-то. Но в один прекрасный день он заключает соглашение, по которому всегда должен отвечать «Да» на любое предложение…', 0, 'Всегда говори «ДА» ', '-', 'Yes Man', '0000-00-00', 2008, 2008, 'США, Австралия', '$70 000 000', 12, 0, 0, '104 мин', 'Пейтон Рид', 'Джим Керри, Зои Дешанель, Брэдли Купер, Джон Майкл Хиггинс, Риз Дэрби, Дэнни Мастерсон, Фионнула Флэнаган, Теренс Стэмп, Саша Александр.\r\nМолли Симс'),
(162, 2, 'У слоненка Хортона такие большие уши, что он, оказывается, может слышать даже то, как с ним говорит цветок. Вернее, существа, которые живут в нем. Но если слоненок начинает говорить и прислушиваться к цветку, наверное он ненормальный? Так посчитали все звери. Но Хортону все равно. Он считает своим долгом спасти население цветка от угрозы извне.', 'У слоненка Хортона такие большие уши, что он, оказывается, может слышать даже то, как с ним говорит цветок. Вернее, существа, которые живут в нем. Но если слоненок начинает говорить и прислушиваться к цветку, наверное он ненормальный? Так посчитали все звери. Но Хортону все равно. Он считает своим долгом спасти население цветка от угрозы извне.', 0, 'Хортон', '-', 'Horton Hears a Who!', '0000-00-00', 2008, 2008, 'США', '$85 000 000', 18, 23, 21, '82 мин', 'Джимми Хейуорд, Стив Мартино', 'Джим Керри, Стив Карелл, Кэрол Бёрнетт, Уилл Арнетт, Сет Роген, Дэн Фоглер, Айла Фишер, Джона Хилл, Эми Полер, Джейми Прессли.'),
(163, 2, 'Съемочная группа одного малобюджетного хоррора выбирается в дикую местность для съемок одного из эпизодов этого фильма. Однако, вскоре они оказываются сами героями самого настоящего фильма ужасов, т. к. их начинает преследовать стая чудовищ, обитающих в этом лесу.', 'Съемочная группа одного малобюджетного хоррора выбирается в дикую местность для съемок одного из эпизодов этого фильма. Однако, вскоре они оказываются сами героями самого настоящего фильма ужасов, т. к. их начинает преследовать стая чудовищ, обитающих в этом лесу.', 0, 'Монстры в лесах', '-', 'Monsters in the Woods', '0000-00-00', 2012, 2012, 'США', '$30 000', 27, 0, 0, '96 мин', 'Джейсон Хортон', 'Гленн Пламмер, Ли Перкинс, Линда Белла, Эдвард Хендершотт, Клаудия Переа, Блейн Кейд, Глэдис Отеро, Эштон Бланчард, Пол Мишко, Курт Мега'),
(250, 2, 'Бекки, не вампир, разрывается между двумя парнями. Также девушка должна донести свой выбор до отца, который является настоящим тираном и считает ее ребенком. Тем временем у друзей Бекки происходят всякие романтические глупости, которые сплетаются в один клубок на выпускном.', 'Бекки, не вампир, разрывается между двумя парнями. Также девушка должна донести свой выбор до отца, который является настоящим тираном и считает ее ребенком. Тем временем у друзей Бекки происходят всякие романтические глупости, которые сплетаются в один клубок на выпускном.', 0, 'Вампирский засос', '-', 'Vampires Suck', '0000-00-00', 2010, 2010, 'США ', '$20 000 000', 12, 0, 0, '80 мин.', 'Джейсон Фридберг, Аарон Зельцер', 'Дженн Проске, Мэтт Лантер,\r\nДидрих Бадер, Крис Ригги, Кен Жонг, Аннелис Ван Дер Пол, Дэвид ДеЛуис, Келси Форд, Дэйв Фоли, Мэттью Варзел.'),
(251, 2, 'Лояльность Бонда своей начальнице М под угрозой со стороны ее прошлого, которое внезапно даст о себе знать. MI6 подвергается нападению, и агент 007 должен ликвидировать угрозу, несмотря на цену, которую придется заплатить.', 'Лояльность Бонда своей начальнице М под угрозой со стороны ее прошлого, которое внезапно даст о себе знать. MI6 подвергается нападению, и агент 007 должен ликвидировать угрозу, несмотря на цену, которую придется заплатить.', 0, '007: Координаты Скайфолл', 'n', 'o', '0000-00-00', 2012, 2012, 'Великобритания, США', '$150 000 000', 3, 26, 15, '143 мин', 'Сэм Мендес', 'Дэниэл Крэйг, Хавьер Бардем, Джуди Денч, Рэйф Файнс,Бен Уишоу, Наоми Харрис, Альберт Финни, Беренис Марло, Хелен МакКрори, Тония Сотирополо'),
(252, 2, 'Пятидесятый год до нашей эры. Юлий Цезарь рвется к новым завоеваниям. Во главе своих прославленных легионов он собирается захватить остров, который находится на самом краю света — таинственную страну, именуемую Британией...\r\n', 'Пятидесятый год до нашей эры. Юлий Цезарь рвется к новым завоеваниям. Во главе своих прославленных легионов он собирается захватить остров, который находится на самом краю света — таинственную страну, именуемую Британией.\r\n\r\nВойско Цезаря одерживает быструю и безоговорочную победу. Ну… почти безоговорочную: одна крошечная деревушка продолжает яростно обороняться, однако силы на исходе, и королева бриттов Корделия отправляет своего самого надежного офицера Красовакса за подмогой в Галлию, где находится такая же маленькая деревушка, известная своим упорным сопротивлением римлянам.\r\n\r\nМежду тем, у Астерикса с Обеликсом и так забот хватает. Вождь поручил им сделать настоящего мужчину из Гадорикса, своего надоедливого племянника, недавно приехавшего из Лютеции, а выполнить это крайне непросто. Когда к галлам приезжает Красовакс, те снабжают его бочонком своего знаменитого волшебного зелья, а Астерикс и Обеликс отправляются вместе с ним в Британию. Гадорикса они тоже берут с собой, ведь путешествие — отличный способ пополнить образование молодого человека.\r\n\r\nНо, к сожалению, все идет не так, как задумывалось…', 0, 'Астерикс и Обеликс в Британии', 'n', 'o', '0000-00-00', 2012, 2012, 'Венгрия, Испания, Италия, Франция', '€60 000 000', 12, 21, 23, '110 мин', 'Лоран Тирар', 'Жерар Депардье, Эдуард Баэр, Гийом Гальенн, Венсан Лакост, Валери Лемерсье, Фабрис Лукини, Катрин Денёв, Шарлотта Лебон, Боли Ланнерс, Дэни Бун');
INSERT INTO `data` (`id`, `cat`, `shot_text`, `all_text`, `view`, `name_ru`, `tname`, `name_en`, `date`, `fyear`, `lyear`, `strana`, `budget`, `genre1`, `genre2`, `genre3`, `time`, `director`, `in_role`) VALUES
(165, 3, 'История о певице, которая на пике своей славы попала в автокатастрофу и оказалась прикованной к больничной койке. 12 дней восходящая звезда Анна Герман не приходила в сознание. В те дни ей пришлось снова пережить трагические события своего детства – арест отца, обвиненного в шпионаже, скитания их осиротелой семьи по Средней Азии, смерть маленького брата, войну и побег в Польшу в надежде скрыться от преследователей из НКВД… ', 'История о певице, которая на пике своей славы попала в автокатастрофу и оказалась прикованной к больничной койке. 12 дней восходящая звезда Анна Герман не приходила в сознание. В те дни ей пришлось снова пережить трагические события своего детства – арест отца, обвиненного в шпионаже, скитания их осиротелой семьи по Средней Азии, смерть маленького брата, войну и побег в Польшу в надежде скрыться от преследователей из НКВД… Первую любовь и первый успех… Никто из врачей не верил, что она выживет. А если даже это случится, ей пророчили полную неподвижность до конца жизни. Однако, после 12 дней комы небо даровало ей шанс начать жизнь заново. И она совершила невозможное, став «белым ангелом» советской эстрады…', 0, 'Анна Герман. Тайна белого ангела', 'no', 'no', '0000-00-00', 2012, 2012, 'Россия', 'неизвестно', 9, 2, 0, '50 мин', 'Артём Антонов', 'Иоанна Моро, Шимон Сендровский, Марат Башаров, Мария Порошина, Екатерина Васильева, Константин Милованов'),
(166, 2, 'Джиб и Сыа вместе уже 3 года, но вынуждены скрывать свои отношения, т. к. условия контракта запрещают сотрудникам банка быть больше, чем...', 'Джиб и Сыа вместе уже 3 года, но вынуждены скрывать свои отношения, т. к. условия контракта запрещают сотрудникам банка быть больше, чем просто друзьями. Когда они решают пожениться, встает вопрос — кто же из них должен уволиться? Тогда они заключают пари: тот, кто раскроет инцидент с неисправным банкоматом, выдавшим лишние 130 тысяч бат, и вернет деньги — остается, а другой должен уволиться. Но в этой «битве полов», «любви и карьеры» все пошло совсем не по плану…', 0, 'Ошибка банкомата', '-', 'ATM: Er Rak Error', '0000-00-00', 2012, 2012, 'Таиланд', '-', 16, 0, 12, '123 мин', 'Mez Tharatorn', 'Чантавит Танасеви, Притья Понтананикон, Чалемпол Тикампонтиравонг, Тават Понраттанапрасет, Санантачат Танапатписан, Понкун Сыэбсанг, Путтачат Понсучат, Компоп Чанчароэн, Яни Трамод'),
(167, 2, 'Что, если в стране произвол? Что, если он убил людей и остался безнаказанным? Что, если он чертовски умен и решает поиграть в супергероя и параллельно сорвать куш? Что, если все спланировано до мельчайших деталей?', 'Что, если в стране произвол? Что, если он убил людей и остался безнаказанным? Что, если он чертовски умен и решает поиграть в супергероя и параллельно сорвать куш? Что, если все спланировано до мельчайших деталей?', 0, '2 Зайца', '-', '2 Coelhos', '0000-00-00', 2012, 2012, 'Бразилия', 'BRL 3 500 000', 3, 0, 0, '108 мин.', 'Afonso Poyart', 'Фернанду Алвис Пинту, Каку Сиоклер, Марат Дескартеш, Djair Guilherme, Роберто Марчезе, Aldine Muller, Алессандра Негрини, Робсон Нюнс, Afonso Poyart и др.'),
(168, 2, 'Сюжет фильма раскрывает тайную жизнь Величайшего Президента Америки Авраама Линкольна — любящего мужа и отца днем и беспощадного убийцу вампиров ночью. Армия кровопийц, которым он бросил вызов, растет с каждым днем. Сможет ли президент великой страны противостоять полчищам вампиров и спасти свою семью и народ от неминуемой гибели?..', 'Сюжет фильма раскрывает тайную жизнь Величайшего Президента Америки Авраама Линкольна — любящего мужа и отца днем и беспощадного убийцу вампиров ночью. Армия кровопийц, которым он бросил вызов, растет с каждым днем. Сможет ли президент великой страны противостоять полчищам вампиров и спасти свою семью и народ от неминуемой гибели?..', 0, 'Президент Линкольн: Охотник на вампиров', '-', 'Abraham Lincoln: Vampire Hunter', '0000-00-00', 2012, 2012, 'США', '$69 000 000', 27, 3, 30, '105 мин', 'Тимур Бекмамбетов', ' Бенджамин Уокер, Доминик Купер, Энтони Маки, Мэри Элизабет Уинстэд, Руфус Сьюэлл, МартонЧокаш, Джимми Симпсон, Джозеф Моул, Робин МакЛиви, Эрин Уоссон'),
(169, 2, 'Они встретились на просторах дикой природы — 16-летняя Кейти и 2-летняя дикая лошадь. Они внешне такие разные: человек и животное, но внутренне они очень схожи. Гордые, независимые, жизнелюбивые, стремящиеся к свободе. Они могут простить обиду и боль, но не предательство. Чистота их искренних отношений порождает настоящую любовь, идущую от силы духа.', 'Они встретились на просторах дикой природы — 16-летняя Кейти и 2-летняя дикая лошадь. Они внешне такие разные: человек и животное, но внутренне они очень схожи. Гордые, независимые, жизнелюбивые, стремящиеся к свободе. Они могут простить обиду и боль, но не предательство. Чистота их искренних отношений порождает настоящую любовь, идущую от силы духа.', 0, 'Флика', '-', 'Flicka', '0000-00-00', 2006, 2006, 'США, Великобритания', '$15 000 000', 9, 23, 21, '95 мин.', 'Майкл Майер', ' Лиза Хартман, Кейси Рол, Макс Ллойд-Джонс, Клинт Блэк, Шиван Уильямс, Александр Кэлверт, Эмили Бетт Рикардс, Рустин Гресук, Катхарине Кинг, Русти Хумпхриес'),
(170, 2, 'Вы хотели бы начать жизнь сначала? Отец двоих детей Майк О`Доннелл хотел бы. И вот внезапно ему выпадает волшебный шанс вернуться в родную школу Хэйден Хай. Теперь Майк — звезда баскетбольной команды, мечта девчонок и одноклассник собственных отпрысков, превратившийся из нерадивого папаши в отличного друга.', 'Вы хотели бы начать жизнь сначала? Отец двоих детей Майк О`Доннелл хотел бы. И вот внезапно ему выпадает волшебный шанс вернуться в родную школу Хэйден Хай. Теперь Майк — звезда баскетбольной команды, мечта девчонок и одноклассник собственных отпрысков, превратившийся из нерадивого папаши в отличного друга.', 0, 'Папе снова 17', '-', '17 Again', '0000-00-00', 2009, 2009, 'США', '$20 000 000', 30, 12, 16, '102 мин. ', 'Бёрр Стирс', 'Зак Эфрон, Лесли Манн, Томас Леннон, Мэттью Перри, Тайлер Стилман, Эллисон Миллер, Стерлинг Найт, Мишель Трахтенберг, Адам Грегори.\r\nХантер Пэрриш'),
(171, 2, 'Когда Папи с сопровождающей его компанией перебираются в роскошный отель, то его самый юный щенок по кличке Роза чувствует себя заброшенным, и Папи должен сделать все, чтобы доказать, что этот щенок очень важен для него.', 'Когда Папи с сопровождающей его компанией перебираются в роскошный отель, то его самый юный щенок по кличке Роза чувствует себя заброшенным, и Папи должен сделать все, чтобы доказать, что этот щенок очень важен для него.', 0, 'Крошка из Беверли-Хиллз 3', '-', 'Beverly Hills Chihuahua 3: Viva La Fiesta!', '0000-00-00', 2012, 2012, 'США', '-', 12, 0, 23, '89 мин ', 'Лев Л. Спиро', 'Одетт Эннэйбл, Эмили Осмент, Кей Панабэйкер, Том Кенни, Фрэнсис Фишер'),
(172, 2, 'Лост Кост — отдалённое местечко на калифорнийском побережье, где по слухам обитает легендарный йети. Выяснить, так это или нет, решает команда молодых телевизионщиков. Вооружившись камерой, они едут на встречу с неким Драйбеком, живущим в тамошних лесах и заявляющим, что нашёл в лесу труп снежного человека.', 'Лост Кост — отдалённое местечко на калифорнийском побережье, где по слухам обитает легендарный йети. Выяснить, так это или нет, решает команда молодых телевизионщиков. Вооружившись камерой, они едут на встречу с неким Драйбеком, живущим в тамошних лесах и заявляющим, что нашёл в лесу труп снежного человека.', 0, 'Пленки из Лост Коста', '-', 'The Lost Coast Tapes', '0000-00-00', 2012, 2012, 'США', '-', 27, 6, 26, '86 мин', 'Кори Грант', 'Дрю Рауш, Рич МакДональд, Эшли Вуд, Ной Вайсберг, Фрэнк Эшмор, Роуди Келли, Яфет Гордон'),
(173, 2, 'Действие картины разворачивается в двух временных пластах: в наши дни и в годы войны, во время тяжелых оборонительных боев августа 1942-го. Главные герои ленты — четверо «черных следопытов» (людей этой сомнительной профессии называют также «черными копателями») — Борман, Череп, Чуха и Спирт. Они ведут раскопки в тех местах, где когда-то шли бои, чтобы потом продать найденные медали, ордена, документы и немецкое оружие.', 'ействие картины разворачивается в двух временных пластах: в наши дни и в годы войны, во время тяжелых оборонительных боев августа 1942-го. Главные герои ленты — четверо «черных следопытов» (людей этой сомнительной профессии называют также «черными копателями») — Борман, Череп, Чуха и Спирт. Они ведут раскопки в тех местах, где когда-то шли бои, чтобы потом продать найденные медали, ордена, документы и немецкое оружие.\r\n\r\nДело это выгодное, но опасное. Однажды на месте раскопок начинает происходить нечто странное: в найденных солдатских книжках, принадлежавших погибшим солдатам Красной армии, вдруг обнаруживаются фотографии самих «следопытов». Пытаясь прийти в себя, коллеги по «черному» бизнесу отправляются купаться в озере и… попадают в 1942 год. В самый разгар тяжелых боев.', 0, 'Мы из будущего', '-', '-', '0000-00-00', 2008, 2008, 'Россия', '$5 000 000', 28, 5, 3, '115 мин', 'Андрей Малюков', ' Данила Козловский, Андрей Терентьев, Владимир Яглыч, Дмитрий Волкострелов, Екатерина Климова, Борис Галкин, Даниил Страхов, Сергей Маховиков, Игорь Черневич, Ральф Шиха, Зоя Буряк, Сергей Мухин'),
(174, 2, '27 октября 1930 года на Тайване произошли события, получившие название «Инцидент в Ушэ». Мона Рудо, вождь племени сидик, был свидетелем репрессий со стороны японцев в течение 30 лет. Во время японской оккупации Тайваня коренной горный народ — сидики — подверглись насилию со стороны японцев.', '27 октября 1930 года на Тайване произошли события, получившие название «Инцидент в Ушэ». Мона Рудо, вождь племени сидик, был свидетелем репрессий со стороны японцев в течение 30 лет. Во время японской оккупации Тайваня коренной горный народ — сидики — подверглись насилию со стороны японцев.\r\n\r\nОни лишились своей культуры и веры. Мужчины тяжело работали и мало получали, им запретили традиционную охоту. Женщины должны были прислуживать японским полицейским и членам их семей. Им запретили ткачество.\r\n\r\nГлавным поводом для «Инцидента в Ушэ» стал случай, когда один из японских полицейских, патрулируя селение Мехебу, попал на свадьбу. Старший сын вождя, Тода Мона, должен был принести в жертву кабана. Он увидел полицейского и решил угостить его вином. Тода взял его за руку, но японец брезгливо отказался, потому что руки сына вождя были испачканы кровью. Завязалась драка, полицейского сильно избили. Мона Рудо, пытаясь уладить конфликт, отправился в полицейский участок, чтобы принести извинения. Но извинения японцы не приняли. Гордый Мона Рудо не мог вынести такого унижения. Вместе с молодежью племени он организовал сопротивление японцам.', 0, 'Воины радуги: Сидик бале', '-', 'Sàidékè balái', '0000-00-00', 2011, 2011, 'Тайвань', '$23 000 000', 3, 11, 9, '276 мин', 'Вей Те-Шен', 'Линь Чинтай, Да Чин, Масанобу Андо, Умин Боя, Сю Ифань'),
(175, 2, 'Китай, 209-202 гг. до н. э. Народ восстал против тирании династии Цинь. Генералы Лю Бан и Сян Юй возглавили основные силы бунтовщиков ивыдвинули Хуай-вана из рода Чу главным кандидатом на трон императора Цинь. Вместе воюя, они становятся побратимами...', ' Китай, 209-202 гг. до н. э. Народ восстал против тирании династии Цинь. Генералы Лю Бан и Сян Юй возглавили основные силы бунтовщиков ивыдвинули Хуай-вана из рода Чу главным кандидатом на трон императора Цинь. Вместе воюя, они становятся побратимами.Но Хуай-ван не до конца доверял им и знал, что они могут предать его. Он организовал заговор, дабы Лю Бан и Сян Юй погубили друг друга.Хуай-ван издал приказ, что тот, кто займёт Гуаньчжун (долину в центре провинции Шэньси, столица Сяньян) получит эту область в свое управление.Прежней дружбе приходит конец, Лю Бан и Сян Юй стают злейшими врагами. Сян Юй хитростью заманивает Лю Бана на пир в Хунмэне.', 0, 'Белая месть', 'White_Vengeance', 'White Vengeance', '0000-00-00', 2011, 2011, 'Китай', '-', 9, 3, 11, '135 мин', 'Дэниэл Ли', 'Шао-Фэн Фэн, Леон Лай, Чжан Ханьюй, Энтони Вонг Чау-Санг, Йифей Лью, Джордан Чан, Энди Он, Цин Сю, Дин Хайфэн, Ксинг Донг Ксу, Чен Зи Хуи, Куан-Тай Чен, Хюнан Чжао, Цзя Цин, Тонг-ди-Мэн, Цзы-Ци Хуан, Ма Ву, Джон До, Чжао Вэнь Хао'),
(176, 2, 'История молодого чернокожего пилота, который превозмогая расизм и неприязнь, сумел сплотить братьев по крови и создал первый в истории воздушный батальон, состоящий исключительно из афроамериканцев.', 'История молодого чернокожего пилота, который превозмогая расизм и неприязнь, сумел сплотить братьев по крови и создал первый в истории воздушный батальон, состоящий исключительно из афроамериканцев.', 0, 'Красные xвосты', '-', 'Red Tails', '0000-00-00', 2012, 2012, 'США', '$58 000 000', 3, 5, 9, '120 мин', 'Энтони Хемингуэй', 'Терренс Ховард, Нэйт Паркер, Тристан Уайлдс, Элайджа Келли, Лесли Одом мл., Кевин Филлипс, Метод Мэн, Ли Тергесен, Даниэла Руа, Мэттью Марш'),
(177, 2, 'Лента рассказывает реальную историю загадочного Оскара Шиндлера, члена нацистской партии, преуспевающего фабриканта, спасшего во время Второй мировой войны более тысячи ста евреев. Это триумф одного человека, не похожего на других, и драма тех, кто, благодаря ему, выжил в ужасный период человеческой истории.', 'Лента рассказывает реальную историю загадочного Оскара Шиндлера, члена нацистской партии, преуспевающего фабриканта, спасшего во время Второй мировой войны более тысячи ста евреев. Это триумф одного человека, не похожего на других, и драма тех, кто, благодаря ему, выжил в ужасный период человеческой истории.', 0, 'Список Шиндлера', '-', 'Schindlers List', '0000-00-00', 1993, 1993, 'США', '$22 000 000', 9, 11, 5, '195 мин', 'Стивен Спилберг', 'Лиам Нисон, Бен Кингсли, Рэйф Файнс, Кэролайн Гудолл, Эмбет Дэвидц, Джонатан Сагалл, Малгоша Гебель, Шмуэль Леви, Марк Иванир, Беатриче Макола.'),
(178, 2, 'В великой Римской империи не было военачальника, равного генералу Максимусу. Непобедимые легионы, которыми командовал этот благородный воин, боготворили его и могли последовать за ним даже в ад...', ' великой Римской империи не было военачальника, равного генералу Максимусу. Непобедимые легионы, которыми командовал этот благородный воин, боготворили его и могли последовать за ним даже в ад.\r\n\r\nНо случилось так, что отважный Максимус, готовый сразиться с любым противником в честном бою, оказался бессилен против вероломных придворных интриг. Генерала предали и приговорили к смерти. Чудом избежав гибели, Максимус становится гладиатором.\r\n\r\nБыстро снискав себе славу в кровавых поединках, он оказывается в знаменитом римском Колизее, на арене которого он встретится в смертельной схватке со своим заклятым врагом…', 0, 'Гладиатор', 'Gladiator', 'Gladiator', '0000-00-00', 2000, 2000, 'США, Великобритания', '$103 000 000', 3, 11, 9, '171 мин', 'Ридли Скотт', 'Рассел Кроу, Хоакин Феникс, Конни Нильсен, Оливер Рид, Ричард Харрис, Дерек Джекоби, Джимон Хунсу, Дэвид Скофилд, Джон Шрэпнел, Томас Арана.'),
(179, 2, 'Фильм повествует о судьбе Владислава Шпильмана — выдающегося польского пианиста, еврея по национальности. Вынужденный жить в Варшавском гетто во время Второй мировой войны, он сполна познает вкус унижений, страдания и борьбы...', 'Фильм повествует о судьбе Владислава Шпильмана — выдающегося польского пианиста, еврея по национальности. Вынужденный жить в Варшавском гетто во время Второй мировой войны, он сполна познает вкус унижений, страдания и борьбы. Один из офицеров отступающей немецкой армии обнаруживает его среди руин разрушенного бомбежками города и помогает ему выжить.', 0, 'Пианист', 'The_Pianist', 'The Pianist', '0000-00-00', 2002, 2002, 'Польша, Франция, Великобритания, Германия', '$35 000 000', 9, 2, 5, '150 мин', 'Роман Полански', 'Эдриан Броуди, Эмилия Фокс, Михал Жебровский, Эд Стоппард, Морин Липмен, Фрэнк Финлей, Джессика Кейт Мейер, Джулия Рейнер, Ваня Муес, Ричард Райдингс.'),
(180, 2, 'В этом фильме суд на Жанной д`Арк, который в действительности длился целый год, спрессован в один единственный день. В этот день её неоднократно допрашивает...', 'В этом фильме суд на Жанной д`Арк, который в действительности длился целый год, спрессован в один единственный день. В этот день её неоднократно допрашивает духовный суд, ей постоянно угрожают пытками, её лишают причастия, если только она не сознается в колдовстве. Наконец, когда она сталкивается с тем, чтобы быть сожжённой заживо, она отрекается, но после отрекается от своего отречения, и ее публично казнят.', 0, 'Страсти Жанны Дарк', '-', 'La passion de Jeanne dArc', '0000-00-00', 1928, 1928, 'Франция', '-', 9, 11, 2, '96 мин', 'Карл Теодор Дрейер', 'Мария Фальконетти, Эжен Сильвен, Антонен Арто, Андре Берлей, Морис Шюц, Жан дИд, Луи Раве, Арман Люрвиль, Мишель Симон, Жак Арнна.'),
(181, 2, 'Сюжет ленты расскажет о герцоге, который готовится вступить в должность британского короля Георга VI, отца нынешней королевы Елизаветы II. После того, как его брат отрекается от престола, герой неохотно соглашается на трон. Измученный страшным нервным заиканием и сомнениями в своих способностях руководить...', 'Сюжет ленты расскажет о герцоге, который готовится вступить в должность британского короля Георга VI, отца нынешней королевы Елизаветы II. После того, как его брат отрекается от престола, герой неохотно соглашается на трон. Измученный страшным нервным заиканием и сомнениями в своих способностях руководить страной, Георг обращается за помощью к неортодоксальному логопеду по имени Лайонел Лог.', 0, 'Король говорит!', '-', 'The Kings Speech', '0000-00-00', 2010, 2010, 'Великобритания', '$15 000 000', 9, 11, 2, '118 мин', 'Том Хупер', 'Колин Фёрт, Джеффри Раш, Хелена Бонем Картер, Гай Пирс, Тимоти Сполл, Энтони Эндрюс, Майкл Гэмбон\r\nКлер Блум, Дерек Джекоби, Дженнифер Эль.'),
(182, 2, 'Фильм основан на реальных событиях. Действия разворачиваются в период японо-китайской войны. Главный герой, американский гробовщик Джон, направляется в Католическую церковь в Нанкине, чтобы подготовить священника к похоронам.', 'Фильм основан на реальных событиях. Действия разворачиваются в период японо-китайской войны. Главный герой, американский гробовщик Джон, направляется в Католическую церковь в Нанкине, чтобы подготовить священника к похоронам. По прибытию он оказывается единственным мужчиной среди учениц монастыря и проституток из соседнего борделя в эпицентре военных действий. Оказавшись в таком положении, он выдаёт себя за священника и пытается спасти обе группы от ужасов вторжения японской армии…', 0, 'Цветы войны', '-', 'Jin líng shí san chai', '0000-00-00', 2011, 2011, 'Китай, Гонконг', '$94 000 000', 9, 11, 5, '146 мин', 'Чжан Имоу', 'Кристиан Бэйл, Ни Ни, Синю Чжан, Тяньюань Хуанг, Хань Ситин, Дуду Чжан, Тун Давэй, Ацуро Ватабэ, Цао Кэфань, Юань Яньчунци.'),
(183, 2, 'Вторая Мировая война закончилась, но Китай все еще слаб и беден. Ип Ман открывает свою школу боевых искусств, однако завоевать свое место под солнцем оказывается непросто — чтобы избежать проблем...', 'Вторая Мировая война закончилась, но Китай все еще слаб и беден. Ип Ман открывает свою школу боевых искусств, однако завоевать свое место под солнцем оказывается непросто — чтобы избежать проблем, Ип Ману нужно сначала завоевать уважение представителей других кунгфу-школ, а председательствующему в их ассоциации Хунгу Ип Ман не понравился с первого взгляда. А тем временем в Гонконге усиливается присутствие британцев, и некоторые из них плевать хотели на китайские традиции и обычаи.', 0, 'Ип Ман 2', '-', 'Yip Man 2', '0000-00-00', 2010, 2010, 'Гонконг, Китай', '$205 675', 3, 11, 2, '108 мин.', 'Уилсон Ип', 'Донни Ен, Линн Хунг, Саймон Ям, Саммо Хунг Кам-Бо, Хуан Сяомин, Фан Сю-Вонг, Кент Чэн, Даррен Шахлави, Брюс Блэйн, Эмбер Чиа.'),
(184, 2, 'Фильм даст совершенно неожиданный ответ на извечный вопрос: а кем же «был или не был» Шекспир, и кто на самом деле скрывается за этим всемирно известным именем великого человека?', 'Фильм даст совершенно неожиданный ответ на извечный вопрос: а кем же «был или не был» Шекспир, и кто на самом деле скрывается за этим всемирно известным именем великого человека?', 0, 'Аноним', '-', 'Anonymous', '0000-00-00', 2011, 2011, 'Великобритания, Германия', '$30 000 000', 26, 11, 9, '130 мин', 'Роланд Эммерих', 'Рис Иванс, Себастьян Фернандес-Арместо, Джейми Кэмпбелл Бауэр, Джоэли Ричардсон, Рейф Сполл, Ванесса Редгрейв, Завьер Сэмюэл, Дэвид Тьюлис, Эдвард Хогг, Сэм Рейд.'),
(185, 2, 'Биографический фильм про Тэмпл Грандин, аутистку, которая стала одной из ведущих учёных в области сельскохозяйственной промышленности по гуманному обращению со скотом.', 'Биографический фильм про Тэмпл Грандин, аутистку, которая стала одной из ведущих учёных в области сельскохозяйственной промышленности по гуманному обращению со скотом.', 0, 'Тэмпл Грандин', '-', 'Temple Grandin', '0000-00-00', 2010, 2010, 'США', '-', 9, 0, 2, '107 мин.', 'Мик Джексон', 'Клэр Дэйнс, Джулия Ормонд, Дэвид Стрэтэйрн, Кэтрин ОХара, Мелисса Фарман, Бэрри Табб, Стефани Фэраси, Стив Ширер, Ричард Диллард, Дженна Хьюз.'),
(186, 2, 'Кобб — талантливый вор, лучший из лучших в опасном искусстве извлечения: он крадет ценные секреты из глубин подсознания во время сна, когда человеческий разум наиболее уязвим. Редкие способности Кобба сделали его ценным игроком в привычном к предательству мире промышленного шпионажа, но ...', 'Кобб — талантливый вор, лучший из лучших в опасном искусстве извлечения: он крадет ценные секреты из глубин подсознания во время сна, когда человеческий разум наиболее уязвим. Редкие способности Кобба сделали его ценным игроком в привычном к предательству мире промышленного шпионажа, но они же превратили его в извечного беглеца и лишили всего, что он когда-либо любил. \r\n\r\nИ вот у Кобба появляется шанс исправить ошибки. Его последнее дело может вернуть все назад, но для этого ему нужно совершить невозможное — инициацию. Вместо идеальной кражи Кобб и его команда спецов должны будут провернуть обратное. Теперь их задача — не украсть идею, а внедрить ее. Если у них получится, это и станет идеальным преступлением. \r\n\r\nНо никакое планирование или мастерство не могут подготовить команду к встрече с опасным противником, который, кажется, предугадывает каждый их ход. Врагом, увидеть которого мог бы лишь Кобб.', 0, 'Начало', 'Nachalo', 'Inception', '0000-00-00', 2010, 2010, 'США, Великобритания', '$160 000 000', 28, 6, 26, '148 мин', 'Кристофер Нолан', 'Леонардо ДиКаприо, Джозеф Гордон-Левитт, Эллен Пейдж, Кен Ватанабе, Марион Котийяр, Том Харди, Киллиан Мёрфи, Том Беренджер, Майкл Кейн, Дилип Рао.'),
(187, 2, 'Смертельный T-вирус, созданный в лабораториях корпорации «Амбрелла», продолжает захватывать Землю, превращая мировое население в легионы пожирающих плоть зомби. Последняя надежда человечества Элис внедряется в самое...', 'Смертельный T-вирус, созданный в лабораториях корпорации «Амбрелла», продолжает захватывать Землю, превращая мировое население в легионы пожирающих плоть зомби. Последняя надежда человечества Элис внедряется в самое сердце самой тайной исследовательской базы корпорации и узнает еще больше о собственном таинственном прошлом. Не имея путей к отступлению, Элис продолжает искать виновных в глобальной катастрофе. Вызов, который она принимала в Токио, Нью-Йорке, Вашингтоне и даже в Москве, приводит ее в итоге к взрывающему сознание откровению, которое заставит ее переосмыслить все, что она полагала правдой. С помощью новых союзников и старых друзей, Элис будет сражаться за выживание и убегать из враждебного мира. Отсчет времени начат…', 0, 'Обитель Зла: Возмездие', '-', 'Resident Evil: Retribution', '0000-00-00', 2012, 2012, 'Германия, Канада', '-', 27, 3, 28, '95 мин', 'Пол У. С. Андерсон', 'Милла Йовович, Сиенна Гиллори, Мишель Родригес, Ариана Энджинир, Ли Бинбин, Борис Коджо, Йохан Урб, Робин Касянов, Кевин Дюран, Офилио Портильо.'),
(188, 2, 'Неизвестные похищают дочь бывшего вора в законе, решившего завязать с темным прошлым. Похитители сообщают, что держат девочку-подростка в багажнике такси. У отца есть всего несколько часов, чтобы отыскать киднепперов и спасти ребенка.', 'Неизвестные похищают дочь бывшего вора в законе, решившего завязать с темным прошлым. Похитители сообщают, что держат девочку-подростка в багажнике такси. У отца есть всего несколько часов, чтобы отыскать киднепперов и спасти ребенка.', 0, 'Медальон', 'Stolen', 'Stolen', '0000-00-00', 2012, 2012, 'США', '$35 000 000', 3, 0, 26, '95 мин', 'Саймон Уэст', 'Николас Кейдж, Джош Лукас, Дэнни Хьюстон, Малин Акерман, Сами Гэйл, М. К. Гейни, Марк Вэлли, Мэтт Нолан, Мишель Торрес, Дж.Д. Эвермор'),
(189, 2, 'История о четырнадцатилетнем мальчике Эллисе и Козопасе — сорокалетнем слабоумном, который живет рядом с Эллисом и его матерью и выполняет всю грязную работу в обмен на еду и крышу над головой для него самого и его коз. Свободное...', 'История о четырнадцатилетнем мальчике Эллисе и Козопасе — сорокалетнем слабоумном, который живет рядом с Эллисом и его матерью и выполняет всю грязную работу в обмен на еду и крышу над головой для него самого и его коз. Свободное от работы время Козопас посвящает выращиванию и употреблению марихуаны. Эллис — его единственный друг. С Козопасом мальчик готов делить даже холодные ночные переходы через пустыню в поисках новых пастбищ. Идиллия заканчивается, когда Эллису настает время отправляться на учебу на другой конец страны, в школу, за которую платит его отсутствующий отец.', 0, 'Козы', 'Kozu', 'Goats', '0000-00-00', 2012, 2012, 'США', '$3 000 000', 12, 0, 0, '94 мин', 'Кристофер Нил', 'Дэвид Духовны, Вера Фармига, Грэхэм Филлипс, Кери Рассел, Джастин Кирк, Тай Бурелл, Дакота Джонсон, Джастин Вилон, Ивэн Боймел, Тимоти Гиббс'),
(190, 2, 'История молодого бизнесмена, который должен доставить 150 000 долларов своей сестре-алкоголичке. Проблема в том, что герой со своей родственницей знаком не был и узнал о ее существовании только после смерти...', 'История молодого бизнесмена, который должен доставить 150 000 долларов своей сестре-алкоголичке. Проблема в том, что герой со своей родственницей знаком не был и узнал о ее существовании только после смерти отца. Познакомившись с ней, он не сообщает о своем родстве, но вмешивается в жизнь сестры и ее 12-летнего сына.', 0, 'Люди как мы', '-', 'People Like Us', '0000-00-00', 2012, 2012, 'США', '$16 000 000', 9, 0, 0, '115 мин', 'Алекс Куртцман', 'Крис Пайн, Элизабет Бэнкс, Мишель Пфайффер, Оливия Уайлд, Марк Дюпласс, Сара Морнелл, Филип Бейкер Холл, Дин Чеквала, Барбара Ив Харрис'),
(191, 2, 'Чудовищное цунами обрушивается на курортный город. Из морских глубин на затопленные улицы вырываются голодные и жаждущие крови акулы...', 'Чудовищное цунами обрушивается на курортный город. Из морских глубин на затопленные улицы вырываются голодные и жаждущие крови акулы. Начинается охота. Оказавшись в ловушке стихии, чудом уцелевшие люди пытаются выжить. Сможет ли Джош спасти жизнь девушки, которую он всегда любил, но однажды уже потерял?', 0, 'Цунами', '-', 'Bait', '0000-00-00', 2012, 2012, 'Австралия', 'AUD 20 000 000', 27, 26, 3, '91 мин', 'Кимбл Рендалл', 'Шарни Винсон, Завьер Сэмюэл, Фиби Тонкин, Джулиан МакМэхон, Кариба Хейн, Алекс Расселл, Линкольн Льюис, Элис Паркинсон, Дэниэл Уилли, Ричард Бранкатисано'),
(192, 2, 'Роберт Миллер — харизматичный аферист и гениальный любовник. Он привык к тому, что в постелях его всегда ждут жена и любовница, которые, правда, попеременно закатывают ему скандалы, а огромные деньги делаются просто из воздуха...', 'Роберт Миллер — харизматичный аферист и гениальный любовник. Он привык к тому, что в постелях его всегда ждут жена и любовница, которые, правда, попеременно закатывают ему скандалы, а огромные деньги делаются просто из воздуха. Но дутый бизнес не может держаться долго. Почуяв провал, он стремится поскорее продать свой хедж-фонд крупному банку, прежде чем раскроются его махинации. Непредвиденные события и нелепые ошибки толкают его на отчаянный шаг…', 0, 'Порочная страсть', '-', 'Arbitrage', '0000-00-00', 2012, 2012, 'США', '$20 668 500', 26, 0, 9, '100 мин', 'Николас Джареки', 'Ричард Гир, Сьюзен Сарандон, Тим Рот, Брит Марлинг, Летиция Каста, Нэйт Паркер, Уильям Фридкин, Моника Реймунд, Джош Пэйс, Кристофер Айджмен');
INSERT INTO `data` (`id`, `cat`, `shot_text`, `all_text`, `view`, `name_ru`, `tname`, `name_en`, `date`, `fyear`, `lyear`, `strana`, `budget`, `genre1`, `genre2`, `genre3`, `time`, `director`, `in_role`) VALUES
(193, 3, 'Сериал рассказывает о жизни учеников и преподавателей элитной школы-интерната, расположенной в старинной усадьбе посреди мрачного, но живописного леса. В их замкнутом мире все переживания намного острее, чем в обычной школьной жизни.', 'Сериал рассказывает о жизни учеников и преподавателей элитной школы-интерната, расположенной в старинной усадьбе посреди мрачного, но живописного леса. В их замкнутом мире все переживания намного острее, чем в обычной школьной жизни. Несмотря на внешнее благополучие, ребята, оторванные от родного дома, очень ранимы и зачастую одиноки. По вечерам они рассказывают друг другу страшные легенды о лесе, глухой стеной окружающем их школу, говорят, будто в нем водятся странные существа и бесследно пропадают люди. Очень скоро ребята узнают, что правда гораздо страшнее легенд.', 0, 'Закрытая школа', '5', 'нет', '0000-00-00', 2011, 2012, 'Россия', 'ниезвестно', 26, 9, 6, '48 мин', 'Олег Асадулин, Константин Статский, Андрей Записов', 'Юлия Агафонова, Евгений Березовский, Луиза-Габриэла Бровина, Иван Гордиенко, Алина Васильева, Виталий Емашов, Марина Казанкова'),
(194, 3, 'Обыденная жизнь Марины Бурцевой из провинциального городка Рыбацкий не особо отличается от жизни тысяч таких же обычных девушек, живущих в глубинке большой советской страны. Ее отец ломается под ударами судьбы — сперва смерть жены, потом потеря работы — и потихоньку спивается от бесперспективности и бессмысленности своего существования. ', 'Обыденная жизнь Марины Бурцевой из провинциального городка Рыбацкий не особо отличается от жизни тысяч таких же обычных девушек, живущих в глубинке большой советской страны. Ее отец ломается под ударами судьбы — сперва смерть жены, потом потеря работы — и потихоньку спивается от бесперспективности и бессмысленности своего существования. А когда появляется возможность заработать на собственной дочери, без раздумий «продает» Марину на заработки в город. Но обладая сильным характером, девушка не сдается. Жизнь Марины — это череда непростых испытаний. Будучи «проданной» собственным отцом, обманутой любимым, преданной друзьями, потеряв веру в окружающих людей, сможет ли она найти причины продолжать жить, бороться за свое будущее, прощать и снова любить? Сколько испытаний может выпасть на долю одного человека и какова цена счастья? Для героини сериала размышления на эту тему — не риторический поиск смысла жизни, это вопросы, на которые ей приходится отвечать каждую минуту, чтобы выжить.', 0, 'Дорога в пустоту', 'no', 'нет', '0000-00-00', 2012, 2012, 'Россия', '-', 16, 0, 0, '48 мин.', 'Анна Гресь', 'Светлана Смирнова-Марцинкевич, Кирилл Жандаров, Михал Жебровский, Наталья Суркова, Тимофей Трибунцев'),
(195, 2, 'Будущее не столь красочно и великолепно, каким его представляют современные люди. Через несколько столетий человечество окажется на грани самоуничтожения, захлёбываясь в кровавых преступлениях, смертельных...', 'Будущее не столь красочно и великолепно, каким его представляют современные люди. Через несколько столетий человечество окажется на грани самоуничтожения, захлёбываясь в кровавых преступлениях, смертельных грехах и беспорядочных убийствах. Старую систему правосудия будет невозможно использовать — анархия, всеобщие беспорядки вынуждают ещё сохранившуюся власть, тем не менее, потерявшую всякий авторитет и легитимность, пойти на отчаянные крайние меры и ввести институт Судей — универсальных полицейских, правоприменителей, а по совместительству — и прокуроров, которые упростили бы весь процесс задержания, следствия и судебных тяжб, совмещая в одном лице все должности блюстителей и защитников правопорядка.\r\n\r\nНегодяи, подонки, вконец обнаглевшие и распоясавшиеся преступники и бандитские группировки всё равно не желают сдавать свои упрочившие позиции, опасаясь лишь одного — встречи с легендарным Судьёй Дреддом, пересажавшим или расстрелявшим не одну сотню насильников, террористов и жадных до человеческих страданий маньяков. В то время, как беспорядки и бесчинства бушуют на улицах города, Дредд спешит вернуть порядок, Закон и тишину, которым, кажется, уже никогда не обрести свою былую полноту, мощь и силу…', 0, 'Судья Дредд 3D', '-', 'Dredd 3D', '0000-00-00', 2012, 2012, 'США, Великобритания, Индия', '$50 000 000', 28, 0, 3, '95 мин', 'Пит Трэвис', ' Карл Урбан, Оливия Тирлби, Лина Хиди, Вуд Харрис, Рэйчел Вуд, Андил Мнгади, Портес Ксандо Стинкамп, Джейсон Коуп, Эмма Бреши, Рэки Айола'),
(196, 2, 'Действие в картине разворачивается на американском Юге во времена сухого закона и Великой Депрессии. В центре сюжета — семья Бондурант, три брата, Джек, Форрест и Говард, которые занимаются запрещенным в то время бизнесом, бутлегерством.', 'Действие в картине разворачивается на американском Юге во времена сухого закона и Великой Депрессии. В центре сюжета — семья Бондурант, три брата, Джек, Форрест и Говард, которые занимаются запрещенным в то время бизнесом, бутлегерством. \r\n\r\n Оптимистично настроенный Джек, самый молодой из братьев, надеется с помощью бутлегерства заработать денег и произвести впечатление на свою девушку Берту. В это же время Форрест, напротив, настроен очень мрачно, он молчалив и подозрителен, а Говарду к тому же часто приходится иметь дело с врагами незаконного семейного бизнеса, в лице которых выступают коррумпированные местные полицейские.', 0, 'Самый пьяный округ в мире', 'Lawless', 'Lawless', '0000-00-00', 2012, 2012, 'США', '$35 192 101', 9, 4, 15, '115 мин', 'Джон Хиллкоут', 'Шайа ЛаБаф, Том Харди, Гари Олдман, Джессика Честейн, Гай Пирс, Джейсон Кларк, Миа Васиковска, Дэйн ДеХаан, Крис МакГарри'),
(197, 2, 'В антологии нас встретят зомби, вампиры, клоуны-монстры, маньяки-убийцы, вообщем будет всё то, что мило сердцу поклонника фильмов ужасов.', 'В антологии нас встретят зомби, вампиры, клоуны-монстры, маньяки-убийцы, вообщем будет всё то, что мило сердцу поклонника фильмов ужасов.', 0, 'Бойся или умри', 'Scary_or_Die', 'Scary or Die', '0000-00-00', 2012, 2012, 'США', '-', 27, 0, 0, '94 мин', 'Боб Бэдуэй, Майкл Эмануэл, Игорь Меглич', ' Билл Оберст мл., Корбин Блю, Шон-Колин Янг, Домициано Арканджели, Эндрю Колдуэлл, Николь Мур, Чарльз Чун, Кристофер Дарга, Дэвид Риверз, Элизабет Дипринсио'),
(198, 3, 'Психологический триллер, в центре сюжета которого терапевт и его жена, которые переживают не самый лучший этап в их супружеской жизни. Вместе с ребенком они переезжают в новый дом, который, как кажется, знает все их страхи и играет на них.', 'Психологический триллер, в центре сюжета которого терапевт и его жена, которые переживают не самый лучший этап в их супружеской жизни. Вместе с ребенком они переезжают в новый дом, который, как кажется, знает все их страхи и играет на них.', 0, 'Американская история ужасов', 'no', 'American Horror Story', '0000-00-00', 2011, 2012, 'США', 'неизвестно', 27, 9, 6, '44 мин', 'Брэдли Букер, Альфонсо Гомез-Рейон, Дэвид Семел', 'Конни Бриттон, Дилан МакДермотт, Таисса Фармига, Эван Питерс, Фрэнсис Конрой, Джессика Лэнг, Александра Брекенридж, Дэнис О’Харе'),
(199, 3, 'Сериал «Карпов» расскажет о дальнейшей судьбе бывшего подполковника милиции Стаса Карпова. Освободившись после принудительного лечения, Карпов оказывается «у разбитого корыта». Не осталось ничего из того, чего он так долго добивался: ни денег, ни положения, ни власти. Бывшему менту выписан волчий билет, в полицию он не попадет даже на самую мелкую должность. Пытаясь хоть как-то прокормить себя, Карпов устраивается работать охранником на склад. Он смотрит на мир трезвыми глазами, не задурманенными властью.', 'Сериал «Карпов» расскажет о дальнейшей судьбе бывшего подполковника милиции Стаса Карпова. Освободившись после принудительного лечения, Карпов оказывается «у разбитого корыта». Не осталось ничего из того, чего он так долго добивался: ни денег, ни положения, ни власти. Бывшему менту выписан волчий билет, в полицию он не попадет даже на самую мелкую должность. Пытаясь хоть как-то прокормить себя, Карпов устраивается работать охранником на склад. Он смотрит на мир трезвыми глазами, не задурманенными властью.', 0, ' Карпов', 'no', 'no', '0000-00-00', 2012, 2012, 'Россия', '--', 6, 0, 0, '44 мин', 'Игорь Ромащенко, Иван Щёголев, Гюзель Киреева', 'Владислав Котлярский, Степан Рожнов, Юлия Майборода, Максим Щёголев, Николай Козак, Анна Михайловская, Дмитрий Блажко, Дмитрий Мазуров, Сергей Карленков'),
(200, 3, 'Главная героиня сериала Наташа по прозвищу Джамайка живет в крайней бедности, всю жизнь называет мамой чужую женщину и ничего не знает о своем настоящем происхождении. Чтобы как-то сводить концы с концами, девушка поет на улицах и мечтает стать певицей. Но у жизни свои законы. В 17 лет, по лживому обвинению, ее арестовывают...', 'Главная героиня сериала Наташа по прозвищу Джамайка живет в крайней бедности, всю жизнь называет мамой чужую женщину и ничего не знает о своем настоящем происхождении. Чтобы как-то сводить концы с концами, девушка поет на улицах и мечтает стать певицей. Но у жизни свои законы. В 17 лет, по лживому обвинению, ее арестовывают. Во время расследования дела Джамайка влюбляется в следователя. Тот не может ответить взаимностью, ведь у него есть молодая жена и ребенок. Он отказывается вести дело Джамайки. Лишившись шанса на объективное расследование, Наташа попадает в тюрьму. Герои встретятся через несколько лет, снова вспыхнет страсть, и снова между ними будет стоять женщина…', 0, 'Джамайка', 'n', 'o', '0000-00-00', 2012, 2012, 'Украина, Россия', '-', 16, 0, 0, '50 мин', 'Игорь Забара, Олег Масленников', 'Людмила Свитова, Дарья Повереннова, Максим Радугин, Наталья Рудова, Олег Треповский'),
(201, 3, 'Они спасают чужие жизни! Но что творится в их душах, что происходит в их семьях, как строятся непростые отношения с коллегами, друзьями? Действие сериала развернется в приемном покое больницы, операционных, а также везде, куда спешат бригады «скорой помощи». Но самое главное — это мир врачей, их жизнь вне работы, человеческие драмы, проблемы, ошибки, сожаления и чаяния. Беспринципные карьеристы и самоотверженные фанатики — хирурги, врачи скорой, фельдшеры — судьба каждого неповторима и уникальна и пересекается в одной точке — в больнице, в которой они работают.', 'Они спасают чужие жизни! Но что творится в их душах, что происходит в их семьях, как строятся непростые отношения с коллегами, друзьями? Действие сериала развернется в приемном покое больницы, операционных, а также везде, куда спешат бригады «скорой помощи». Но самое главное — это мир врачей, их жизнь вне работы, человеческие драмы, проблемы, ошибки, сожаления и чаяния. Беспринципные карьеристы и самоотверженные фанатики — хирурги, врачи скорой, фельдшеры — судьба каждого неповторима и уникальна и пересекается в одной точке — в больнице, в которой они работают.', 0, 'Страна 03', 'n', 'o', '0000-00-00', 2012, 2012, 'Россия', '-', 9, 16, 0, '50 мин', 'Сергей Лесогоров, Мичислав Юзовский', 'Леся Кудряшова, Анна Гусева, Анзор Камариддинов, Валерия Богук, Алексей Шаранин'),
(202, 3, '«Люди Хэ» — это пародийное шоу о необычных способностях, казалось бы, обычных людей. Проект преследует две цели: во-первых, заставить поверить в паранормальные явления тех, кто относится к ним скептически; во-вторых, заставить улыбнуться тех, кто в существовании паранормального убежден. ', '«Люди Хэ» — это пародийное шоу о необычных способностях, казалось бы, обычных людей. Проект преследует две цели: во-первых, заставить поверить в паранормальные явления тех, кто относится к ним скептически; во-вторых, заставить улыбнуться тех, кто в существовании паранормального убежден. Вокруг нас много людей, обладающих настоящими экстрасенсорными способностями. Старушка-ворожея, девочка с плюшевым медведем, полицейский-телепат, сладкий мальчик со сверхчувствительным сердцем, кавказский маг, девушка с волшебной грудью… «Люди Хэ» обладают такими сверхъестественными способностями, как, например, включение принтера без электричества, излечение женской грудью от облысения и, конечно, банальная левитация. Они не признают авторитетов и не преклоняются перед знаменитостями: снять порчу с Мерседеса Игоря Верника, найти таинственного преследователя Леры Кудрявцевой, остановить необъяснимое появление чужих вещей в доме Юлии Ковальчук, а в квартире Олега Газманова обнаружить серебряные батареи — для них так же легко, как почистить зубы. Наша великолепная шестерка помогает как звездам, так и обычным людям. «Люди Хэ» — это не просто шоу. Это соревнование за звание лучшего из лучших! Недремлющее око строгого судьи — ведущего шоу, мага и медиума в первом поколении Властелина Кольцова — неотрывно следит за великолепной шестеркой экстрасенсов. Денно и нощно он подкидывает экстрасенсам всё новые и новые испытания… Помни: проект «Люди Хэ» не содержит ни капли лжи, только смешную неправду! P. S. Если ты по какой-либо причине не будешь смотреть шоу «Люди Хэ», наши экстрасенсы нашлют на тебя порчу в виде повышения тарифов на коммунальные платежи!', 0, 'Люди Хэ', 'n', 'o', '0000-00-00', 2011, 2012, 'Россия', '-', 22, 0, 0, '22 мин', 'СТС', 'Александр Ревва'),
(203, 3, 'Сюжет вращается вокруг трех девушек, которые занимаются художественной гимнастикой на площадке клуба «Комета». Однажды к компании Юли, Саши и Наташи присоединяется талантливая спортсменка по имени Милена. Тренер заметил ее среди множества учениц спортивных школ, и предложил заниматься под его руководством. Милена затмила своим появлением Юлю, звезду клуба. Но Юля не признает конкуренции, и готова пойти на любые меры, чтобы убрать с дороги потенциальную чемпионку.', 'Сюжет вращается вокруг трех девушек, которые занимаются художественной гимнастикой на площадке клуба «Комета». Однажды к компании Юли, Саши и Наташи присоединяется талантливая спортсменка по имени Милена. Тренер заметил ее среди множества учениц спортивных школ, и предложил заниматься под его руководством. Милена затмила своим появлением Юлю, звезду клуба. Но Юля не признает конкуренции, и готова пойти на любые меры, чтобы убрать с дороги потенциальную чемпионку.', 0, 'Чемпионки', 'no', 'no', '0000-00-00', 2012, 2012, 'Россия', '-', 9, 0, 0, '46 мин', 'Павел Дроздов', 'Ляйсан Утяшева, Софья Райзман, Алена Миронова, Полина Пахомова, Лариса Маркина'),
(204, 3, 'ревья, глаза оборотней и еще что-то невразумительное. «Опять эта ерунда», — подумал Кирилл и подошел к распахнутому окну. Далеко внизу шумела ночная Москва. Воздух был душный и липкий. До 7 июля оставалось несколько дней...', 'В ту ночь Кирилл проснулся от собственного крика. Его мучили кошмары: мелькали заброшенные колодцы, черные деревья, глаза оборотней и еще что-то невразумительное. «Опять эта ерунда», — подумал Кирилл и подошел к распахнутому окну. Далеко внизу шумела ночная Москва. Воздух был душный и липкий. До 7 июля оставалось несколько дней. Несколько дней, которые отделяли Кирилла от важного события — ночи на Ивана Купалу. Он и не подозревает еще, что буквально завтра окажется в далекой Сибири, что среди вековых кедров и обрывистых скал Алтая его самого, сестру Сашу и нескольких случайных попутчиков закружит водоворот приключений, вынуждая то убегать от погони, то пробираться тайными тропами, то барахтаться среди порогов могучей Катуни! Однако герои даже не могли предположить, что все случившееся с ними — не просто цепь совпадений, а невидимая борьба мистических сил. Разве могли обычные туристы, дети цивилизованного мира понять, что они уже давно оказались в зачарованном и таинственном месте, где реальность не подчиняется обычным законам? Теперь, чтобы спастись от опасности, найти друг друга и выйти живыми из схватки с неведомыми силами, у героев остается слишком мало времени! Всего несколько часов, пока не настанет ночь на Ивана Купалу и не зацветет волшебный папоротник! Тот самый сказочный цветок, который позволяет видеть клады под землей, читать мысли людей и повелевать духами.', 0, 'Пока цветет папоротник', 'no', 'no', '0000-00-00', 2012, 2012, 'Россия', '-', 30, 12, 21, '47 мин', 'Евгений Бедарев, Дмитрий Бедарев', 'Татьяна Орлова, Юлия Самойленко, Алексей Васильев, Ксения Шеломитская, Алла Подчуфарова'),
(205, 3, 'Это не шоу, а демонстрация реальной мощи ясновидения. Участники и победители нескольких сезонов «Битвы экстрасенсов» приводят документальные доказательства того, как паранормальные способности способны помочь людям. В этом цикле экстрасенсы находят пропавших родственников и угнанные автомобили, избавляют жилище от привидений и возвращают супругов в семьи. В фильмах создается «эффект присутствия» - зритель выступает очевидцем всех этапов процесса расследования.', 'Это не шоу, а демонстрация реальной мощи ясновидения. Участники и победители нескольких сезонов «Битвы экстрасенсов» приводят документальные доказательства того, как паранормальные способности способны помочь людям. В этом цикле экстрасенсы находят пропавших родственников и угнанные автомобили, избавляют жилище от привидений и возвращают супругов в семьи. В фильмах создается «эффект присутствия» - зритель выступает очевидцем всех этапов процесса расследования. Комментарии свидетелей – следователей, самих героев событий – подтверждают правдоподобность происходящего на экране. А особенный интерес вызывает то, как люди со сверхвозможностями существуют в своих привычных условиях жизни и работы.', 0, 'Битва экстрасенсов', 'n', 'o', '0000-00-00', 2007, 2012, 'Россия', '-', 22, 0, 0, '48 мин', 'ТНТ', 'Марат Башаров'),
(206, 3, '11 самых красивых и безбашенных парней и девчонок приезжают в Мексику… На роскошную виллу Жанны Фриске! И начинают знакомиться! Текила льется рекой, симпатии возникают мгновенно! Парни – как на подбор! Девушки – одна другой краше! Вот только на всех красоток мачо не хватит. И вечером кто-то из девушек останется без пары… Кто?', '11 самых красивых и безбашенных парней и девчонок приезжают в Мексику… На роскошную виллу Жанны Фриске! И начинают знакомиться! Текила льется рекой, симпатии возникают мгновенно! Парни – как на подбор! Девушки – одна другой краше! Вот только на всех красоток мачо не хватит. И вечером кто-то из девушек останется без пары… Кто?', 0, 'Каникулы в Мексике 2', 'n', 'o', '0000-00-00', 2012, 2012, 'Россия', '-', 22, 0, 0, '55 мин', 'MTV', 'Жанна Фриске'),
(208, 2, 'Действие фильма происходит в небольшом городке штата Пенсильвания. Шесть человек оказываются в ловушке сверхъестественной бури, которой нужен лишь один из них…', 'Действие фильма происходит в небольшом городке штата Пенсильвания. Шесть человек оказываются в ловушке сверхъестественной бури, которой нужен лишь один из них…', 0, 'Шесть ступеней ада ', '-', '6 Degrees of Hell', '0000-00-00', 2012, 2012, 'США', '-', 27, 0, 0, '86 мин ', 'Joe Raffa', ': Кори Фельдман, Джилл Вилан, Никки Белл, Брайан Энтони Уилсон, Дэвид Дж. Боннер, Кайл Патрик Бреннан, Сьюзэн Моусес, Брайан Галлахер, Том МакКарти и др.'),
(209, 2, 'Ребята из «Биг Тайм Раш» едут на гастроли в Лондон — в рамках своего первого мирового турне — и неожиданно становятся героями самого настоящего шпионского триллера. В аэропорту их багаж перепутали, и в руках у молодых ...', 'Ребята из «Биг Тайм Раш» едут на гастроли в Лондон — в рамках своего первого мирового турне — и неожиданно становятся героями самого настоящего шпионского триллера. В аэропорту их багаж перепутали, и в руках у молодых музыкантов оказалось устройство, способное уничтожить весь мир. За ребятами теперь охотятся маньяки-злодеи, агенты федеральных служб, шведские шпионы и владелец секретного устройства, бизнесмен-миллиардер. Ребятам предстоит спасти мир и при этом не опоздать на свой собственный концерт…', 0, 'Биг Тайм Раш', 'Big_Time_Movie', 'Big Time Movie', '0000-00-00', 2012, 2012, 'США', '-', 12, 0, 7, '-', 'Сэвидж Стив Холланд', 'Кендалл Шмидт, Джеймс Маслоу, Логан Хендерсон, Карлос Пена, Эрин Сандерс, Кьяра Браво, Эмма Лахана, Эмили Холмс, Кейтлин Тервер, Чаллен Кэйтс'),
(210, 2, 'В недалеком будущем, где стали возможны путешествия во времени, некая корпорация убирает нежелательных людей, отправляя их в прошлое в пластиковых пакетах. Задача принимающей стороны — всадить жертве пулю в голову, стерев...', 'В недалеком будущем, где стали возможны путешествия во времени, некая корпорация убирает нежелательных людей, отправляя их в прошлое в пластиковых пакетах. Задача принимающей стороны — всадить жертве пулю в голову, стерев тем самым несчастного из истории. Все идет гладко до тех пор, пока главный герой не распаковывает очередной пакет, обнаруживая в нем… самого себя из будущего.', 0, 'Петля времени', '-', 'Looper', '0000-00-00', 2012, 2012, 'США, Китай', '$30 000 000', 28, 26, 3, '118 мин.', 'Райан Джонсон', 'Брюс Уиллис, Джозеф Гордон-Левитт, Эмили Блант, Пайпер Перабо, Пол Дано, Гаррет Диллахант, Джефф Дэниелс, Трейси Томс, Пирс Гэнон, Ан Нуу Нгуйен и др.'),
(211, 2, 'Любимец всей Америки кот Гарфилд пересекает океан с целью преподнести сюрприз своему хозяину Джону Арбаклу, отправившемуся в Лондон, чтобы сделать предложение своей возлюбленной, ветеринару Лиз Уилсон. Очутившись в Англии, Гарфилд случайно меняется местами со своим двойником — котом Принцем, принадлежащим королевской семье.', 'Любимец всей Америки кот Гарфилд пересекает океан с целью преподнести сюрприз своему хозяину Джону Арбаклу, отправившемуся в Лондон, чтобы сделать предложение своей возлюбленной, ветеринару Лиз Уилсон. Очутившись в Англии, Гарфилд случайно меняется местами со своим двойником — котом Принцем, принадлежащим королевской семье.', 0, 'Гарфилд 2: История двух кошечек', '-', 'Garfield: A Tail of Two Kitties', '0000-00-00', 2006, 2006, 'США, Великобритания', '$28 426 747', 12, 0, 23, '86 мин.', 'Тим Хилл', 'Брекин Мейер, Дженнифер Лав Хьюитт, Билли Коннолли, Билл Мюррей, Йен Эберкромби , Роджер Рис, Люси Дэвис, Лена Кардвэлл, Вероника Алисино, Джейн Карр.'),
(212, 2, 'Ранго — хамелеон, который живет в террариуме и считает себя героем, которому, к сожалению, никак не удается проявить свое бесстрашие. Но когда он внезапно оказывается в городке Грязь, у него появляется такая возможность...', 'Ранго — хамелеон, который живет в террариуме и считает себя героем, которому, к сожалению, никак не удается проявить свое бесстрашие. Но когда он внезапно оказывается в городке Грязь, у него появляется такая возможность. Ранго провозглашает себя борцом за справедливость и начинает вести себя как шериф на Диком Западе. Он еще не знает, что быть «хорошим парнем» в этих краях не самая завидная участь…', 0, 'Ранго', '-', 'Rango', '0000-00-00', 2011, 2011, 'США', '$135 000 000', 12, 23, 21, '107 мин.', 'Гор Вербински', 'Джонни Депп, Айла Фишер, Эбигейл Бреслин, Нед Битти, Альфред Молина, Билл Найи, Стивен Рут, Гарри Дин Стэнтон, Тимоти Олифант, Рэй Уинстоун.'),
(213, 2, 'Ранго — хамелеон, который живет в террариуме и считает себя героем, которому, к сожалению, никак не удается проявить свое бесстрашие. Но когда он внезапно оказывается в городке Грязь, у него появляется такая возможность...', 'Ранго — хамелеон, который живет в террариуме и считает себя героем, которому, к сожалению, никак не удается проявить свое бесстрашие. Но когда он внезапно оказывается в городке Грязь, у него появляется такая возможность. Ранго провозглашает себя борцом за справедливость и начинает вести себя как шериф на Диком Западе. Он еще не знает, что быть «хорошим парнем» в этих краях не самая завидная участь…', 0, 'Ранго', '-', 'Rango', '0000-00-00', 2011, 2011, 'США', '$135 000 000', 12, 23, 21, '107 мин.', 'Гор Вербински', 'Джонни Депп, Айла Фишер, Эбигейл Бреслин, Нед Битти, Альфред Молина, Билл Найи, Стивен Рут, Гарри Дин Стэнтон, Тимоти Олифант, Рэй Уинстоун.'),
(214, 2, '7 августа 1974 года французский канатоходец Филипп Пети совершил то, что позже назвали «художественным преступлением века». Он 45 минут разгуливал по канату, натянутому между башнями Всемирного торгового центра в Нью-Йорке...', '7 августа 1974 года французский канатоходец Филипп Пети совершил то, что позже назвали «художественным преступлением века». Он 45 минут разгуливал по канату, натянутому между башнями Всемирного торгового центра в Нью-Йорке. Это стало вершиной его карьеры, в которой уже были аналогичные проделки с собором Парижской Богоматери и мостом Харбор-Бридж в Сиднее. Документальная лента режиссера Джеймса Марша — это не только гимн смелому человеку, но еще и дань эпохе, уничтоженной 11 сентября 2001 года.', 0, 'Канатоходец', '-', 'Man on Wire', '0000-00-00', 2007, 2007, 'США, Великобритания', '£1 000 000', 31, 0, 2, '94 мин.', 'Джеймс Марш', 'Филипп Пети, Жан Франсуа Хекел, Жан-Луи Блондо, Энни Аликс, Дэвид Форман, Алан Уелнер, Марк Льюис, Бэрри Гринхаус, Джим Мур, Гай Ф. Тоццоли.'),
(215, 2, 'Семнадцатилетняя девушка Белла переезжает к отцу в небольшой городок Форкс. Она влюбляется в загадочного одноклассника, который, как оказалось, происходит из семьи вампиров, отказавшихся от нападений на людей. Влюбиться в вампира. Это страшно?...', 'Семнадцатилетняя девушка Белла переезжает к отцу в небольшой городок Форкс. Она влюбляется в загадочного одноклассника, который, как оказалось, происходит из семьи вампиров, отказавшихся от нападений на людей. Влюбиться в вампира. Это страшно? Это романтично, это прекрасно и мучительно, но это не может кончиться добром, особенно в вечном противостоянии вампирских кланов, где малейшее отличие от окружающих уже превращает вас во врага.', 0, 'Сумерки', 'Twilight', 'Twilight', '0000-00-00', 2008, 2008, 'США', '$37 000 000', 30, 16, 9, '122 мин.', 'Кэтрин Хардвик', 'Кристен Стюарт, Роберт Паттинсон, Билли Бёрк, Эшли Грин, Анна Кендрик, Тэйлор Лотнер, Джексон Рэтбоун, Питер Фачинелли, Рашель Лефевр, Кэм Жиганде.'),
(216, 2, 'Влюбиться в вампира — страшно и романтично. Но потерять любимого, решившего ценой разрыва спасти свою девушку от роли пешки в вечном противостоянии кланов «ночных охотников», — это просто невыносимо. Белла Свон мучительно переживает...', 'Влюбиться в вампира — страшно и романтично. Но потерять любимого, решившего ценой разрыва спасти свою девушку от роли пешки в вечном противостоянии кланов «ночных охотников», — это просто невыносимо. Белла Свон мучительно переживает исчезновение Эдварда и безуспешно ищет забвения в дружбе с мальчишкой-индейцем Джейкобом Блэком. Она даже не подозревает, что её лучший друг — порождение ещё одного «народа Тьмы». Народа, куда более жестокого и опасного, чем аристократы-вампиры…', 0, 'Сумерки. Сага. Новолуние', '-', 'New Moon', '0000-00-00', 2009, 2009, 'США', '$50 000 000', 30, 16, 9, '130 мин.', 'Крис Вайц', 'Кристен Стюарт, Роберт Паттинсон, Билли Бёрк, Анна Кендрик, Тэйлор Лотнер, Эшли Грин, Майкл Шин, Дакота Фаннинг, Кристина Ястржембска, Майкл Уэлш.'),
(217, 2, 'Сиэтл охвачен чередой таинственных убийств, а обуреваемая жаждой мести вампирша продолжает поиски Беллы, снова оказавшейся в смертельной опасности. Кроме того, находясь в эпицентре всех событий, Белла вынуждена делать...', 'Сиэтл охвачен чередой таинственных убийств, а обуреваемая жаждой мести вампирша продолжает поиски Беллы, снова оказавшейся в смертельной опасности. Кроме того, находясь в эпицентре всех событий, Белла вынуждена делать выбор между любовью к Эдварду и дружбой с Джейкобом, зная что ее решение может послужить толчком к возобновлению давнего противостояния между вампирами и оборотнями. \r\n\r\nПомимо всего прочего, ей предстоит принять еще одно важное решение: жизнь или смерть, ведь окончание средней школы уже не за горами.', 0, 'Сумерки. Сага. Затмение', '-', 'The Twilight Saga: Eclipse', '0000-00-00', 2010, 2010, 'США', '$68 000 000', 30, 16, 26, '124 мин.', 'Дэвид Слэйд', 'Кристен Стюарт, Роберт Паттинсон, Тэйлор Лотнер, Эшли Грин, Келлан Латс, Питер Фачинелли, Брайс Даллас Ховард, Никки Рид, Ксавьер Сэмюэл, Билли Бёрк');
INSERT INTO `data` (`id`, `cat`, `shot_text`, `all_text`, `view`, `name_ru`, `tname`, `name_en`, `date`, `fyear`, `lyear`, `strana`, `budget`, `genre1`, `genre2`, `genre3`, `time`, `director`, `in_role`) VALUES
(218, 2, 'В четвертой части Белла Свон оказывается перед непростым выбором — сохранить жизнь себе или своему ребенку (наполовину вампиру, наполовину человеку). Она решает оставить малыша, но Эдвард и остальные члены семьи Каллен категорически против.', 'В четвертой части Белла Свон оказывается перед непростым выбором — сохранить жизнь себе или своему ребенку (наполовину вампиру, наполовину человеку). Она решает оставить малыша, но Эдвард и остальные члены семьи Каллен категорически против. \r\n\r\nПомощи Белле ждать не от кого, но она приходит неожиданно, от того, от кого её совсем не ждали. Вдвоем Белла и Розали пытаются сохранить жизнь малышу, даже не догадываясь, к каким ужасающим последствиям это приведет.', 0, 'Сумерки. Сага. Рассвет: Часть 1', '-', 'The Twilight Saga: Breaking Dawn - Part 1', '0000-00-00', 2011, 2011, 'США', '$110 000 000', 30, 16, 9, '117 мин.', 'Билл Кондон', 'Кристен Стюарт, Роберт Паттинсон, Дакота Фаннинг, Майкл Шин, Тэйлор Лотнер, Анна Кендрик, Джейми Кэмпбелл Бауэр, Эшли Грин, Никки Рид, Мэгги Грэйс'),
(219, 3, '«Comedy Club» (переводится, как рус. «Клуб Комедии», но произносится на английский манер «Камеди Клаб») — российское шоу, выходящее с 23 апреля 2005 года по сей день в жанре «stand-up comedy» на канале ТНТ. С 23 апреля 2010 года передача выходит в новом формате.', '«Comedy Club» (переводится, как рус. «Клуб Комедии», но произносится на английский манер «Камеди Клаб») — российское шоу, выходящее с 23 апреля 2005 года по сей день в жанре «stand-up comedy» на канале ТНТ. С 23 апреля 2010 года передача выходит в новом формате.', 0, 'Новый Сomedy club ', '-', 'Сomedy club', '0000-00-00', 2010, 2012, 'Россия', '-', 22, 0, 0, '45 мин', 'ТНТ', 'Гарик Мартиросян, Семён Слепаков, Павел Воля, Александр Ревва, Михаил Галустян, Гавр, Зураб Матуa, Андрей Аверин, Александр Незлобин, Дмитрий Хрусталёв, Виктор Васильев, Сергей Бессмертный'),
(220, 2, 'Из газет 1955 года Марти узнает, что доктор Браун погиб еще сто лет назад. Несмотря на просьбы Дока не навещать его в XIX веке, Марти вновь хочет вмешаться в ход событий и на машине времени уносится в 1885 год, навстречу Дикому Западу.', 'Из газет 1955 года Марти узнает, что доктор Браун погиб еще сто лет назад. Несмотря на просьбы Дока не навещать его в XIX веке, Марти вновь хочет вмешаться в ход событий и на машине времени уносится в 1885 год, навстречу Дикому Западу. \r\n\r\nЭто путешествие, как и все прежние, не обходится без опасных приключений, но смелый Марти, рискуя жизнью, предотвращает трагедию в жизни Эммета Брауна. Тот, в свою очередь, без памяти влюбляется в очаровательную незнакомку, которую спасает от гибели, и поездка домой — в будущее — теряет для него всякий смысл…', 0, 'Назад в будущее', '-', 'Back to the Future Part III', '0000-00-00', 1990, 1990, 'США', '$40 000 000', 28, 4, 12, '118 мин.', 'Роберт Земекис', 'Майкл Дж. Фокс, Кристофер Ллойд, Мэри Стинберген, Томас Ф. Уилсон, Лиа Томпсон, Элизабет Шу, Джеймс Толкан, Мэтт Кларк, Даб Тейлор, Гарри Кэри мл.'),
(221, 2, 'Есть герои, есть супергерои, и есть Хэнкок. Обладание сверхспособностями предполагает ответственность, все знают это — кроме него. За любую задачу он берётся с душой и лучшими намерениями, спасает жизни людей — ценой нечеловеческих...', 'Есть герои, есть супергерои, и есть Хэнкок. Обладание сверхспособностями предполагает ответственность, все знают это — кроме него. За любую задачу он берётся с душой и лучшими намерениями, спасает жизни людей — ценой нечеловеческих разрушений и неисчислимого ущерба. В конце концов, терпение общественности подходит к концу: люди благодарны своему местному герою, но иногда не понимают, чем заслужили такое наказание.\r\n\r\nХэнкок не из тех парней, кого волнует какое-то там общественное мнение, но однажды, после очередного подвига, спасая высокопоставленного пиарщика Рэя, он вдруг понимает, что в некотором смысле он может быть уязвим. С этим трудно смириться, особенно по мнению Мэри, жены Рэя, считающей, что Хэнкок попросту безнадежен.', 0, 'Хэнкок', '-', 'Hancock', '0000-00-00', 2008, 2008, 'США', '$150 000 000', 28, 9, 3, '88 мин', 'Питер Берг', 'Уилл Смит, Шарлиз Терон, Джейсон Бейтман, Джей Хед, Эдди Марсан, Дэвид Мэтти, Метрикс Фиттен, Томас Леннон, Джонни Галэки, Хейли Норман.'),
(222, 3, 'Comedy Woman - женское шоу, в котором женщины шутят о себе и окружающих. Они говорят о тряпках и мужчинах, размере груди и богатстве внутреннего мира. Еще они поют и танцуют, смеются друг над другом и выясняют отношения. ', 'Comedy Woman - женское шоу, в котором женщины шутят о себе и окружающих. Они говорят о тряпках и мужчинах, размере груди и богатстве внутреннего мира. Еще они поют и танцуют, смеются друг над другом и выясняют отношения. Comedy Woman - это своеобразный ответ миру мужского юмора, призванный отобразить все стороны женского бытия в легкой ироничной форме. Каждая вечеринка Comedy Woman представляет собой законченный мини-спектакль, который длиться примерно 60 мин.', 0, 'Новый Comedy Woman', 'n', 'o', '0000-00-00', 2012, 2012, 'ТНТ', '-', 22, 0, 0, '45 мин', '-', 'Дитрий Хрусталев'),
(223, 3, '«Пятницкий» – сериал о жизни и работе отдела внутренних дел в одном из районов Москвы. Начальница – подполковник Ирина Зимина – по-прежнему варится в котле бытовых и рабочих проблем, борется с подчиненными, точнее – с их пороками, следит за порядком и соблюдением правил и пытается все держать под контролем.', '«Пятницкий» – сериал о жизни и работе отдела внутренних дел в одном из районов Москвы. Начальница – подполковник Ирина Зимина – по-прежнему варится в котле бытовых и рабочих проблем, борется с подчиненными, точнее – с их пороками, следит за порядком и соблюдением правил и пытается все держать под контролем. Ей приходится принимать активное участие во всех делах своих коллег. Особенно это касается ближнего круга – новой начальницы дознания, крутящей роман с одним из оперативных работников…', 0, 'Пятницкий. Глава вторая', 'n', 'o', '0000-00-00', 2012, 2012, 'Россия', '-', 15, 0, 0, '48 мин', 'Сергей Лесогоров, Мичислав Юзовский', 'Виктория Тарасова, Дмитрий Мазуров, Виктория Герасимова, Анна Липко, Антон Батырев, Георгий Тополага, Андрей Сорока, Сергей Гурьев, Антон Афанасьев'),
(224, 3, 'Сюжет фильма основан на реальных фактах, связанных с обнаружением в 1993 году в небольшом украинском городе Кировограде огромной коллекции древностей, стоимостью около миллиарда долларов, принадлежавшей обычному электрику Александру Ильину, а также на материалах расследований, гипотезах и домыслах, появившихся по этому поводу за пятнадцать лет.', 'Сюжет фильма основан на реальных фактах, связанных с обнаружением в 1993 году в небольшом украинском городе Кировограде огромной коллекции древностей, стоимостью около миллиарда долларов, принадлежавшей обычному электрику Александру Ильину, а также на материалах расследований, гипотезах и домыслах, появившихся по этому поводу за пятнадцать лет.', 0, 'Синдром дракона', 'n', 'o', '0000-00-00', 2012, 2012, 'Россия, Украина', '-', 26, 6, 0, '52 мин', 'Николай Хомерики', 'Дмитрий Муляр, Андрей Мерзликин, Лев Борисов, Екатерина Климова, Леонид Бичевин, Кристина Асмус, Карина Андоленко, Елена Шевченко, Алексей Гуськов, Юрий Цурило'),
(225, 2, 'В каждом уважающем себя фильме ужасов есть телефон, который вот-вот зазвонит; жертва, которая вот-вот завопит; убийца, который вот-вот нанесет смертельный удар. И единственный способ остаться в живых — это твердо помнить, что надо всегда опережать убийцу на один шаг…', 'В каждом уважающем себя фильме ужасов есть телефон, который вот-вот зазвонит; жертва, которая вот-вот завопит; убийца, который вот-вот нанесет смертельный удар. И единственный способ остаться в живых — это твердо помнить, что надо всегда опережать убийцу на один шаг… \r\n\r\n Когда сексуальная репортерша, вечно сующая свой нос, на пару с попадающим во всякие дурацкие истории охранником из супермаркета пытается остановить убийцу, задумавшего расправиться с самыми видными учениками средней школы Булемия-Фоллз, начинается такое… ну очень страшное кино.', 0, 'Очень страшное кино', '-', 'Scary Movie', '0000-00-00', 2000, 2000, 'США', '$19 000 000', 12, 0, 0, '88 мин', 'Кинен Айвори Уайанс', 'Анна Фэрис, Реджина Холл, Марлон Уайанс, Джон Абрахамс, Шеннон Элизабет, Кармен Электра, Дейв Шеридан, Фрэнк Б. Мур, Джакомо Бессато.\r\nКайл Грэхэм'),
(226, 2, 'Отыгравшись по полной программе в фильме «Очень страшное кино» на молодежных ужастиках, создатели картины окончательно потеряли стыд и совесть! Теперь пришла очередь киноклассики «Изгоняющий дьявола»', 'Отыгравшись по полной программе в фильме «Очень страшное кино» на молодежных ужастиках, создатели картины окончательно потеряли стыд и совесть! Теперь пришла очередь киноклассики «Изгоняющий дьявола», «Полтергейст», «Кладбище домашних животных» и таких блокбастеров как: «Ангелы Чарли», «Миссия невыполнима 2», «Что скрывает ложь», «Ганнибал», «Призрак дома на холме». Мало не покажется!', 0, 'Очень страшное кино 2', '-', 'Scary Movie 2', '0000-00-00', 2001, 2001, 'США, Канада', '$45 000 000', 12, 0, 0, '83 мин', 'Кинен Айвори Уайанс', 'Анна Фэрис, Марлон Уайанс, Джеймс ДеБелло, Шоун Уайанс, Дэвид Кросс, Реджина Холл, Кристофер Мастерсон, Тим Карри, Кэтлин Робертсон, Крис Эллиот.'),
(227, 2, 'Журналистка Синди Кэмпбелл охвачена желанием сделать скандальный репортаж о каком-нибудь мировом заговоре и открыть самые секретные материалы! Кто ищет, тот всегда найдёт: вскоре Синди становится свидетельницей необъяснимых явлений.', 'Журналистка Синди Кэмпбелл охвачена желанием сделать скандальный репортаж о каком-нибудь мировом заговоре и открыть самые секретные материалы! Кто ищет, тот всегда найдёт: вскоре Синди становится свидетельницей необъяснимых явлений. \r\n\r\n На Землю вот-вот высадится десант зловещих инопланетян, на полях появились странные концентрические круги, некий Избранный пророчит нехорошее всему человечеству, дети со странными глазами пугают взрослых, под угрозой жизнь самого Президента, а амбициозные белые рэперы совершили подозрительный прорыв в мире шоу-бизнеса! Зло наступает со всех сторон, и Синди должна сражаться, чтобы спасти мир еще раз!', 0, 'Очень страшное кино 3', '-', 'Scary Movie 3', '0000-00-00', 2003, 2003, 'США, Канада', '$48 000 000', 12, 0, 0, '83 мин', 'Дэвид Цукер', 'Памела Андерсон, Дженни МакКарти, Марни Энг, Чарли Шин, Саймон Рекс, Джина Баллард, Джереми Пивен, Анна Фэрис, Тимоти Стэк, Элейн Климашевски.'),
(228, 2, 'Журналистка Синди Кэмпбелл все еще не может оправиться после ужасных событий, произошедших с ней за последнее время. Чтобы сменить обстановку, она устраивается на работу сиделкой к пожилой женщине.', 'Журналистка Синди Кэмпбелл все еще не может оправиться после ужасных событий, произошедших с ней за последнее время. Чтобы сменить обстановку, она устраивается на работу сиделкой к пожилой женщине. \r\n\r\n Вскоре Синди знакомится с овдовевшим соседом Томом Райаном и влюбляется в него. Казалось бы, жизнь начинает налаживаться, как вдруг на Землю высаживаются инопланетяне, которые хотят уничтожить все человечество. Том и Синди вступают в отчаянную схватку с пришельцами…', 0, 'Очень страшное кино 4', '-', 'Scary Movie 4', '0000-00-00', 2006, 2006, 'США', '$45 000 000', 12, 0, 0, '83 мин', 'Дэвид Цукер', 'Анна Фэрис, Реджина Холл, Крэйг Бирко, Билл Пуллман, Энтони Андерсон, Лесли Нильсен, Молли Шеннон, Майкл Мэдсен, Крис Эллиот, Кармен Электра.'),
(229, 2, 'Жил да был в сказочном государстве большой зеленый великан по имени Шрек. Жил он в гордом одиночестве в лесу, на болоте, которое считал своим. Но однажды злобный коротышка — лорд Фаркуад, правитель волшебного королевства,', 'Жил да был в сказочном государстве большой зеленый великан по имени Шрек. Жил он в гордом одиночестве в лесу, на болоте, которое считал своим. Но однажды злобный коротышка — лорд Фаркуад, правитель волшебного королевства, безжалостно согнал на Шреково болото всех сказочных обитателей.\r\n\r\nИ беспечной жизни зеленого великана пришел конец. Но лорд Фаркуад пообещал вернуть Шреку болото, если великан добудет ему прекрасную принцессу Фиону, которая томится в неприступной башне, охраняемой огнедышащим драконом…\r\n\r\nПотрясающий мультфильм занял свое заслуженное место в пятерке самых кассовых мультфильмов всех времен.', 0, 'Шрек', 'Shrek', 'Shrek', '0000-00-00', 2001, 2001, 'США', '$60 000 000', 18, 23, 30, '90 мин.', 'Эндрю Адамсон, Вики Дженсон', 'Майк Майерс, Эдди Мёрфи, Кэмерон Диаз, Джон Литгоу, Венсан Кассель\r\nПитер Дэннис, Клайв Пирс, Джим Каммингс, Бобби Блок, Крис Миллер.'),
(230, 2, 'Лорд Фаркуард был съеден драконом, но его дух все еще жив и все так же зол. Он похищает Фиону с помощью все еще живого помощника-подручного. Шрек и Осел отправляются в путешествие, чтобы спасти принцессу.', 'Лорд Фаркуард был съеден драконом, но его дух все еще жив и все так же зол. Он похищает Фиону с помощью все еще живого помощника-подручного. Шрек и Осел отправляются в путешествие, чтобы спасти принцессу.', 0, 'Шрэк 4-D', 'Shrek_4-D', 'Shrek 4-D', '0000-00-00', 2003, 2003, 'США', '$-', 18, 14, 30, '12 мин.', 'Саймон Дж. Смит', 'Майк Майерс, Эдди Мёрфи, Джон Литгоу, Конрад Вернон, Коуди Камерон, Кристофер Найтс, Саймон Дж. Смит.'),
(231, 2, 'Шрэк и Фиона возвращаются после медового месяца и находят письмо от родителей Фионы с приглашением на ужин. Однако те не подозревают, что их дочь тоже стала огром! Вместе с Осликом счастливая пара отправляется в путешествие, полное неожиданностей, и попадает в круговорот событий, во время которых приобретает множество друзей…', 'Шрэк и Фиона возвращаются после медового месяца и находят письмо от родителей Фионы с приглашением на ужин. Однако те не подозревают, что их дочь тоже стала огром! Вместе с Осликом счастливая пара отправляется в путешествие, полное неожиданностей, и попадает в круговорот событий, во время которых приобретает множество друзей…', 0, 'Шрэк 2', 'Shrek_2', 'Shrek 2', '0000-00-00', 2004, 2004, 'США', '$150 000 000', 18, 14, 30, '93 мин.', 'Эндрю Адамсон, Келли Эсбёри, Конрад Вернон', 'Майк Майерс, Эдди Мёрфи, Кэмерон Диаз, Джули Эндрюс, Антонио Бандерас, Джон Клиз, Руперт Эверетт, Дженнифер Сондерс, Арон Уорнер.\r\nКелли Эсбёри'),
(232, 2, 'Королем может быть не каждый — особенно если вы не очень симпатичный великан. Когда Шрэк женился на принцессе Фионе, он меньше всего на свете хотел управлять Далекой-Далекой страной. Такой он невластолюбивый. Однако отец Фионы, король Гарольд, внезапно...', 'Королем может быть не каждый — особенно если вы не очень симпатичный великан. Когда Шрэк женился на принцессе Фионе, он меньше всего на свете хотел управлять Далекой-Далекой страной. Такой он невластолюбивый. Однако отец Фионы, король Гарольд, внезапно умирает, и корону должен унаследовать именно Шрэк. Как-никак, он все-таки муж наследницы.\r\n\r\nОднако Шрэк наотрез отказывается от бремени власти, и решает отправиться вместе со своими старыми друзьями Ослом и Котом в сапогах на поиски кандидата на трон. Если Шрэк не найдет себе подходящей замены, ему придется управлять сказочной страной самому… и это надолго. Похоже, что король Артур — тот, кто им нужен. \r\n\r\nОднако в отсутствие великана его старый враг принц по имени Чарминг замышляет всякие пакости, для чего и возвращается в сказочную страну. Шрэку придется очень постараться, чтобы спасти страну от происков врагов и от возможного переворота.', 0, 'Шрэк 3', 'Shrek_3', 'Shrek 3', '0000-00-00', 2007, 2004, 'США', '$160 000 000', 18, 14, 30, '93 мин.', 'Крис Миллер, Раман Хюи', 'Майк Майерс, Эдди Мёрфи, Кэмерон Диаз, Антонио Бандерас, Джули Эндрюс, Джон Клиз, Руперт Эверетт, Эрик Айдл, Джастин Тимберлэйк, Сьюзан Блэйксли.'),
(233, 2, 'Чем бы еще заняться огру, который уже сразился со злым драконом, спас прекрасную принцессу и уберег от беды королевство родственников по линии жены? Что ж, если вы Шрэк, то, сами того не заметив, вы вдруг сядете дома...', 'Чем бы еще заняться огру, который уже сразился со злым драконом, спас прекрасную принцессу и уберег от беды королевство родственников по линии жены? Что ж, если вы Шрэк, то, сами того не заметив, вы вдруг сядете дома и станете наслаждаться покоем в кругу семьи. Вместо того чтобы как раньше пугать деревенских жителей, теперь Шрэк, хоть и с неохотой, но соглашается оставлять автографы на их вилах. А куда же подевался знаменитый рык этого огра? \r\n\r\nПод грузом воспоминаний о днях, когда он чувствовал себя «настоящим огром», Шрэк поддается на уговоры сладкоголосого Румпельштильцхена и заключает с ним договор. Сразу после этого Шрэк оказывается в альтернативной реальности Тридевятого королевства, где все поставлено с ног на голову: на огров здесь охотятся, Румпельштильцхен восседает на троне, а Шрэк и Фиона даже не знакомы. И теперь только сам Шрэк может исправить все, что он натворил, чтобы спасти друзей, восстановить привычный ему порядок вещей и вернуть себе свою единственную Истинную Любовь.', 0, 'Шрэк навсегда', 'Shrek_Forever_After', 'Shrek Forever After', '0000-00-00', 2010, 2010, 'США', '$165 000 000', 18, 14, 30, '90 мин.', 'Майк Митчел', 'Майк Майерс, Эдди Мёрфи, Кэмерон Диаз, Антонио Бандерас, Джули Эндрюс, Джон Хэмм, Джон Клиз, Крэйг Робинсон, Уолт Дорн, Джейн Линч.'),
(234, 3, 'В анналах академии Сэйкё множество чудес, жутковатых легенд и просто страшных историй, в большинстве которых фигурирует местный призрак Юко. Неудивительно, что в школе создан клуб изучения паранормальных явлений, где основной ударной единицей является 13-летний экстрасенс Тэйити Ниия, свободно общающийся с потусторонним миром…', 'В анналах академии Сэйкё множество чудес, жутковатых легенд и просто страшных историй, в большинстве которых фигурирует местный призрак Юко. Неудивительно, что в школе создан клуб изучения паранормальных явлений, где основной ударной единицей является 13-летний экстрасенс Тэйити Ниия, свободно общающийся с потусторонним миром. Здравый смысл представляет на год старшая Кириэ Каноэ, девушка из старинного рода, тоже обладающая духовной силой, а энтузиазма хоть отбавляй у ее ровесницы, секретаря клуба Момоэ Оконоги. Проблема же в том, что президента клуба по имени Юко Каноэ никто из посторонних никогда не видел! \r\n\r\nВсе верно, Юко Каноэ и есть школьный призрак, общаться с ней могут только Тэйити, на самом деле сильный экстрасенс, и Кириэ, ее внучатая племянница. Юко, то есть «сумеречная дева», попросила Тэйити использовать клуб не только для развлечения (хотя за годы одиночества развила вкус к шуткам и проказам). Дело в том, что Каноэ-старшая знает, что умерла в этой школе, но совсем не помнит обстоятельства своей смерти. Вместе с тем всем призрачным чутьем Юко понимает, что смерть была нелегкой, и с этим связана какая-то опасность для потомков. Так что теперь доблестные исследователи непознанного должны между сказками и легендами постепенно подобраться к главной тайне…', 0, 'Сумеречная Дева и Амнезия', '-', 'Dusk Maiden of Amnesia', '0000-00-00', 2012, 2012, 'Япония', '-', 1, 16, 9, '24 мин', 'Ютака Хирата, Томоюки Курокава, Шин Онума', 'Мисато Фукуэн, Юми Хара, Ери Китамура, Цубаса Ёнага.'),
(235, 2, 'Жоржа влекут деньги, секс и власть. Обольстительная внешность и железные нервы карточного игрока, обворожительные манеры и когти хищника — и Париж, город порока и страсти, лежит у его ног…', 'Жоржа влекут деньги, секс и власть. Обольстительная внешность и железные нервы карточного игрока, обворожительные манеры и когти хищника — и Париж, город порока и страсти, лежит у его ног…', 0, 'Милый друг', '-', 'Bel Ami', '0000-00-00', 2010, 2010, 'Великобритания, Италия', '$6 165 119', 9, 0, 0, '98 мин.', 'Деклан Доннеллан, Ник Ормерод', 'Роберт Паттинсон, Ума Турман, Кристин Скотт Томас, Кристина Риччи, Колм Мини, Филип Гленистер, Холлидей Грейнджер, Наталия Тена, Джеймс Лэнс, Энтони Хиггинс.'),
(236, 2, 'Двое новоиспеченных горе-полицейских отправляются на сверхсекретное задание. Им предстоит заново стать учениками средней школы, в которой процветает наркоторговля.', 'Двое новоиспеченных горе-полицейских отправляются на сверхсекретное задание. Им предстоит заново стать учениками средней школы, в которой процветает наркоторговля.', 0, 'Мачо и ботан', '-', '21 Jump Street', '0000-00-00', 2012, 2012, 'США', '$42 000 000', 3, 15, 12, '109 мин. ', 'Фил Лорд, Крис Миллер', 'Джона Хилл, Ченнинг Татум, Бри Ларсон, Дэйв Франко, Роб Риггл, Айс Кьюб, ДеРэй Дэвис, Дакс Флэйм, Крис Парнелл, Элли Кемпер.'),
(237, 3, 'Ее зовут Ева, и она орудие зла. Женщина, для которой рамок приличия не существует: если нужно опорочить приличного человека, она сделает это. Подтолкнуть к предательству, убедить честного лжесвидетельствовать, а миролюбивого взять в руки оружие – Ева с удовольствием устроит все так, что ни одна тень не упадет на заказчика. Преступление никогда не будет раскрыто, если в помощниках у нарушителей закона есть она - циничная, беспринципная и криминально талантливая...', 'Ее зовут Ева, и она орудие зла. Женщина, для которой рамок приличия не существует: если нужно опорочить приличного человека, она сделает это. Подтолкнуть к предательству, убедить честного лжесвидетельствовать, а миролюбивого взять в руки оружие – Ева с удовольствием устроит все так, что ни одна тень не упадет на заказчика. Преступление никогда не будет раскрыто, если в помощниках у нарушителей закона есть она - циничная, беспринципная и криминально талантливая. В каждой серии два актера и одно место действия.', 0, 'Откровения. Реванш', 'n', 'o', '0000-00-00', 2012, 2012, 'Россия', '-', 6, 0, 0, '26 мин', 'Дмитрий Петрунь, Дмитрий Дакович, Иван Лебедев', 'Вера Строкова, Мадлен Джабраилова, Евгений Стычкин, Анатолий Лобоцкий, Мария Баева'),
(238, 3, 'Двадцатилетняя Алиса влюблена и счастлива: ее любимый — Егор, восходящая звезда боев без правил, — только что прямо на ринге сделал ей предложение. Но счастье Алисы оказывается недолгим. Ради отца, задолжавшего крупную сумму денег бандитам, Алиса вынуждена выйти замуж по расчету...', 'Двадцатилетняя Алиса влюблена и счастлива: ее любимый — Егор, восходящая звезда боев без правил, — только что прямо на ринге сделал ей предложение. Но счастье Алисы оказывается недолгим. Ради отца, задолжавшего крупную сумму денег бандитам, Алиса вынуждена выйти замуж по расчету. Ее муж, успешный пятидесятилетний бизнесмен Султан Бакоев, влюблен в Алису и готов ради нее свернуть горы. Только это не нужно самой Алисе. Она ненавидит мужа и не замечает, что ей достался очень честный, умный и достойный уважения мужчина…', 0, 'Неравный брак', 'n', 'o', '0000-00-00', 2012, 2012, 'Россия', '-', 16, 0, 0, '50 мин', ' Виталий Бабенко, Сергей Терещук, Лев Гришин', 'Александр Кузнецов, Дмитрий Брусникин, Алла Довлатова, Елена Костина, Сергей Барковский, Владимир Денисов, Олег Семисынов'),
(239, 3, 'Студенты престижной частной школы на Манхэттене впервые узнают, что Серена Ван Дер Вудсен вернулась в город, способом, с помощью которого они узнают все важные новости школьной жизни — из всем известного блога Сплетницы. Никто не знает кто она такая, однако все полагаются на публикуемые ею последние сплетни...', 'Студенты престижной частной школы на Манхэттене впервые узнают, что Серена Ван Дер Вудсен вернулась в город, способом, с помощью которого они узнают все важные новости школьной жизни — из всем известного блога Сплетницы. Никто не знает кто она такая, однако все полагаются на публикуемые ею последние сплетни. Лучшая подруга Серены, Блэр, удивлена не меньше остальных, что Серена внезапно переменила свое решение об учебе за границей и вернулась в Манхэттен. Напряжение между ними не осталось незамеченным для Сплетницы, которая раскрывает любую тайну и делает достоянием общественности все скандалы.', 0, 'Сплетница', 'n', 'o', '0000-00-00', 2012, 2012, 'США', '-', 9, 16, 0, '40 мин', 'Марк Пизнарский, Жан Де Сегонзак, Джон Стефенс', 'Блейк Лайвли, Лейтон Мистер, Эд Вествик, Пенн Бэджли, Чейс Кроуфорд, Келли Разерфорд, Мэттью Сеттл'),
(240, 3, 'Место действия сериала — Нью-Йорк 1860-х годов. Кевин Коркоран — сильный и грубый ирландский полицейский, работающий в пользующемся дурной славой районе «Пять Углов». В беспокойном мире Коркоран старается быть верным своим моральным принципам на пути к правде об исчезновении его жены и смерти дочери.', 'Место действия сериала — Нью-Йорк 1860-х годов. Кевин Коркоран — сильный и грубый ирландский полицейский, работающий в пользующемся дурной славой районе «Пять Углов». В беспокойном мире Коркоран старается быть верным своим моральным принципам на пути к правде об исчезновении его жены и смерти дочери.\r\n\r\nЕго дружба с двумя соотечественниками — своенравным сыном богатого промышленника и афро-американским врачом, которые тайно помогают Коркорану с его работой — сталкивает его с контрастирующими мирами Пятой авеню и развивающегося афро-американского общества в сельском северном Манхэттене. Всех троих объединяет опыт сражений в Гражданской войне и это связывает их жизни навсегда.', 0, 'Легавый', 'n', 'o', '0000-00-00', 2012, 2012, 'США', '-', 9, 0, 0, '40 мин', 'Джефф Вулнаф, Кен Джиротти, Кларк Джонсон', 'Том Уэстон-Джонс, Кайл Шмид, Анастасия Гриффит, Ато Эссонда, Кевин Дж. Райан, Дилан Тейлор, Кьяра Гласко'),
(254, 3, 'Капитан полиции Игорь Светлов продолжает вести бескомпромиссную войну с разгулявшейся преступностью «Гарлема». На стороне криминала — превосходящие силы, прочные связи с коррумпированной верхушкой власти, жестокость и хитрость. В арсенале Светлова — непримиримость ко лжи и предательству, стремление отомстить любой ценой и, конечно, поддержка верных друзей.', 'Капитан полиции Игорь Светлов продолжает вести бескомпромиссную войну с разгулявшейся преступностью «Гарлема». На стороне криминала — превосходящие силы, прочные связи с коррумпированной верхушкой власти, жестокость и хитрость. В арсенале Светлова — непримиримость ко лжи и предательству, стремление отомстить любой ценой и, конечно, поддержка верных друзей.', 0, 'Брат за брата 2', 'n', 'o', '0000-00-00', 2012, 2012, 'Россия', '-', 9, 15, 0, '45 мин', 'Олег Туранский, Олег Филипенко', 'Ярослав Бойко, Владимир Стеклов, Константин Стрельников, Егор Клейменов, Анна Казючиц, Анатолий Зиновенко, Дмитрий Суржиков'),
(242, 2, 'После вселенской катастрофы Земля превратилась в выжженную пустыню. По бескрайним дорогам, кишащим бандитами, враждующими между собой за еду, странствуют пятеро. Надеясь найти покой, они останавливаются в доме, который легко превращается в ловушку. Сможет ли кто-то выйти живым?', 'После вселенской катастрофы Земля превратилась в выжженную пустыню. По бескрайним дорогам, кишащим бандитами, враждующими между собой за еду, странствуют пятеро. Надеясь найти покой, они останавливаются в доме, который легко превращается в ловушку. Сможет ли кто-то выйти живым?', 0, 'Судный день', '-', 'The Day', '0000-00-00', 2011, 2011, 'США', '$20 000', 28, 9, 26, '90 мин.', 'Дуглас Арниокоски', 'Шон Эшмор, Эшли Белл, Кори Хардрикт, Доминик Монахэн, Шаннин Соссамон, Майкл Эклунд, Брайана Барнс, Кэссиди Верро, София Эванюк, Роберт Болдуин.'),
(243, 3, 'Рассмеши комика" - народная развлекательная программа, в которой любой человек, обладающий комическим талантом, имеет возможность заработать неплохие деньги. Рассмешить своего знакомого или родственника - это одно дело, а вот заставить смеяться человека, который всю свою жизнь профессионально занимается юмором - такая задача по зубам далеко не каждому ... ', 'Рассмеши комика" - народная развлекательная программа, в которой любой человек, обладающий комическим талантом, имеет возможность заработать неплохие деньги. Рассмешить своего знакомого или родственника - это одно дело, а вот заставить смеяться человека, который всю свою жизнь профессионально занимается юмором - такая задача по зубам далеко не каждому ... Зато того, кому удастся рассмешить Евгения Кошевого и Владимира Зеленского, ждет солидное денежное вознаграждение! Никаких жестких правил, никаких серьезных ограничений: заставил комиков смеяться - получи деньги! ', 0, 'Рассмеши комика', 'n', 'o', '0000-00-00', 2012, 2012, 'Украина', '-', 22, 0, 0, '45 мин', '1+1', 'Дмитрий Шепелев, Владимир Зеленский, Евгений Кошевой');
INSERT INTO `data` (`id`, `cat`, `shot_text`, `all_text`, `view`, `name_ru`, `tname`, `name_en`, `date`, `fyear`, `lyear`, `strana`, `budget`, `genre1`, `genre2`, `genre3`, `time`, `director`, `in_role`) VALUES
(244, 3, 'Современные убийства в Мистик Фоллс напоминают Дэймону о схожих преступлениях, происходивших сто лет назад. Во флешбэках из 1912го года Дэймон вспоминает прекрасную вампиршу Сэйдж, которая показала ему, что жить можно совсем по-другому. Шериф Форбс предупреждает Дэймона, чтобы он не ввязывался в расследование, но он уверен, что она подозревает не того...', 'Современные убийства в Мистик Фоллс напоминают Дэймону о схожих преступлениях, происходивших сто лет назад. Во флешбэках из 1912го года Дэймон вспоминает прекрасную вампиршу Сэйдж, которая показала ему, что жить можно совсем по-другому. Шериф Форбс предупреждает Дэймона, чтобы он не ввязывался в расследование, но он уверен, что она подозревает не того. Елена с Мэттом устраивают взлом, пытаясь найти улики против доктора Фелл, которую считают убийцей.', 0, 'Дневники вампира', 'n', 'o', '0000-00-00', 2012, 2012, 'США', '-', 16, 30, 9, '43 мин', 'Маркос Сига, Роб Харди, Дэвид Фон Энкен, Дж. Миллер Тобин', 'Нина Добрев, Пол Уэсли, Йен Сомерхалдер, Стивен Р. МакКуин, Катерина Грэхэм, Кэндис Аккола, Зак Рериг, Майкл Тревино, Джозеф Морган, Сара Каннинг, Кайла Юэлл'),
(245, 2, 'Бывшие сотрудники секретного оперативного подразделения Том Стил и его напарник Мэннинг получают задание — осуществить процедуру закрытия старой тюрьмы, для чего им поручают проконтролировать прибытие двух женщин-заключенных.', 'Бывшие сотрудники секретного оперативного подразделения Том Стил и его напарник Мэннинг получают задание — осуществить процедуру закрытия старой тюрьмы, для чего им поручают проконтролировать прибытие двух женщин-заключенных. \r\n\r\nС первого взгляда, необременительное дело вскоре превращается в поле боевых действий — профессиональная группа наёмников проникает в тюрьму с целью — любой ценой отыскать вновь прибывших узниц. Выяснив, кем являются эти женщины на самом деле, оперативник Стил понимает, что он оказался втянут в нечто более опасное, чем он мог себе представить…', 0, 'Максимальный срок', 'n', 'o', '0000-00-00', 2012, 2012, 'США', '-', 3, 26, 21, '98 мин', 'Киони Ваксман', 'Стивен Сигал, Стив Остин, Майкл Паре, Стеф Сонг, Брен Фостер, Кирби Морроу'),
(246, 3, 'Обычная девушка попадает в мир большого бизнеса. Ей приходится решать множество задач. Но среди них самая сложная – помочь молодому наследнику компании стать Боссом и возглавить семейный бизнес. Зрителя ждут не только офисные интриги, но и любовь, романтические приключения и много хорошего юмора.', 'Обычная девушка попадает в мир большого бизнеса. Ей приходится решать множество задач. Но среди них самая сложная – помочь молодому наследнику компании стать Боссом и возглавить семейный бизнес. Зрителя ждут не только офисные интриги, но и любовь, романтические приключения и много хорошего юмора.', 0, 'Спасти босса', 'n', 'o', '0000-00-00', 2012, 2012, 'Россия', '-', 12, 0, 0, '45 мин', 'Константин Фролов, Владимир Устюгов', 'Ксения Хаирова, Илья Иосифов, Оксана Дорохина, Алена Криг, Илья Коробко'),
(247, 3, 'Алекс и Ленчик готовятся отметить день ВДВ, но внезапно получают сообщение от Сереги о том, что его жена Светлана в беде. Прибыв в Озерскую, где отдыхала Светлана, друзья узнают, что она бесследно исчезла. Братаны выходят на след местного авторитета Мартынова...', 'Алекс и Ленчик готовятся отметить день ВДВ, но внезапно получают сообщение от Сереги о том, что его жена Светлана в беде. Прибыв в Озерскую, где отдыхала Светлана, друзья узнают, что она бесследно исчезла. Братаны выходят на след местного авторитета Мартынова. Но на руках у Мартынова серьезные «козыри»: он может творить на «своей» территории всё, что захочет - и бандиты, и мэр, и полиция пляшут под его дудку уже много лет. Братаны вступают в неравную схватку, хотя возможностей выйти победителями у них остается все меньше и меньше. Но в лице заместителя Макара Вадима Рощина братаны находят верного друга.', 0, 'Братаны 3', 'n', 'o', '0000-00-00', 2012, 2012, 'Россия', '-', 3, 15, 0, '45 мин', 'Виктор Конисевич, Александр Калугин', 'Алексей Кравченко, Сергей Селин, Антон Хабаров, Даниил Воробьёв, Дмитрий Назаров, Дарья Калмыкова, Наталья Коренная, Надежда Борисова'),
(248, 3, '«Во все времена еда была рядом с людьми. Она искушает, вдохновляет, восхищает, отвращает. Но человек не может без еды, а значит тот, кто создает еду, может управлять миром…». Так думал Максим Лавров, когда шел осуществлять свою мечту — устраиваться поваром в один из самых дорогих ресторанов столицы... ', '«Во все времена еда была рядом с людьми. Она искушает, вдохновляет, восхищает, отвращает. Но человек не может без еды, а значит тот, кто создает еду, может управлять миром…». Так думал Максим Лавров, когда шел осуществлять свою мечту — устраиваться поваром в один из самых дорогих ресторанов столицы. Мечта сбылась, вот только на деле все вышло не так вкусно. Шеф-повар ресторана Виктор Баринов — настоящая звезда гастрономического бомонда, знающая как угодить взыскательной публике. Оборотная сторона этого идеального образа — злоупотребление алкоголем, страсть к азартным играм и невыносимый характер. В гневе Баринов страшен, в загуле — неукротим. Арт-директор Виктория Гончарова — настоящая снежная королева, карьеристка с ледяным сердцем, однако именно с ней Макс проводит ночь до того, как пойти на новую работу. А вся команда поваров только и ждет промашки новичка, чтобы от души посмеяться.', 0, 'Кухня', 'n', 'o', '0000-00-00', 2012, 2012, 'Россия', '-', 12, 15, 0, '45 мин', 'Дмитрий Дьяченко', 'Дмитрий Назаров, Марк Богатырев, Дмитрий Нагиев, Юлия Такшина, Елена Подкаминская'),
(249, 3, 'Келли, Натан, Кёртис, Алиша и Саймон выполняют общественные работы за совершение мелких преступлений. Они — не друзья. Более того, у них нет ничего общего. В группе постоянно происходят конфликты, споры и драки. Но в удивительный день во ', 'Келли, Натан, Кёртис, Алиша и Саймон выполняют общественные работы за совершение мелких преступлений. Они — не друзья. Более того, у них нет ничего общего. В группе постоянно происходят конфликты, споры и драки. Но в удивительный день во время сильного шторма сильная молния делает из них супергероев и наделяет их сверхвозможностями. Они понятия не имеют, что делать с этими сверхвозможностями. Более того, никто из них не рад своей новой силе, потому что она раскрывает их самые глубокие комплексы и тайны, которые бы они не хотели выставлять напоказ. Например, Келли, озабоченная общественным мнением о себе, получает способность читать чужие мысли, а у Кёртиса появляется способность возвращать прошлое. Ребята просто хотят побыстрее закончить свои исправительные работы и окунуться с головой в обычную жизнь тинейджеров. Но судьба им припасла еще одно задание, ведь после ужасного шторма в городе сверхспособностями стали обладать не только они одни…', 0, 'Отбросы', 'Misfits', 'Misfits', '0000-00-00', 2009, 2012, 'Великобритания', '-', 30, 9, 28, '40 мин', 'Том Грин, Джонатан ван Тюллекен, Том Харпер,', 'Роберт Шиэн, Иван Реон, Лорен Соча, Антония Томас, Натан Стюарт-Джарретт, Джозеф Гилган, Крэйг Паркинсон, Мэттью МакНалти, Алекс Рид, Рут Негга.'),
(253, 2, 'Главная героиня знакомится с мужчиной через интернет. На свидании он набрасывается на нее, насилует и клеймит буквой «Х».', 'Главная героиня знакомится с мужчиной через интернет. На свидании он набрасывается на нее, насилует и клеймит буквой «Х».', 0, 'Юлия Икс', 'n', 'o', '0000-00-00', 2011, 2011, 'США', '$4 000 000', 26, 0, 0, '92 мин', 'П.Дж. Петтьетте', 'Валери Эзлинн, Кевин Сорбо, Алисия Ли Уиллис, Джоэль Мур, Винг Реймз, Саксон Шарбино, Грегг Браззел, Мэг Рэйнс'),
(255, 3, 'С детства все прочили Веронике счастье — в городке еще не видывали такой красавицы. Девушка росла без печали и забот — отец, талантливый ученый, не чаял души в единственной дочке, соседские мальчишки сражались за ее любовь, в школе журили за гордый нрав.. ', 'С детства все прочили Веронике счастье — в городке еще не видывали такой красавицы. Девушка росла без печали и забот — отец, талантливый ученый, не чаял души в единственной дочке, соседские мальчишки сражались за ее любовь, в школе журили за гордый нрав.. Но однажды в жизнь героини приходит горе, изменившее всё: горячо любимый отец внезапно умирает… Спасая Веронику от приюта, он перед смертью поручает воспитание дочки своему бывшему ученику Кострову — столичному миллионеру, волей случая оказавшемуся рядом с ним в последний день.. Вероника наотрез отказывается ехать в чужой город с мрачным замкнутым человеком, которого совсем не знает. Но, оставшись в городе одна, девушка вскоре понимает, что оказалась втянутой в темную историю и теперь ей придется бороться за свою жизнь..', 0, 'Вероника. Потерянное счастье', 'n', 'o', '0000-00-00', 2012, 2012, 'Россия', '-', 16, 0, 0, '45 мин', 'Мирослав Малич', 'Наталья Бардо, Александр Дьяченко, Сергей Жигунов, Дмитрий Лабуш, Амаду Мамадаков, Мария Машкова, Владимир Носик'),
(256, 2, '4 ноября 1979 г. революция в Иране достигает своего апогея, исламисты штурмуют посольство США в Тегеране и берут в заложники 52 американца. Но в этом хаосе шестерым удается ускользнуть и найти прибежище в доме канадского посла...', '4 ноября 1979 г. революция в Иране достигает своего апогея, исламисты штурмуют посольство США в Тегеране и берут в заложники 52 американца. Но в этом хаосе шестерым удается ускользнуть и найти прибежище в доме канадского посла. Понимая, что их обнаружение и, вероятнее всего, убийство — всего лишь вопрос времени, Тони Мендес, специалист ЦРУ по тайному вывозу людей из страны, предлагает рискованный план безопасной эвакуации. План столь невероятен, что такое бывает только в кино.', 0, 'Операция «Арго»', 'n', 'o', '0000-00-00', 2012, 2012, 'США', '$44 500 000', 26, 9, 11, '120 мин', 'Бен Аффлек', 'Бен Аффлек, Брайан Крэнстон, Алан Аркин, Джон Гудмен, Виктор Гарбер, Тейт Донован, Клеа Дюваль, Скут МакНэйри, Рори Кокрейн, Кристофер Денхам'),
(257, 2, 'Они были лучшими копами Лос-Анджелеса. Бесстрашные и везучие напарники, они стали друг другу как братья. Но однажды парни залезли в самое логово преступного мира города, по-глупому подставились и сами стали мишенью… Кто успеет первым разрядить обойму?', 'Они были лучшими копами Лос-Анджелеса. Бесстрашные и везучие напарники, они стали друг другу как братья. Но однажды парни залезли в самое логово преступного мира города, по-глупому подставились и сами стали мишенью… Кто успеет первым разрядить обойму?', 0, 'Патруль', 'n', 'o', '0000-00-00', 2012, 2012, 'США', '$7 000 000', 26, 9, 15, '109 мин', 'Дэвид Эйр', 'Джейк Джилленхол, Майкл Пенья, Анна Кендрик, Натали Мартинез, Америка Феррера, Фрэнк Грилло, Дэвид Харбор, Кле Шахид Слоун, Джейм Фицсаймонс, Коуди Хорн'),
(258, 2, 'Одним холодным зимним днем над территорией Норвегии разгорается жаркое сражение двух самолетов — немецкого и английского. В результате столкновения обе машины получают серьезные повреждения и падают в глухом норвежском лесу. Здесь, в изоляции от внешнего мира, враги вынуждены выживать вместе...', 'Одним холодным зимним днем над территорией Норвегии разгорается жаркое сражение двух самолетов — немецкого и английского. В результате столкновения обе машины получают серьезные повреждения и падают в глухом норвежском лесу. Здесь, в изоляции от внешнего мира, враги вынуждены выживать вместе. Тяжелые условия и необходимость поддерживать друг друга постепенно превращают врагов в товарищей', 0, 'Снежная тюрьма', 'n', 'o', '0000-00-00', 2012, 2012, 'США', '$7 000 000', 3, 5, 11, '100 мин', 'Петтер Несс', 'Флориан Лукас, Дэвид Кросс, Стиг Хенрик Хофф, Локлен Нибор, Руперт Гринт, Ким Хёуген, Кнут Йонер, Мортен Фальдаас, Сондре Крогтофт Ларсен'),
(259, 2, 'Одним холодным зимним днем над территорией Норвегии разгорается жаркое сражение двух самолетов — немецкого и английского. В результате столкновения обе машины получают серьезные повреждения и падают в глухом норвежском лесу. Здесь, в изоляции от внешнего мира, враги вынуждены выживать вместе...', 'Одним холодным зимним днем над территорией Норвегии разгорается жаркое сражение двух самолетов — немецкого и английского. В результате столкновения обе машины получают серьезные повреждения и падают в глухом норвежском лесу. Здесь, в изоляции от внешнего мира, враги вынуждены выживать вместе. Тяжелые условия и необходимость поддерживать друг друга постепенно превращают врагов в товарищей', 0, 'Блокбастер 3D', 'n', 'o', '0000-00-00', 2011, 2011, 'США', '-', 12, 0, 0, '102 мин', 'Эцио Греджо', 'Эцио Греджо, Маурицио Маттиоли, Энцо Сальви, Антонелло Фассари, Бьяджо Иццо, Анна Фальчи, Джорджия Вурт\r\nДжанфранко Ияннуццо, Макс Пизу, Алессандро Бьянчи'),
(260, 2, 'После удачного ограбления казино, Эдд и Лиза пускаются в бега. С полными сумками денег, они хотят уехать из страны, но на границе их настигает снежная буря. Бывший боксер Джей освобождается из тюрьмы и спешит домой, чтобы провести День Благодарения в кругу семьи. Тем временем, полиция ведет поиски опасных преступников, напавших на полицейский патруль...', 'После удачного ограбления казино, Эдд и Лиза пускаются в бега. С полными сумками денег, они хотят уехать из страны, но на границе их настигает снежная буря. Бывший боксер Джей освобождается из тюрьмы и спешит домой, чтобы провести День Благодарения в кругу семьи. Тем временем, полиция ведет поиски опасных преступников, напавших на полицейский патруль...', 0, 'Черный дрозд', 'n', 'o', '0000-00-00', 2012, 2012, 'США', '$12 000 000', 26, 9, 15, '94 мин', 'Штефан Руцовицки', 'Эрик Бана, Оливия Уайлд, Чарли Ханнэм, Сисси Спейсек, Крис Кристофферсон, Джейсон Кавалье, Кевин Десфоссес, Ален Голем, Эллисон Грэхэм, Патрик Кертон'),
(261, 2, 'Переехав жить в небольшой провинциальный город, Сара и ее дочь еще не догадываются, что вскоре окажутся в эпицентре очень ужасной истории. Когда окажется, что вблизи живет серийный убийца, который несколько лет назад убил всю свою семью, хладнокровно спланировав преступление и выйдя сухим из воды.', 'Переехав жить в небольшой провинциальный город, Сара и ее дочь еще не догадываются, что вскоре окажутся в эпицентре очень ужасной истории. Когда окажется, что вблизи живет серийный убийца, который несколько лет назад убил всю свою семью, хладнокровно спланировав преступление и выйдя сухим из воды.', 0, 'Дом в конце улицы', '-', 'House at the End of the Street', '0000-00-00', 2012, 2012, 'США, Канада', '$10 000 000', 27, 0, 26, '101 мин.', 'Марк Тондерай', 'Дженнифер Лоуренс, Макс Тириот, Элизабет Шу, Джил Беллоуз, Нолан Фанк, Ева Линк, Александра МакДональд, Джордан Хэйес, Криста Бриджес, Джеймс Томас.'),
(262, 2, 'Две сексуальные современные вампирши живут в свое удовольствие среди нью-йоркской ночной тусовки до тех пор, пока любовь не встречается на их пути и не ставит под угрозу их бессмертие.', 'Две сексуальные современные вампирши живут в свое удовольствие среди нью-йоркской ночной тусовки до тех пор, пока любовь не встречается на их пути и не ставит под угрозу их бессмертие.', 0, 'Вампирши', '-', 'Vamps', '0000-00-00', 2012, 2012, 'США', '$16 000 000', 27, 12, 16, '93 мин.', 'Эми Хекерлинг', 'Алисия Сильверстоун, Кристен Риттер, Дэн Стивенс, Ричард Льюис, Сигурни Уивер, Уоллес Шоун, Джастин Кирк, Малкольм МакДауэлл, Зак Орт, Мэрилу Хеннер.'),
(263, 3, 'Жизнь Риты давно сложилась и течет размеренно и спокойно. В ней есть все: муж Анатолий, дочь Ольга, работа и даже хобби — Рита делает кукол. Хотя ее куклы хороши, муж против такого хобби. Анатолий хочет, чтобы вся вселенная крутилась вокруг него. Рита должна себя отдавать ему без остатка. В ее куклах он видит конкуренцию..', 'Жизнь Риты давно сложилась и течет размеренно и спокойно. В ней есть все: муж Анатолий, дочь Ольга, работа и даже хобби — Рита делает кукол. Хотя ее куклы хороши, муж против такого хобби. Анатолий хочет, чтобы вся вселенная крутилась вокруг него. Рита должна себя отдавать ему без остатка. В ее куклах он видит конкуренцию. Вот себе любимому он позволяет все. Любое хобби. Даже любовницу. И если бы Рита не узнала об этом, никогда бы мир не увидел ее кукол. Но теперь, когда Анатолий изгнан, надо найти возможность жить. Раньше она жила ради мужа. Ради чего жить теперь? Остается только одно — ее куклы. Теперь Рита одна. Больше нет надежной стены, о которую можно было бы опереться. Придется позаботиться о себе самой, а значит — повзрослеть. Но путь взросления тернист. И на этом пути можно как встретить новую любовь, так и потерять ее.', 0, 'Куклы', 'n', 'o', '0000-00-00', 2012, 2012, 'Россия', '-', 16, 0, 0, '45 мин', 'Алексей Карелин', 'Мария Аниканова, Олег Алмазов, Татьяна Чердынцева, Сергей Жбанков, Александр Тютин'),
(264, 3, 'Сериал покажет нам необычных московских школьников, их учителей и родителей. Фильм начинается с мальчика по имени Стас. Совсем недавно, он перевелся в новую школу, где в первый же день, с ним приключается удивительная история...', 'Сериал покажет нам необычных московских школьников, их учителей и родителей. Фильм начинается с мальчика по имени Стас. Совсем недавно, он перевелся в новую школу, где в первый же день, с ним приключается удивительная история. Новые знакомые, новые соперники и друзья. Все как обычно, за исключением того, что весь сериал выполнен в оригинальном режиссерском стиле, под зажигательные ритмы известных исполнителей...', 0, 'После школы', 'n', 'o', '0000-00-00', 2012, 2012, 'Россия', '-', 12, 0, 0, '55 мин', 'Владимир Пресняков, Олег Пресняков', 'Линда Табагари, Александр Казаков, Андрей Фандеев, Вадим Прокопов, Константин Попов, Марат Яруллин, Максим Виноградов, Агиша Семашкова, Вероника Вернадская, Максим Девизоров'),
(265, 2, 'Главный герой — молодой белорус Никита Мицкевич. Ему около 20 лет, живет и учится в Минске. Он музыкант, композитор, играет в модной минской группе… Но тут происходит событие, которое переворачивает всю его жизнь.', 'Главный герой — молодой белорус Никита Мицкевич. Ему около 20 лет, живет и учится в Минске. Он музыкант, композитор, играет в модной минской группе… Но тут происходит событие, которое переворачивает всю его жизнь.', 0, 'Выше неба', '-', '-', '0000-00-00', 2012, 2012, 'Беларусь', '---', 9, 0, 0, '113 мин.', 'Дмитрий Маринин, Андрей Курейчик', 'Леонид Пашковский, Оксана Чивелёва, Олеся Грибок, Дмитрий Винсент Папко, Евгений Булка, Иван Трус, Виктор Рыбчинский, Татьяна Бовкалова, Ольга Нефедова, Тамара Миронова.'),
(266, 2, 'Шестеро молодых туристов-экстремалов прибыли на каникулы в Украину. Узнав о том, что в Зону отчуждения устраиваются экскурсии, они нанимают гида и отправляются за незабываемыми впечатлениями...', 'Шестеро молодых туристов-экстремалов прибыли на каникулы в Украину. Узнав о том, что в Зону отчуждения устраиваются экскурсии, они нанимают гида и отправляются за незабываемыми впечатлениями. И таковые не заставляют их долго ждать. Казалось, радиоактивный город пуст и заброшен. Там не осталось ничего живого. Но как только солнце прячется за горизонт, Припять оживает. Нечеловеческие крики сотрясают ночной воздух. Незадачливых путешественников охватывают ужас и паника. Они понимают, что не одни в этом мёртвом городе.', 0, 'Запретная зона', '-', 'Chernobyl Diaries', '0000-00-00', 2012, 2012, 'США', '$37 157 000', 27, 0, 0, '88 мин.', 'Брэдли Паркер', 'Джонатан Садовский, Натан Филлипс, Джесси МакКартни, Ингрид Болсай Бердал, Дмитрий Дьяченко, Оливия Дадли, Девин Келли, Милош Тимотиевич, Милутин Милошевич, Иван Джорджевич.'),
(267, 2, '«Итак, вы хотите быть пиратом?» Если это правда, то будьте готовы к фантастическим путешествиям, безумным приключениям, и всем сюрпризам, которые ждут искателей приключений в открытом море. Помните, что вы...', 'путешествиям, безумным приключениям, и всем сюрпризам, которые ждут искателей приключений в открытом море. Помните, что вы всегда можете рассчитывать на пиратского капитана, который будет оказывать необходимую консультативную помощь и содействие любой адаптированному пирату. \r\n\r\nС помощью Полли, доверенных Додо птицы, пиратский капитан дает множество советов — узнать, как сэкономить место, чтобы спрятать сокровища, изучить секреты и тайны ветров навигации и даже попробовать отличные блюда — кальмары и ракообразные с лимоном это не звучит вкусно? При участии специальных гостей, таких как Чарльз Дарвин и Король пиратов, это приключение в море является фантастическим, воспроизведение музыки и полна сюрпризов ожидания по пути.', 0, 'Кто хочет стать пиратом?', '-', 'The Pirates! So You Want To Be A Pirate!', '0000-00-00', 2012, 2012, 'США, Великобритания', '-', 18, 12, 14, '17 мин.', 'Питер Лорд, Джефф Ньюитт', 'Хью Грант, Брендан Глисон, Джереми Пивен, Брайан Блессид, Ленни Генри, Сальма Хайек, Коннор Бирн, Мартин Фриман, Эшли Дженсен, Питер Лорд.'),
(268, 3, 'Есть люди, которых устраивает только первое место. Именно к таким относится Хикари Хакадзоно — девушка из бедной семьи, привыкшая достигать всего в жизни своим трудом. И, как на грех, с детства дорогу ей везде переходит Кэй Такисима — наследник известного клана,...', 'Есть люди, которых устраивает только первое место. Именно к таким относится Хикари Хакадзоно — девушка из бедной семьи, привыкшая достигать всего в жизни своим трудом. И, как на грех, с детства дорогу ей везде переходит Кэй Такисима — наследник известного клана, гениальный буквально во всем. Соперничество, начавшееся с 6 лет, приводит их в частную школу Хакусэн, где не считают нужным говорить «не высовывайся, будь, как все». \r\n\r\nНаоборот, одаренных и ярких личностей собирают в спецкласс «А», ученики которого отличаются не только формой и свободным графиком, но и в качестве «клуба избранных» используют огромную оранжерею. Кроме Кэя и Хикари, в классе есть еще одержимые музыкой близнецы Дзюн и Мэгуми, директорский сынок Тадаси, тусовщица Акира и Рю, парень себе на уме. Ну, а остальные школьники относятся к «избранным» по-разному — от обожания до зависти, переходящей в ненависть, что, в общем-то, тех мало волнует.', 0, 'Спецкласс "А" ', 'Special_A', 'Special A', '0000-00-00', 2008, 2008, 'Япония', '---', 1, 12, 9, '25 мин.', 'Йошиказу Мияо, Хирокадзу Ямада, Тору Ёсида', 'Юко Гото, Дзюн Фукуяма,\r\nХитоми Набатамэ, иро Симоно, Аяхи Такагаки, Цубаса Ёнага, Кадзума Хориэ, Кисё Танияма, Мегуми Огата, Ами Косимидзу.'),
(269, 3, 'Последний раз вы так смеялись летом, когда на "ТНТ" вышел заключительный выпуск битвы. И только сегодня самые талантливые, но пока никому не известные юмористы продолжат борьбу за право стать новым резидентом Сomedy Сlub. Скромные армянские боги юмора Галустян и Мартиросян, а также их отечественные коллеги - Харламов, Светлаков и Слепаков - определят самого смешного бойца', 'Последний раз вы так смеялись летом, когда на "ТНТ" вышел заключительный выпуск битвы. И только сегодня самые талантливые, но пока никому не известные юмористы продолжат борьбу за право стать новым резидентом Сomedy Сlub. Скромные армянские боги юмора Галустян и Мартиросян, а также их отечественные коллеги - Харламов, Светлаков и Слепаков - определят самого смешного бойца', 0, 'Comedy Баттл', 'n', 'o', '0000-00-00', 2012, 2012, 'Россия', '-', 22, 0, 0, '47 мин', 'ТНТ', 'Павел Воля'),
(270, 3, 'Симпсоны живут в вымышленном городе Спрингфилд, со своим обществом и историей. Гомер - отец семейства, который дает плохие советы и работает инспектором безопасности на атомной электростанции; Мардж - любящая мать и жена, старается сохранить спокойствие в семье; Барт - 10 летний хулиган; Лиза - философский 8-летний ребенок; и Мэгги - младенец, который общается посредством соски.', 'Симпсоны живут в вымышленном городе Спрингфилд, со своим обществом и историей. Гомер - отец семейства, который дает плохие советы и работает инспектором безопасности на атомной электростанции; Мардж - любящая мать и жена, старается сохранить спокойствие в семье; Барт - 10 летний хулиган; Лиза - философский 8-летний ребенок; и Мэгги - младенец, который общается посредством соски.', 0, 'Симпсоны', 'n', 'o', '0000-00-00', 2012, 2012, 'США', '-', 18, 12, 0, '20 мин', 'Мэтт Гроунинг', 'Дэн Кастелланета, Джули Кавнер, Нэнси Картрайт, Ярдли Смит, Гарри Ширер, Хэнк Азария, Памела Хейден, Тресс МакНилл, Карл Видерготт, Мэгги Росвэлл и другие.'),
(271, 3, 'Действие происходит в конце 80-х гг в маленьком городе Заводске. Леся — красивая, одаренная, но очень своенравная девушка. После смерти родителей ее растила старшая сестра Катя — ради Леси она оставила мечту о сцене и работала за троих, чтобы Леся ни в чём не нуждалась. Вскоре после окончания школы красавицу Лесю позвал замуж влюбленный до безумия поклонник...', 'Действие происходит в конце 80-х гг в маленьком городе Заводске. Леся — красивая, одаренная, но очень своенравная девушка. После смерти родителей ее растила старшая сестра Катя — ради Леси она оставила мечту о сцене и работала за троих, чтобы Леся ни в чём не нуждалась. Вскоре после окончания школы красавицу Лесю позвал замуж влюбленный до безумия поклонник и девушка ответила согласием. Но вместо того, чтобы готовится к свадьбе, героиня целыми днями пропадает на вокзале, с тоской встречает поезда из Москвы и ждёт, что Он всё-таки вернётся…', 0, 'Только о любви', 'n', 'o', '0000-00-00', 2012, 2012, 'Россия', '-', 1, 0, 0, '45 мин', 'Валерий Девятилов', 'Дмитрий Курта, Карина Разумовская, Артем Федотов, Анна Литкенс, Екатерина Молоховская, Нелли Пшенная'),
(272, 3, 'Лео, Раф, Майки и Донни – черепашки-мутанты, научившиеся боевому искусству ниндзюцу у своего сэнсэя Учителя Сплинтера. Выбравшись из канализации на улицы Нью-Йорка, братья оказываются в бурлящем жизнью мегаполисе. Здесь им придется неустанно противостоять самым кровожадным злодеям в истории человечества...', 'Лео, Раф, Майки и Донни – черепашки-мутанты, научившиеся боевому искусству ниндзюцу у своего сэнсэя Учителя Сплинтера. Выбравшись из канализации на улицы Нью-Йорка, братья оказываются в бурлящем жизнью мегаполисе. Здесь им придется неустанно противостоять самым кровожадным злодеям в истории человечества. В свободное от схваток время ребята занимаются своим любимым делом – дурачатся и едят восхитительную сочную пиццу! Сражаясь с мастером Шредером, мерзким инопланетянином Крэнгом и толпами свехмощных мутантов, черепашки учатся стоять друг за друга стеной, чтобы стать теми, кем им предписано быть судьбой – отважными и благородными героями!', 0, 'Черепашки-ниндзя (2012)', 'n', 'o', '0000-00-00', 2012, 2012, 'США', '-', 18, 28, 3, '24 мин', 'Алан Ван, Juan Jose Meza-Leon, Майкл Чанг', 'Шон Эстин, Джейсон Биггз, Грег Сайпс, Роб Полсен, Хун Ли, Мэй Уитман'),
(273, 3, 'Быть стройной и выйти замуж по великой любви, желательно до 30, — вот об этом мечтала Саша Зайцева в тринадцать лет. Шестнадцать лет спустя, в подвенечном платье, она стоит на мосту, плачет и не может решить, что же ей делать дальше?', 'Быть стройной и выйти замуж по великой любви, желательно до 30, — вот об этом мечтала Саша Зайцева в тринадцать лет. Шестнадцать лет спустя, в подвенечном платье, она стоит на мосту, плачет и не может решить, что же ей делать дальше? Так Саша устраивается работать в клинику к отцу… Но перед нами не очередная история из жизни медиков. В центре сюжета любовный треугольник. В клинике с Зайцевой работают двое замечательных мужчин: хирург-плейбой и романтик гинеколог. Путаница в отношениях, необходимость спасать жизнь пациентов, кризис в семье отца и матери, дневник и … много шоколада — простая формула отличной истории.', 0, 'Дневник доктора Зайцевой', 'n', 'o', '0000-00-00', 2012, 2012, 'Россия', '-', 16, 0, 0, '50 мин', 'Андрей Щербович-Вечер', 'Яна Крайнова, Илья Любимов, Павел Трубинер, Елена Сафонова'),
(274, 3, 'На НТВ - премьера третьего сезона самого дикого сериала с одноименным названием! Создатели обещают, что будет дико смешно, дико опасно и дико интересно! Ведь любимого зрителями героя - Дикого - ждут новое звание, новая любовь и новая служба!', 'На НТВ - премьера третьего сезона самого дикого сериала с одноименным названием! Создатели обещают, что будет дико смешно, дико опасно и дико интересно! Ведь любимого зрителями героя - Дикого - ждут новое звание, новая любовь и новая служба! Всё начинается с того, что оперуполномоченный Александр Диченко он же - Дикий - начинает охоту на банду беспредельщиков, которая занимается отстрелом якобы не чистых на руку полицейских. Бандиты захватывают отделение полиции, берут заложников, тяжело ранив при этом бывшего сослуживца Дикого... Разоблачение этой преступной группировки и станет последним делом Дикого в Вышнегорске. Вскоре он приезжает в Москву на похороны своего бывшего начальника Василича, который был жестоко убит накануне. ', 0, 'Дикий 3', 'n', 'o', '0000-00-00', 2012, 2012, 'Россия', '-', 3, 0, 0, '46 мин', 'Артем Мазунов', 'Игорь Лифанов, Артем Мазунов, Мария Баева, Юлия Майборода, Дмитрий Исаев, Игорь Миркурбанов');
INSERT INTO `data` (`id`, `cat`, `shot_text`, `all_text`, `view`, `name_ru`, `tname`, `name_en`, `date`, `fyear`, `lyear`, `strana`, `budget`, `genre1`, `genre2`, `genre3`, `time`, `director`, `in_role`) VALUES
(275, 3, 'В Питере по адресу: Литейный, 4 находится специальный отдел по расследованию особо важных преступлений. В его состав входят талантливые оперативные сотрудники самых разных структур, старые друзья, известные нам по сериалу «Улицы разбитых фонарей»...', 'В Питере по адресу: Литейный, 4 находится специальный отдел по расследованию особо важных преступлений. В его состав входят талантливые оперативные сотрудники самых разных структур, старые друзья, известные нам по сериалу «Улицы разбитых фонарей», встретившиеся по воле судьбы вновь через много лет, собранные в независимую команду, которую теперь возглавляет генерал Шаламов. Они подчиняются только президенту страны и высшему руководству МВД. В их распоряжении — дорогие машины, вся мощь современных технологий и новейшей шпионской техники. Спецотдел занимается самыми сложными делами — наркоторговля, торговля оружием и человеческими органам, детская проституция, угроза терроризма…', 0, 'Литейный 7', 'n', 'o', '0000-00-00', 2012, 2012, 'Россия', '-', 15, 0, 0, '45 мин', 'Андрей Астраханцев, Максим Бриус', 'Анвар Либанов, Анастасия Мельникова, Алексей Нилов, Сергей Селин, Евгений Сидихин, Андрей Федорцов'),
(276, 2, 'Саша привык во всем слушаться только маму. А что будет, если мама уедет на довольно длительный срок? Ведь Саша никогда не оставался дома один.', 'Саша привык во всем слушаться только маму. А что будет, если мама уедет на довольно длительный срок? Ведь Саша никогда не оставался дома один.', 0, 'Человек из банки', 'n', 'o', '0000-00-00', 2012, 2012, 'Россия', '-', 16, 12, 0, '61 мин', 'Иван Кульнев', 'Алексей Белов, Любовь Копылова, Людмила Зотова, Валерий Чебурканов'),
(277, 2, 'История любви, страсти и предательства между сводными братом и сестрой. Юный бунтарь Тадек возвращается к сестре Анке домой в поисках утешения и ласки. Связанные болезненной семейной историей, брат и сестра должны найти путь освободиться, чтобы выжить.', 'История любви, страсти и предательства между сводными братом и сестрой. Юный бунтарь Тадек возвращается к сестре Анке домой в поисках утешения и ласки. Связанные болезненной семейной историей, брат и сестра должны найти путь освободиться, чтобы выжить.', 0, 'Без стыда (2012) [HD 720]', 'n', 'o', '0000-00-00', 2012, 2012, 'Польша', '-', 9, 8, 0, '80 мин', 'Филип Марчевский', 'Матеуш Кощчукевич, Агнешка Гроховска, Анна Пручняк, Мачей Марчевский, Павел Круликовский, Дариуш Майхшак, Михал Филипяк'),
(278, 2, 'Опытный пилот Уип Вайтекер чудом избегает крушения самолета, и, совершив аварийную посадку, сохраняет жизни практически всех пассажиров. Уипа чествуют, как героя, но чем больше появляется подробностей о катастрофе, тем больше вопросов возникает: что же на самом деле произошло на борту самолёта…', 'Опытный пилот Уип Вайтекер чудом избегает крушения самолета, и, совершив аварийную посадку, сохраняет жизни практически всех пассажиров. Уипа чествуют, как героя, но чем больше появляется подробностей о катастрофе, тем больше вопросов возникает: что же на самом деле произошло на борту самолёта…', 0, 'Экипаж (2012)', 'n', 'o', '0000-00-00', 2012, 2012, 'США', '$31 000 000', 9, 0, 0, '124 мин.', 'Роберт Земекис', 'Дензел Вашингтон, Мелисса Лео, Джон Гудмен, Дон Чидл, Келли Райлли, Брюс Гринвуд, Надин Веласкес, Джеймс Бэдж Дэйл, Гарсель Бове, Брайан Джерати'),
(279, 2, 'Опытный пилот Уип Вайтекер чудом избегает крушения самолета, и, совершив аварийную посадку, сохраняет жизни практически всех пассажиров. Уипа чествуют, как героя, но чем больше появляется подробностей о катастрофе, тем больше вопросов возникает: что же на самом деле произошло на борту самолёта…', 'Опытный пилот Уип Вайтекер чудом избегает крушения самолета, и, совершив аварийную посадку, сохраняет жизни практически всех пассажиров. Уипа чествуют, как героя, но чем больше появляется подробностей о катастрофе, тем больше вопросов возникает: что же на самом деле произошло на борту самолёта…', 0, 'Соловей-Разбойник (2012)', 'n', 'o', '0000-00-00', 2012, 2012, 'Россия', '$2 881 593', 12, 3, 15, '87 мин.', 'Егор Баранов', 'Иван Охлобыстин, Евгений Стычкин, Оксана Фандера, Игорь Жижикин, Сергей Бадюк, Александр Стриженов, Павел Прилучный'),
(280, 2, 'Когда злой дух Кромешник посягает на самое дорогое — детские мечты, Северянин, Ледяной Джек, Кролик, Зубная Фея и Песочный Человек впервые объединяются, чтобы создать команду Хранителей снов…', 'Когда злой дух Кромешник посягает на самое дорогое — детские мечты, Северянин, Ледяной Джек, Кролик, Зубная Фея и Песочный Человек впервые объединяются, чтобы создать команду Хранителей снов…', 0, 'Хранители снов (2012)', 'n', 'o', '0000-00-00', 2012, 2012, 'США', '$145 000 000', 18, 30, 21, '97 мин', 'Питер Рэмси', 'Алек Болдуин, Айла Фишер, Дакота Гойо, Хью Джекман, Джуд Лоу, Крис Пайн, Хамани Гриффин, Камиль МакФедден, Джорджи Грив, Эмили Нордвинд'),
(281, 3, 'Сериал рассказывает о приключениях братьев Сэма и Дина Винчестеров, которые путешествуют по Соединённым Штатам на чёрном автомобиле Chevrolet Impala 1967 года...', 'Сериал рассказывает о приключениях братьев Сэма и Дина Винчестеров, которые путешествуют по Соединённым Штатам на чёрном автомобиле Chevrolet Impala 1967 года, расследуют паранормальные явления, многие из которых основаны на американских городских легендах и фольклоре, и сражаются с порождениями зла, такими как демоны и призраки.', 0, ' Сверхъестественное', '-----', 'Supernatural', '0000-00-00', 2005, 0, 'США', '---', 27, 26, 30, '42 мин.', 'Филип Сгриккиа, Роберт Сингер, Ким Мэннерс', 'Джаред Падалеки, Дженсен Эклс, Джим Бивер, Миша Коллинз, Марк Шеппард, Марк Пеллегрино, Женевьев Падалеки, Кэти Кэссиди, Джеймс Патрик Стюарт, Саманта Феррис.'),
(282, 3, 'Главные герои сериала, Суворова и Шульгин, любят друг друга и собираются объявить всем о своих отношениях. Но возникает неожиданное препятствие — Шульгин получает известие, что женщина по имени Елена, которую он когда-то любил и считал трагически погибшей по его вине, жива...', 'Главные герои сериала, Суворова и Шульгин, любят друг друга и собираются объявить всем о своих отношениях. Но возникает неожиданное препятствие — Шульгин получает известие, что женщина по имени Елена, которую он когда-то любил и считал трагически погибшей по его вине, жива. Шульгин пытается её разыскать, для него это очень важно — его мучило чувство вины за ее смерть. Не разобравшись со своим прошлым, Шульгин не может строить отношения с Суворовой. Кроме того, Елена — ключевой свидетель в давнем незаконченном деле об убийстве. Шульгин не посвящает Суворову в свое расследование, считает это дело слишком личным. И когда Суворова узнаёт о происходящем, ее это сильно задевает. Она вдруг понимает, что совсем ничего не знает про Шульгина: кто он, откуда, каким он был до неё? Они отдаляются друг от друга. Суворова начинает своё параллельное расследование, надеясь тем самым помочь Шульгину и выяснить что-то для себя. На этом пути они встречают множество преград, их любовь трещит по швам, но, тем не менее, они постепенно, шаг за шагом, узнают друг друга.', 0, 'По горячим следам 2', 'n', 'o', '0000-00-00', 2012, 2012, 'Россия', '-', 6, 0, 0, '43 мин.', 'Илья Максимов', 'Алексей Шаранин, Мария Порошина, Вячеслав Разбегаев, Илья Древнов, Владимир Епифанцев'),
(283, 2, 'Шесть жизней, прямо не связанных между собой людей, каждый из которых по-своему борется за выживание в окружающем их круге насилия и жестокости.', 'Шесть жизней, прямо не связанных между собой людей, каждый из которых по-своему борется за выживание в окружающем их круге насилия и жестокости.', 0, 'Неблагоприятные Кварталы / Форестгейт (2012)', 'n', 'o', '0000-00-00', 2012, 2012, 'Великобритания', '&#163;100 000', 9, 15, 0, '121 мин.', 'Бен Дрю', 'Риз Ахмед, Эд Скрейн, Натали Пресс, Анушка Монд, Мем Ферда, Ли Аллен, Даниэль Брент, Мартин Серен, Джо Хартли, Ник Сагар'),
(284, 2, 'Фильм является идейным продолжением жизни героев телесериала «Бригада». Однако акцент смещен в историю сына Александра Белова — Ивана. Это Кино о современной России. О том, что у всех на устах: политике, коррупции, цинизме крупного бизнеса и спецслужб...', 'Фильм является идейным продолжением жизни героев телесериала «Бригада». Однако акцент смещен в историю сына Александра Белова — Ивана. Это Кино о современной России. О том, что у всех на устах: политике, коррупции, цинизме крупного бизнеса и спецслужб. О новом поколении, которое, узнав правду о нечистом бизнесе родителей, не идет по их стопам, а выбирает новый путь. Для них дороги понятия чести, любви и Родины. Герой, комфортно живший за границей, тем не менее, выбирает Россию (в отличие от сериала) и остается жить в ней, надеясь привнести эти идеалы в жизнь своих близких и страны в целом.', 0, 'Бригада: Наследник (2012)', 'n', 'o', '0000-00-00', 2012, 2012, 'Россия', '$6 500 000', 3, 15, 0, '102 мин.', 'Денис Алексеев', 'Риз Ахмед, Эд Скрейн, Натали Пресс, Анушка Монд, Мем Ферда, Ли Аллен, Даниэль Брент, Мартин Серен, Джо Хартли, Ник Сагар'),
(285, 2, 'Маленький городок в Западной Вирджинии проводит ежегодный фестиваль «Горный человек», посвящённый Хэллоуину. Туда направляется группа студентов колледжа, однако они не подозревают, что шумная костюмированная вечеринка с музыкой и выпивкой обернётся для них кровавым кошмаром — на фестиваль направляется семья горных каннибалов.', 'Маленький городок в Западной Вирджинии проводит ежегодный фестиваль «Горный человек», посвящённый Хэллоуину. Туда направляется группа студентов колледжа, однако они не подозревают, что шумная костюмированная вечеринка с музыкой и выпивкой обернётся для них кровавым кошмаром — на фестиваль направляется семья горных каннибалов.', 0, 'Поворот не туда 5 (2012)', 'n', 'o', '0000-00-00', 2012, 2012, 'США', '-', 27, 26, 0, '91 мин.', 'Деклан О’Брайэн', 'Даг Брэдли, Камилла Арфведсон, Саймон Джинти, Роксанна МакКи, Paul Luebke, Оливер Хоар'),
(286, 2, 'Тихое ирландское побережье потрясают странные и ужасные события. Сперва, пропадают рыбаки, на берегу находят обескровленных китов, местные жители погибают при загадочных обстоятельствах. Причиной всех бед оказались грабберсы - кровожадные пришельцы из космоса, очень похожие на пиявок-мутантов. Практически неуязвимые хищники нуждались лишь в воде и человеческой крови...', 'Тихое ирландское побережье потрясают странные и ужасные события. Сперва, пропадают рыбаки, на берегу находят обескровленных китов, местные жители погибают при загадочных обстоятельствах. Причиной всех бед оказались грабберсы - кровожадные пришельцы из космоса, очень похожие на пиявок-мутантов. Практически неуязвимые хищники нуждались лишь в воде и человеческой крови...', 0, 'Грэбберсы (2011)', 'n', 'o', '0000-00-00', 2011, 2011, 'Великобритания, Ирландия', '&#163;4 000 000', 27, 26, 0, '90 мин.', 'Джон Райт', 'Ричард Койл,Рут Брэдли, Рассел Тоуви, Лалор Родди, Дэвид Пирс, Брона Галлахер, Паскаль Скотт, Клелия Мерфи, Луис Демпси, Мишель О’Груэгейн'),
(164, 3, 'Главное событие новых серий «Папиных дочек» — воссоединение семьи Васнецовых! Теперь вся семья, включая Папу (актер Андрей Леонов), Маму (актриса Нонна Гришаева), пять дочек (актрисы Настя Сиваева, Мирослава Карпович, Лиза Арзамасова, Даша Мельникова, Катя Старшова), Веника (актер Филипп Бледный) и даже Олигарха (актер Александр Олешко), будет жить в загородном доме в местечке с забавным названием Лохово. С переездом поменяется жизнь каждого члена семьи Васнецовых. Маша устроится на работу... ', 'Главное событие новых серий «Папиных дочек» — воссоединение семьи Васнецовых! Теперь вся семья, включая Папу (актер Андрей Леонов), Маму (актриса Нонна Гришаева), пять дочек (актрисы Настя Сиваева, Мирослава Карпович, Лиза Арзамасова, Даша Мельникова, Катя Старшова), Веника (актер Филипп Бледный) и даже Олигарха (актер Александр Олешко), будет жить в загородном доме в местечке с забавным названием Лохово. С переездом поменяется жизнь каждого члена семьи Васнецовых. Маша устроится на работу... актрисой! Даша погрузится в семейную жизнь и воспитание дочки Сони. Галина Сергеевна начнет встречаться с принцем, причем с настоящим! У Жени тоже случится настоящая любовь, но ей снова придется покинуть отчий дом. Ну, а Пуговка… Ей, как всегда, простят все шалости, чем она беззастенчиво будет пользоваться. Папу с мамой ждет немало хлопот в новом сезоне, ведь они воспитывают маленького сына и пять дочек… Но, несмотря на семейные хлопоты, в их жизни найдется место и романтическим отношениям.', 0, 'Папины дочки. Суперневесты', 'n', 'o', '0000-00-00', 2012, 2012, 'Россия', '', 12, 0, 0, '24 мин.', 'Александр Жигалкин, Сергей Алдонин', 'Мирослава Карпович, Настя Сиваева, Даша Мельникова, Лиза Арзамасова, Катя Старшова'),
