(288, 3, 'Уникумы и таланты со всей страны, самородки и смельчаки, исключительные и одаренные – настает звездный час для телезрителей! На Первом канале стартует новый сезон любимого шоу “Минута славы”, где главными действующими лицами являются таланты из народа.', 'Уникумы и таланты со всей страны, самородки и смельчаки, исключительные и одаренные – настает звездный час для телезрителей! На Первом канале стартует новый сезон любимого шоу “Минута славы”, где главными действующими лицами являются таланты из народа. В этом году самому народному шоу талантов исполняется пять лет! Позади уже шесть сезонов, со своими талантами, героями, победами и успехами, разными судьями, и бессменным и беспристрастным председателем жюри, легендой отечественного телевидения – Александром Васильевичем Масляковым. В юбилейный год мы будем не только оценивать таланты в студии…', 0, 'Минута славы шагает по стране', 'n', 'o', '0000-00-00', 2012, 2012, 'Россия', '-', 22, 0, 0, '90 мин.', 'Первый канал', 'Александр Олешко, Юлия Ковальчук и Дмитрий Шепелев '),
(289, 3, 'В оригинальном сериале рассказывается о приключениях братьев Винчестеров — Сэма и Дина, которые разъезжают по Соединенным Штатам на черном «Шевроле» 1967 года и расследуют разнообразные паранормальные явления, лихо сражаясь с зловещими демоническими сущностями...', 'В оригинальном сериале рассказывается о приключениях братьев Винчестеров — Сэма и Дина, которые разъезжают по Соединенным Штатам на черном «Шевроле» 1967 года и расследуют разнообразные паранормальные явления, лихо сражаясь с зловещими демоническими сущностями.\r\n\r\nВ аниме-проекте не только будут воссозданы лучшие эпизоды оригинального сериала, но также появятся моменты, не вошедшие в американскую версию. Мы увидим новые эпизоды, повествующие о детстве Винчестеров; у главных героев возникнут особые анимешные враги, а также полнее будут раскрыты образы некоторых второстепенных персонажей.', 0, 'Сверхъестественное  (аниме)', 'Supernatural: The Animation', 'Supernatural: The Animation', '0000-00-00', 2011, 2011, 'США, Япония', '----', 1, 30, 27, '---', 'Ацуко Ишизука, Сигэюки Маия', 'Джаред Падалеки, Эндрю Фаррар, Хироки Тоти, Юя Утида, Гарри Стандджофски, Такаши Танигути, Дженсен Эклс, Анджела Галуппо, Ален Голем, Такая Хаши.'),
(290, 2, 'Фильм повествует о путешествии Бильбо Бэггинса, который пускается в грандиозный поход, целью которого является отвоевание утраченного королевства гномов Эребор у зловещего дракона Смога...', 'Фильм повествует о путешествии Бильбо Бэггинса, который пускается в грандиозный поход, целью которого является отвоевание утраченного королевства гномов Эребор у зловещего дракона Смога. Совершенно неожиданно с хоббитом налаживает контакт волшебник Гэндальф Серый. Так Бильбо находит себя, присоединяясь к компании тринадцати гномов, возглавляемых легендарным воином, Торином Дубощитом. Их путешествие проляжет через Дикий Край, через предательские земли, населенные гоблинами и орками, смертоносными варгами и гигантскими пауками, народом, меняющим шкуры, и волшебниками.\r\n\r\nИ хотя их цель находится на Востоке среди пустошей Одинокой Горы, сначала им придется выбраться из туннелей гоблинов, где Бильбо встретит существо, которое изменит его жизнь навсегда… Голлума.\r\n\r\nЗдесь, один на один с Голлумом, на берегу подземного озера, непритязательный Бильбо Бэггинс обнаружит не только скрытые в глубине души хитрость и отвагу, которые удивят даже его, но и завладеет «прелестным» колечком Голлума, которое обладает нежданными и полезными свойствами… Простое золотое кольцо, c которым связана судьба всего Средиземья, нитями, о которых Бильбо не мог даже вообразить.', 0, 'Хоббит: Нежданное путешествие', 'n', 'o', '0000-00-00', 2012, 2012, 'США, Новая Зеландия', '$180 000 000', 30, 21, 0, '166 мин.', 'Питер Джексон', 'Хьюго Уивинг, Мартин Фриман, Кейт Бланшетт, Люк Эванс, Орландо Блум, Элайджа Вуд'),
(291, 3, 'Фронтовой разведчик, старший лейтенант Юрий Козырев, в последние дни войны попадает в плен и получает за это срок. В результате пересмотра дела в 1948-м, Козырев выходит из лагеря полностью оправданным и едет домой в родной рабочий городок под Москвой. Там его ждут перемены...', 'Фронтовой разведчик, старший лейтенант Юрий Козырев, в последние дни войны попадает в плен и получает за это срок. В результате пересмотра дела в 1948-м, Козырев выходит из лагеря полностью оправданным и едет домой в родной рабочий городок под Москвой. Там его ждут перемены: отец пропал без вести на фронте, мать умерла, а любимая девушка — Лариса — вышла замуж за обеспеченного работника торговли Волынского. Однажды на склад, куда Юрий устраивается работать охранником, совершается нападение. Главным подозреваемым по делу становится Козырев — на него начинается настоящая охота. Козырев скрывается от милиции и решает первым найти и обезвредить настоящего организатора ограбления. В награду за поимку преступника, сам Берия распоряжается назначить Козырева на должность инспектора уголовного розыска. Это назначение принесет ему новые расследования, и поставит его в рамки опасного треугольника — между бывшими товарищами по оружию, коллегами по службе и уголовниками…', 0, 'Легавый', 'n', 'o', '0000-00-00', 2012, 2012, 'Россия', '-', 6, 0, 0, '45 мин.', 'Рустам Уразаев', 'дуард Флёров, Михаил Павлик, Николай Козак, Оксана Гуляева, Анастасия Макеева, Елена Коровчук, Анатолий Кот'),
(292, 3, 'Фронтовой разведчик, старший лейтенант Юрий Козырев, в последние дни войны попадает в плен и получает за это срок. В результате пересмотра дела в 1948-м, Козырев выходит из лагеря полностью оправданным и едет домой в родной рабочий городок под Москвой. Там его ждут перемены...', 'Фронтовой разведчик, старший лейтенант Юрий Козырев, в последние дни войны попадает в плен и получает за это срок. В результате пересмотра дела в 1948-м, Козырев выходит из лагеря полностью оправданным и едет домой в родной рабочий городок под Москвой. Там его ждут перемены: отец пропал без вести на фронте, мать умерла, а любимая девушка — Лариса — вышла замуж за обеспеченного работника торговли Волынского. Однажды на склад, куда Юрий устраивается работать охранником, совершается нападение. Главным подозреваемым по делу становится Козырев — на него начинается настоящая охота. Козырев скрывается от милиции и решает первым найти и обезвредить настоящего организатора ограбления. В награду за поимку преступника, сам Берия распоряжается назначить Козырева на должность инспектора уголовного розыска. Это назначение принесет ему новые расследования, и поставит его в рамки опасного треугольника — между бывшими товарищами по оружию, коллегами по службе и уголовниками…', 0, 'Легавый (2012)', 'n', 'o', '0000-00-00', 2012, 2012, 'Россия', '-', 6, 0, 0, '45 мин.', 'Рустам Уразаев', 'дуард Флёров, Михаил Павлик, Николай Козак, Оксана Гуляева, Анастасия Макеева, Елена Коровчук, Анатолий Кот'),
(293, 3, 'Главная героиня истории — Варвара Ивановна Слуцкая. Бывшая учительница, ныне пенсионерка. Обожает читать детективы Агаты Кристи и всюду совать свой нос...', 'Главная героиня истории — Варвара Ивановна Слуцкая. Бывшая учительница, ныне пенсионерка. Обожает читать детективы Агаты Кристи и всюду совать свой нос. Варвара Ивановна переезжает в квартиру к своему сыну Роману и его жене Алёне помогать с воспитанием внуков Гоши и Лизы. Поначалу отношения Варвары Ивановны с невесткой складываются не очень гладко: две хозяйки «на одной кухне» всегда сложно уживаются. К тому же у Варвары Ивановны свои взгляды и методы воспитания внуков. Алена считает их слишком мягкими. Однажды Варвара Ивановна возвращалась домой и обнаружила в лифте труп соседки. Дело ведет следователь ОВД, сосед и друг четы Слуцких — Иван Болотников. Естественно, непоседа Варвара Ивановна начинает свое расследование. В этом ей помогает еще один сосед — пенсионер и бывший преподаватель в Академии Контрразведки — Вязьмин. Безудержная энергия, врожденная любопытность вкупе с деликатностью пожилого учителя, и, конечно, доскональное знание детективного жанра позволяет Варваре Ивановне смотреть на преступление немного под другим углом, нежели следователи…', 0, 'Любопытная Варвара', 'n', 'o', '0000-00-00', 2012, 2012, 'Россия', '-', 16, 6, 0, '50 мин.', 'Александр Кириенко', 'Елена Яковлева, Виталий Хаев, Андрей Кузичев, Даша Волга, Петр Баранчеев, Рамиля Искандер, Алексей Юрченко, Софья Лукьянова, Ирина Таранник, Олег Алмазов'),
(294, 2, 'Маниакальный злодей управляет смертельной игрой, в которую вовлечены ассасины со всего мира. Размещенные внутри изолированного бункера, эти безжалостные злодеи должны схватиться друг с другом и только один получит главный приз, а также свободу.', 'Маниакальный злодей управляет смертельной игрой, в которую вовлечены ассасины со всего мира. Размещенные внутри изолированного бункера, эти безжалостные злодеи должны схватиться друг с другом и только один получит главный приз, а также свободу.', 0, 'Убей их всех (2012)', 'n', 'o', '0000-00-00', 2012, 2012, 'США', '$3 200 000', 3, 0, 0, '86 мин.', 'Раймунд Хубер', 'Джонни Месснер, Джа Хуи Лью, Джо Льюис, Тим Мэн, Аммара Сирипонг, Рашид Феникс, Брахим Ачаббаке, Эрик Маркус Шуетз'),
(295, 3, 'Уолтер Уайт — преподаватель химии в школе. У него есть жена и сын-инвалид, жена ждет еще одного ребенка. Уолт уже не молод, и в этом возрасте часто бывают кризисы, тем более нужно кормить семью, а на зарплату преподавателя не разгуляешься, поэтому он вынужден подрабатывать на автомойке, где его же студенты над ним насмехаются, а еще сын, чью инвалидность тоже постоянно осмеивают.', 'Уолтер Уайт — преподаватель химии в школе. У него есть жена и сын-инвалид, жена ждет еще одного ребенка. Уолт уже не молод, и в этом возрасте часто бывают кризисы, тем более нужно кормить семью, а на зарплату преподавателя не разгуляешься, поэтому он вынужден подрабатывать на автомойке, где его же студенты над ним насмехаются, а еще сын, чью инвалидность тоже постоянно осмеивают.', 0, 'Во все тяжкие / Breaking Bad', 'n', 'o', '0000-00-00', 2008, 2012, 'США', '-', 9, 15, 0, '45 мин.', 'Адам Бернштейн, Винс Джиллигэн', 'Брайан Крэнстон, Анна Ганн, Аарон Пол'),
(296, 2, 'Биографическая лента об Аврааме Линкольне, шестнадцатом президенте США, который внес неоценимый вклад в победу северян во времена гражданской войны.', 'Биографическая лента об Аврааме Линкольне, шестнадцатом президенте США, который внес неоценимый вклад в победу северян во времена гражданской войны.', 0, 'Линкольн / Lincoln (2012)', 'n', 'o', '0000-00-00', 2012, 2012, ' Индия, США', '$65 000 000', 2, 5, 9, '150 мин.', 'Стивен Спилберг', ' Брюс МакГилл, Джеймс Спэйдер, Джеки Эрл Хейли, Джозеф Гордон-Левитт, Джон Хоукс, Дэвид Стрэтэйрн, Дэниэл Дэй-Льюис, Салли Филд, Томми Ли Джонс, Хэл Холбрук'),
(297, 2, 'Обожаемый мальчиком Виктором пес Спарки погибает в результате несчастного случая. Мальчик, не желая мириться с потерей друга, призывает науку на помощь и…возвращает питомца к жизни!...', 'Обожаемый мальчиком Виктором пес Спарки погибает в результате несчастного случая. Мальчик, не желая мириться с потерей друга, призывает науку на помощь и…возвращает питомца к жизни! Казалось бы, все не так уж плохо, но когда Спарки сбегает от Виктора, его друзья, родители, учителя и жители городка узнают, что возвращение к жизни домашнего питомца может повлечь за собой неожиданные и даже ужасные последствия!', 0, 'Франкенвини / Frankenweenie ( 2012)', 'n', 'o', '0000-00-00', 2012, 2012, 'США', '$39 000 000', 18, 12, 28, '87 мин.', 'Тим Бёртон', 'Аттикус Шаффер, Вайнона Райдер, Кончата Феррелл, Кристофер Ли, Кэтрин О’Хара, Мартин Ландау, Мартин Шорт, Роберт Капрон, Том Кенни, Чарли Тахэн'),
(298, 2, 'В 1930-е высокопоставленный чиновник Лиги Наций Солаль приезжает в Женеву. Там он знакомится с замужней аристократкой Арианой, и через некоторое время у них начинается страстный роман.', 'В 1930-е высокопоставленный чиновник Лиги Наций Солаль приезжает в Женеву. Там он знакомится с замужней аристократкой Арианой, и через некоторое время у них начинается страстный роман.', 0, 'Влюбленные  / Belle du Seigneur (2012)', 'n', 'o', '0000-00-00', 2012, 2012, 'Франция, Люксембург, Германия, Бельгия...', '€10 000 000', 9, 16, 0, '-', 'Гленио Бондер', 'Гилберт Джонстон, Джанин Хорсбур, Джимми Де Брэбэнт, Джонатан Риз Майерс, Лесли Вудхолл, Марианна Фэйтфулл, Мария Бонневи'),
(299, 2, 'Комедийная пародия на фильмы о зомби. Оставшись за главного в лавке древностей, принадлежащей его деду, Каспер, и его друзья по колледжу, случайно разбивают старинный артефакт и обрушивают себе на голову древнее проклятье...', 'Комедийная пародия на фильмы о зомби. Оставшись за главного в лавке древностей, принадлежащей его деду, Каспер, и его друзья по колледжу, случайно разбивают старинный артефакт и обрушивают себе на голову древнее проклятье. Теперь, стоит им только взглянуть на кого-нибудь, как тот убивает себя, а потом воскресает зомбаком! Пока друзья разбирались в чем тут дело, половина города успела превратится в зомби. Зомбаками стали даже ребята из сборной колледжа по футболу и девчонки из группы поддержки. Теперь друзьям необходимо срочно найти способ снять проклятье. Это будет нелегко, но зато очень круто и дико смешно!', 0, 'Самый страшный фильм 3D (2012)', 'n', 'o', '0000-00-00', 2012, 2012, 'Канада', '-', 12, 27, 21, '-', 'Эйприл Маллен', 'Бриттани Аллен, Брэндон Джей МакЛарен, Девон Бостик, Кайл Шмид, Кевин МакДональд, Кристофер Ллойд, Марта МакАйсак, Тим Дойрон'),
(300, 2, 'История разворачивается в 1952 году, когда Англия готовится к коронации. «Козёл отпущения» рассказывает историю двух очень разных людей, у которых есть кое-что общее — лицо.', 'История разворачивается в 1952 году, когда Англия готовится к коронации. «Козёл отпущения» рассказывает историю двух очень разных людей, у которых есть кое-что общее — лицо.', 0, 'Козёл отпущения / The Scapegoat (2012)', 'n', 'o', '0000-00-00', 2012, 2012, 'Великобритания', '-', 9, 0, 0, '100 мин.', 'Чарльз Старридж', 'Айлин Эткинс, Джоди Мэй, Джулиан Уэдэм, Мэттью Риз, Пип Торренс, Сильви Тестю, Фиби Николлс, Шеридан Смит');
INSERT INTO `data` (`id`, `cat`, `shot_text`, `all_text`, `view`, `name_ru`, `tname`, `name_en`, `date`, `fyear`, `lyear`, `strana`, `budget`, `genre1`, `genre2`, `genre3`, `time`, `director`, `in_role`) VALUES
(301, 3, 'При Следственном комитете Москвы создается специальный отдел, который должен заниматься расследованием случаев жестокого обращения. В компетенцию отдела входят расследования случаев физического и морального насилия в государственных учреждениях, вопиющие случаи несоблюдения прав человека, связанные с пытками и насилием, невыполнение служебных обязанностей органами следствия, жестокое обращение с детьми, женщинами, стариками.', 'При Следственном комитете Москвы создается специальный отдел, который должен заниматься расследованием случаев жестокого обращения. В компетенцию отдела входят расследования случаев физического и морального насилия в государственных учреждениях, вопиющие случаи несоблюдения прав человека, связанные с пытками и насилием, невыполнение служебных обязанностей органами следствия, жестокое обращение с детьми, женщинами, стариками.', 0, 'Право на правду', 'n', 'o', '0000-00-00', 2012, 2012, 'Россия', '-', 6, 15, 0, '43 мин.', 'Николай Барышников', 'Елена Ксенофонтова, Борис Хвошнянский, Илья Исаев, Сергей Никоненко, Артур Ваха, Артем Осипов, Дарья Лузина, Ольга Торощина'),
(302, 3, 'В центре проекта — истории из жизни счастливых людей.Шоу «Счастливый конец» расскажет как заставить блондинку с пышными формами примерить все купальники в отделе, можно ли вылечить простуду с помощью груди...', 'В центре проекта — истории из жизни счастливых людей.Шоу «Счастливый конец» расскажет как заставить блондинку с пышными формами примерить все купальники в отделе, можно ли вылечить простуду с помощью груди пятого размера, чем закадрить сногсшибательную секретаршу на глазах у начальника и как отыскать сексуального маньяка, если он – женщина твоей мечты!', 0, 'Счастливый конец', 'Schastlivyi_konec', '-', '0000-00-00', 2013, 2013, 'Россия', '---', 22, 0, 0, '24 мин', 'Перец ТВ', '---'),
(303, 3, '«Битва цивилизаций» – так называется новый проект известного журналиста Игоря Прокопенко. \r\nЗакрытая до сих пор информация из секретных архивов станет доступна только зрителям РЕН ТВ.\r\n 15 уникальных документальных расследований: неопровержимые факты, шокирующие открытия, громкие сенсации.\r\n РЕН ТВ откроет все тайны.', '«Битва цивилизаций» – так называется новый проект известного журналиста Игоря Прокопенко. \r\nЗакрытая до сих пор информация из секретных архивов станет доступна только зрителям РЕН ТВ.\r\n 15 уникальных документальных расследований: неопровержимые факты, шокирующие открытия, громкие сенсации.\r\n РЕН ТВ откроет все тайны.', 0, 'Битва цивилизаций', 'Bitva_civilizacii', '---', '0000-00-00', 2012, 2012, 'Россия', '---', 31, 0, 0, '47 мин', 'РЕН ТВ', 'Игорь Прокопенко'),
(304, 3, 'В следственный отдел прокуратуры введен специальный консультант, гражданский человек Роман Фрейдин, психолог по образованию. Его появление обусловлено необходимостью применения нетрадиционных методов борьбы с преступностью..', 'В следственный отдел прокуратуры введен специальный консультант, гражданский человек Роман Фрейдин, психолог по образованию. Его появление обусловлено необходимостью применения нетрадиционных методов борьбы с преступностью. В молодости Фрейдин объездил всю Россию и Европу, общался с людьми самых разных профессий - от квалифицированных психоаналитиков до народных колдунов и гадалок, от признанных ученых до карточных игроков с сомнительной репутацией. В расследовании преступлений Фрейдин опирается на интуицию и использует научные методики, воссоздает биокинетические картины событий, психофизические портреты преступников, прогнозирует действия бандитов. И каждый раз «залезая в голову» преступника, Фрейдин понимает, что трагедии можно было избежать, и что зачастую человек, нарушивший закон, не мрачный злодей, а запутавшаяся в жизненных обстоятельствах душа.', 0, 'Метод Фрейда', 'n', 'o', '0000-00-00', 2013, 2013, 'Россия', '-', 6, 0, 0, '50 мин.', 'Михаил Вайнберг', 'ван Охлобыстин, Наталия Антонова, Елена Николаева (II), Павел Прилучный, Артур Ваха, Алексей Гришин, Александр Воробьёв (II), Александр Кузнецов, Наталья Рычкова, Алла Подчуфарова, Маргарита Быстрякова, Вячеслав Яковлев, Виктор Марки'),
(305, 3, 'Паутина криминальных связей становится больше. С ней продолжает борьбу начальник убойного отдела майор Фёдор Туманов. В новом сезоне Туманов с капитаном Петром Грековым будут разгадывать ещё более изощрённые криминальные загадки...', 'Паутина криминальных связей становится больше. С ней продолжает борьбу начальник убойного отдела майор Фёдор Туманов. В новом сезоне Туманов с капитаном Петром Грековым будут разгадывать ещё более изощрённые криминальные загадки. Например, в одной из них фигурирует чёрный тюльпан, что был в букете, который оказался на месте очередного преступления. Туманову кажется всё это подозрительным: чёрный тюльпан уж слишком контрастирует с нежными белыми розами. Греков считает, что Туманов отстал от жизни, ведь сейчас в нынешнем гламурном обществе нет никаких правил. Нашим операм придётся выяснить, что это: «гламур и дизигн» от современных флористов или атрибут изощренных методов преступника?', 0, 'Паутина 6', 'n', 'o', '0000-00-00', 2013, 2013, 'Россия', '-', 6, 0, 0, '45 мин.', 'Андрей Хрулев', 'Олег Харитонов, Маргарита Иванова-Донская, Валерий Новиков, Сергей Пасько, Александра Булычёва, Валентин Садики'),
(306, 2, 'Изабель мечтает о свадьбе. Но на её семье лежит проклятие. Все первые браки неминуемо заканчиваются разводами. Поэтому, когда ее парень делает ей предложение, Изабель решает перехитрить судьбу. Она отыскивает первого попавшегося лузера, влюбляет его в себя и: вместо того, чтобы развестись, случайно влюбляется сама.', 'Изабель мечтает о свадьбе. Но на её семье лежит проклятие. Все первые браки неминуемо заканчиваются разводами. Поэтому, когда ее парень делает ей предложение, Изабель решает перехитрить судьбу. Она отыскивает первого попавшегося лузера, влюбляет его в себя и: вместо того, чтобы развестись, случайно влюбляется сама.', 0, 'Замуж на 2 дня', 'Zamuj_na_2_dnya', 'Un plan parfait', '0000-00-00', 2012, 2012, 'Франция', '€17 000 000', 16, 21, 12, '101 мин.', 'Паскаль Шомель', 'Дайан Крюгер, Дэни Бун, Алис Поль, Робер Планьоль, Джонатан Коэн, Бернадетт Ле Саше. Этьен Шико, Лорэ Кэлами, Мэлонн Левана, Оливье Клавери.'),
(307, 2, 'По знаменитому одноименному роману Льва Толстого.', 'По знаменитому одноименному роману Льва Толстого.', 0, 'Анна Каренина', 'Anna_Karenina', 'Anna Karenina', '0000-00-00', 2012, 2012, 'Великобритания', '$11 670 921', 9, 0, 0, '129 мин.', 'Джо Райт', 'Кира Найтли, Джуд Лоу, Аарон Тейлор-Джонсон, Келли Макдоналд, Мэтью Макфейден, Домналл Глисон, Рут Уилсон, Алисия Викандер, Оливия Уильямс, Эмили Уотсон.'),
(308, 2, 'Шесть историй — пять реинкарнаций, происходящих в разное время, тесно переплетаются между собой…', 'Шесть историй — пять реинкарнаций, происходящих в разное время, тесно переплетаются между собой…', 0, 'Облачный атлас', 'Oblachnyi_atlas', 'Облачный атлас', '0000-00-00', 2012, 2012, 'Германия, США, Гонконг, Сингапур', '$100 000 000', 28, 6, 9, '172 мин.', '	Лана Вачовски, Том Тыквер, Энди Вачовски', 'Том Хэнкс, Холли Берри, Джим Бродбент, Хьюго Уивинг, Джим Стёрджесс, Пэ Ду На, Бен Уишоу, Джеймс Д’Арси, Жу Жу, Кит Дэвид.'),
(309, 2, 'Эксцентричный охотник за головами, также известный как «Дантист», промышляет отстрелом самых опасных преступников на Диком Западе. Работенка пыльная, и без надежного помощника ему не обойтись. Но как найти такого и желательно не очень дорогого? Беглый раб по имени Джанго — прекрасная кандидатура. Правда, у нового помощника свои мотивы — кое с чем надо разобраться…', 'Эксцентричный охотник за головами, также известный как «Дантист», промышляет отстрелом самых опасных преступников на Диком Западе. Работенка пыльная, и без надежного помощника ему не обойтись. Но как найти такого и желательно не очень дорогого? Беглый раб по имени Джанго — прекрасная кандидатура. Правда, у нового помощника свои мотивы — кое с чем надо разобраться…', 0, 'Джанго освобожденный', 'Django_osvobojdennyi', 'Django Unchained', '0000-00-00', 2012, 2012, 'США', '$100 000 000', 9, 4, 12, '165 мин.', 'Квентин Тарантино', 'Джейми Фокс, Кристоф Вальц, Леонардо ДиКаприо, Керри Вашингтон, Сэмюэл Л. Джексон, Уолтон Гоггинс, Деннис Кристофер, Джеймс Римар, Майкл Паркс, Дон Джонсон.'),
(310, 3, 'Сериал «Ты не один» — истории о буднях адвокатов, чья специализация — оперативная работа по вызову...', 'Сериал «Ты не один» — истории о буднях адвокатов, чья специализация — оперативная работа по вызову. Трое сотрудников — юрист Владимир Николаевич Кузьмин, бывший оперуполномоченный милиции Максим Геннадьевич Загорский и выпускница престижного юридического ВУЗа Наталья Валерьевна Шатова, используя свои способности, возможности, полезные связи и контакты, экстренно приходят на помощь по первому звонку. Адвокаты работают как скорая помощь: спасают своих клиентов от выбивания долгов; защищают обманутых дольщиков; советуют, как выгодно развестись и избежать уплаты алиментов; помогают получить выплаты от страховой компании или по иску от ресторана за кишечное отравление… Каждая серия — законченное самостоятельное дело.', 0, 'Ты не один', 'n', 'o', '0000-00-00', 2013, 2013, 'Россия', '-', 15, 6, 31, '26 мин', 'Дмитрий Панченко', 'Дмитрий Новицкий, Максим Радугин, Елена Болдина'),
(311, 3, 'Продолжение телесериала "Институт благородных девиц"\r\nВ институт благородных девиц, который теперь возглавляет Софья (ее, как и в первом сезоне, играет Алиса Сапегина), приходят новые девушки...', 'Продолжение телесериала "Институт благородных девиц"\r\nВ институт благородных девиц, который теперь возглавляет Софья (ее, как и в первом сезоне, играет Алиса Сапегина), приходят новые девушки. Юной Лизе Вишневецкой (эту новую роль исполняет актриса Алина Кизиярова) предстоит пройти непростые испытания. Только смелость и благородство графа Воронцова, Софьи и, конечно же, помощь подружек Лизы из «Союза горячих сердец» помогут избежать страшного финала. Приключения, похищения, побеги, крепкая дружба, романтические встречи и настоящая любовь - всем этим будет наполнен новый сезон.', 0, 'Тайны института благородных девиц', 'n', 'o', '0000-00-00', 2013, 2013, 'Россия', '-', 9, 11, 0, '44 мин', 'Сергей Данелян, Сахат Дурсунов', 'лиса Сапегина, Дарья Егорова, Алина Кизиярова, Людмила Кожевникова, Ирэна Морозова, Сергей Астахов, Елена Дубровская, Александр Корженков, Ирина Линдт, Алена Созинова'),
(312, 3, 'Москва. Площадь трех вокзалов — Ленинградского, Ярославского и Казанского. Бермудский треугольник столицы. Здесь ломаются судьбы и продаются билеты в один конец. Тут часто оказываются на верном пути, а от расписания иногда зависят жизнь и смерть.', 'Москва. Площадь трех вокзалов — Ленинградского, Ярославского и Казанского. Бермудский треугольник столицы. Здесь ломаются судьбы и продаются билеты в один конец. Тут часто оказываются на верном пути, а от расписания иногда зависят жизнь и смерть.', 0, 'Москва. Три вокзала - 5', 'n', 'o', '0000-00-00', 2013, 2013, 'Россия', '-', 16, 0, 0, '46 мин', 'Юрий Павлов', 'Владимир Стеклов, Андрей Фролов (II), Алексей Булдаков, Александр Цуркан, Владимир Жеребцов, Иван Оганесян, Марина Гайзидорская, Андрей Вальц, Мария Кононова, Александр Негреба, Елена Ожиганова'),
(313, 3, 'В Битово происходит громкое экономическое преступление: заезжих бизнесменов "кинули" на 100 миллионов рублей. Дерзкого афериста разыскивают оперативники Кручи, бандиты Сафрона и сами "бизнесмены", оказавшиеся членами организованной преступной группировки...', 'В Битово происходит громкое экономическое преступление: заезжих бизнесменов "кинули" на 100 миллионов рублей. Дерзкого афериста разыскивают оперативники Кручи, бандиты Сафрона и сами "бизнесмены", оказавшиеся членами организованной преступной группировки. Также в этом сезоне Сафрон баллотируется в депутаты под лозунгом: "Я освобожу район Битово от преступности и от бездействия полиции". Борьба Кручи против преступности обостряется: масштабные грабежи и циничные убийства, борьба с работорговцами и квартирными аферистами, арест банды подростков из богатых семей, которые играют в карты человеческими жизнями.', 0, 'Мент в законе 6', 'n', 'o', '0000-00-00', 2013, 2013, 'Россия', '-', 6, 0, 0, '45 мин', 'Сергей Полянский, Евгений Сологалов', 'Сергей Плотников, Антон Сёмкин, Михаил Бабичев, Константин Глушков, Юлия Яблонская, Денис Кирис, Константин Гацалов, Дарья Русакова, Роман Селецкий, Тарас Кияшко'),
(314, 3, 'Трофим Петрович Стрельцов — и его помощник Егор не только защищают людей, но и проводят собственные расследования самых запутанных дел. В этом уникальность их работы, но в этом и ее главный подвох: если юристы найдут доказательства виновности клиента, то на защиту конторы он рассчитывать не сможет. Жестко, но честно!...', 'Трофим Петрович Стрельцов — и его помощник Егор не только защищают людей, но и проводят собственные расследования самых запутанных дел. В этом уникальность их работы, но в этом и ее главный подвох: если юристы найдут доказательства виновности клиента, то на защиту конторы он рассчитывать не сможет. Жестко, но честно! Петрович сознательно идет на риск: пусть он потеряет адвокатскую лицензию, но останется верен себе и своим принципам.', 0, 'Петрович', 'n', 'o', '0000-00-00', 2013, 2013, 'Россия', '-', 6, 0, 0, '47 мин', 'Геннадий Байсак, Георгий Гаврилов', 'Алексей Петренко, Илья Шакунов, Андрей Барило, Анастасия Панина, Марина Голуб, Сергей Цепов, Евдокия Германова, Иван Николаев, Лолита Милявская, Влад Топалов, Анатолий Котенев, Борис Каморзин, Екатерина Семенова'),
(315, 3, 'В новом сезоне Кате Лавровой и её курсантам предстоит расследовать череду загадочных убийств участников археологической экспедиции, поломать голову над чертовщиной, происходящей в одной из деревень, распутать дело, в котором замешаны оборотни, и спасти от приговора курсанта, обвиняемого в жестоком убийстве.', 'В новом сезоне Кате Лавровой и её курсантам предстоит расследовать череду загадочных убийств участников археологической экспедиции, поломать голову над чертовщиной, происходящей в одной из деревень, распутать дело, в котором замешаны оборотни, и спасти от приговора курсанта, обвиняемого в жестоком убийстве.', 0, 'Метод Лавровой', 'n', 'o', '0000-00-00', 2013, 2013, 'Россия', '-', 6, 0, 0, '48 мин', 'Валерия Ивановская', 'Светлана Ходченкова, Дмитрий Блохин, Артём Григорьев, Павел Прилучный, Ярослав Жалнин, Григорий Иванец, Максим Виноградов, Михаил Хмуров, Дарья Иванова, Ольга Дибцева, Ольга Хохлова, Юрий Батурин, Александр Соколовский'),
(316, 2, 'Граф Дракула для себя и своей любимой дочки построил хорошо укрытый от посторонних глаз отель, куда монстры со всего света приезжают отдохнуть от семейных забот, повседневной суеты и, конечно… людей. Но вездесущие американские туристы проникают и сюда.', 'Граф Дракула для себя и своей любимой дочки построил хорошо укрытый от посторонних глаз отель, куда монстры со всего света приезжают отдохнуть от семейных забот, повседневной суеты и, конечно… людей. Но вездесущие американские туристы проникают и сюда.', 0, 'Монстры на каникулах', 'Hotel_Transylvania', 'Hotel Transylvania', '0000-00-00', 2012, 2012, 'США', '$85 000 000', 18, 23, 12, '91 мин', 'Генндий Тартаковский', 'Адам Сэндлер, Энди Сэмберг, Селена Гомес, Кевин Джеймс, Фрэн Дрешер, Стив Бушеми, Молли Шеннон, Дэвид Спейд, Си-Ло, Джон Ловиц.'),
(317, 3, 'Сериал построен по принципу складывающейся головоломки. Каждую серию мы видим глазами ее главного героя. У каждого героя своя история в рамках серии. Эти истории переплетаются между собой, опираясь на систему флешбэков и флешфорвардов. Одни и те же события зритель увидит глазами каждого персонажа, принимающего в них участие.', 'Сериал построен по принципу складывающейся головоломки. Каждую серию мы видим глазами ее главного героя. У каждого героя своя история в рамках серии. Эти истории переплетаются между собой, опираясь на систему флешбэков и флешфорвардов. Одни и те же события зритель увидит глазами каждого персонажа, принимающего в них участие.', 0, 'Моими глазами', 'o', 'n', '0000-00-00', 2013, 2013, 'Россия', '-', 26, 0, 0, '25 мин.', 'Заур Болотаев', 'Анатолий Горячев, Дмитрий Готсдинер, Александр Бобров, Ирина Денисова, Константин Шелестун, Дмитрий Поднозов, Макар Запорожский, Вячеслав Чепурченко, Павел Ясенок, Лилия Разакова'),
(318, 3, 'Лидии Викторовне Гориной, ставшей матерью для двух приёмных детей, приходится столкнуться с новыми жизненными испытаниями. И на сей раз под ударом оказалась её главная надежда и опора — любимый супруг Борис Одинцов. Решив начать новое дело — строительство коттеджного посёлка на месте разрушенных бывшим мэром домов, Борис Сергеевич неожиданно разворошил осиное гнездо...', 'Лидии Викторовне Гориной, ставшей матерью для двух приёмных детей, приходится столкнуться с новыми жизненными испытаниями. И на сей раз под ударом оказалась её главная надежда и опора — любимый супруг Борис Одинцов. Решив начать новое дело — строительство коттеджного посёлка на месте разрушенных бывшим мэром домов, Борис Сергеевич неожиданно разворошил осиное гнездо. Старый недоброжелатель Одинцова Щетинин с помощью своих высоких покровителей добивается смещения Бориса Сергеевича с поста директора и берёт контроль над фирмой в свои руки. Оказавшись на улице после ареста мужа, Горина начинает борьбу за свободу Одинцова и будущее свой семьи.', 0, 'Катерина 4: Другая жизнь', 'o', 'n', '0000-00-00', 2013, 2013, 'Россия', '-', 16, 0, 0, '43 мин.', 'Андрей Щербинин', 'Ирина Розанова, Александр Блок, Алиса Седова, Сергей Маркеев, Сергей Лосев, Мария Валешная, Ирина Цветкова, Александр Кудренко, Сергей Уманов, Геннадий Смирнов'),
(319, 3, 'Фильм о том, как бывший советский прокурор организовал адвокатскую контору, которая никогда — даже за огромаднейшие деньги! — не будет защищать неправедных людей.', 'Фильм о том, как бывший советский прокурор организовал адвокатскую контору, которая никогда — даже за огромаднейшие деньги! — не будет защищать неправедных людей.', 0, 'Петрович', 'o', 'n', '0000-00-00', 2013, 2013, 'Россия', '-', 6, 0, 0, '47 мин.', 'Геннадий Байсак, Георгий Гаврилов', 'Алексей Петренко, Александр Петров, Илья Шакунов, Марина Голуб, Евгений Щецов, Сергей Цепов, Александр Воробьев, Вадим Чибисов'),
(320, 3, 'После кораблекрушения плейбой миллиардер Оливер Куин пропадает и считается погибшим в течение пяти лет, после чего его обнаруживают живым на затерянном острове в Тихом океане. Когда он возвращается домой в Старлинг-Сити, его преданная мать Мойра, столь любимая сестра Теа и лучший друг Томми приветствуют его дома, но они видят, что Оливер изменился после испытаний на острове...', 'После кораблекрушения плейбой миллиардер Оливер Куин пропадает и считается погибшим в течение пяти лет, после чего его обнаруживают живым на затерянном острове в Тихом океане. Когда он возвращается домой в Старлинг-Сити, его преданная мать Мойра, столь любимая сестра Теа и лучший друг Томми приветствуют его дома, но они видят, что Оливер изменился после испытаний на острове. Хотя Оливер скрывает правду о человеке, которым он стал…', 0, 'Стрела / Arrow', 'o', 'n', '0000-00-00', 2012, 2013, 'США', '-', 28, 3, 9, '60 мин.', 'David Barrett', 'Стивен Амелл, Кэти Кэссиди, Пол Блекторн, Колин Доннелл, Сюзанна Томпсон, Колин Сэлмон'),
(321, 3, 'Зрители увидят украинскую версию легендарного американского ситкома. «Такси» вошел в список лучших комедийных сериалов в истории телевидения: 18 премий «Эмми» за 5 сезонов, сотни приглашенных звезд в кадре и тысячи фанов по другую сторону экрана!...', 'Зрители ICTV увидят украинскую версию легендарного американского ситкома. «Такси» вошел в список лучших комедийных сериалов в истории телевидения: 18 премий «Эмми» за 5 сезонов, сотни приглашенных звезд в кадре и тысячи фанов по другую сторону экрана! Роли в проекте принесли первую славу таким «гуру» Голливуда, как Денни де Вито, Кристофер Ллойд и Энтони Хопкинс! Над украинской версией ситкома поработала команда профессиональных сценаристов во главе с известным «камеди-клаберам» и ноуменом Антон Лирник. События сериала разворачиваются вокруг службы такси и жизнь ее колоритных сотрудников: водители, механики и руководитель станут участниками невероятных и веселых историй. Практически все работники службы пришли сюда «только на время», а оставшиеся «несколько дольше, чем планировали». «Старожил» гаража Алексей, начинающий актер Эдик, дизайнер Елена, боксер Егор, кореец Ван и странный человек многосложный работают под руководством хитрого и опытного бюрократаВалерика, дружат, ссорятся, попадают в забавные ситуации и вместе с ним выпутываются. - Главный секрет в том, чтобы сюжет был правдивым, состоял из ситуаций и историй нашей с вами жизни, - поделился своим видением сюжета креативный продюсер проекта Антон Лирник. - Мы собираем эти истории и подаем так, чтобы выглядели они интересно, забавно и весело. ', 0, 'Такси', 'o', 'n', '0000-00-00', 2013, 2013, 'Украина', '-', 12, 0, 0, '25 мин.', 'Антон Щербаков ', ' Сергей Белоголовцев, Сергей Рост, Екатерина Кистень, Егор Крутоголов, Павел Галич, Роман Хан '),
(322, 2, 'Во время испытаний машины времени в сверхсекретной правительственной лаборатории неожиданно происходит сбой аппаратуры. Это приводит к тому, что отправленную на 100 000 000 лет назад экспедицию не удается вернуть обратно...', 'Во время испытаний машины времени в сверхсекретной правительственной лаборатории неожиданно происходит сбой аппаратуры. Это приводит к тому, что отправленную на 100 000 000 лет назад экспедицию не удается вернуть обратно. \r\n\r\n Для спасательной операции был срочно привлечен отряд специального назначения, который под руководством профессора Рено отправляется в далекое прошлое. Ведь каждая минута нахождения в древнем мире может стоить пропавшей группе исследователей жизни! Однако, вооруженные сверхсовременным оружием и обладающие профессиональными навыками, солдаты спецназа оказываются бессильными против динозавров…\r\n\r\n Всякое столкновение с исполинскими хищниками приводит к потерям в элитном отряде. К счастью, им все же удается найти ученых, ведущих отчаянную борьбу за выживание в доисторических джунглях, и вернуть их в XXI век. Но внезапно оборудование дает новый сбой. Это приводит к настоящей катастрофе — в современный мир попадает самый опасный хищник в истории Земли!', 0, '100 000 000 лет до нашей эры', '-', '100 Million BC', '0000-00-00', 2008, 2008, 'США', '- $', 28, 3, 30, '85 мин.', 'Грифф Ферст', 'Майкл Гросс, Кристофер Аткинс, Грег Эвиган, Мари Уэстбрук, Фил Бурк, Венди Картер, Джофф Мид, Стефен Блекхарт, Дин Крейлинг, Дэниэл Понски.'),
(323, 2, '10 лет спустя бывшие одноклассники собираются, чтобы оторваться по полной и поставить на уши весь город. Море выпивки, веселья и воспоминаний, но теперь все по-взрослому! Красавчик Джейк прибыл...', '10 лет спустя бывшие одноклассники собираются, чтобы оторваться по полной и поставить на уши весь город. Море выпивки, веселья и воспоминаний, но теперь все по-взрослому! Красавчик Джейк прибыл на вечеринку вместе с ослепительной девушкой, они — идеальная пара, и они счастливы в любви. Но этой ночью на глаза Джейку попадается его первая любовь, прошлое притягивает его и стучится в память с новой силой. Сможет ли он сделать правильный выбор? И правда ли, что у любви нет срока давности?', 0, '10 лет спустя', '10_Years', '10 Years', '0000-00-00', 2012, 2012, 'США', '-$', 9, 12, 16, '100 мин.', 'Джеми Линден', 'Ченнинг Татум, Дженна Деван, Джастин Лонг, Макс Мингелла, Оскар Айзек, Крис Прэтт, Эри Грейнор, Дэниэл Скотт, Лампкин мл., Лили Лампкин, Скотт Портер.'),
(324, 2, 'Фильм основан на мифическом персонаже из норвежского фольклора, которого называют Хулдра. Согласно мифу Хулдра — прекрасная женщина, живущая в лесу, соблазняющая и убивающая мужчин. Она поет красивые песни, манит их к себе в глубь леса прекрасным телом, и затем убивает. Узнать ее можно лишь по наличию коровьего хвоста…', 'Фильм основан на мифическом персонаже из норвежского фольклора, которого называют Хулдра. Согласно мифу Хулдра — прекрасная женщина, живущая в лесу, соблазняющая и убивающая мужчин. Она поет красивые песни, манит их к себе в глубь леса прекрасным телом, и затем убивает. Узнать ее можно лишь по наличию коровьего хвоста…', 0, 'Хвост', 'hvost', 'Thale', '0000-00-00', 2012, 2012, 'Норвегия', '-$', 30, 6, 26, '78 мин.', 'Aleksander Nordaas', 'Силье Рейномо, Erlend Nervold, Jon Sigve Skard, Мортен Андресен.'),
(325, 2, 'Каждый из главных героев фильма стремился к своей заветной мечте. Сара Голдфарб мечтала сняться в известном телешоу, ее сын Гарольд со своим другом Тайроном — сказочно разбогатеть, подруга Гарольда Мэрион грезила о собственном модном магазине, но на их пути были всяческие...', 'Каждый из главных героев фильма стремился к своей заветной мечте. Сара Голдфарб мечтала сняться в известном телешоу, ее сын Гарольд со своим другом Тайроном — сказочно разбогатеть, подруга Гарольда Мэрион грезила о собственном модном магазине, но на их пути были всяческие препятствия. События фильма разворачиваются стремительно, герои погрязли в наркотиках. Мечты по-прежнему остаются недостижимыми, а жизни героев рушатся безвозвратно.', 0, 'Реквием по мечте', '-', 'Requiem for a Dream', '0000-00-00', 2000, 2000, 'США', '$4 500 000', 9, 0, 0, '102 мин.', 'Даррен Аронофски', 'Марлон Уайанс, Джаред Лето, Дженнифер Коннелли, Эллен Бёрстин, Кристофер МакДональд, Кит Дэвид, Марк Марголис, Луиза Лэссер, Марсия Жан Кертц, Джанет Сарно.'),
(326, 3, 'Эта история началась еще в 1986 году. Уже шла перестройка, но Советский Союз еще не распался. Это было время, когда не было интернета, гипермаркетов и даже мобильных телефонов, но зато воду пили из-под крана, в Москве не было пробок, а ключи от квартиры спокойно оставляли под ковриком.', 'Эта история началась еще в 1986 году. Уже шла перестройка, но Советский Союз еще не распался. Это было время, когда не было интернета, гипермаркетов и даже мобильных телефонов, но зато воду пили из-под крана, в Москве не было пробок, а ключи от квартиры спокойно оставляли под ковриком.', 0, 'Восьмидесятые', 'n', 'o', '0000-00-00', 2013, 2013, 'Россия', '-', 12, 0, 0, '25 мин.', 'Федор Стуков', 'Александр Якин, Александр Головин, Александр Половцев, Мария Аронова'),
(327, 2, 'На молодую парочку, Макса и Лизу, сваливается удача: они становятся победителями лотереи с выигрышем в пять миллионов долларов! Но получить деньги можно только на торжественной церемонии в столице порока, азартных игр и безудержного веселья, Лас Вегасе… ', 'На молодую парочку, Макса и Лизу, сваливается удача: они становятся победителями лотереи с выигрышем в пять миллионов долларов! Но получить деньги можно только на торжественной церемонии в столице порока, азартных игр и безудержного веселья, Лас Вегасе… \r\n\r\nСчастливчики не подозревают, что на большой куш есть и другие претенденты. Оказавшись в Америке, они попадают на крючок очень опасного, но невероятно обаятельного мошенника Гарика, вылитого Элвиса Пресли.\r\n\r\nКто же сорвет джек-пот?', 0, 'Билет на Vegas (2012)', 'n', 'o', '0000-00-00', 2012, 2012, 'Россия, США', '-', 12, 21, 0, '92 мин', 'Гор Киракосян', 'Михаил Галустян, Ингрид Олеринская, Иван Стебунов, Владимир Яглыч, Наталья Ноздрина, Дэнни Трехо, Олег Тактаров, Виталий Хаев, Ким Уитли, Гильермо Диас');
INSERT INTO `data` (`id`, `cat`, `shot_text`, `all_text`, `view`, `name_ru`, `tname`, `name_en`, `date`, `fyear`, `lyear`, `strana`, `budget`, `genre1`, `genre2`, `genre3`, `time`, `director`, `in_role`) VALUES
(328, 2, 'Главный герой нашей истории — успешный актер, звезда шоу-бизнеса Игорь Успенский. Его жизнь — сплошные съемки, концерты, презентации, корпоративы, интервью и светские тусовки. Он вынужден «крутиться» день и ночь, у него нет выходных и праздников.', 'Главный герой нашей истории — успешный актер, звезда шоу-бизнеса Игорь Успенский. Его жизнь — сплошные съемки, концерты, презентации, корпоративы, интервью и светские тусовки. Он вынужден «крутиться» день и ночь, у него нет выходных и праздников. А его очаровательная жена и прекрасная дочка видят его в лучшем случае поздно ночью, когда он приезжает домой, чтобы поспать хотя бы пару часов. Но все труды не проходят даром. Игорь очень популярен и однажды его кандидатуру выдвигают на премию «Человек года» — теперь ему нужно еще больше времени, чтобы победить главного конкурента — певца Михаила Стасова, главные хиты которого свели с ума всех женщин России…\r\n\r\nВ подмосковном городе живет Сева, человек, чрезвычайно похожий на Игоря Успенского. Он работает массажистом в салоне красоты, живет вдвоем с собакой по имени Сергей Валерьевич, абсолютно доволен своей жизнью и не признает сходства со звездой. Однажды директор салона убеждает Севу сняться в рекламном ролике, где САМ Игорь Успенский (конечно, изображаемый Севой) делает массаж клиентам салона. Ролик оказывается в интернете — так о своем двойнике узнает Успенский. Понимая, что времени ни на что не хватает, Успенский решает не подавать в суд на салон, а предложить Севе стать своим Дублером. Тому лишь нужно посетить несколько корпоративов и светских тусовок в образе Игоря Успенского. Сева принимает предложение и… попадает в незнакомый мир шоу-бизнеса, где его ждут невероятные приключения…', 0, 'Дублер (2013)', 'т', 'щ', '0000-00-00', 2013, 2013, 'Россия', '$6 322 465', 12, 0, 0, '85 мин', 'Евгений Абызов', 'Александр Ревва, Кристина Асмус,  Дмитрий Хрусталев, Людмила Артемьева, Татьяна Орлова, Ксения Буравская'),
(329, 2, 'Лояльность Бонда своей начальнице М под угрозой со стороны ее прошлого, которое внезапно даст о себе знать. MI6 подвергается нападению, и агент 007 должен ликвидировать угрозу, несмотря на цену, которую придется заплатить.', 'Лояльность Бонда своей начальнице М под угрозой со стороны ее прошлого, которое внезапно даст о себе знать. MI6 подвергается нападению, и агент 007 должен ликвидировать угрозу, несмотря на цену, которую придется заплатить.', 0, '007: Координаты «Скайфолл»', '-', 'Skyfall', '0000-00-00', 2012, 2012, 'Великобритания, США', '$200 000 000', 3, 15, 26, '143 мин. ', 'Сэм Мендес', 'Дэниэл Крэйг, Хавьер Бардем, Джуди Денч, Рэйф Файнс, Наоми Харрис, Бен Уишоу, Альберт Финни, Беренис Марло, Хелен МакКрори, Тония Сотиропулу.'),
(330, 3, 'Савельев решает выйти в отставку. Начальник затягивает процесс уволнения, ведь Савельев не только его друг но и настоящий профессионал. Савельев, уроженец провинции, вдруг осознаёт, что проживание в мегаполисе уже ничего не даёт ему в отношении интереса к жизни. Конечно, повлияли на его решение и развод с женой. Савельев настаивает на своей отставке и уезжает на родину, в районный город N. Здесь от покойных родителей осталась квартира. Но главное, что у Савельева есть постоянная возможность ездить на кордон, жить и дышать в лесной глуши. Но к счастью или несчастью, профессия и высокая репутация не оставляют Савельева в покое. Его иногда привлекает к расследованиям местный прокурор, его однокашник – Черанёв. Но самое главное событие для Савельева – постигшая его любовь.', 'Савельев решает выйти в отставку. Начальник затягивает процесс уволнения, ведь Савельев не только его друг но и настоящий профессионал. Савельев, уроженец провинции, вдруг осознаёт, что проживание в мегаполисе уже ничего не даёт ему в отношении интереса к жизни. Конечно, повлияли на его решение и развод с женой. Савельев настаивает на своей отставке и уезжает на родину, в районный город N. Здесь от покойных родителей осталась квартира. Но главное, что у Савельева есть постоянная возможность ездить на кордон, жить и дышать в лесной глуши. Но к счастью или несчастью, профессия и высокая репутация не оставляют Савельева в покое. Его иногда привлекает к расследованиям местный прокурор, его однокашник – Черанёв. Но самое главное событие для Савельева – постигшая его любовь.', 0, 'Кордон следователя Савельева', 'n', 'o', '0000-00-00', 2013, 2013, 'Россия', '-', 6, 0, 0, '45 мин', 'Сергей Крутин', 'Дмитрий Марьянов, Александр Андриенко, Михаил Жигалов, Любовь Толкалина, Ада Роговцева, Нонна Гришаева, Евгений Ефремов, Елена Турбал, Злата Швец-Скальская, Сергей Фролов'),
(331, 3, '“Рен ТВ” вновь разжигает огненные печи русской версии суперпопулярного во всем мире кулинарного шоу “Адская кухня”!\r\n Зрителя вновь ждет беспощадная битва кулинаров со всей страны на самой жаркой, перченой и острой кухне на отечественном ТВ – “Адской кухне”!\r\n', '“Рен ТВ” вновь разжигает огненные печи русской версии суперпопулярного во всем мире кулинарного шоу “Адская кухня”!\r\n Зрителя вновь ждет беспощадная битва кулинаров со всей страны на самой жаркой, перченой и острой кухне на отечественном ТВ – “Адской кухне”!\r\n Их 16 – шефов и су-шефов со всей страны.\r\n Они прошли жесткий отбор и доказали, что уже претендуют на звание лучших из лучших и готовы сорвать главный куш проекта – 3 миллиона рублей!', 0, ' Адская кухня (2013)', 'т', 'щ', '0000-00-00', 2013, 2013, 'Россия', '-', 22, 0, 0, '74 мин', 'РЕН-ТВ', ' Арам Мнацаканов, Сергей Гусовский'),
(332, 2, 'В заброшенной хижине в чаще леса найдены две девочки. Таинственным образом они прожили в пустом доме пять лет. Найденных сирот забирают единственные родственники, молодая супружеская пара. Но девочки не одиноки, у них есть мама, и она приходит из тьмы…', 'В заброшенной хижине в чаще леса найдены две девочки. Таинственным образом они прожили в пустом доме пять лет. Найденных сирот забирают единственные родственники, молодая супружеская пара. Но девочки не одиноки, у них есть мама, и она приходит из тьмы…', 0, 'Мама', 'Mama', 'Mama', '0000-00-00', 2013, 2013, 'Испания, Канада', '$15 000 000', 27, 0, 6, '100 мин.', 'Андрес Мускетти', 'Джессика Честейн, Николай Костер-Вальдау, Меган Чарпентье, Изабель Нелисс, Дэниэл Кэш, Хавьер Боте, Джейн Моффат, Морган МакГарри, Дэвид Фокс, Доминик Куццокреа.'),
(333, 2, '4 ноября 1979 г. революция в Иране достигает своего апогея, исламисты штурмуют посольство США в Тегеране и берут в заложники 52 американца. Но в этом хаосе шестерым удается ускользнуть и найти прибежище в доме канадского посла...', '4 ноября 1979 г. революция в Иране достигает своего апогея, исламисты штурмуют посольство США в Тегеране и берут в заложники 52 американца. Но в этом хаосе шестерым удается ускользнуть и найти прибежище в доме канадского посла. Понимая, что их обнаружение и, вероятнее всего, убийство — всего лишь вопрос времени, Тони Мендес, специалист ЦРУ по тайному вывозу людей из страны, предлагает рискованный план безопасной эвакуации. План столь невероятен, что такое бывает только в кино.', 0, 'Операция «Арго»', '-', 'Argo', '0000-00-00', 2012, 2012, 'США', '$44 500 000', 26, 11, 9, '120 мин', 'Бен Аффлек', 'Бен Аффлек, Брайан Крэнстон, Алан Аркин,Джон Гудмен, Виктор Гарбер, Тейт Донован, Клеа Дюваль, Скут МакНэйри, Рори Кокрейн, Кристофер Денхам.'),
(334, 3, '«Светофор» — история о трех друзьях детства. Им слегка за 30. Они мужчины в самом расцвете сил. Один женат, другой занят, третий свободен, как ветер. Герои абсолютно не похожи, но их объединяют дружба и разная, но все же искренняя любовь к женщинам.', '«Светофор» — история о трех друзьях детства. Им слегка за 30. Они мужчины в самом расцвете сил. Один женат, другой занят, третий свободен, как ветер. Герои абсолютно не похожи, но их объединяют дружба и разная, но все же искренняя любовь к женщинам.', 0, 'Светофор', 'т', 'т', '0000-00-00', 2013, 2013, 'Россия', '-', 12, 0, 0, '26 мин.', 'Роман Фокин', 'Дмитрий Миллер, Александр Макогон, Джемал Тетруашвили'),
(335, 3, 'Молодая и амбициозная журналистка Лика отправляется в отдаленный гарнизон вслед за своим возлюбленным — призывником Денисом. Она решает написать разоблачительный материал о тотальном разложении армии и для этого устраивается в гарнизон продавщицей...', 'Молодая и амбициозная журналистка Лика отправляется в отдаленный гарнизон вслед за своим возлюбленным — призывником Денисом. Она решает написать разоблачительный материал о тотальном разложении армии и для этого устраивается в гарнизон продавщицей. Но жизнь в этом, на первый взгляд, тихом месте не обещает быть спокойной. Лике приходится включиться в опасные расследования, которые перевернут всю ее дальнейшую жизнь…', 0, 'Жена офицера', 'т', 'щ', '0000-00-00', 2013, 2013, 'Россия', '-', 16, 6, 0, '43 мин.', 'Сергей Басин', 'Валерия Ланская, Иван Стебунов, Ярослав Бойко, Эмилия Спивак, Владимир Литвинов'),
(336, 3, 'Это история о том, как внезапное увлечение латиноамериканскими танцами может изменить судьбу. В самый неудачный период своей жизни каждая из героинь истории - Света, Маша, Кристина и Алла - случайно оказываются в клубе танго «Не плачь по мне, Аргентина!»...', 'Это история о том, как внезапное увлечение латиноамериканскими танцами может изменить судьбу. В самый неудачный период своей жизни каждая из героинь истории - Света, Маша, Кристина и Алла - случайно оказываются в клубе танго «Не плачь по мне, Аргентина!». У журналистки Светы не складываются отношения с мужчинами. Маша так самозабвенно посвящала себя семье, что теперь ее брак на грани распада. Кристина любой ценой хочет выйти замуж и этим отталкивает любимого мужчину. Алла – успешный продюсер, но ее сильный характер мешает ей в личной жизни. В клубе девушек встречает хозяйка «Аргентины» – яркая и независимая Екатерина. Она уверена, что девушки оказались здесь не случайно, танго поможет им решить все их проблемы! На протяжении истории подруги будут искать «золотую середину» в отношениях с мужчинами, помогая, но иногда и мешая друг другу советами, которые, порой, кажутся странными и нелогичными, но они всегда от души…', 0, 'Не плачь по мне, Аргентина!', 'т', 'щ', '0000-00-00', 2013, 2013, 'Россия', '-', 16, 12, 0, '45 мин.', 'Владимир Устюгов, Вано Бурдули', 'Валерия Ланская, Иван Стебунов, Ярослав Бойко, Эмилия Спивак, Владимир Литвинов'),
(337, 3, 'Вампир Феликс был отправлен силами Тьмы в ссылку в город Светлогорск. Графу Дракуле было предсказано, что падет он от руки своего соратника, вампира, и именно он, Феликс, мог прервать путь Графа Тьмы...', 'Вампир Феликс был отправлен силами Тьмы в ссылку в город Светлогорск. Графу Дракуле было предсказано, что падет он от руки своего соратника, вампира, и именно он, Феликс, мог прервать путь Графа Тьмы. Появление Феликса в Светлогорске сопровождали, чума, многие смерти и разорение. Немало бед навлек он на городок. Силы Света заточили Феликса в пещере, где он находился целых пять веков. И вот вампир вышел на свободу. Но теперь мысль о служении Тьме противна ему и Феликс выбрал Добро. В городке Светлогорске он открыл детективное агентство, подобрав команду из таких же как и он — не просто людей, а раскаявшихся грешников, которые готовы стоять на защите Света и Добра. Вместе они расследуют злодеяния, которые ежедневно совершаются силами тьмы и хранят покой города Светлогорска, которому суждено стать метом, где пройдет решающе сражение между силами Тьмы и Света…', 0, 'Пятая стража', 'т', 'щ', '0000-00-00', 2013, 2013, 'Россия', '-', 1, 0, 0, '47 мин.', 'Василий Пичул', 'Кирилл Козаков, Майя Вознесенская, Егор Вадов, Олег Семисынов, Ирина Виноградова, Матвей Матвеев, Полина Манохина, Ростислав Бершауэр, Станислав Любшин, Регимантас Адомайтис'),
(338, 3, 'В 2012 году правительство России увеличивает субсидии на развитие НАНОтехнологий. В семье Шевелевых, бывших работников НИИ, физиков по образованию, праздник. Завтра Игорь Шевелев выходит на работу в специальный отдел...', 'В 2012 году правительство России увеличивает субсидии на развитие НАНОтехнологий. В семье Шевелевых, бывших работников НИИ, физиков по образованию, праздник. Завтра Игорь Шевелев выходит на работу в специальный отдел. Супругам по сорок лет, они вместе учились в университете, затем вместе еще с советских времен работали в НИИ, у них есть взрослая дочь-студентка – Оксана и шестилетний сын Гоша. Супруги едут на банкет, посвященный открытию нанолаборатории. Игорь напивается и в состоянии алкогольного опьянения сбивает сотрудника ГИБДД. Мария берет вину на себя – Игорь получил хорошую работу, а это реальный шанс для семьи Шевелевых вырваться из нищеты и обеспечить будущее детей. Мария получает срок. Из колонии общего режима Мария выходит через год. Игорь работает у Сергеева (директора наноцентра), хорошо зарабатывает и любит другую женщину – Жанну, секретаршу Сергеева. Мария не может устроиться на работу по своей специальности, физика с судимостью нигде не берут, тогда Мария устраивается работать в больницу – простой санитаркой. Спасая жизнь своему тяжело заболевшему сыну, Мария совершает переворот в использовании нанотехнологий в области медицины. Несмотря на все трудности, Мария все-таки сможет вернуть себе детей, получить новую работу и заново обрести любовь в лице выдающегося хирурга Сорина. Она обретает второе дыхание. И получает шанс на новую жизнь.', 0, 'Второе дыхание', 'т', 'п', '0000-00-00', 2013, 2013, 'Россия', '-', 16, 0, 0, '45 мин.', 'Сергей Пикалов', 'Виктория Толстоганова, Марат Башаров, Егор Бероев, Ксения Суркова, Андрюс Паулавичюс, Ольга Кудакова, Елена Лотова, Александр Поляев, Юлия Рувинская'),
(339, 3, 'Сериал рассказывает об отряде викингов Рагнара. Он восстал, чтобы стать королём племён викингов. Норвежская легенда гласит, что он был прямым потомком Одина, бога войны и воинов.', 'Сериал рассказывает об отряде викингов Рагнара. Он восстал, чтобы стать королём племён викингов. Норвежская легенда гласит, что он был прямым потомком Одина, бога войны и воинов.', 0, 'Викинги / Vikings (2013)', 'т', 'п', '0000-00-00', 2013, 2013, 'Ирландия, Канада', '-', 3, 5, 11, '60 мин.', 'Киаран Доннелли, Йохан Ренк, Кен Джиротти', 'Трэвис Фиммел, Клайв Стэнден, Кэтрин Уинник, Гэбриел Бирн, Джессалин Гилсиг, Густаф Скарсгард, Джефферсон Холл, Джордж Благден, Тадж Мерфи, Диармэйд Мурта'),
(340, 2, '25 cуперзвезд первой величины — в комедийном проекте, который состоит из двух десятков мини-новелл с нескончаемым потоком шуток, гэгов, острот и пародий, о страстях и страстишках человеческих.', '25 cуперзвезд первой величины — в комедийном проекте, который состоит из двух десятков мини-новелл с нескончаемым потоком шуток, гэгов, острот и пародий, о страстях и страстишках человеческих.', 0, 'Муви 43 / Movie 43', 'и', 'и', '0000-00-00', 2013, 2013, 'США', '$6 000 000', 12, 0, 0, '97 мин.', 'Стивен Брилл, Питер Фаррелли, Боб Оденкирк', 'Холли Берри, Джерард Батлер, Анна Фэрис, Хью Джекман, Джонни Ноксвил, Кристофер Минц-Плассе, Шонн Уильям Скотт, Эмма Стоун'),
(341, 2, 'Когда ураган забрасывает циркового фокусника Оскара Диггса из пыльного Канзаса в волшебную страну Оз, склонный к мошенничеству циркач полагает, что он поймал удачу за хвост — ведь с помощью своих трюков он с легкостью может добыть в новых землях и славу и богатство...', 'Когда ураган забрасывает циркового фокусника Оскара Диггса из пыльного Канзаса в волшебную страну Оз, склонный к мошенничеству циркач полагает, что он поймал удачу за хвост — ведь с помощью своих трюков он с легкостью может добыть в новых землях и славу и богатство. \r\n\r\nОднако его ждёт встреча с тремя чародейками, Теодорой, Эванорой и Глиндой, которые сомневаются в том, тот ли это великий волшебник, появления которого ждали легковерные жители страны Оз. Волей-неволей, пришелец оказывается втянутым в противостояние эпического масштаба, и ему приходится использовать весь свой «магический» арсенал, с добавлением толики настоящего волшебства. \r\n\r\nВ ситуации выбора между Добром и Злом, Оскару Диггсу предстоит не только стать Великим и Ужасным Волшебником из Страны Оз, но и немного измениться к лучшему.', 0, 'Оз: Великий и Ужасный', '-', 'Oz the Great and Powerful', '0000-00-00', 2013, 2013, 'США', '$215 000 000', 30, 12, 21, '130 мин.', 'Сэм Рэйми', 'Джеймс Франко, Мила Кунис, Рейчел Вайс, Мишель Уильямс, Зак Брафф, Билл Коббс, Джои Кинг, Тони Кокс, Стивен Р. Харт, Эбигейл Спенсер.'),
(342, 2, 'Когда ураган забрасывает циркового фокусника Оскара Диггса из пыльного Канзаса в волшебную страну Оз, склонный к мошенничеству циркач полагает, что он поймал удачу за хвост — ведь с помощью своих трюков он с легкостью может добыть в новых землях и славу и богатство...', 'Когда ураган забрасывает циркового фокусника Оскара Диггса из пыльного Канзаса в волшебную страну Оз, склонный к мошенничеству циркач полагает, что он поймал удачу за хвост — ведь с помощью своих трюков он с легкостью может добыть в новых землях и славу и богатство. \r\n\r\nОднако его ждёт встреча с тремя чародейками, Теодорой, Эванорой и Глиндой, которые сомневаются в том, тот ли это великий волшебник, появления которого ждали легковерные жители страны Оз. Волей-неволей, пришелец оказывается втянутым в противостояние эпического масштаба, и ему приходится использовать весь свой «магический» арсенал, с добавлением толики настоящего волшебства. \r\n\r\nВ ситуации выбора между Добром и Злом, Оскару Диггсу предстоит не только стать Великим и Ужасным Волшебником из Страны Оз, но и немного измениться к лучшему.', 0, 'Гамбит', '-', 'Gambit', '0000-00-00', 2012, 2012, 'США', '$215 000 000', 30, 12, 21, '130 мин.', 'Сэм Рэйми', 'Джеймс Франко, Мила Кунис, Рейчел Вайс, Мишель Уильямс, Зак Брафф, Билл Коббс, Джои Кинг, Тони Кокс, Стивен Р. Харт, Эбигейл Спенсер.'),
(343, 2, 'История лондонского любителя искусств, задумавшего обмануть богатого коллекционера и заставить его купить фальшивую картину Моне. Для этого он договаривается с разбитной девахой из Техаса. Героиня не имеет...', 'История лондонского любителя искусств, задумавшего обмануть богатого коллекционера и заставить его купить фальшивую картину Моне. Для этого он договаривается с разбитной девахой из Техаса. Героиня не имеет никакого отношения к искусству — она работает на родео. Однако она будет выдавать себя за женщину, чей отец раздобыл картину в конце Второй мировой войны.', 0, 'Гамбит', '-', 'Gambit', '0000-00-00', 2012, 2012, 'США', '$----', 12, 0, 15, '89 мин.', 'Майкл Хоффман', 'Колин Фёрт, Кэмерон Диаз, Алан Рикман, Том Кортни, Стэнли Туччи, Клорис Личмен, Анна Скеллерн, Сенем Темиз, Того Игава, Эрика ЛаРоуз.'),
(344, 3, 'История Вероники продолжается. Потеряв любимого мужа, героиня остается беззащитной перед бандитами, охотившимися за бесценным научным открытием ее отца. Единственный путь к спасению — передать информацию ученику отца, живущему в Польше.', 'История Вероники продолжается. Потеряв любимого мужа, героиня остается беззащитной перед бандитами, охотившимися за бесценным научным открытием ее отца. Единственный путь к спасению — передать информацию ученику отца, живущему в Польше.', 0, 'Вероника. Беглянка', 'n', 'o', '0000-00-00', 2013, 2013, 'Россия', '-', 16, 0, 0, '43 мин.', 'Андрей Селиванов', 'Наталья Бардо, Александр Дьяченко, Сергей Жигунов, Амаду Мамадаков, Сергей Астахов, Олег Алмазов, Игорь Седов, Денис Бургазлиев'),
(345, 3, 'Женя Ковалева (Анна Кошмал) перестала быть готом и теперь у нее новые страдания - мальчики почти не обращают на нее внимания. Она плачет в подушку днями и ночами, а родители Евгении не знают, что делать. Близнецы снова проказничают и не дают родителям спокойно жить, постоянно достают страдающую старшую сестру. Когда бабушки и дедушка интересуются жизнью своих внуков и детей, родители вновь стараются скрыть все невзгоды их семьи...', 'Женя Ковалева (Анна Кошмал) перестала быть готом и теперь у нее новые страдания - мальчики почти не обращают на нее внимания. Она плачет в подушку днями и ночами, а родители Евгении не знают, что делать. Близнецы снова проказничают и не дают родителям спокойно жить, постоянно достают страдающую старшую сестру. Когда бабушки и дедушка интересуются жизнью своих внуков и детей, родители вновь стараются скрыть все невзгоды их семьи, но это сделать не получается, ибо сваты чувствуют нечто неладное и приезжают к Маше(Инна Королёва) и Максиму(Даниил Белых). Конечно, они не могут оставить всё происходящее без дела и берутся за перевоспитание и усмирение близнецов Ковалевых, а также помогают Женечке решить ее проблему. Близится лето. Все едут в Кучугуры. Там у них снова много приключений, в их жизнь вписывается Лариса(Олеся Железняк) с Митяем(Николай Добрынин), у которых появилась... двойня. Однако за лето, не решив много проблем, сваты с чувством неудачи возвращают детей домой. Спустя несколько месяцев наступают новогодние каникулы. Родители улетают в Испанию, а своих детей отправляют... неизвестно кому, то ли Берковичу (Александр Феклистов) и Ольге Николаевне (Людмила Артемьева), то ли Валюхе (Татьяна Кравченко) с Иваном (Федор Добронравов)... Сваты не могут решить, у кого будет внучка, вследствие чего Оля с Берковичем на время зимних каникул перебираются к Валюхе с Иваном. Внезапно приезжают родители сватов, и они вместе проходят ряд очередных приключений и встречают новый год. Близнецы становятся послушными, а Женя встречает Кирилла (Денис Шепотинник)и её и "Сватов" ждут новые смешные истории.', 0, 'Сваты 6', 'n', 'o', '0000-00-00', 2013, 2013, 'Украина', '-', 16, 0, 0, '45 мин.', 'Андрей Яковлев', 'Федор Добронравов, Татьяна Кравченко, Людмила Артемьева, Анна Кошмал, Александр Феклистов, Анна Полищук, Константин Чернокрылюк, Олеся Железняк, Николай Добрынин, Владимир Зельдин'),
(346, 3, 'Женя Ковалева (Анна Кошмал) перестала быть готом и теперь у нее новые страдания - мальчики почти не обращают на нее внимания. Она плачет в подушку днями и ночами, а родители Евгении не знают, что делать. Близнецы снова проказничают и не дают родителям спокойно жить, постоянно достают страдающую старшую сестру. Когда бабушки и дедушка интересуются жизнью своих внуков и детей, родители вновь стараются скрыть все невзгоды их семьи...', 'Всю свою жизнь Татьяна посвятила мужу и сыну Денису. Именно поэтому, когда накануне своей свадьбы сын, выпив, садится за руль и сбивает человека, Татьяна, не задумываясь, берет его вину на себя и по приговору суда оказывается в колонии-поселении. Муж и сын Татьяны воспринимают ее поступок как должное. Свадьба Дениса проходит без Татьяны. Непривычная к тяжелому физическому труду и барачному быту, в тюрьме Татьяна становится объектом насмешек и издевательств. Выжить Татьяне помогает только дружеская поддержка Аркадия – единственного осужденного, кто решился встать на ее защиту. Муж и сын Татьяны озабочены только своими бытовыми проблемами и, казалось, забыли о матери... А Татьяна начинает понимать, что не хочет возвращаться домой, боится снова встретиться с эгоизмом мужа и инфантильностью сына, и… уже не представляет свою жизнь без Аркадия. Но выбор Татьяне придется сделать раньше срока - неожиданно Татьяна узнает о своем условно-досрочном освобождении…', 0, 'Уравнение любви', 'n', 'o', '0000-00-00', 2013, 2013, 'Россия', '-', 16, 0, 0, '45 мин.', 'Рауф Кубаев', 'Наталия Антонова, Дмитрий Муляр, Екатерина Волкова, Галина Петрова, Вадим Андреев, Иван Соловьев, Александр Робак, Павел Юлку'),
(347, 3, 'Торговый центр – настоящее сердце любого современного города. Там всегда кипит жизнь – тысячи покупателей, десятки продавцов. Это еще и место для отдыха, развлечений и даже романтических свиданий.', 'Торговый центр – настоящее сердце любого современного города. Там всегда кипит жизнь – тысячи покупателей, десятки продавцов. Это еще и место для отдыха, развлечений и даже романтических свиданий. Но мало кто знает, какие страсти кипят там изо дня в день, какие тайны скрываются за табличками "Служебное помещение" и "Только для персонала" и на что толкают обитателей этих стен любовь, власть и деньги. На фоне жизни крупного торгового центра "Астория" в Ярославле, владельцем которого является бизнесмен Эдуард Фадеев, разворачиваются главные события и переплетаются истории взаимоотношений нескольких семей.', 0, 'Торговый центр', 'n', 'o', '0000-00-00', 2013, 2013, 'Россия', '-', 16, 0, 0, '45 мин.', 'Игорь Войтулевич, Сергей Краснов, Сергей Пищиков', 'Валерия Ланская, Сергей Жигунов, Евгений Пронин, Андрей Казаков, Ксения Лаврова-Глинка, Юрий Батурин, Анатолий Дзиваев, Екатерина Кузнецова'),
(348, 3, 'Оперативнику Сергею Демидову поручают возглавить новую команду.  В каждой серии группа Демидова получает новое задание и приступает к розыску преступника или преступников, сбежавших из-под стражи...', 'Оперативнику Сергею Демидову поручают возглавить новую команду. Своенравный Вадим Непогода - отличный оперативник и смельчак, способный в любой ситуации протянуть руку помощи, прикрыть спину. Марина Говорнова - в прошлом профессиональная биатлонистка, мастерски стреляет из многих видов оружия. К тому же выясняется, что у нее - дар переговорщика. "Желторотик" Денис Тавардин отлично разбирается в компьютерах и становится "техническим гением" команды... В каждой серии группа Демидова получает новое задание и приступает к розыску преступника или преступников, сбежавших из-под стражи. Это убийцы, налетчики, мошенники. Они бегут и из мест заключения, и во время этапа, и из психиатрических клиник, и прямо из зала суда... Команда работает отлично и ловит беглецов. Однако Демидова мучает подозрение, что кто-то в команде "крот" и предатель...', 0, 'В зоне риска', 'n', 'o', '0000-00-00', 2013, 2013, 'Россия', '-', 6, 15, 0, '45 мин.', 'Владимир Котт', 'Марк Богатырев, Александр Кудинов, Стас Наумов, Сергей Коваленко, Алексей Аникин, Татьяна Плетнева, Владимир Демидов, Эдуард Рябинин, Даниил Кокин, Ян Воробьев'),
(349, 3, 'Прошел год после предыдущих событий. Отец и сын Богомоловы живут в городе Солнечный. Ваня ходит в школу, Борис Андреевич руководит приютом для детей, оказавшихся в сложной жизненной ситуации...', 'Прошел год после предыдущих событий. Отец и сын Богомоловы живут в городе Солнечный. Ваня ходит в школу, Борис Андреевич руководит приютом для детей, оказавшихся в сложной жизненной ситуации. Отец и сын живут под настоящей фамилией. С законом Богомол в ладу, с прошлым он завязал… Так ему только кажется. В городе Солнечный происходит рейдерский захват ювелирного завода. Директора завода расстреливают прямо у проходной наемные убийцы? Причем сразу же после встречи с Богомолом. Начинается следствие. Так как прошлое Богомолова для полиции не секрет, он — потенциальный подозреваемый…', 0, 'Учитель в законе 3. Возвращение', 'g', 'g', '0000-00-00', 2013, 2013, 'Россия', '-', 3, 9, 15, '45 мин.', 'Сергей Виноградов, Рустам Уразаев', 'Юрий Беляев, Михаил Горевой, Александр Кузнецов, Сергей Векслер, Всеволод Николаев, Кристина Бабушкина, Наталия Антонова, Константин Желдин, Георгий Пицхелаури, Владимир Стеклов'),
(350, 3, 'К восстанию Спартака присоединились тысячи. Вместе с Криксом и Ганником он побеждает одного римского командира за другим. Отчаявшись, Рим обращается за помощью к богатому, амбициозному Марку Крассу и молодому Юлию Цезарю.', 'К восстанию Спартака присоединились тысячи. Вместе с Криксом и Ганником он побеждает одного римского командира за другим. Отчаявшись, Рим обращается за помощью к богатому, амбициозному Марку Крассу и молодому Юлию Цезарю.', 0, 'Спартак: Война проклятых', 'т', 'щ', '0000-00-00', 2013, 2013, 'США', '-', 3, 9, 21, '50 мин.', 'Марк Бисли', 'Лиам МакИнтайр, Ману Беннет, Ричард Нортон, Дастин Клер, Дэниэл Фьюрриджел, Синтия Аддай-Робинсон');
INSERT INTO `data` (`id`, `cat`, `shot_text`, `all_text`, `view`, `name_ru`, `tname`, `name_en`, `date`, `fyear`, `lyear`, `strana`, `budget`, `genre1`, `genre2`, `genre3`, `time`, `director`, `in_role`) VALUES
(351, 3, 'Алексей — однолюб. Анечка — женщина его жизни. Ради нее он готов на любые жертвы, даже принимает на себя ее вину и садится в тюрьму...', 'Алексей — однолюб. Анечка — женщина его жизни. Ради нее он готов на любые жертвы, даже принимает на себя ее вину и садится в тюрьму. Но в то же время, он легко поддается искушениям, вступая в постороннюю связь, хотя и мучается потом, и грызет себя за это. С главной героиней хорошо понимают друг друга, чувствуют себя «на одной волне», объясняя это поначалу кровным родством. С другой девушкой живет из гуманистических побуждений. Позволяет себя любить, поскольку уважает право другого человека на чувство. Повышенная восприимчивость позволяет ему перенять опыт травницы Ольги Афанасьевны, и благодаря открывшемуся дару, Алексей начинает лечить людей. Он бессеребренник, легко отказывается от материальных удовольствий, считает себя виновным в гибели близких и потому с легкостью принимает затворнический образ жизни. Помощь людям становится смыслом его жизни.', 0, 'Анечка', 'т', 'т', '0000-00-00', 2012, 2012, 'Россия', '-', 16, 0, 0, '40 мин.', 'Сергей Краснов, Борис Рабей, Елена Шилова', 'Ксения Зуева, Егор Корешков, Александр Пугачев, Елена Шилова, Дарья Егорова, Сергей Спиридонов, Сергей Комаров, Александр Матросов, Михаил Богдасаров, Кирилл Нагиев'),
(352, 3, 'Полина, красивая и чистая сельская девушка, ждет из армии своего любящего жениха Сергея. К несчастью, Сергей не единственный, кому нужна Полина — хозяин рынка, непререкаемый...', 'Полина, красивая и чистая сельская девушка, ждет из армии своего любящего жениха Сергея. К несчастью, Сергей не единственный, кому нужна Полина — хозяин рынка, непререкаемый авторитет Буров, тоже положил глаз на цветущую соседку. Вероятно, эта история могла бы разрешиться, если бы матери Полины не потребовалась срочная дорогостоящая операция. Оказавшись перед тяжелым выбором, героиня выходит замуж за Бурова, который ей ненавистен…', 0, 'Королева бандитов', 'Koroleva_banditov', '-', '0000-00-00', 2013, 2013, 'Россия', '-', 16, 0, 0, '43 мин.', 'Валерий Девятилов', 'Екатерина Кузнецова, Владимир Жеребцов, Леонид Громов, Александр Самойленко, Екатерина Васильева, Павел Кузьмин, Натали Старынкевич, Наталья Хорохорина, Борис Галкин'),
(353, 3, 'Алексей — однолюб. Анечка — женщина его жизни. Ради нее он готов на любые жертвы, даже принимает на себя ее вину и садится в тюрьму. Но в то же время, он легко поддается искушениям, вступая в постороннюю связь, хотя и мучается потом, и грызет себя за это. С главной героиней хорошо понимают друг друга, чувствуют себя...', 'Алексей — однолюб. Анечка — женщина его жизни. Ради нее он готов на любые жертвы, даже принимает на себя ее вину и садится в тюрьму. Но в то же время, он легко поддается искушениям, вступая в постороннюю связь, хотя и мучается потом, и грызет себя за это. С главной героиней хорошо понимают друг друга, чувствуют себя «на одной волне», объясняя это поначалу кровным родством. С другой девушкой живет из гуманистических побуждений. Позволяет себя любить, поскольку уважает право другого человека на чувство. Повышенная восприимчивость позволяет ему перенять опыт травницы Ольги Афанасьевны, и благодаря открывшемуся дару, Алексей начинает лечить людей. Он бессеребренник, легко отказывается от материальных удовольствий, считает себя виновным в гибели близких и потому с легкостью принимает затворнический образ жизни. Помощь людям становится смыслом его жизни.', 0, 'Анечка', 'Anechka', '--', '0000-00-00', 2012, 2012, 'Россия', '---', 16, 0, 0, '40 мин.', 'Сергей Краснов, Борис Рабей, Елена Шилова', 'Ксения Зуева, Егор Корешков, Александр Пугачев, Елена Шилова, Дарья Егорова, Сергей Спиридонов, Сергей Комаров, Александр Матросов, Михаил Богдасаров, Кирилл Нагиев'),
(354, 3, '«Топтуны» — так называют Оперативно-поисковое управление, одну из самых засекреченных служб МВД. Майор милиции Сергей Ковалев, его помощник Макс Самедов, оперуполномоченные Аглая Максимова и Екатерина Чепикова каждый день ...', '«Топтуны» — так называют Оперативно-поисковое управление, одну из самых засекреченных служб МВД. Майор милиции Сергей Ковалев, его помощник Макс Самедов, оперуполномоченные Аглая Максимова и Екатерина Чепикова каждый день имеют дело с особо опасными преступниками. Маскируясь под обычных людей и часто без оружия, они обязаны найти и обезвредить подозреваемых в уголовных преступлениях. Мгновенно перевоплощаясь в любой образ, которого требует ситуация, эта команда выполняет самые различные задачи — от поиска вооруженного дезертира, до ареста главбуха финансовой пирамиды, находящегося в бегах с круглой суммой уже не один год. \r\n\r\n ', 0, 'Топтуны', 'Toptuny', '---', '0000-00-00', 2013, 2013, 'Россия', '---', 15, 0, 6, '43 мин.', 'Сергей Артимович, Сергей Векслер', 'Денис Никифоров, Анна Носатова, Сослан Фидаров, Елена Мольченко, Сергей Векслер, Евгений Леонов-Гладышев, Александра Афанасьева-Шевчук, Анна Банщикова'),
(355, 3, 'Евгения Колесникова (Евгения Добровольская) много лет живет счастливо в браке с известным хирургом Сергеем (Владимир Симонов). Идиллию семейных отношений омрачает только одно обстоятельство – у них до...', 'Евгения Колесникова (Евгения Добровольская) много лет живет счастливо в браке с известным хирургом Сергеем (Владимир Симонов). Идиллию семейных отношений омрачает только одно обстоятельство – у них до сих пор нет детей. Казалось бы, семейному благополучию ничто не сможет помешать. Но в одночасье все меняется: предательство любимого человека заставляет Женю начать жизнь сначала. В небольшом поселке, где прошло ее детство, героиня неожиданно находит свое настоящее призвание и получает шанс изменить к лучшему свою жизнь и жизни многих других людей...', 0, 'Повороты судьбы', '-', '---', '0000-00-00', 2013, 2013, 'Россия', '---', 17, 0, 0, '45 мин.', 'Александр Замятин', 'Евгения Добровольская, Валерий Золотухин, Алексей Кравченко, Олег Чернов, Сергей Кирюшкин, Олег Данилевский, Алексей Кирсанов, Кирилл Федоренко, Михаил Котелов, Анастасия Фурса, Тамара Акулова'),
(356, 2, 'Самая опасная и жестокая банда наркоторговцев сбегает из-под конвоя ФБР. Прихватив заложника, они мчатся к мексиканской границе на бронированной, оснащенной первоклассным вооружением машине. У них на пути стоит лишь тихий городок, за порядком в котором следит шериф Оуенс. Когда-то он был одним из лучших полицейских Лос-Анджелеса, теперь он вернулся.', 'Самая опасная и жестокая банда наркоторговцев сбегает из-под конвоя ФБР. Прихватив заложника, они мчатся к мексиканской границе на бронированной, оснащенной первоклассным вооружением машине. У них на пути стоит лишь тихий городок, за порядком в котором следит шериф Оуенс. Когда-то он был одним из лучших полицейских Лос-Анджелеса, теперь он вернулся.', 0, 'Возвращение героя (2013)', 'h', 'h', '0000-00-00', 2013, 2013, 'США', '$45 000 000', 3, 26, 15, '107 мин.', 'Ким Чжи Ун', 'Арнольд Шварценеггер, Форест Уитакер, Джонни Ноксвил, Родриго Санторо, Джейми Александр, Луис Гузман'),
(357, 3, 'Вся наша жизнь зависит от электричества. Что же произойдет, если оно внезапно исчезнет? Однажды, словно по щелчку выключателя, весь мир был отброшен в темные века. Самолеты падали с небес, больницы лишались энергообеспечения, связь стала невозможной. Теперь, без всех современных технологий, кто же ответит, почему?...', 'Вся наша жизнь зависит от электричества. Что же произойдет, если оно внезапно исчезнет? Однажды, словно по щелчку выключателя, весь мир был отброшен в темные века. Самолеты падали с небес, больницы лишались энергообеспечения, связь стала невозможной. Теперь, без всех современных технологий, кто же ответит, почему? Через 15 лет после бедствия, жизнь стала такой, какой она была до промышленной революции: семьи живут на глухих улочках, с заходом солнца зажигают фонари и свечи. Жизнь стала спокойнее и лучше. Но так ли это? За пределами небольших фермерских общин все еще таится опасность. Так жизнь молодой девушки резко меняется, когда местная полиция убивает ее отца, который каким-то неведомым для дочери образом имел связь с отключением. Это событие заставляет ее вместе с двумя спутниками отправиться в смелое путешествие, чтобы найти правду о прошлом в надежде изменить будущее.', 0, 'Революция', 'Revolyuciya', 'Revolution', '0000-00-00', 2013, 2013, 'США', '---', 28, 9, 3, '45 мин.', 'Стив Бойум, Чарльз Бисон', 'Билли Бёрк, Трэйси Спиридакос, Дэвид Лайонс, Элизабет Митчелл, Зак Орт, Даниэлла Алонсо, Джанкарло Эспозито, Дж.Д. Пардо, Грэхэм Роджерс, Колм Фиор'),
(358, 2, 'Фильм повествует о путешествии Бильбо Бэггинса, который пускается в грандиозный поход, целью которого является отвоевание утраченного королевства гномов Эребор у зловещего дракона Смога...', 'Фильм повествует о путешествии Бильбо Бэггинса, который пускается в грандиозный поход, целью которого является отвоевание утраченного королевства гномов Эребор у зловещего дракона Смога. Совершенно неожиданно с хоббитом налаживает контакт волшебник Гэндальф Серый. Так Бильбо находит себя, присоединяясь к компании тринадцати гномов, возглавляемых легендарным воином, Торином Дубощитом. Их путешествие проляжет через Дикий Край, через предательские земли, населенные гоблинами и орками, смертоносными варгами и гигантскими пауками, народом, меняющим шкуры, и волшебниками.\r\n\r\nИ хотя их цель находится на Востоке среди пустошей Одинокой Горы, сначала им придется выбраться из туннелей гоблинов, где Бильбо встретит существо, которое изменит его жизнь навсегда… Голлума.\r\n\r\nЗдесь, один на один с Голлумом, на берегу подземного озера, непритязательный Бильбо Бэггинс обнаружит не только скрытые в глубине души хитрость и отвагу, которые удивят даже его, но и завладеет «прелестным» колечком Голлума, которое обладает нежданными и полезными свойствами… Простое золотое кольцо, c которым связана судьба всего Средиземья, нитями, о которых Бильбо не мог даже вообразить.', 0, 'Хоббит: Нежданное путешествие (часть 2)', 'n', 'o', '0000-00-00', 2012, 2012, 'США, Новая Зеландия', '$180 000 000', 30, 21, 0, '166 мин.', 'Питер Джексон', 'Хьюго Уивинг, Мартин Фриман, Кейт Бланшетт, Люк Эванс, Орландо Блум, Элайджа Вуд'),
(359, 2, 'Фильм повествует о путешествии Бильбо Бэггинса, который пускается в грандиозный поход, целью которого является отвоевание утраченного королевства гномов Эребор у зловещего дракона Смога...', 'Фильм повествует о путешествии Бильбо Бэггинса, который пускается в грандиозный поход, целью которого является отвоевание утраченного королевства гномов Эребор у зловещего дракона Смога. Совершенно неожиданно с хоббитом налаживает контакт волшебник Гэндальф Серый. Так Бильбо находит себя, присоединяясь к компании тринадцати гномов, возглавляемых легендарным воином, Торином Дубощитом. Их путешествие проляжет через Дикий Край, через предательские земли, населенные гоблинами и орками, смертоносными варгами и гигантскими пауками, народом, меняющим шкуры, и волшебниками.\r\n\r\nИ хотя их цель находится на Востоке среди пустошей Одинокой Горы, сначала им придется выбраться из туннелей гоблинов, где Бильбо встретит существо, которое изменит его жизнь навсегда… Голлума.\r\n\r\nЗдесь, один на один с Голлумом, на берегу подземного озера, непритязательный Бильбо Бэггинс обнаружит не только скрытые в глубине души хитрость и отвагу, которые удивят даже его, но и завладеет «прелестным» колечком Голлума, которое обладает нежданными и полезными свойствами… Простое золотое кольцо, c которым связана судьба всего Средиземья, нитями, о которых Бильбо не мог даже вообразить.', 0, 'Хоббит: Нежданное путешествие (часть 3)', 'n', 'o', '0000-00-00', 2012, 2012, 'США, Новая Зеландия', '$180 000 000', 30, 21, 0, '166 мин.', 'Питер Джексон', 'Хьюго Уивинг, Мартин Фриман, Кейт Бланшетт, Люк Эванс, Орландо Блум, Элайджа Вуд'),
(360, 3, 'Мужская частная школа Сэйка, славная бесчинствами своих воспитанников, когда-то наводила ужас на всю округу. Для «смягчения нравов» в ней ввели совместное обучение, но результат пока очень и очень сомнителен. Впрочем, Мисаки Аюдзава — ...', 'Мужская частная школа Сэйка, славная бесчинствами своих воспитанников, когда-то наводила ужас на всю округу. Для «смягчения нравов» в ней ввели совместное обучение, но результат пока очень и очень сомнителен. Впрочем, Мисаки Аюдзава — спортсменка, отличница и первая в истории Сэйки девушка-президент школьного совета — твердо решила изменить положение и принести в храм науки порядок и дисциплину.', 0, 'Президент студсовета – горничная!', '–', 'Kaichou wa meido-sama!', '0000-00-00', 2010, 2010, 'Япония', '–', 1, 16, 18, '25 мин.', 'Хироаки Сакурай', 'Айуми Фуджимура, Кана Ханадзава, Мицухиро Итики, Ю Кобаяси, Нобухико Окамото, Кадзуёси Сиибаси, Такума Тэрасима.'),
(361, 2, 'Лос-Анджелес, 1949 год. Уроженец Бруклина, жестокий главарь банды Микки Коэн держит город в ежовых рукавицах, собирая «грязные» деньги от торговли наркотиками, оружием и проституции, и — если все пойдет, как надо, — к Западу от Чикаго мышь не пискнет без его ведома. Защищают его не только его же головорезы, но и находящиеся у него «на крючке» полиция и политики. Этого хватит, чтобы запугать даже самых смелых, закаленных улицей копов… кроме, пожалуй, небольшой тайной группы сотрудников полицейского ...', 'Лос-Анджелес, 1949 год. Уроженец Бруклина, жестокий главарь банды Микки Коэн держит город в ежовых рукавицах, собирая «грязные» деньги от торговли наркотиками, оружием и проституции, и — если все пойдет, как надо, — к Западу от Чикаго мышь не пискнет без его ведома. Защищают его не только его же головорезы, но и находящиеся у него «на крючке» полиция и политики. Этого хватит, чтобы запугать даже самых смелых, закаленных улицей копов… кроме, пожалуй, небольшой тайной группы сотрудников полицейского департамента Лос-Анджелеса во главе с сержантом Джоном О’Мара и Джерри Вутерсом, которые объединились, чтобы попытаться уничтожить преступный мир Коэна.', 0, 'Охотники на гангстеров', 'Ohotniki_na_gangsterov', 'Gangster Squad', '0000-00-00', 2013, 2013, 'США', '$60 000 000', 3, 9, 26, '113 мин.', 'Рубен Флейшер', 'Джош Бролин, Райан Гослинг, Ник Нолти, Эмма Стоун, Энтони Маки, Джованни Рибизи, Майкл Пенья, Роберт Патрик, Шон Пенн, Холт МакКэллани.'),
(362, 2, 'Неприступные женщины, полмиллиона долларов и четверо героев которым предстоит принять участие в игре «Секс-лото», организованное экстравагантным миллионером. Суть игры — за пять дней соблазнить как можно больше женщин на морском курорте. Получив задания, великолепная четверка бросается в бой...', 'Неприступные женщины, полмиллиона долларов и четверо героев которым предстоит принять участие в игре «Секс-лото», организованное экстравагантным миллионером. Суть игры — за пять дней соблазнить как можно больше женщин на морском курорте. Получив задания, великолепная четверка бросается в бой. \r\n\r\nНо все цели совсем не простые — бабушка, жена олигарха, девственница, феминистка, сектантка — и приз получит только лучший. Каждый применит свой фирменный арсенал, и все будут близки к тому, чтобы получить заветный куш, записав новых жертв в список своих мужских побед. Но неожиданно в «дело секса» вмешается любовь.', 0, 'Что творят мужчины!', '-', '-', '0000-00-00', 2013, 2013, 'Россия', '$2 000 000', 12, 0, 0, '83 мин.', 'Сарик Андреасян', 'Таир Мамедов, Роман Юнусов, Константин Крюков, Гавриил Гордеев, Равшана Куркова, Анна Хилькевич, Кристина Асмус, Наталия Медведева, Екатерина Скулкина, Даша Астафьева.'),
(363, 2, 'Группа подростков хочет проверить легенду о бессмертной ведьме. Они считают, что это все выдумки и решают прийти к дому, в котором живет ведьма. Оказывается, что легенда не врала и ведьма на самом деле существует.', 'Группа подростков хочет проверить легенду о бессмертной ведьме. Они считают, что это все выдумки и решают прийти к дому, в котором живет ведьма. Оказывается, что легенда не врала и ведьма на самом деле существует.', 0, 'Злой', 'Zloi', 'The Wicked', '0000-00-00', 2013, 2013, 'США', '$1 500 000', 27, 26, 30, '105 мин.', 'Питер Уинтер', 'Девон Веркхейзер, Джастин Дили, Джесс Адамс, Джэми Калер, Кэйтлин Кармайкл, Диана Хоппер, Жаклин Гоци, Чейз Мэйсер, Роберт Янг, Кэсси Келлер.'),
(364, 2, 'После мучительного развода 40-летний Лукас находит новую подругу, новую работу и стремится восстановить отношения со своим сыном-подростком Маркусом. Но ему что-то мешает… Что-то, казалось бы, незначительное. Замечание, сделанное между прочим...', 'После мучительного развода 40-летний Лукас находит новую подругу, новую работу и стремится восстановить отношения со своим сыном-подростком Маркусом. Но ему что-то мешает… Что-то, казалось бы, незначительное. Замечание, сделанное между прочим. Мелкая ложь. И вот накануне Рождества, когда падает снег и зажигаются огни на елке, ложь разрастается и проникает повсюду, как невидимый вирус. Растет недоверие, и все вокруг оказываются в состоянии коллективной истерии. Лукас вынужден бороться за свою жизнь и достоинство.', 0, 'Охота', 'Ohota', 'Jagten', '0000-00-00', 2012, 2012, 'Дания', '$3 800 000', 9, 0, 0, '106 мин.', 'Томас Винтерберг', 'Мадс Миккельсен, Томас Бо Ларсен, Анника Веддеркопп, Лассе Фогельстрём, Суссе Вольд, Анне Луизе Хассинг, Ларс Ранте, Александра Рапапорт, Оле Дюпон, Рикке Бергманн.'),
(365, 3, 'На протяжении многих веков длится противостояние добра и зла. Каждый день люди сталкиваются с вмешательством потусторонних сил. Ангелы и демоны находятся среди нас и ведут непрестанную борьбу за человеческую душу. Демоны придумывает все более изощренные ухищрения, чтобы очернить чистые души...', 'На протяжении многих веков длится противостояние добра и зла. Каждый день люди сталкиваются с вмешательством потусторонних сил. Ангелы и демоны находятся среди нас и ведут непрестанную борьбу за человеческую душу. Демоны придумывает все более изощренные ухищрения, чтобы очернить чистые души. Они манипулируют судьбами невинных людей, пытаясь обратить их ко злу. Порой даже ангелы не могут устоять перед соблазном и искушениями. Отдавшись во власть греха, они становятся падшими душами и пополняют ряды демонов. Тем не менее, небесным воинам света и добра удается отыскать в земном мире и тех людей, чьи души настолько чисты и непорочны, что никакому демону не под силу заполучить их. Они хранят земных ангелов и обучают для того, чтобы однажды они обрели крылья и бессмертие. Простая семнадцатилетняя школьница Маша Аверина (Анна Адрусенко) никогда не подозревала о своей истиной природе. Она – земной ангел. Уже около ста лет в этом бренном мире не встречались люди, обладающие такой кристально чистой душой как у Маши. От своего наставника Яна (Алексей Комашко) девушка узнает, что призвана бороться с демонами и спасать невинных людей от их влияния. Но не только силы света видят в Маше огромный потенциал. Демоны желают заставить ее свернуть на тропу зла. Теперь, чтобы выполнить свою миссию, девушка должна научиться противостоять соблазнам, которые готовят для нее враги всего человечества. Ситуацию осложняет то, что на пути Маши встречается Даниил или Дэн (Кирилл Запорожский), прекрасный падший ангел, подосланный демонами, чтобы совратить девушку. Дэн покорил её сердце, и она оказывается перед сложным выбором: исполнить своё божественное предназначение или быть рядом с возлюбленным. Вместе с тем, Дэну становится все сложнее выполнять свое задание, ведь он тоже полюбил Машу… Смотреть онлайн Ангел иили демон все серии бесплатно', 0, 'Ангел или демон', 'к', 'к', '0000-00-00', 2013, 2013, 'Россия', '-', 26, 0, 0, '48 мин.', 'Марк Горобец, Стас Иванов', 'Анна Андрусенко, Кирилл Запорожский, Сергей Чирков, Алексей Комашко, Татьяна Федоровская, Анастасия Стежко, Анна Скиданова, Анфиса Вистингаузен, Валерий Панков, Сергей Борисов'),
(366, 3, 'Семнадцатилетняя воспитанница провинциального детского дома Даша становится жертвой богатого мошенника Богданова. Чтобы уберечь свое имущество от конфискации, он выдает Дашу за свою внебрачную дочь, которую разыскал, чтобы загладить прошлые грехи и дать дочери престижное заграничное образование...', 'Семнадцатилетняя воспитанница провинциального детского дома Даша становится жертвой богатого мошенника Богданова. Чтобы уберечь свое имущество от конфискации, он выдает Дашу за свою внебрачную дочь, которую разыскал, чтобы загладить прошлые грехи и дать дочери престижное заграничное образование. На самом деле Богданов хочет переписать на девочку свое имущество и избавиться от нее. Только он не учел, что у Даши волевой, свободолюбивый характер: девушка, которая выросла в детском доме, привыкла принимать решения самостоятельно. Она не согласна гнить в рабстве из-за прихоти проворовавшегося негодяя. И теперь богатая невеста Даша будет бороться за свою жизнь и счастье, которое она заслужила.', 0, 'Даша (2013)', 'к', 'к', '0000-00-00', 2013, 2013, 'Россия', '-', 16, 0, 0, '45 мин.', 'Антон Азаров', 'Александр Тютин, Андрей Барило, Дарья Егорова, Артем Фадеев, Игорь Писный, Любава Грешнова, Ирина Барбинова, Михаил Пшеничный, Андрей Дебрин'),
(367, 3, 'Приказ о переводе Фролова обратно опером в Центральный район уже практически подписан, и вот и зашёл Андрей прогуляться «на районе» да попрощаться с друзьями-товарищами, так и не смог вернуться. Точнее, вернуться-то удалось, а вот быть в нужном для службы состоянии – нет...', 'Приказ о переводе Фролова обратно опером в Центральный район уже практически подписан, и вот и зашёл Андрей прогуляться «на районе» да попрощаться с друзьями-товарищами, так и не смог вернуться. Точнее, вернуться-то удалось, а вот быть в нужном для службы состоянии – нет. И как назло комиссия из Москвы с проверкой пожаловала. Поэтому Фролов в центральном районе работать пока не будет, а вернется в Молот до лучших времен. Так Фролов снова оказался в «Чужом районе». Этому очень обрадовался начальник отделения Статюк. Этому не обрадовались Артур и Макаров. И весьма удивился Свистунов.', 0, 'Чужой район 2', 'к', 'к', '0000-00-00', 2013, 2013, 'Россия', '-', 6, 15, 0, '45 мин.', 'Андрей Тумаркин', 'Денис Рожков, Кирилл Полухин, Игорь Головин, Зоя Буряк, Сергей Колос, Екатерина Проскурина, Юрий Архангельский, Алексей Нилов, Вячеслав Аркунов, Алексей Одинг'),
(368, 3, 'Холостяк - это Российская версия популярного шоу, которое завоевало миллионы женских сердец по всему миру, а теперь и в России на канале ТНТ вы сможете увидеть как 26 девушек борятся за сердце Холостяка...', 'Холостяк - это Российская версия популярного шоу, которое завоевало миллионы женских сердец по всему миру, а теперь и в России на канале ТНТ вы сможете увидеть как 26 девушек борятся за сердце Холостяка. Только одна из них сможет дойти до финала и получить предложение руки и сердца от героя программы. На что готовы пойти девушки ради того чтобы заполучить сердце Холостяка...', 0, 'Холостяк', 'к', 'к', '0000-00-00', 2013, 2013, 'Россия', '-', 22, 0, 0, '76 мин.', 'ТНТ', 'Петр Фадеев'),
(369, 3, 'Нарезка лучших выпусков всеми любимых Comedy Woman, Comedy Баттл, Comedy Club и Наша Russia…', 'Нарезка лучших выпусков всеми любимых Comedy Woman, Comedy Баттл, Comedy Club и Наша Russia…', 0, ' ТНТ Mix', 'к', 'к', '0000-00-00', 2013, 2013, 'Россия', '-', 22, 0, 0, '22 мин.', 'ТНТ', 'неизвестно'),
(370, 2, 'Молодая женщина Миа, пытающаяся избавиться от наркозависимости, отправляется вместе с братом и группой друзей в удалённую хижину, где они открывают Книгу мёртвых, что приводит к опасности и ужасу.', 'Молодая женщина Миа, пытающаяся избавиться от наркозависимости, отправляется вместе с братом и группой друзей в удалённую хижину, где они открывают Книгу мёртвых, что приводит к опасности и ужасу.', 0, 'Зловещие мертвецы: Черная книга', 'и', 'м', '0000-00-00', 2013, 2013, 'США', '$17 000 000', 27, 0, 0, '91 мин.', 'Федерико Альварес', 'Джейн Леви, Шайло Фернандес, Лу Тэйлор Пуччи, Джессика Лукас, лизабет Блэкмор, Феникс Коннолли, Джим МакЛарти, Сиан Дэвис'),
(371, 3, 'Евгений Новиков — гуру и спец по женским сердцам, перед ним не устоит ни одна девушка. Он с легкостью меняет подруг и даже не собирается искать «ту единственную». Женятся друзья, меняются коллеги, а Женя остается все тем же прожигателем жизни и ловеласом — он запросто может выкрасть друга-жениха за день до свадьбы, устроить ему мальчишник на Кипре, а сам с легкостью проведет ночь с прекрасной девушкой, отбив её у спутника… ', 'Евгений Новиков — гуру и спец по женским сердцам, перед ним не устоит ни одна девушка. Он с легкостью меняет подруг и даже не собирается искать «ту единственную». Женятся друзья, меняются коллеги, а Женя остается все тем же прожигателем жизни и ловеласом — он запросто может выкрасть друга-жениха за день до свадьбы, устроить ему мальчишник на Кипре, а сам с легкостью проведет ночь с прекрасной девушкой, отбив её у спутника… Но однажды в его жизни появляется Даша. Даша — бывшая сотрудница Новикова: когда-то девушка предоставила шефу оригинальный туристический проект, но тот, взглянув на него, уволил подчиненную. Теперь все изменилось. Дашин проект может выиграть тендер Министерства культуры. Но, вспомнив старую обиду, девушка отказывается сотрудничать с бывшим начальником. В то время как Новиков спит и видит — как бы заполучить проект Даши. Не придумав ничего лучше, Евгений идет на крайние меры — он решает украсть Дашин проект, но неожиданно для себя влюбляется в бывшую подчиненную. Однако, конкурентная борьба так велика, что Новиков, воспользовавшись доверием Даши, доводит дело до конца — несмотря на влюбленность, крадет ее работу и выигрывает тендер, а девушка теряет все, чем рискнула. Впрочем, и сам Женя оказывается в неприятной ситуации: его обвиняют в хищении. В итоге, пытаясь уйти от преследования, он попадает в аварию и теперь все считают его погибшим. В сложившейся ситуации решение приходит само собой — Женя решает вернуться в свой офис, правда, в образе женщины бальзаковского возраста — Евы Анатольевны. Теперь ему предстоит вернуть доверие возлюбленной и восстановить репутацию. Кроме этого он сделает открытие: для того, чтобы стать настоящим мужчиной, нужно встать на каблуки.', 0, 'Думай как женщина', 'g', 'g', '0000-00-00', 2013, 2013, 'Россия', '-', 9, 12, 0, '48 мин.', 'Андрей Силкин', 'Марат Башаров, Анна Попова, Александр Арсентьев, Владимир Зайцев, Татьяна Орлова, Сергей Габриэлян, Владимир Стержаков, Антон Васильев, Екатерина Дубакина, Елизавета Лотова'),
(372, 3, 'Главный герой безумно любит свою жену, красавицу. Она же постоянно изменяет ему и… рожает почти каждый год по ребенку.. Всех детей Валера растит как родных. Он им и отец, и мать. Однажды Люся исчезает из дому вовсе, встретив «новую любовь»- иностранца…', 'Главный герой безумно любит свою жену, красавицу. Она же постоянно изменяет ему и… рожает почти каждый год по ребенку.. Всех детей Валера растит как родных. Он им и отец, и мать. Однажды Люся исчезает из дому вовсе, встретив «новую любовь»- иностранца…В тот же год с Голубевым случается горе… Как сложится судьба одинокого многодетного отца и его малышей? Что станет с беспутной мамашей на чужбине? Это история любви, предательства, прощения, а еще - преодоления себя.', 0, 'Жених', 'g', 'g', '0000-00-00', 2013, 2013, 'Россия', '-', 16, 0, 0, '50 мин.', 'Каринэ Фолиянц', 'Андрей Егоров, Ольга Чудакова, Раиса Рязанова, Вера Сотникова, Софья Лебедева, Александр Суворов, Александр Тютин, Анастасия Добрынина, Ольга Хохлова, Валерий Иваков, Илья Капанец, Валентин Терехов');
INSERT INTO `data` (`id`, `cat`, `shot_text`, `all_text`, `view`, `name_ru`, `tname`, `name_en`, `date`, `fyear`, `lyear`, `strana`, `budget`, `genre1`, `genre2`, `genre3`, `time`, `director`, `in_role`) VALUES
(373, 3, 'Любит? Не любит? эти вопросы мучают каждую 17-летнюю девушку. Наша героиня – не исключение! И эта история о ней. Лёля – боевая, смешная и задорная девушка. Она заканчивает свои многострадальные школьные годы в одном из провинциальных российских городов. Школа позади. Впереди учеба и работа, но самое главное – можно сколько угодно рисовать любимые комиксы, которые буквально лезут Лёле в голову!...', 'Любит? Не любит? эти вопросы мучают каждую 17-летнюю девушку. Наша героиня – не исключение! И эта история о ней. Лёля – боевая, смешная и задорная девушка. Она заканчивает свои многострадальные школьные годы в одном из провинциальных российских городов. Школа позади. Впереди учеба и работа, но самое главное – можно сколько угодно рисовать любимые комиксы, которые буквально лезут Лёле в голову! Детство заканчивается в тот день, когда её любимый уезжает в столицу. Недолго думая, Лёля отправляется в город мечты возвращать утраченную любовь...', 0, 'Любит не любит', 'g', 'g', '0000-00-00', 2013, 2013, 'Россия', '-', 12, 0, 0, '24 мин.', 'Нигина Сайфуллаева, Стас Иванов', 'Вероника Вернадская, Кларисса Барская, Александр Константинов, Елизавета Лотова, Галина Данилова, Иван Шмаков, Лариса Домаскина, Александр Чевычелов, Кирилл Каганович, Любовь Новикова'),
(374, 3, 'Кастинги «Comedy Баттл. Без границ» прошли не только по городам России, но и далеко за ее пределами. Самых лучших юмористов искали в Таллинне, Алматы, Минске, Дюссельдорфе, Тель-Авиве, Астане, Ереване, Тбилиси, Киеве, Харькове, Риге и многих других населенных пунктах ближнего и дальнего зарубежья...', 'Кастинги «Comedy Баттл. Без границ» прошли не только по городам России, но и далеко за ее пределами. Самых лучших юмористов искали в Таллинне, Алматы, Минске, Дюссельдорфе, Тель-Авиве, Астане, Ереване, Тбилиси, Киеве, Харькове, Риге и многих других населенных пунктах ближнего и дальнего зарубежья. «Comedy Баттл. Без границ» ТНТ покажет в два этапа: первый – с 5 апреля и до лета, второй стартует осенью и продлится до самого нового года, когда и состоится финал шоу. Победитель станет новым резидентом Comedy Club.', 0, 'Comedy Баттл. Без границ', 'т', 'п', '0000-00-00', 2013, 2013, 'Россия', '-', 22, 0, 0, '47 мин.', 'ТНТ', 'Павел Воля'),
(375, 3, 'Кастинги «Comedy Баттл. Без границ» прошли не только по городам России, но и далеко за ее пределами. Самых лучших юмористов искали в Таллинне, Алматы, Минске, Дюссельдорфе, Тель-Авиве, Астане, Ереване, Тбилиси, Киеве, Харькове, Риге и многих других населенных пунктах ближнего и дальнего зарубежья...', 'Кастинги «Comedy Баттл. Без границ» прошли не только по городам России, но и далеко за ее пределами. Самых лучших юмористов искали в Таллинне, Алматы, Минске, Дюссельдорфе, Тель-Авиве, Астане, Ереване, Тбилиси, Киеве, Харькове, Риге и многих других населенных пунктах ближнего и дальнего зарубежья. «Comedy Баттл. Без границ» ТНТ покажет в два этапа: первый – с 5 апреля и до лета, второй стартует осенью и продлится до самого нового года, когда и состоится финал шоу. Победитель станет новым резидентом Comedy Club.', 0, 'ХБ Шоу', 'т', 'п', '0000-00-00', 2013, 2013, 'Россия', '-', 22, 0, 0, '24 мин.', 'ТНТ', 'Гарик Харламов, Тимур Батдрутдинов'),
(376, 3, 'Рин Окимура и его брат Юкио — сироты, росшие в храме священника и экзорциста Фудзимото. Рин — парень неплохой, но вспыльчивый, придурковатый и постоянно ввязывающийся в драки. Юкио же наоборот, умный, прилежный и мечтающий стать врачом (и лечение извечных ссадин брата ему в этом лишь помогает).\r\n\r\n', 'Рин Окимура и его брат Юкио — сироты, росшие в храме священника и экзорциста Фудзимото. Рин — парень неплохой, но вспыльчивый, придурковатый и постоянно ввязывающийся в драки. Юкио же наоборот, умный, прилежный и мечтающий стать врачом (и лечение извечных ссадин брата ему в этом лишь помогает).\r\n\r\nНо в реальности разница между ними куда сильнее: на самом деле Рин — полудемон, и не просто полудемон, а сын самого Сатаны. И когда, вопреки предосторожностям Фудзимото, силы рина прорезаются наружу, папенька находит его и пытается забрать домой, чтобы в дальнейшем использовать сына в качестве плацдарма для захвата нашего измерения. Рину удаётся избежать сей плачевной участи, но дорогой ценой — Фудзимото гибнет, защищая своего приёмного сына. И тогда Рин решает стать экзорцистом и отомстить Сатане, для чего устраивается вместе с Юкио в специальную закрытую школу.', 0, 'Синий экзорцист', 'Sinii_ekzorcist', 'Ao no Ekusoshisuto', '0000-00-00', 2011, 2011, 'Япония', '---', 1, 30, 18, '30 мин', 'Тэнсай Окамура, Алекс Фон Дэвид', 'Нобухико Окамото, Дзюн Фукуяма, Хироши Камия, Кодзи Юса, Кана Ханадзава, Кадзуя Накаи, Юки Кадзи, Патрик Мёллекен, Китамура Эри, Кейдзи Фудзивара.'),
(377, 2, '\nТони Старк -  он же Железный Человек, постоянно пытается усовершенствовать свой  костюм супергероя,  в то время как новый злодей совершает ряд терактов, после которых не остается никаких следов и улик.  Все силы США бросаются на поимку террориста по кличке «Мандарин», но это все безрезультатно. Похоже,  что справится с террористом под силу только Железному Человеку, у которого с ним личные счеты. Однако скоро выясняется, что настоящий враг все это время был ближе, чем казалось…\nСмотрите  фильм «Железный Человек 3» онлайн на нашем сайте, скоро фильм появится в хорошем качестве  \n', 'Тони Старк -  он же Железный Человек, постоянно пытается усовершенствовать свой  костюм супергероя,  в то время как новый злодей совершает ряд терактов, после которых не остается никаких следов и улик.  Все силы США бросаются на поимку террориста по кличке «Мандарин», но это все безрезультатно. Похоже,  что справится с террористом под силу только Железному Человеку, у которого с ним личные счеты. Однако скоро выясняется, что настоящий враг все это время был ближе, чем казалось…\nСмотрите  фильм «Железный Человек 3» онлайн на нашем сайте, скоро фильм появится в хорошем качестве  \n', 0, 'Железный человек 3 / Iron Man 3 (2013)', 'n', 'n', '0000-00-00', 2013, 2013, 'США, Китай', '-', 28, 3, 21, '131 мин.', 'Шейн Блэк', 'Роберт Дауни мл., Гвинет Пэлтроу, Дон Чидл, Гай Пирс, Бен Кингсли, Ребекка Холл, Пол Беттани'),
(378, 2, '2 сентября 1972 года. Монреаль. Хоккейная сборная СССР с разгромным счетом 7:3 победила канадских профессионалов из НХЛ в стартовом матче эпохальной Суперсерии СССР-Канада. Это была не просто игра, это была битва за свою страну, которая перевернула мировое представление о хоккее...', '\r\n\r\nТеперь весь мир знал его просто по номеру «17». Валерий Харламов, забивший в том матче 2 шайбы, мгновенно взлетел на вершину славы. Сбылась его мечта -упорство, спортивный талант и суровые уроки великого тренера Анатолия Тарасова сделали из «номера 17» легенду мирового хоккея.', 0, 'Легенда №17', 'к', 'к', '0000-00-00', 2013, 2013, 'Россия', '€10 000 000', 24, 9, 2, '134 мин', 'Николай Лебедев', 'Данила Козловский, Олег Меньшиков, Владимир Меньшов, Роман Мадянов, Светлана Иванова, Алехандра Грепи, Борис Щербаков'),
(379, 3, 'Сериал «Истребители» перенесёт зрителя в начало 40-х годов прошлого века, в страшные годы Великой Отечественной войны, и познакомит с главными героями - молодыми лётчиками Леонидом и Борисом, которым предстоит вскоре отправиться на фронт в составе авиационного полка. Первое же боевое задание лётчиков оказывается провалено - из-за их неправильных действий в воздухе гибнут люди. Парней ждёт трибунал и расстрел, однако буквально в последний момент об их возвращении в строй ходатайствует командир штурмового отряда. Чтобы расплатиться за допущенную ошибку, Леониду и Борису предстоит стать штурмовиками и беспрекословно следовать приказам любой сложности, без колебаний и страха за собственные жизни...', 'Сериал «Истребители» перенесёт зрителя в начало 40-х годов прошлого века, в страшные годы Великой Отечественной войны, и познакомит с главными героями - молодыми лётчиками Леонидом и Борисом, которым предстоит вскоре отправиться на фронт в составе авиационного полка...', 0, 'Истребители', 'er', 'e', '0000-00-00', 2013, 2013, 'Россия', '-', 3, 5, 0, '43 мин.', 'Алексей Мурадов', 'Екатерина Вилкова, Дмитрий Дюжев, Николай Козак, Елена Яковлева, Олег Фомин, Мария Андреева, Антон Соколов, Дмитрий Арбенин, Екатерина Рябова, Владимир Большов'),
(380, 3, 'Продолжение сериалов 1941 и 1942. Новый 1943 год. После поражения под Сталинградом немцы готовят реванш. На оккупированную территорию высаживается советский десант. Но все погибают, кроме молодой девушки-радистки Кати. Её в лесу находит Муха и прячет в деревни, где живет с Аленой...', 'Продолжение сериалов 1941 и 1942. Новый 1943 год. После поражения под Сталинградом немцы готовят реванш. На оккупированную территорию высаживается советский десант. Но все погибают, кроме молодой девушки-радистки Кати. Её в лесу находит Муха и прячет в деревни, где живет с Аленой. Для конспирации они выдают себя мужем и женой. О радистке узнают в городе подпольщики. Для связи с ней направляется Григорий, который служит в полиции. Между радисткой Катей и Гришкой вспыхивают чувства. Но Григорий еще пытается наладить отношения и с Дашей и Аленой. Это у него не выходит. К тому же, между Аленой и Мухой возникает взаимная симпатия. А Даша, потеряв ребенка, и спасенная от расстрела Вальтером попадает в его дом. Вальтер предлагает Даше стать его женой, но Даша отказывается. Через нее пытается наладить связь с подпольем советский разведчик Антон Ковалёв. Он служит у немцев под фамилией Йоганс Вайс и имеет доступ к секретной информации. Он может узнать и передать в центр, где будет главное немецкое наступление.', 0, '1943', 'er', 'e', '0000-00-00', 2013, 2013, 'Россия, Украина', '-', 9, 5, 0, '42 мин.', 'Валерий Шалыга', 'Александр Пашков, Владимир Гостюхин, Йоханес Габриель, Любовь Тихомирова, Дарья Баранова, Ольга Олексий, Владимир Башкиров, Егор Баринов, Анатолий Гущин, Нина Усатова'),
(381, 3, 'Сериал «Разведчицы» о том, как  Великая Отечественна Война в корне изменила судьбы двух девушек, которые  вынуждены искупить свою вину за несовершенные поступки.', 'Сериал «Разведчицы» о том, как  Великая Отечественна Война в корне изменила судьбы двух девушек, которые  вынуждены искупить свою вину за несовершенные поступки. Одна девушка, по имени Арина – интеллигентка, яркая представительница комсомола,  выросшая в порядочной семье – обвиняется в предательстве родины. Вторая, выросшая в селе девушка , -  Зоя является трудолюбивой колхозницей,  на которую, по ложным обвинениям, «вешают» убийство матери Арины.\r\nОбоим девушкам остается только одно – пойти  в Разведчицы\r\n', 0, 'Разведчицы', 'r', 'r', '0000-00-00', 2013, 2013, 'Россия', '-', 5, 9, 0, '46 мин.', 'Феликс Герчиков', 'Светлана Иванова, Светлана Устинова, Владимир Вдовиченков, Ирина Апексимова, Евгений Пронин, Анатолий Руденко, Николай Добрынин, Елизавета Лотова, Лянка Грыу, Александра Мареева, Анна Халиулина, Олег Морозов, Маркус Кунце, Михаил Елисеев, Сергей Мардарь, Юрий Орлов (II), Игорь Копылов, Оксана Базилевич, Алиса Миронова, Кирилл Жандаров, Олеся Бойко, Екатерина Рудакова, Александр Ситников, Александр Петров (X), Наталья Зацепина, Евгений Павлов (IV), Павел Миронов, Олег Малышев, Кирилл Горбунов, Ирина Основина'),
(382, 2, ' Местный шериф согласился организовать для Джеба Сойера, который и скрывался под Кожаным лицом, честный судебный процесс и предоставить ему адвоката. Однако его намерениям мешает мэр, который ведет за собой толпу людей, жаждущих линчевать кровавого маньяка..', ' Местный шериф согласился организовать для Джеба Сойера, который и скрывался под Кожаным лицом, честный судебный процесс и предоставить ему адвоката. Однако его намерениям мешает мэр, который ведет за собой толпу людей, жаждущих линчевать кровавого маньяка. Когда ситуация начинает выходить из-под контроля, а горожане принимаются ладить петли для убийцы, кто-то бросает в дом Сойера бутылку с зажигательной смесью. Дом сгорает, а вместе с ним в огне гибнут и все, кто в нем находился, включая самого Джеба и его отца. Разумеется, спустя определенное время убийства с помощью бензопилы начинаются снова. Первое предположение шерифа — Джеб Сойер выжил и решил отомстить. Но он ли это на самом деле? И если нет, то кто?', 0, 'Техасская резня бензопилой 3D (2013)', 'b', 'b', '0000-00-00', 2013, 2013, 'США', '-', 27, 26, 0, '92 мин.', 'Джон Льюсенхоп', ' Александра Даддарио, Дэн Йеджер, Трей Сонгз, Скотт Иствуд, Таня Рэймонд, Шон Сайпос, Керам Малики-Санчес, Джеймс МакДональд, Том Бэрри, Пол Рэй'),
(383, 3, 'Выпускник Военно-Медицинской Академии им. С.М. Кирова - подполковник медицинской службы Андрей Ковалев (Александр Лазарев-мл.) - человек неординарный и талантливый. Герой России и легендарный хирург, он много лет провел в горячих точках в составе миротворческих сил страны..', 'Выпускник Военно-Медицинской Академии им. С.М. Кирова - подполковник медицинской службы Андрей Ковалев (Александр Лазарев-мл.) - человек неординарный и талантливый. Герой России и легендарный хирург, он много лет провел в горячих точках в составе миротворческих сил страны, спас сотни людей и не представляет себя без любимой профессии. Но когда из-за случайного ранения Ковалев вынужден оставить главное дело своей жизни, он решается на отчаянный шаг...', 0, 'Лекарство против страха', 'f', 'f', '0000-00-00', 2013, 2013, 'Россия', '-', 16, 0, 0, '40 мин.', 'Александр Аравин', 'Александр Лазарев (мл.), Дмитрий Ульянов, Янина Соколовская, Евгений Шумейко, Роман Агеев, Игорь Гордин, Александр Блок, Владимир Студеновский, Эльвира Болгова, Евгений Славский'),
(384, 3, 'Бывший муж певицы Натальи Мельник отказался платить алименты, и тогда женщина решила стать судебным приставом, чтобы заставить всех горе-отцов вспомнить о своем долге...', 'Бывший муж певицы Натальи Мельник отказался платить алименты, и тогда женщина решила стать судебным приставом, чтобы заставить всех горе-отцов вспомнить о своем долге. «Тем, для кого эти алименты — единственная надежда на нормальную жизнь ребенка, я обещаю: за каждую вашу пролитую слезу нерадивые папаши ответят соответствующим рублем», — эти слова стали рабочим девизом Натальи.', 0, 'Бывшая жена', 'f', 'f', '0000-00-00', 2013, 2013, 'Россия', '-', 16, 0, 0, '50 мин.', 'Дарья Полторацкая', 'Нелли Уварова, Юрий Батурин, Олег Тактаров, Мария Машкова, Владимир Капустин, Сергей Малюгов, Елена Купрашевич, Максим Меркулов, Максим Студеновский, Олег Чернов'),
(385, 3, 'Перец перенёс на экран один из самых феерических праздников в жизни россиян — вечер встречи выпускников. Герои комедийного сериала "Одноклассники" учились в самой обычной школе самого обычного Пырьевска. Встретившись энцать лет спустя на фуршете в родной столовой, они делятся сплетнями, вспоминают общие приключения и хвастаются явно завышенными успехами. С каждой серией "Одноклассников" закуски на столах всё меньше, а истории из жизни бывших "ботаников" и двоечников — всё смешнее.', 'Перец перенёс на экран один из самых феерических праздников в жизни россиян — вечер встречи выпускников. Герои комедийного сериала "Одноклассники" учились в самой обычной школе самого обычного Пырьевска. Встретившись энцать лет спустя на фуршете в родной столовой, они делятся сплетнями, вспоминают общие приключения и хвастаются явно завышенными успехами. С каждой серией "Одноклассников" закуски на столах всё меньше, а истории из жизни бывших "ботаников" и двоечников — всё смешнее.', 0, 'Одноклассники', 'f', 'f', '0000-00-00', 2013, 2013, 'Россия', '-', 12, 0, 0, '22 мин.', 'Неизвестно', 'Неизвестно'),
(386, 3, 'Александр Варламов работает в специальном подразделении милиции, которое занимается раскрытием серийных убийств и особо жестоких преступлений, совершенных людьми с отклонениями в психике. Когда обычные методы не работают, и следствие заходит в тупик, в игру вступают Варламов со своей группой..', 'Александр Варламов работает в специальном подразделении милиции, которое занимается раскрытием серийных убийств и особо жестоких преступлений, совершенных людьми с отклонениями в психике. Когда обычные методы не работают, и следствие заходит в тупик, в игру вступают Варламов со своей группой. Изучая место преступления, улики, результаты судмедэкспертизы, они вычисляют психотип маньяка и стараются понять его истинные мотивы. Они вникают в каждый шаг преступника, и пытаются угадать его следующий шаг, чтобы предотвратить новое преступление. При этом внешне очень успешный Варламов находится на пороге неизбежного кризиса сорока лет, неизбежной переоценки своей жизни.', 0, 'Бездна', 'f', 'f', '0000-00-00', 2013, 2013, 'Россия', '-', 6, 26, 0, '45 мин.', 'Дмитрий Петрунь', 'Илья Шакунов, Алёна Бабенко, Богдан Ступка, Анна Вартанян, Артём Семакин, Геннадий Смирнов, Артём Алексеев, Анна Дюкова, Вадим Волков, Сергей Кузнецов'),
(387, 2, 'Мир поражен чумой и стоит на грани вымирания. Покойники ходят по земле и норовят употребить в пищу живых, которые, оставшись в катастрофическом меньшинстве, с трудом держат оборону. Перемены начинаются, когда один зомби, чье имя при жизни начиналось на «Р», спасает девушку вместо того, чтобы ее съесть...', 'Мир поражен чумой и стоит на грани вымирания. Покойники ходят по земле и норовят употребить в пищу живых, которые, оставшись в катастрофическом меньшинстве, с трудом держат оборону. Перемены начинаются, когда один зомби, чье имя при жизни начиналось на «Р», спасает девушку вместо того, чтобы ее съесть. Дружба, завязавшаяся между представителями враждующих сторон, грозит обоим самыми нехорошими последствиями. Но Р и Джули, сами того не подозревая, держат в руках простой и единственный ключ к спасению гибнущего мира.', 0, 'Тепло наших тел (2013) [HD 720]', 'и', 'и', '0000-00-00', 2013, 2013, 'США', '$35 000 000', 27, 16, 12, '98 мин.', 'Джонатан Левин', 'Николас Холт, Тереза Палмер, Аналей Типтон, Роб Кордри, Дэйв Франко, Джон Малкович, Кори Хардрикт'),
(388, 2, 'Тони Старк - он же Железный Человек, постоянно пытается усовершенствовать свой костюм супергероя, в то время как новый злодей совершает ряд терактов, после которых не остается никаких следов и улик. Все силы США бросаются на поимку террориста по кличке «Мандарин», но это все безрезультатно. Похоже, что справится с террористом под силу только Железному Человеку, у которого с ним личные счеты. Однако скоро выясняется, что настоящий враг все это время был ближе, чем казалось… Смотрите фильм «Железный Человек 3» онлайн на нашем сайте, скоро фильм появится в хорошем качестве', 'Тони Старк - он же Железный Человек, постоянно пытается усовершенствовать свой костюм супергероя, в то время как новый злодей совершает ряд терактов, после которых не остается никаких следов и улик. Все силы США бросаются на поимку террориста по кличке «Мандарин», но это все безрезультатно. Похоже, что справится с террористом под силу только Железному Человеку, у которого с ним личные счеты. Однако скоро выясняется, что настоящий враг все это время был ближе, чем казалось… Смотрите фильм «Железный Человек 3» онлайн на нашем сайте, скоро фильм появится в хорошем качестве', 0, 'Железный человек 3 / Iron Man 3 [HD 720]', 'n', 'o', '0000-00-00', 2013, 2013, 'США, Китай', '$200 000 000', 28, 3, 21, '131 мин.', 'Шейн Блэк', 'Роберт Дауни мл., Гвинет Пэлтроу, Дон Чидл, Гай Пирс, Бен Кингсли, Ребекка Холл, Пол Беттани'),
(389, 3, 'Каникулы в Мексике» не могли так просто закончиться. На новой вилле, в центре одного из самых популярных курортов Тихоокеанского побережья Пуэрто-Валарте, собрались самые яркие участники двух сезонов реалити..', 'Каникулы в Мексике» не могли так просто закончиться. На новой вилле, в центре одного из самых популярных курортов Тихоокеанского побережья Пуэрто-Валарте, собрались самые яркие участники двух сезонов реалити. Одни из них давно дружат, другие – видятся впервые, а третьи – заклятые враги. Теперь все они – участники нового шоу «Каникулы в Мексике. Суперигра», которое стартует на канале «ПЯТНИЦА!» с 3 июня в 22:00. С первого же дня героев ждут сюрпризы, но не все из них будут приятными. На мексиканских каникулах теперь не получится вдоволь отдохнуть, как раньше. Каждый день участников ждут сложнейшие испытания на деньги, неожиданные повороты и новые правила. Каждую неделю по пятницам кто-то из участников будет покидать виллу. Герои все меньше могут рассчитывать на чудесное спасение, ведь количество иммунитетов от ведущего за всю игру будет сокращено до минимума, а главным правилом церемонии станет отсутствие всяких правил. Ежедневные испытания на деньги продумывались с особой тщательностью. Среди них будут коллективные и индивидуальные, веселые и опасные, но все они направлены на то, чтобы помочь героям преодолеть свои страхи, испытать себя и открыть в себе что-то новое. Чтобы справиться с ними и выиграть в финале беспрецедентный суперприз в 5 миллионов рублей, героям придется стать одной командой. ', 0, 'Каникулы в Мексике. Суперигра', 'т', 'т', '0000-00-00', 2013, 2013, 'Россия', '-', 22, 0, 0, '60 мин.', 'Пятница', 'Неизвестно'),
(390, 3, 'Женезио одинокий вдовец и отец маленькой девочки по имени Рита, женится на простой девушке Карминии, считая, что она как никто лучше сможет заменить мать девочке. Сама же скрывает за своей приятной улыбкой и добрыми намерениями свою подлую сущность коварной особы...', 'Женезио одинокий вдовец и отец маленькой девочки по имени Рита, женится на простой девушке Карминии, считая, что она как никто лучше сможет заменить мать девочке. Сама же скрывает за своей приятной улыбкой и добрыми намерениями свою подлую сущность коварной особы. Она при поддержке Макса убирает со своего пути мужа, и после его трагической смерти понимает что единственным наследником старика осталась Рита. Карминия выгоняет свою падчерицу на свалку.', 0, 'Проспект Бразилии', 'т', 'т', '0000-00-00', 2013, 2013, 'Бразилия', '-', 9, 0, 0, '50 мин.', 'Андре Камара, Густаво Фернандез, Паоло Сильвестрини', 'Элиане Жиардини, Адриана Эстевес, Мурило Бенисио, Марселлу Новаес, Летиция Иснард, Элоиза Периссе, Дебора Блок, Маркос Карузо, Алешандре Боржес, Фабиула Наскименту'),
(391, 3, 'Продолжение сериала «Универ» со старыми героями Сашей и Таней, которые теперь живут семейной жизнью и воспитывают сына. Саша и Таня Сергеевы снимают квартиру и строят свой быт на собственные деньги, несмотря на все попытки Сильвестра Андреевича помочь материально...', 'Продолжение сериала «Универ» со старыми героями Сашей и Таней, которые теперь живут семейной жизнью и воспитывают сына. Саша и Таня Сергеевы снимают квартиру и строят свой быт на собственные деньги, несмотря на все попытки Сильвестра Андреевича помочь материально. Новые приключения, трудности и радости семейной жизни – все это ждет героев сериала.	\r\n  Смотрите все серии сериала СашаТаня бесплатно на нашем сайте', 0, 'СашаТаня', 'и', 'и', '0000-00-00', 2013, 2013, 'Россия', '-', 12, 0, 0, '24 мин.', 'Михаил Старчак', 'Андрей Гайдулян, Валентина Рубцова, Алексей Климушкин, Алексей Гаврилов, Лариса Баранова, Наталья Ходус, Виктор Полторацкий'),
(392, 2, '«Человек из стали» это история одного из самых ранних комиксов – комиксов о Супермене. Еще в юном возрасте Кларк Кент обнаруживает в себе нечеловеческую силу, которая может изменить мир, как в лучшую, так и в худшую сторону.  Кларк хочет узнать о себе правду, узнать откуда он и в чем его миссия на Земле. Однако ему приходится скрывать свои возможности, чтобы не вызывать подозрения у общества…\r\n  Вы можете смотреть фильм «Человек из стали» на нашем сайте бесплатно и без регистрации. Скоро фильм появится в хорошем качестве. \r\n', '«Человек из стали» это история одного из самых ранних комиксов – комиксов о Супермене. Еще в юном возрасте Кларк Кент обнаруживает в себе нечеловеческую силу, которая может изменить мир, как в лучшую, так и в худшую сторону.  Кларк хочет узнать о себе правду, узнать откуда он и в чем его миссия на Земле. Однако ему приходится скрывать свои возможности, чтобы не вызывать подозрения у общества…\r\n  Вы можете смотреть фильм «Человек из стали» на нашем сайте бесплатно и без регистрации. Скоро фильм появится в хорошем качестве. \r\n', 0, 'Человек из стали / Man of Steel (2013)', 'и', 'и', '0000-00-00', 2013, 2013, 'США, Канада, Великобритания', '$225 000 000', 28, 3, 21, '143 мин.', 'Зак Снайдер', 'Генри Кавилл, Эми Адамс, Майкл Шеннон, Кевин Костнер, Дайан Лэйн, Лоренс Фишбёрн, Антье Трое, Айелет Зурер'),
(393, 3, 'Собака всегда считалась лучшим другом человека, ведь как можно не любить такое верное, заботливое и дружелюбное существо. Ви тоже думаете так? Тогда знакомьтесь с Уилфредом – милым существом, в котором все люди видят обычного песика и только соседский парень по имени  Райан видит в Уилфреде говорящую собаку в человеческом облике...', 'Собака всегда считалась лучшим другом человека, ведь как можно не любить такое верное, заботливое и дружелюбное существо. Ви тоже думаете так? Тогда знакомьтесь с Уилфредом – милым существом, в котором все люди видят обычного песика и только соседский парень по имени  Райан видит в Уилфреде говорящую собаку в человеческом облике. Их дружба приносит много полезных плодов для Райана, потому что Уилфред постоянно впутывает его в какие-то истории, подставляет и тем самым учит жизни.\r\n   Смотрите первый, второй и третий сезон сериала «Уилфред» на нашем сайте безплатно.\r\n', 0, 'Уилфред / Wilfred', 'b', 'b', '0000-00-00', 2011, 2013, 'США', '-', 12, 0, 0, '22 мин.', 'Рэндолл Айнхорн, Виктор Нелли мл.', 'Элайджа Вуд, Джейсон Гэнн, Фиона Габелманн, Дориан Браун, Крис Клейн\r\nЭллисон Мэк, Родни То'),
(394, 3, 'Обычным, пригожим осенним днем, город Честерс Миллз, штат Мэн, был внезапно отрезан от остального мира невидимым силовым барьером. Самолеты врезаются в купол и падают, пылая, с небес; садовнику отрезает силовым полем руку; люди, выехавшие в соседний город по делам, не могут вернуться к своим близким..', 'Обычным, пригожим осенним днем, город Честерс Миллз, штат Мэн, был внезапно отрезан от остального мира невидимым силовым барьером. Самолеты врезаются в купол и падают, пылая, с небес; садовнику отрезает силовым полем руку; люди, выехавшие в соседний город по делам, не могут вернуться к своим близким; автомобили взрываются от столкновения с куполом. Никто не понимает, что это за барьер, откуда он взялся и исчезнет ли он. Дейл Барбара, ветеран конфликта в Ираке, а ныне повар, обнаруживает себя в команде с несколькими отважными жителями — Джулией Шамвей, владелицей городской газеты, помощником врача, женщиной и тремя храбрыми детьми. Против них выступает Большой Джим Ренни — местный политический деятель, который для удержания власти не остановится ни перед чем, даже перед убийством, а также его сын со своим личным «скелетом в шкафу». Но главный их противник — сам Купол…', 0, 'Под куполом / Under the Dome', 'v', 'v', '0000-00-00', 2013, 2013, 'США', '-', 27, 28, 0, '43 мин.', 'Джек Бендер', 'Майк Фогель, Колин Форд, Аиша Хиндс, Александр Кох, Рашель Лефевр, Натали Мартинез, Дин Норрис, Джолин Парди, Бриттани Робертсон, Николас Стронг'),
(395, 2, 'На Земле происходит страшное заражение, которое уничтожает человечество превращая людей в ужасных зомби.   Чтобы остановить страшную эпидемию и спасти человечество от зловещей чумы, которая с огромной скоростью разрастается по планете, Джерри Лейн вынужден найти то место, откуда именно началось заражение. Для этого он со своей командой бросает вызов огромной армии гниющих зомби, ведь их с каждой секундой становится больше и больше…\n   фильм Война миров z скоро появится онлайн в хорошем качестве\n', 'На Земле происходит страшное заражение, которое уничтожает человечество превращая людей в ужасных зомби.   Чтобы остановить страшную эпидемию и спасти человечество от зловещей чумы, которая с огромной скоростью разрастается по планете, Джерри Лейн вынужден найти то место, откуда именно началось заражение. Для этого он со своей командой бросает вызов огромной армии гниющих зомби, ведь их с каждой секундой становится больше и больше…\n   фильм Война миров z скоро появится онлайн в хорошем качестве\n', 0, 'Война миров Z / World War Z', 'b', 'b', '0000-00-00', 2013, 2013, 'США', '$190 000 000', 27, 28, 3, '116 мин.', 'Марк Форстер', 'Брэд Питт, Эрик Уэст, Мэттью Фокс, Дэвид Морс, Мирей Инос, Джеймс Бэдж Дэйл, Джулиан Сигер, Мишель Хайсмэн, Дэвид Эндрюс');
INSERT INTO `data` (`id`, `cat`, `shot_text`, `all_text`, `view`, `name_ru`, `tname`, `name_en`, `date`, `fyear`, `lyear`, `strana`, `budget`, `genre1`, `genre2`, `genre3`, `time`, `director`, `in_role`) VALUES
(396, 2, 'Интересная и довольно увлекательная история защитника правопорядка Джона Рейдка, который, не без помощи веселого индейца Джека Воробья... Пардон, индейца Тонто, стал легендарным мстителем в маске, продолжая дальше творить добро во имя справедливости...', 'Интересная и довольно увлекательная история защитника правопорядка Джона Рейдка, который, не без помощи веселого индейца Джека Воробья... Пардон, индейца Тонто, стал легендарным мстителем в маске, продолжая дальше творить добро во имя справедливости. Индейец, обладает неплохим чувством юмора, что позволяет наделять рассказываемые им истории о приключениях увлекательности и забавности, которые пришлось пережить двум друзьям, ради того, что бы сражаться против общего неприятеля. Живя в эпоху железных дорог и смены власти, им придется преодолеть не мало трудностей. Встречаем капитана Джека Воробья на Диком Западе', 0, 'Одинокий рейнджер / The Lone Ranger (2013)', 'vv', 'v', '0000-00-00', 2013, 2013, 'США', '$215 000 000', 4, 21, 3, '149 мин', 'Гор Вербински', 'Джонни Депп, Хелена Бонем Картер, Арми Хаммер, Джеймс Бэдж Дэйл, Уильям Фихтнер, Бэрри Пеппер, Джеймс Фрейн, Том Уилкинсон, Рут Уилсон, У. Эрл Браун'),
(397, 2, 'Давно-давно Майк и Салли, ныне самые профессиональные в деле пугательств монстры, поступили в престижный "Университет Монстров". Поначалу эти два непохожие монстры друг друга не переносили! Фильм расскажет нам о том, как два героя из заклятых врагов превратились в лучших друзей.', 'Наверно, многие из вас смотрели Корпорацию Монстров. Многие скучали, многие ждали продолжения... И вот встречайте перед Вами совершенно новый фильм со старыми героями. Давно-давно Майк и Салли, ныне самые профессиональные в деле пугательств монстры, поступили в престижный "Университет Монстров". Поначалу эти два непохожие монстры друг друга не переносили! Фильм расскажет нам о том, как два героя из заклятых врагов превратились в лучших друзей.', 0, 'Университет монстров / Monsters University (2013)', 'g', 'g', '0000-00-00', 2013, 2013, 'США', '$241 220 190', 18, 12, 23, '107 мин.', 'Дэн Скэнлон', 'Джон Гудман, Билли Кристал, Нэйтан Филлион, Стив Бушеми, Джон Красински, Обри Плаза, Хелен Миррен, Чарли Дэй Бонни Хант'),
(398, 2, 'Вот уже столько дней Росомаха пытается найти душевный покой и уединение, но его постоянно терзают муки и сомнение, которые он испытывает через свою способность всегда оставаться бессмертным.\r\n   Спустя какое-то время Росомаха встречает посла из Японии, посла от своего старого знакомого, который, будучи на смертном одре, приглашает Логана в страну восходящего солнца. Там он хочет лично  поблагодарить Росомаху за когда-то спасенную жизнь. Но кроме благодарности давний приятель предлагает Росомахе некий дар, а именно – вновь сделать его смертным и уязвимым….\r\n', 'Продолжение  культовой серии фильмов о людях-х, главным героем где, как и в прошлой части, выступает Росомаха. Вот уже столько дней Росомаха пытается найти душевный покой и уединение, но его постоянно терзают муки и сомнение, которые он испытывает через свою способность всегда оставаться бессмертным.\r\n   Спустя какое-то время Росомаха встречает посла из Японии, посла от своего старого знакомого, который, будучи на смертном одре, приглашает Логана в страну восходящего солнца. Там он хочет лично  поблагодарить Росомаху за когда-то спасенную жизнь. Но кроме благодарности давний приятель предлагает Росомахе некий дар, а именно – вновь сделать его смертным и уязвимым….	\r\nСмотрите фильм «Росомаха: Бессмертный» онлайн, пока в самом лучшем качестве\r\n', 0, 'Росомаха: Бессмертный / The Wolverine (2013)', 'g', 'g', '0000-00-00', 2013, 2013, 'США', '$120 000 000', 28, 21, 3, '126 мин', 'Джеймс Мэнголд', 'Хью Джекман, Тао Окамото,Рила Фукусима,Светлана Ходченкова,Уилл Юн Ли, Харукико Яманоути'),
(399, 2, 'Планета Земля в 2077 году стала совсем пуста, битва человечества с инопланетными пришельцами кончилась не в пользу людей. Последние выжившие собираются улетель на планету Уран, чтобы у человечества был хоть какой-то шанс на продолжение истории. Но в последний момент главный герой фильма Джек Харпер находит корабль NASA, который потерпел крушение и вся его команда умирает. Вся кроме одной женщины, которая делится с Джеком некой информацией меняющей исход событий... Смотрите фильм Обливион / Oblivion в хорошем качестве', 'Планета Земля в 2077 году стала совсем пуста, битва человечества с инопланетными пришельцами кончилась не в пользу людей. Последние выжившие собираются улетель на планету Уран, чтобы у человечества был хоть какой-то шанс на продолжение истории. Но в последний момент главный герой фильма Джек Харпер находит корабль NASA, который потерпел крушение и вся его команда умирает. Вся кроме одной женщины, которая делится с Джеком некой информацией меняющей исход событий... Смотрите фильм Обливион / Oblivion в хорошем качестве', 0, 'Обливион / Oblivion [HD 720] (2013)', 'b', 'b', '0000-00-00', 2013, 2013, 'США', '$120 000 000', 28, 3, 21, '125 мин.', 'Джозеф Косински', 'Ольга Куриленко, Андреа Райзборо, Морган Фриман, Николай Костер-Вальдау, Мелисса Лео, Зои Белл\r\nЭбигейл Лоу, Изабель Лоу, Дэвид Мэдисон'),
(400, 2, 'Каким может быть мир без преступности, грабежей, убийств? Такой бы мир наверняка назывался бы идеальным, если бы не Судная Ночь. Этой ночью, которая бывает раз в году, можно совершить любое злодеяние и не нести за это никакой ответственности. Так Что Судная ночь – это ночь убийств и даже ничего не подозревающие люди могут оказаться в самом центре кровавых событий…\r\n	Смотрите фильм «Судная Ночь» бесплатно на нашем сайте\r\n', 'Каким может быть мир без преступности, грабежей, убийств? Такой бы мир наверняка назывался бы идеальным, если бы не Судная Ночь. Этой ночью, которая бывает раз в году, можно совершить любое злодеяние и не нести за это никакой ответственности. Так Что Судная ночь – это ночь убийств и даже ничего не подозревающие люди могут оказаться в самом центре кровавых событий…\r\n	Смотрите фильм «Судная Ночь» бесплатно на нашем сайте\r\n', 0, 'Судная ночь / The Purge [hd 720]', 'd', 'd', '0000-00-00', 2013, 2013, 'США', '$3 000 000', 27, 26, 0, '85 мин. ', 'Джеймс ДеМонако', 'Итан Хоук, Лина Хиди, Макс Буркхолдер, Аделаида Кэйн, Эдвин Ходж, Риз Уэйкфилд, Тони Оллер, Ария Барейкис');
