INSERT INTO `serial` (`id`, `serial_name`, `seria_name`, `seria_number`, `meta_d`, `meta_k`, `description`, `text`, `video_cod`, `season`) VALUES
(1, 'Солдаты', 'Неизвестно', 1, '', '', 'Призывниками не рождаются, а становятся. Два товарища, потерявшие связь друг с другом на гражданке, неожиданно встречаются в военкомате. Городской мажор и деревенский паренек теперь будут вместе тянуть армейскую лямку. Выполнение гражданского долга, как обычно, сопровождается большим количеством неприятностей. \r\n', 'Призывниками не рождаются, а становятся. Два товарища, потерявшие связь друг с другом на гражданке, неожиданно встречаются в военкомате. Городской мажор и деревенский паренек теперь будут вместе тянуть армейскую лямку. Выполнение гражданского долга, как обычно, сопровождается большим количеством неприятностей. \r\n\r\nГлавная напасть — «настоящий полковник». Это хрестоматийный командир. Такие военачальники не переходят через Альпы, зато гарантированно становятся героями анекдотов. С новобранцами случаются обычные истории, присущие военной жизни: от «дедов» до самоволок. Иногда в расположение российских войск врываются неуставные романтические отношения. Медсестра, майор и рядовой — такому любовному треугольнику позавидовал бы и Шекспир.\r\nРейтинг фильма', '<iframe src="http://vk.com/video_ext.php?oid=89424901&id=162665779&hash=ea5077e59862529e&hd=1" width="607" height="360" frameborder="0"></iframe>', '1 сезон'),
(2, 'Солдаты', 'неизвестно', 2, '', '', 'Призывниками не рождаются, а становятся. Два товарища, потерявшие связь друг с другом на гражданке, неожиданно встречаются в военкомате. Городской мажор и деревенский паренек теперь будут вместе тянуть армейскую лямку. Выполнение гражданского долга, как обычно, сопровождается большим количеством неприятностей. \r\n', 'Призывниками не рождаются, а становятся. Два товарища, потерявшие связь друг с другом на гражданке, неожиданно встречаются в военкомате. Городской мажор и деревенский паренек теперь будут вместе тянуть армейскую лямку. Выполнение гражданского долга, как обычно, сопровождается большим количеством неприятностей. \r\n', '<iframe src="http://vk.com/video_ext.php?oid=44803779&id=162985201&hash=96029b6688288295&hd=1" width="607" height="360" frameborder="0"></iframe>', '1 сезон'),
